INSERT INTO `ponencia_15022024` VALUES ('AP-CASM002','¿DE QUÉ MANERA SE PUEDEN UTILIZAR LAS TRANSFORMACIONES LINEALES EN LA INDUSTRIA DE LA ANIMACIÓN?','En la mayoría de los cursos de álgebra lineal que se imparten en escuelas de ingeniería, se ha observado que los estudiantes no vinculan la teoría con la práctica. Con frecuencia pierden motivación y seguridad porque argumentan estar frente a un tema abstracto. En consecuencia, se sugiere promover en el aula de clase la exploración de distintos escenarios de aprendizaje incluyendo la aplicación de conceptos con relación a otras áreas de estudio. Hace un poco más de tres décadas inició en Estados Unidos de América el análisis, estudio y desarrollo de las animaciones en tercera dimensión, este hecho provocó una de las transformaciones tecnológicas más rápidas y profundas de las bases utilizadas en la industria audiovisual. El objetivo del trabajo es mostrar las propiedades de las transformaciones lineales y su aplicación en la industria de la animación haciendo del uso del software libre GeoGebra. El desarrollo de las animaciones mediante transformaciones lineales de traslación es una técnica común en gráficos por computadora y animación. Por lo tanto, se creó un escenario interactivo con el software para que los estudiantes permitan visualizar la notación matricial que describe el movimiento de traslación y su aplicación en el campo de la animación. Así mismo consiste en desplazar un objeto o figura en una dirección específica dentro de un espacio 2D o 3D. Esto se logra aplicando una matriz de traslación a las coordenadas del objeto. Con relación los productos obtenidos se garantiza el aprendizaje del tema de forma interactiva y creativa.','Larraza, S. (2004). Enseñanza del algebra lineal en la carrera de matemáticas aplicadas y computación: una experiencia nueva. Tesis de maestría. Universidad Nacional Autónoma de México, México.',NULL,NULL,16,1,5,931,'2024-01-27 18:26:26.000000',945),('AP-POSM001','EL MODELO DE OFERTA Y DEMANDA: UNA PROPUESTA DESDE LA PERSPECTIVA HETERODOXA','La Economía tiene una controversia: ¿Estado o Mercado? Dos campos de la disciplina ayudan a encontrar la respuesta. La visión ortodoxa asume al mercado como el mejor mecanismo de ajuste para encontrar una equitativa distribución de los recursos en una economía. En la mirada heterodoxa apela a una mayor intervención del Estado para regular la acción de los agentes en una economía de mercado. Para un estudiante, la discusión es irrelevante y abstracta. La propuesta es tomar un modelo para señalar los atributos de cada campo. En ese sentido, la ponencia tiene como objetivo mostrar las bondades del uso de las matemáticas para enseñar los dos campos que forman la disciplina de la Economía, a partir del Modelo de Oferta y Demanda (MOD). \r\nDesde los hechos, las Universidades pugnan por explicaciones menos fantasiosas y más reales, los involucrados en la enseñanza demandan más elementos heterodoxos y menos ortodoxos a partir de las crisis recientes (2008 y 2020).\r\nDesde el estado del arte, Lavoie (2011) propone tomar manuales ortodoxos (instrumentos convencionales) e introducir elementos heterodoxos para enseñar economía desde un punto de vista plural y empleando matemáticas (Lavoie, 2015; Lavoie y Seccareccia, 2022) para darle formalidad y entablar un diálogo entre ortodoxos y heterodoxos.\r\nLa metodología consiste en realizar una revisión documental de los principales autores de los dos campos, explicar el MOD con ayuda de elementos matemáticos desde las dos visiones y empleando el instrumento para generar política económica.\r\nLa conclusión principal es desarrollar el MOD desde una perspectiva matemátia heterodoxa, para mostrar al lector que la controversia de la ciencia económica puede compartirse desde la parsimonia a un público no contextualizado en Economía. Otro objetivo que busca la ponencia es impulsar una agenda de uso de matemáticas en modelos e ideas heterodoxas, insistiendo en la necesidad de pluralidad académica.\r\n','Lavoie, M. (2011). La enseñanza de economía post-keynesiana en un departamento ortodoxo. Lavoie, M. (2015). ¿Debería la economía heterodoxa ser enseñada en departamentos de economía, o existe algún espacio para la economía backwater? Lavoie, M. y M. Seccareccia (2022). La economía poskeynesiana, ¿un pensamiento heterodoxo desconocido?',NULL,NULL,16,2,5,801,'2023-12-02 16:59:25.000000',415),('AP-POSM017','RALLY MATEMÁTICO, UNA ACTIVIDAD LÚDICA Y COMPLEMENTARIA AL CURRÍCULO EN EL CCH VALLEJO.','¡Las matemáticas son aburridas!, expresión que suele mencionar el alumnado de cualquier nivel académico, ya que su aprendizaje suele ser memorístico o con la simple repetición y aplicación de fórmulas sin significado, por ello se buscó implementar actividades de carácter lúdico o experimental que contribuyeran al aprendizaje y que favorecieran el razonamiento lógico, la imaginación y creatividad en búsqueda del aprendizaje significativo.\r\nDe lo anterior se propuso realizar un Rally Matemático como una opción al aire libre que permitiera a los alumnos del Colegio de Ciencias y Humanidades plantel Vallejo utilizar diversas habilidades y destrezas para resolver los retos y juegos ubicados en diferentes estaciones favoreciendo aspectos cognitivos y sociales de los alumnos.\r\nEl Rally Matemático busco la participación por equipos de los estudiantes inscritos en cualquier semestre donde debían ejecutar adecuadamente una serie de 8 juegos matemáticos que tenían la intención de estimular la concentración, la memoria y el razonamiento, contribuyendo en la adquisición de conocimientos, pero sobre todo incrementar el gusto por las matemáticas.     En el presente trabajo se muestran los resultados de la aplicación del Rally Matemático en el CCH Vallejo y parte de las actividades desarrolladas.       ','Morera, M y Serrano, A. (2007). Rally… naturaleza, recreación y salud. Revista MHSalud, 1(4), 1-7.',NULL,NULL,16,2,5,55,'2024-01-13 01:05:55.000000',289),('AP-POSM019','LA IMPORTANCIA DE LA SIMULACIÓN Y MODELACIÓN MATEMÁTICA EN LA ENSEÑANZA DE LA FÍSICA EXPERIMENTAL','En este trabajo se presenta la aplicación de la simulación y modelación matemática para el diseño de actividades experimentales con estudiantes de bachillerato que cursan la asignatura de Física III en la Escuela Nacional Colegio de Ciencias y Humanidades (ENCCH). El problema se limita a estudiar la variación del momento de inercia con respecto a la distribución de masa de un sistema rotativo que desciende sobre un plano inclinado. La simulación y modelación se llevó a cabo con GeoGebra, mientras que para el trabajo experimental se implementaron las TIC, en particular, el uso de video en cámara lenta, así como el software video tracker para la toma, análisis e interpretación de datos experimentales. Esta propuesta de enseñanza permitirá a los alumnos desarrollar su autonomía intelectual en ambientes presenciales, virtuales e híbridos, ya que se utilizan materiales accesibles y de bajo costo, así como  softwares de uso libre como los mencionados anteriormente. \\r\\n\\r\\nAdemás, dicho trabajo puede contribuir a la actualización de los Programas de Estudio de la asignatura de Física III que se está llevando a cabo en el presente año en la ENCCH, así como proporcionar a los docentes recursos didácticos tecnológicos innovadores para mejorar los procesos de enseñanza y dar frente a la transformación digital educativa acelerada debida por eventualidades como la ocurrida por la contingencia sanitaria causada por el COVID-19.  \\r\\n','Aguirre. (2006). Actividades expérimentales de Física I. Mecánica. México: Trillas. ',NULL,NULL,16,2,5,390,'2024-01-18 11:52:43.000000',641),('AP-POSM020','DISEÑO DE SIMULADORES EN GEOGEBRA PARA ANALIZAR EL MCU Y ABORDAR CONCEPTOS TRIGONOMÉTRICOS','En las últimas décadas, el avance tecnológico en el ámbito educativo ha proporcionado nuevas oportunidades para mejorar la enseñanza y el aprendizaje de la Física y la Matemática. En particular, el uso de simuladores en el aula ha permitido a los estudiantes explorar, conjeturar y construir conceptos matemáticos de manera visual, interactiva y transversal, ya que estos recursos aunque de forma simplificada, representan la realidad.\r\n\r\nLos simuladores, empleados adecuadamente pueden favorecer la construcción de significados de los objetos matemáticos, porque permiten a los estudiantes experimentar con diferentes configuraciones, parámetros y escenarios, lo que les brinda la oportunidad de explorar cómo los cambios en una variable afectan a otras. Esta experimentación interactiva fomenta el pensamiento crítico y la exploración activa, lo que contribuye a una comprensión más profunda de los conceptos matemáticos.\r\n\r\nEn este trabajo se presentan dos ejemplos de simuladores del Movimiento Circular Uniforme diseñados en GeoGebra para abordar algunos conceptos trigonométricos. Además, se analizarán las ventajas y las limitaciones de utilizar GeoGebra para el diseño de este tipo de recursos, así como la forma en que pueden implementar en el salón de clases.','Gutiérrez, R.,  Prieto, J.L.  y  Ortiz, J.  (2017). Matematización  y trabajo matemático en  la elaboración de simuladores con GeoGebra. Educación Matemática, 29(2), pp. 37-68.',NULL,NULL,16,2,1,738,'2024-01-19 01:54:01.000000',813),('AP-POSM022','DISEÑO DE  HERRAMIENTA DE TROQUELADO PARA UNA TERMINAL ELECTRICA','Los procesos de troquelado utilizados en la industria metal – mecánica se clasifican en tres grupos, punzonado, doblado y embutido.  Actualmente en nuetro país esta industria  es muy importante, ya que dicho sector aporta el 3.0% del Producto Interno Bruto (PIB) total y el 17.2% del PIB Manufacturero.\\\\r\\\\nPor esta razón es de suma importancia tener una infraestructura para el diseño y manufactura de herramientas para procesar láminas metálicas (chapas).  En este trabajo presentamos el diseño  de un conjunto de herramientas para la fabricación de una terminal eléctrica, así como el cálculo de lasa fuerzas de doblez  y corte del material tomando en cuenta la estimación de la recuperación elástica de este, debido al proceso de doblez de la chapa. Se describe la metodología para establecer los cálculos necesarios para determinar la secuencia de dobleces necesarios para alcanzar las tolerancias en el proceso de corte y doblado.La parte se fabricará en lámina de latón 70-30, calibre # 22 y cuyas tolerancias son de ±  0.005 milésimos de pulgada y de ± 0.30’ de deviación angular.','Faies G. et.al (2009). “Optimization of springback in L-bendign process using a coupled Abaqus/Python algorithm”. Journal Adv. Manuf. Technol. Vol. 44 pp 61-67.  Farsi M, Arezoo B., (2009). “Development of a new method to determine bending sequence in progressive dies”. Journal Adv. Manuf. Technol. Vol. 43 pp 52-60.',NULL,NULL,16,2,5,4,'2024-01-19 11:04:12.000000',353),('AP-POSM024','PROTOTIPO MÓVIL PARA LA RECOLECCIÓN DE EXCREMENTO SÓLIDO CANINO ','El presente trabajo de investigación propone el diseño y construcción de un prototipo móvil que realice el barrido de un área específica en busca de excremento canino para su recolección. Para ello, se propone caracterizar el desecho a recolectar haciendo uso de dos o tres características importantes: presencia de gas metano, temperatura y/o color. Esta información será procesada en una red neuronal, que una vez sea entrenada para clasificar los elementos efectivamente, será implementada al prototipo para clasificar los objetos encontrados en el camino. Esto con la finalidad de facilitar el cuidado y mantenimiento de una casa con perros pequeños como mascotas.\r\nEste trabajo se dividio en 4 partes, La primera   suministra la información clave de los términos y procesos que se emplearon a lo largo del trabajo.\r\nLos siguientes pasos fueron el  Diseño Conceptual y  el Diseño de Detalle. En el primero  se analizaron los requerimientos generales del prototipo y los subsistemas necesarios para su correcto funcionamiento considerando las áreas funcionales de acuerdo con la metodología propuesta por Niegel Cross .  Se analizaron las posibles soluciones a cada una de las funciones requeridas, evalúando las alternativas.  En el Diseño de Detalle se desarrolla a profundidad las alternativas seleccionadas previamente, la selección de materiales y componentes, basados en propiedades fisicas y cálculos matemáticos, así como su correcta manufactura. Por último se realizó la validación de los datos a traves de pruebas en campo, mostrando  la integración de cada una de las áreas funcionales como un todo que trabaja en conjunto para llevar a cabo su función final.','A. Arenas, «Control de excrementos de perro en los espacios públicos municipales,» Universidad de Cordoba. Facultad de Veterinaria., 2014. [En línea]. Available: http://www.corvet.es/img/1rps_1439813577_a.pdf. IBM, «El modelo de redes neuronales,» 2007. [En línea]. Available: https://www.ibm.com/support/knowledgecenter/es/SS3RA7_sub/modeler_mainhelp_client_ddita/components/neuralnet/neuralnet_model.html.. ',NULL,NULL,16,2,5,4,'2024-01-19 12:30:04.000000',353),('AP-POSM027','ECUACIONES DIFERENCIALES DE MAXWELL EN EL DESARROLLO DE PROTIOTIPOS DE INGENIERÍA','Este artículo aborda la aplicación y relevancia de las ecuaciones diferenciales de Maxwell en el proceso de desarrollo de prototipos de ingeniería. Las ecuaciones de Maxwell son fundamentales en la descripción matemática de los fenómenos electromagnéticos, proporcionando un marco teórico esencial para el diseño y funcionamiento de dispositivos eléctricos y electrónicos.\r\nEn el cuerpo del trabajo se proporciona una visión integral de cómo las ecuaciones diferenciales de Maxwell son esenciales en la ingeniería contemporánea, ofreciendo valiosas perspectivas para estudiantes de licenciatura involucrados en proyectos de desarrollo de prototipos electromagnéticos.\r\n','Alexander, C., & Sadiku, M. (2017). Fundamentos de Circuitos Eléctricos (5ta ed.). McGrawHill',NULL,NULL,16,2,5,628,'2024-01-21 21:19:20.000000',289),('AP-POSM031','APRENDIZAJE BASADO EN PROBLEMAS: ENFOQUE EN EL ANÁLISIS ESTADÍSTICO EN PSICOLOGÍA','En la educación superior se debe fomentar la solución de problemas, dejando de lado la repetición acrítica. Esto es de mayor relevancia cuando se trata de cuestiones que incluyen las matemáticas, como en el uso de la estadística. En el caso de la carrera de Psicología, además de su aprendizaje sobre temas teóricos y conceptuales, hay que enfatizar su preparación en probabilidad y estadística, que es un dispositivo clave dentro del proceso de llevar a cabo intervenciones y determinar su efectividad . Esta carrera tiene problemas de reprobación, principalmente en el área metodológica, donde se entrena el análisis estadístico. Considerando que (Fink, 2003): (a) la tecnología amplía la variedad de contextos donde pueda darse un aprendizaje significativo, que el salón tradicional no permite y (b) tiene un efecto por hacer más activo al estudiante, aquí combinamos la situación didáctica en el aula, con la enseñanza virtual en una plataforma Moodle, en un entrenamiento en toma de decisiones estadísticas para la solución de problemas de investigación en Psicología. Como problema se asignó, uno por uno, seis artículos de investigación ya publicados para su análisis estratégico, centrando el enfoque en el análisis estadístico utilizado por el autor. Los participantes, un grupo de sexto semestre, de psicología, fueron entrenados en un curso virtual en la estrategia de análisis de textos (Santoyo, 2001) y se profundizó en las categorías relacionadas con la estadística. Después del curso los estudiantes fueron capaces de realizar análisis cada vez más completos, con una mejora en sus habilidades de análisis estadístico medidas mediante un examen. Asimismo, se logró que los estudiantes propusieran mejoras a los diseños de los artículos analizados. ','Fink, L. D. (2003). Creating significant learning experiences: An integrated approach to designing college courses. USA. John Wiley & Sons. Santoyo, C. (2001). Alternativas docentes. Vol. II. Aportaciones al estudio de la formación en habilidades metodológicas y profesionales en las ciencias del comportamiento. PAPIME, UNAM ',NULL,NULL,16,2,5,466,'2024-01-22 12:53:55.000000',573),('AP-POSM038','MODELOS MATEMÁTICOS EN UN SISTEMA DIGITAL PARA PERSONAS CON DISCAPACIDAD AUDITIVA','En el proyecto que se desarrolla en el Tecnológico de Estudios Superiores de Cuautitlán Izcalli utilizan herramientas como Blender y Kotlin para el reconocimiento del alfabeto en lenguaje de señas que representan patrones definidos.\r\n\r\nEl uso de técnicas en el Reconocimiento de Patrones y el análisis de la información en áreas como la medicina se agrupan bajo el nombre de procesamiento y/o análisis de señales biomédicas, esto se conoce comúnmente bajo el nombre de imagenología biomédica, que es el área de la ciencia que se encarga de extraer información de los seres vivos.\r\n\r\nPara el Reconocimiento de Patrones, se pueden identificar un conjunto de conocimientos y áreas que pueden ser multidisciplinarias, como lo puede ser la biología, la física, la misma medicina que se mencionó anteriormente, en el desarrollo de teorías, técnicas, métodos y el uso de dispositivos computacionales procesos de matemáticos y de ingeniería, que se relacionen con objetos físicos cuyo propósito es extraer o interpretar información que le permita establecer una relación en conjunto entre dichos objetos sobre los cuales se puede hacer una relación, comparación, clasificación o identificación para obtener un resultado y significado de dicha interpretación.\r\n\r\nLos objetos pueden ser fotos, escrituras, señales acústicas, algunas partes del cuerpo como la huella dactilar, el iris del ojo o en el presente caso la forma que presenta una mano para el lenguaje de señas como una forma de comunicación entre por lo menos dos personas donde una de ellas presente discapacidad auditiva.\r\n\r\nLa interpretación se hace mediante el uso de diferentes herramientas como YOLOv3, YOLOv3-tiny y MediaPipe librerías basadas en redes neuronales convolucionales, el uso de Blender que basado en los Algoritmos: Bresenham, DDA y ambas aplicaciones utilizadas en el presente proyecto para el desarrollo e interpretación de la forma y posición de la mano.','Gómez Maria del pilar, 2019, Rangayyan, 2015, Theis y Meyer Ruiz Shulcloper, J., (2013). Acerca del surgimiento del Reconocimiento de Patrones en Cuba. Revista Cubana de Ciencias Informáticas, 7(2), 169-192.-Bäse, 2010, ',NULL,NULL,16,2,5,210,'2024-01-23 18:37:33.000000',813),('AP-POSM041','MATEMÁTICAS EN EL CONTEXTO DE PROBLEMAS DE BALANCE','La clase de matemáticas en la educación superior tiene como propósito desarrollar en el estudiante las habilidades necesarias para el planteamiento y resolución de problemas. Se presenta un diseño para la clase de álgebra con la resolución de un sistema de tres ecuaciones lineales   con tres incógnitas aplicado al balance de materia, la asignatura se cursa en el primer semestre de la carrera de Ingeniería Química, Facultad de Estudios Superiores Cuautitlán UNAM.\\\\r\\\\nEl objetivo planteado: Al terminar la clase el alumno será capaz de aplicar conceptos matemáticos en el contexto de problemas de balance de materia. Se diseña   la estrategia de aprendizaje (utilizando la planeación de la enseñanza estratégica) con   un problema enfocado a la utilidad de los métodos de resolución de sistemas lineales (en particular el método por determinantes) aplicado al tema de balance de masa (éste corresponde a la asignatura de Transferencia de Masa II que cursará en el 7°semestre de su carrera),se refuerzan sólo  los conceptos  algebraicos  y se abordan articuladamente para lograr que los aprendizajes  sean una base robusta para otras asignaturas dando como resultado un estudiante motivado con un aprendizaje significativo a largo plazo. Los resultados de la situación didáctica aplicada son óptimos, se demuestra que matemáticas no es sólo aplicación de fórmulas sino también razonamiento lógico para solucionar problemas. En conclusión, proporcionar ejemplos con aplicaciones prácticas ayuda a los estudiantes a entender la relevancia de la clase de álgebra y logran trabajar en forma colaborativa   reflexiva y crítica\\\\r\\\\n','•	Bruner, J. (1988). Desarrollo cognitivo y educación, selección de textos por Jesús Palacios. Editorial Morata,50 edición •	Polya, G. (1965). Cómo plantear y resolver problemas. México: Editorial Trillas,  •	Quesada, R. (2012). Cómo planear la enseñanza estratégica. México: Editorial. Limusa.  •	Zarzar, C. (2015). Planeación didáctica por competencias. México:  Editorial Patria. Primera edición',NULL,NULL,16,2,5,114,'2024-01-24 11:59:23.000000',217),('AP-POSM051','MODELACIÓN DINÁMICA EN ECOLOGÍA, SOFTWARE Y APLICACIONES','La modelación dinámica de sistemas ecológicos, actualmente, enfrenta desafíos importantes en cuanto al proceso de enseñanza-aprendizaje en los cursos de la licenciatura en Biología. La falta de familiaridad con herramientas informáticas y con la comprensión de modelos ya desarrollados representan obstáculos para el dominio y conocimiento de procesos ecológicos complejos. Por lo que se exploran opciones de software para representar la estructura de un sistema ecológico, así como para entender el sustento matemático de un posible modelo. Encontrando que Vensim, un software de uso libre, proporciona capacidades de simulación que permiten evaluar escenarios complejos. El manejo de esta herramienta mejora la capacidad para modelar y proponer opciones para gestionar eficazmente los recursos naturales, sin embargo, hay poco material disponible para su conocimiento y manejo, por lo que se desarrolló una guía basada en el desarrollo de ejemplos paso a paso, para que los alumnos del curso de ecología cuantitativa que se imparte en el octavo semestre de la carrera de Biología de la FES Zaragoza tengan un acercamiento más amigable a este tipo de temas. Esta Guía muestra el manejo de los modelos básicos, como el exponencial, logístico y el de la interacción presa-depredador, hasta llegar a los de manejo de sistemas acuáticos, terrestres y ambientales, entre otros. Proponiendo una versión digital vía un Blog que aumente sus posibilidades de difusión y uso.\r\n\r\nPalabras claves: Modelación, Vensim, Simulación\r\n','-De Leo, E., Aranda, D. y Addati, G. (2020). Introducción a la dinámica de sistemas. Serie Documentos de Serie. (739).  -García, J. (2024) Theory and Practical Exercises of System Dynamics. Coppell, TX. USA. -García, J. (2024) System Dynamics Modelling with Vensim. Coppell, TX. USA.',NULL,NULL,16,2,5,870,'2024-01-24 20:46:25.000000',353),('AP-POSM052','APLICACIÓN DE ANOVA EN EL ENSAYO DE DUREZA PARA LA CARACTERIZACIÓN DE MATERIALES COMPUESTOS','El objetivo de este trabajo es analizar la aplicación de ANOVA (Análisis de Varianza) como una técnica estadística en el ensayo de dureza para la caracterización de materiales compuestos, con el fin de identificar las influencias de diferentes variables en la dureza de estos materiales. Se llevó a cabo un ensayo de dureza en muestras de materiales compuestos(plástico-madera), utilizando durómetros Shore A. Se seleccionaron diferentes variables independientes, como la composición del material, la temperatura de curado y el tiempo de procesamiento. Se realizaron múltiples repeticiones de cada ensayo para obtener resultados confiables. Los resultados obtenidos del ensayo de dureza se analizaron mediante ANOVA, permitiendo identificar la influencia de las diferentes variables en la dureza de los materiales compuestos. Se observaron diferencias significativas en la dureza entre diferentes composiciones de materiales y diferentes condiciones de procesamiento. Los resultados indican que la composición del material tiene un efecto significativo en la dureza de los materiales compuestos. Además, se encontró que la temperatura de curado y el tiempo de procesamiento también influyen en la dureza. Estos hallazgos son de gran importancia para la industria de los materiales compuestos, ya que permiten optimizar las propiedades de dureza mediante el control de estas variables. La aplicación de ANOVA en el ensayo de dureza para materiales compuestos ha demostrado ser una herramienta eficaz para identificar las influencias de diferentes variables en la dureza de los composites. Estos hallazgos contribuyen a un mejor entendimiento de las propiedades mecánicas de los materiales compuestos y pueden ser utilizados para optimizar su fabricación y aplicaciones utilizando herramientas computacionales y métodos estadísticos.\r\n','Alfaro Ureña, D., Ortega A., B., & Lozano, B. (2022). Aplicación del análisis de varianza para comparar el aprendizaje de los estudiantes en tres modalidades: : virtual sincrónica, virtual asincrónica y presencial. Revista Científica Guacamaya, 7(1), 60–72. Recuperado a partir de https://revistas.up.ac.pa/index.php/guacamaya/article/view/3182',NULL,NULL,16,2,5,319,'2024-01-25 09:54:58.000000',724),('AP-POSM053',' SISTEMA DE ACTUADORES HIDRÁULICOS PARA EL AHORRO DE ENERGÍA EN PUERTAS ABATIBLES','En este trabajo se diseñó, demostró y propuso el cambio de un sistema eléctrico común de apertura y cierre de puertas automáticas a un sistema que les permitiera a los usuarios un ahorro energético por medio de actuadores hidráulicos. Se creó un prototipo a escala del sistema de actuadores hidráulicos. En dicho prototipo se simularon y se analizaron dos alternativas de diseño del sistema, se midieron los parámetros eléctricos necesarios de cada elemento que contenía el sistema eléctrico común de apertura y cierre de puertas, y del nuevo sistema propuesto con actuadores hidráulicos.  Posteriormente con los datos que se obtuvieron, se calculó el consumo energético en KWH (Kilo Watt-Hora) del sistema eléctrico común para obtener el costo que le genera al usuario por bimestre.  Para poder tener la comparativa y demostrar el ahorro energético que puede ofrecer la implementación del sistema propuesto con actuadores hidráulicos, se realizó también el cálculo de su correspondiente consumo energético. ','Mc Millan, K. Gregory (1999), Process/Industrial Instruments and Controls Handbook',NULL,NULL,16,2,5,907,'2024-01-25 11:57:26.000000',353),('AP-POSM054','CÁLCULOS Y SELECCIÓN DE DISPOSITIVOS PARA AUTOMATIZACION DE MÁQUINA SERIGRÁFICA','El objetivo de este trabajo es automatizar una máquina de serigrafía manual, con el consiguiente aumento en la productividad, se determinó en base a los cálculos integrar sensores de detección, PLC´s, elementos primarios y finales de control, válvulas y otros elementos de automatización, también se desarrollaron los diagramas de máquina como son: lazo de control, eléctrico, neumático, de espacio fase y líneas de programación del PLC. Se logró una reducción en los tiempos de producción de 4 días a solo un día, lo que repercute en el aumento de las ganancias.','Soria Saturnino (2020). Sistemas Automáticos Industriales de Eventos Discretos. México. Alfaomega. Balcells J. Romero J. L. (1998). Autómatas Programables. México. Alfaomega.',NULL,NULL,16,2,5,907,'2024-01-25 12:06:20.000000',353),('AP-POSM059','DEDUCCIÓN FÍSICA-MATEMÁTICA DE LA DEFINICIÓN DEL CENTRO DE GRAVEDAD DE UN CUERPO CON MASA','En este trabajo se muestra la deducción completa física-matemática de la definición de centro de gravedad de un cuerpo con masa partiendo desde conceptos fundamentales de equilibrio mecánico y cómo se utiliza en análisis de Ingeniería en Mecánica. Utilizamos dos equivalencias para el cálculo de momentos resultantes (MR), que es el giro o rotación un cuerpo que es causado por la fuerza resultante (FR) aplicada en un punto (req) de equivalencia del cuerpo respecto a un sistema de referencia (O\') que puede ser el punto de donde se sostiene el cuerpo y respecto al cual será el giro. Después del primer cálculo, se traslada el sistema desde la ubicación del req dentro del cuerpo, para después desde ese punto de referencia hacer nuevamente el cálculo de momento resultante dando como resultado un momento cero, de forma que ya no rota sujetado desde O’. Hasta esta segunda equivalencia apenas nos aproximamos a los fundamentos del centro de gravedad, donde se debe considerar, ahora que la fuerza resultante tenga única y exclusivamente origen gravitacional (peso del cuerpo), es decir, que la única fuerza sobre el cuerpo con masa sea la de la gravedad y aplicando la segunda equivalencia exclusivamente para fuerza gravitacional es que se deduce la definición matemática del centro de gravedad de un cuerpo, sin embargo, esto es el fundamento también para definir el centro de masa y el centroide del mismo cuerpo que puede ser el mismo punto o diferentes puntos dentro de un cuerpo. Las definiciones contribuyen a la difusión y comprensión de las matemáticas detrás del cálculo del centro de masa, debido a que resulta vital para su empleo en aspectos como la elaboración de estructuras o simplificación de las interacciones de cuerpos complejos en una variedad de contextos de ingeniería mecánica y dinámica.','Hibbeler, R. C. (2016). Ingenieria Mecanica Estatica (14a Edición). Pearson. Marsden, J. E., & Tromba, A. J. (1999). Calculo vectorial - 4b: Edicion. Addison Wesley Longman.  Stewart, J. (2012). Calculo de Varias Variables Trascendentes Tempranas. Cengage Learning Editores.',NULL,NULL,16,2,5,917,'2024-01-25 22:09:07.000000',628),('AP-POSM060','LA OFRENDA COMO MEDIO DE APRENDIZAJE PARA LA CIENCIA Y LA TECNOLOGÍA. ','La Universidad y el Colegio de Ciencias y Humanidades se ha preocupado por desarrollar el interés de los jóvenes por la investigación y el estudio de algunas disciplinas, en esta vertiente se reconoce la importancia del desarrollo cognoscitivo de los alumnos, pero sin perder de vista lo emocional, animando a los alumnos a una sana convivencia, a relacionarse con sus pares, a participar en actividades creativas y artísticas. El grupo de trabajo Hipatia de Alejandría ha trabajado en un conjunto de acciones curriculares y actividades de apoyo no curriculares que contribuyan a la formación integral de las y los jóvenes, a través de la participación del Club de Robótica en la ofrenda del CCH Vallejo, con la temática de Científicas y Científicos en la historia, se buscó que los alumnos utilizando una metodología de aprendizaje basado en proyectos ABP, en donde a través de la investigación lograran comprender la historia de la computación y las aportaciones de científicos y científicas, de esta forma construyeron prototipos que representara su investigación y pudieran ser parte de la ofrenda.  En el presente trabajo se muestran las actividades desarrolladas que fortalecieron el aprendizaje y la convivencia de los alumnos que participan en el Club de Robótica del Plantel Vallejo.','Pittí Patiño.(2012). La robótica educativa, una herramienta para la enseñanza-aprendizaje de las ciencias y las tecnologías.',NULL,NULL,16,2,5,55,'2024-01-26 12:14:38.000000',440),('AP-POSM061','GENERACION DE BIOGAS CON RESIDUOS ORGANICOS DOMESTICOS','El objetivo de éste proyecto fue el desarrollo de un prototipo de digestión anaerobio para la producción de biogás mediante la descomposición de residuos orgánicos domésticos. Para lograr éste objetivo se evaluaron las condiciones óptimas de pH, temperatura y presión necesarias para el proceso a nivel laboratorio para entonces construir un prototipo piloto que consta de un reactor controlado automáticamente a un pH de 7+/- 0.5º Y a una temperatura de 35º +/- 0.5º. En el biogás producido se detectó una composición donde el porcentaje de metano oscila en 98% contra un 5% de hidrógeno en volumen de líquido, después de 19 días de evaluación con un 37% de degradación de materia orgánica. El control de pH se realizó mediante un sistema realimentado, donde si es detectado un pH menor a 7 se activa una bomba peristáltica, la cual dispensa un volumen de Sodio proporcional al error detectado. El control de temperatura se realiza mediante un sistema realimentado donde el calefactor es encendido cuando la temperatura se encuentra por debajo del valor de referencia correspondiente. Para el control de presión se ha instalado una válvula de seguridad, la cual es abierta si la presión supera 1 MPa. El diseño del digestor es de  forma cilíndrica vertical  para facilitar la agitación y el desalojo del material, la capacidad final fué de 20 litros para almacenar tanto la materia prima como el gas generado. Se aplicó la teoría de Von Mises para el cálculo de esfuerzos y deformaciones. Los resultados se validaron  mediante el software de simulación (ANSYS) basado en métodos de elemento finito.','Gerardi Michael. Microbiogy of Anaerobic Digesters. Edit Willey Interscience. Pp 177. New York. 2003.',NULL,NULL,16,2,5,4,'2024-01-26 15:13:00.000000',353),('AP-POSM066','PRIMER CICLO DEL CÍRCULO DE LECTURA “DESCIFRANDO LAS MATEMÁTICAS A TRAVÉS DE LA LECTURA”','En este trabajo se reporta una experiencia del Círculo de Lectura “Descifrando las matemáticas a través de la lectura” llevada a cabo durante el segundo semestre 2023. Su objetivo fue: Extender el valor de las matemáticas en la vida cotidiana explorando y analizando obras literarias relacionadas con esta disciplina. Con una frecuencia quincenal, se propuso un artículo o fragmento de un libro congregando a interesados a una reunión virtual. Inicialmente, los encuentros se realizaron únicamente por Zoom. Gracias al apoyo institucional, se realizó posteriormente la transmisión simultánea a través del canal oficial de YouTube de la FES Cuautitlán.\\r\\nCada encuentro fue abierto a la participación de quienes se interesasen. La única condición pedida fue la lectura previa de la publicación propuesta. Para cada encuentro, se organizó la coordinación compartida entre varios de los participantes, previendo la posibilidad de algún inconveniente tecnológico debido a la virtualidad. Un coordinador planteaba, al inicio del encuentro, un interrogante relacionado con la lectura como disparador de respuestas, ideas, opiniones y puntos de vista. Los participantes iban pidiendo la palabra sucesivamente generando un espacio de intercambio y debate. Las ideas surgidas eran recogidas y analizadas por los coordinadores de esa reunión. Los roles de coordinación de cada encuentro fueron rotativos.\\r\\nLa cantidad de participantes de los encuentros ha sido entre dieciséis y veinte por encuentro, participando profesores y estudiantes no solo del área de matemática sino de otras disciplinas como diseño gráfico, comunicación e informática, provenientes de distintas instituciones de México y Argentina. \\r\\nEntre las temáticas abordadas: aportes e influencia de matemáticos a través de la historia, origen de la teoría de probabilidades, presencia del número de oro en la naturaleza y en las artes, modelos matemáticos predictivos de carácter epidemiológico, orden geométrico y proporción en obras de distintos escenarios socioculturales.\\r\\n','Carreño, O. (2015). El eco de las lecturas. Introducción a los clubes de lectura. Santiago de Chile:  Dirección de Bibliotecas, Archivos y Museos. FESCUNAMoficial. (03 de octubre de 2023). Circulo de lectura \\\"Descifrando las matemáticas a través de la lectura\\\". [Archivo de Video]. https://www.youtube.com/watch?v=F3dR2nn8Cio',NULL,NULL,16,2,5,108,'2024-01-26 18:35:55.000000',445),('AP-POSM067','RED NEURONAL CONVOLUCIONAL PARA EL RECONOCIMIENTO DE PERSONAS','En los últimos años, la implementación de tecnología en diversas áreas ha experimentado un gran impulso, tal es el caso de los sistemas de detección de datos biométricos, específicamente el reconocimiento facial.\r\nEl reconocimiento facial es una tecnología que permite identificar o verificar la identidad de una persona mediante el análisis de sus características faciales únicas. Este proceso implica la captura, análisis y comparación de patrones faciales con el objetivo de identificar a individuos o verificar si una persona es quien dice ser. Este proceso se divide principalmente en dos tareas: detección (implica la localización de una o varias caras dentro de una imagen) y reconocimiento (se trata de comparar la cara detectada, con otras almacenadas en una base de datos).\r\nEn el reconocimiento facial se suelen utilizar algoritmos de aprendizaje matemático, en particular redes neuronales y técnicas de aprendizaje profundo, para entrenar modelos que pueden reconocer patrones dentro de las plantillas faciales. Las redes neuronales más utilizadas en esta área son de tipo convolucional (CNN), cuya arquitectura de red está diseñada específicamente para el procesamiento de datos con imágenes, para su aprendizaje, se realiza un proceso iterativo de entrenamiento, donde se les suministra una cantidad de imágenes para que sea capaz de identificar características específicas de cada una, con la finalidad de realizar alguna clasificación o predicción.\r\nEste trabajo tiene como objetivo mostrar el entrenar una red convolucional que sea capaz de reconocer rostros de personas específicas dentro de una base de datos creada previamente e implementar una interfaz gráfica para mostrar los resultados.\r\n\r\n','Chellappa, R., Phillips, P. J. & Rosenfeld, A. (2003). Face Recognition: A literature survey.: ACM Computing Surveys, vol. 35.',NULL,NULL,16,2,5,406,'2024-01-27 07:37:54.000000',354),('AP-POSM068','MÉTODOS MATEMÁTICOS APLICADOS A LA INGENIERÍA DE SOFTWARE','\"Deberíamos reestructurar nuestro campo de la programación de tal manera que los métodos matemáticos sean igualmente aplicables a nuestros problemas de programación, porque no existe otra manera de hacerlo\" [ref]. La anterior frase es una solicitud realizada hace varias décadas por Edsger Wybe Dijkstra quién buscaba dar mayor formalismo al desarrollo de programas. Todas las personas que en algún momento han tenido la oportunidad de programar, han conocido la necesidad de tener un pensamiento más estructurado sin importar la forma de ser o la propia personalidad; es bien sabido que la programación es un arte y la esencia del artista se queda en cada una de sus obras. Sin embargo, no siempre resulta fácil el poder llevar a cabo de principio a fin una creación artística como lo es el desarrollo de software. Por este motivo, en este artículo se presentan los porqués del desarrollo de software y su ciclo de vida con ayuda de un ejemplo que parecería ser muy sencillo, el cual abarca desde la abstracción de lo que se va a construir pasando por el diseño, desarrollo hasta llegar a la implementación y la validación, mostrando además la aplicación de métodos matemáticos en diversas etapas del mismo, haciendo explícita la relación existente entre las matemáticas y el área de la ingeniería de software.','Dijkstra E.W. On a methodology of design. Pressman, R.S., Maxim, B.R.: Software engineering, a practitioner\'s approach (2014). Sommerville, I.: Software engineering (2016). Summers, B.L.: Software engineering reviews and audits (2011). Dawson, C.W.: Projects in computing and information systems, a student\'s guide (2009). Dijkstra E.W. My recollections of operating system design.',NULL,NULL,16,2,5,918,'2024-01-27 10:10:05.000000',784),('AP-POSM069','UTILIZAR TRANSFORMACIONES LINEALES COMO UNA ESTRATEGIA PARA MODIFICAR LAS DIMENSIONES DE UNA PIEZA MECÁNICA ','Durante varias décadas es aceptado que en álgebra lineal existe un número significativo de aplicaciones. Nuestro proyecto se realizó para un curso de dicha asignatura utilizando la aplicación de las transformaciones lineales a los diferentes vectores que componen una pieza mecánica. El objetivo de la propuesta consiste en utilizar las transformaciones lineales para modificar las dimensiones de la pieza mecánica seleccionada. El sustento teórico utilizado se enmarca en la modelación, entendida como una estrategia para modificar las características iniciales del objeto de estudio. El proceso inicia con un modelo en R2 dibujado en papel milimétrico para observar los efectos que produce la matriz de rotación, la matriz de expansión y la matriz de reflexión en el eje x sobre los vectores que caracterizan dicho modelo. Además, se llevó a cabo el proceso algebraico para realizar el análisis de los vectores, pero en R3, con la intención de generar un objeto tangible de ser impreso a partir de los valores obtenidos. Como resultado del proyecto se considera que la impresión del producto atraviesa varias etapas: primero con los vectores obtenidos se graficó en R2 y R3 con el software libre GeoGebra. Después, se diseñó en AutoCAD el objeto 3D, de esta manera, se generó un archivo “litografía (.STL) que es el tipo de formato que acepta el software de corte (\\\"slicer\\\") para la impresión de un modelo digital en 3D. A continuación, se exporta a formato de código G, dicho formato es un lenguaje para la impresora 3D, método conocido como FFF (fabricación de filamento fundido). Finalmente, el equipo de trabajo que se dedicó a realizar este proyecto con una duración de un semestre lo considera todo un éxito porque no se había logrado la participación organizada de varios departamentos con un mismo objetivo. \\r\\n','Grossman, S. I. (1999). Álgebra Lineal Quinta edición. México.  Mc. Graw Hill/Interamericana de México, S.A de C.V. Strang, G. (2007). Álgebra Lineal y sus aplicaciones cuarta edición. México. International Thomson Editores, S.A de C.V.',NULL,NULL,16,2,5,100,'2024-01-27 15:18:07.000000',628),('AP-POSM078','ANÁLISIS DE FRACCIONES MEDIANTAS EN EL PROCESO DE COINCIDENCIA DE PULSOS','Una de las tareas básicas en ciencia e ingeniería es medir, esto nos permite entender como un parámetro cambia bajo ciertas condiciones. Es por esto que, en el desarrollo de dispositivos que realizan tareas automáticas, es necesario el desarrollo de sistemas de medición que tengan la capacidad de ofrecer aproximaciones precisas al parámetro de interés. En este sentido, un método de medición y detección consiste en el uso de sensores que convierten el parámetro de interés a variaciones en frecuencia. Para el uso adecuado de estos sensores es necesario medir el valor de la frecuencia generada de la manera más rápida y precisa posible. De los métodos disponibles para esta tarea destaca el principio de aproximaciones racionales, en el cual la frecuencia deseada se compara con una frecuencia conocida. Durante este proceso de comparación se generan coincidencias, las cuales se ha observado que pueden formar fracciones mediantas. Estas fracciones se forman a partir de una secuencia de Farey. Aunque se ha reportado que en el proceso de coincidencia de pulsos aparecen las fracciones mediantas, su estudio en procesos experimentales aún está lejos de un desarrollo amplio. Por esta razón, en este trabajo se muestra como es la simulación del proceso de coincidencia de pulsos, así como su análisis teórico. Dichos resultados se comparan con los datos generados de un proceso de coincidencia de pulsos experimental. ','Murrieta-Rico, F. N., Sergiyenko, O. Y., Petranovskii, V., Hernandez-Balbuena, D., Lindner, L., Tyrsa, V., ... & Karthashov, V. M. (2016). Pulse width influence in fast frequency measurements using rational approximations. Measurement, 86, 67-78.',NULL,NULL,16,2,5,881,'2024-01-28 16:14:01.000000',404),('AP-POSM079','MATEMÁTICAS, MÁS INTERESANTES DE LO QUE CREES: SU APLICACIÓN A UN PROBLEMA CLÁSICO DE ELECTROMAGNETISMO','En las carreras de ingeniería el entendimiento de las matemáticas es la base fundamental para describir y aplicar fenómenos físicos en dispositivos tecnológicos en las áreas de mecánica, electromagnetismo, termodinámica, etcétera. En este trabajo utilizamos la aplicación de las matemáticas en el electromagnetismo clásico para resolver el campo magnético dentro de un solenoide de longitud finita (l-finito) definiendo claramente las variables físico-matemáticas para este caso y posteriormente la aplicación de la definición de límite matemático para el caso idealizado de solenoide de longitud infinita (l-infinito), en la solución del sistema se analizan dos opciones de variables de solución; una solución está en el problema 7.14 del libro “Elementos de Electromagnetismo” de Matthew N.O. Sadiku y la otra solución es propuesta por nosotros para luego comparar las soluciones para l-finita y l-infinita. En nuestro análisis hacemos hincapié en la elección de variables físico-matemáticas, el uso de conceptos matemáticos de integral, diferenciales, límites y cambios de variable, todos asociados a conceptos físicos que describen el sistema, mostrando maneras diferentes de resolver un mismo problema utilizando las herramientas matemáticas y comparando con otros autores. Este tipo de análisis impacta, por ejemplo, en los cursos de ingeniería de Electricidad y Magnetismo, Teoría Electromagnética y Máquinas Eléctricas impartidos en la UPIITA.','Sadiku, M.N. (2003) Elementos de Electromagnetismo (3er edición) Oxford University Press; Hayt W.H.& Buck J.A. (2006) Teoría Electromagnética (7ma edición) Mc Graw-hill Interamerica; Ayres, F., Jr. (1966). Cálculo diferencial e integral: resumo da teoria problemas resolvidos problemas propostos.',NULL,NULL,16,2,5,895,'2024-01-28 16:30:48.000000',641),('AP-POSM084','DISEÑO DE INYECTORA DE PLASTICOS PARA PARTES AUTOMOTRICES','El presente trabajo de investigación se diseñó y construyó una máquina de inyección de plástico para partes automotrices, se requirió la unión sinérgica de la Mecánica, Electrónica, Control y Programación.\r\nComo punto inicial se realizó un estudio sobre las especificaciones del proceso manual, documentando los principales componentes y las fallas del proceso. Una vez concluida la evaluación se propuso el diseño del dispositivo, identificando las partes básicas del proceso de inyección (platina fija, platina móvil, unidad de inyección y el molde\r\nLas variables principales por controlar fueron, la presión de inyección, la temperatura de fusión del polímero y del molde, la fuerza de cierre y el tiempo de inyección.\r\nEl peso aproximado de cada pieza es de 120 a 150 gramos. El cálculo arrojó, una fuerza de cierre de 250 kN, y la fuerza de empuje del pistón de 125 kN.\r\nPara las platinas y las columnas se seleccionó un acero ASTM, de alta resistencia con un módulo de elasticidad E = 200 GPa y una resistencia ultima de 500 MPa; se utilizó un factor de seguridad de 3.\r\nLa selección del actuador fue un motor de CD, con un recorrido de 7 cm para permitir el desalojo del material.\r\nLa estructura del dispositivo se calculó matemáticamente y se validó con el software MDSolids, seleccionando tubo estructural PTR.\r\nPara su automatización, se seleccionó un microcontrolador AVR (ATMega 32)\r\nEn las pruebas del equipo se documentaron las medidas de presión en platinas, temperatura, presión de inyección, velocidad del motor (RPM), tiempo de inyección, temperatura del pirómetro en el termopar, tiempo de operación, problemas y correcciones. Las cuales resultaron satisfactorias tanto en la puesta en marcha del equipo, en el sistema de control. Como en las partes estructúrales de la máquina.','Gianni Bodini, Franco Cacchi Pessa. (1999). Moldes y máquinas de inyección para la transformación de plásticos,. Bodini & Gianni',NULL,NULL,16,2,5,4,'2024-01-28 21:17:49.000000',353),('AP-POSM085','DISPOSITIVO AUTOMATICO ELECTROSOLDADOR DE MALLAS','El presente trabajo consiste en diseñar un dispositivo, que realize el proceso de electrosoldado de alambre por medio del método de electropunto, para la fabricacion de mallas metálicas.\r\nPara la solución del problema se diseñó y manufacturó una mesa por coordenadas, en la cual se monta una plantilla de madera, donde se coloca el alambre, generando una cuadricula; así como el control del posicionamiento, apertura y cierre de los electrodos en cada una de las intersecciones de los alambres.\r\nPara el desplazamiento de la mesa se calculó de la potencia de los motores asi como las caracteristicas del tornillo sin fin tomando en cuenta el peso, la velocidad y la precision, una vez obtenido el par requerido, el sistema se validó  realizando  un analisis matemático de esfuerzos y una simulación por computadora. \r\nEn relacion a los electrodos para el soldado, se eligieron actuadores neumaticos de doble efecto, el cálculo de la fuerza necesaria se hizo tomando en cuenta la presión requerida y el area de contacto de los alambres entrecruzados. \r\nLa estructura de la máquina se fabricó en perfil PTR de una pulgada, el cual se seleccionó  posterior al  análisis de  los esfuerzos cortantes y flexionantes aplicados. Con el objetivo de asegurar que la elección del PTR fue la correcta en la zona critica de carga del dispositivo, se consideró necesario validarlo con un software. \r\n','robert l mott. (2006). diseño de elementos de maquinas. pearson',NULL,NULL,16,2,5,4,'2024-01-28 21:36:09.000000',353),('AP-POSM091','EL PROCTORING UNA TECNOLOGÍA CON INTELIGENCIA ARTIFICIAL','En la actualidad las evaluaciones a distancia forman parte de una necesidad de trabajo, por lo que es fundamental monitorear a los estudiantes mientras realizan un examen en línea, evaluar las habilidades y conocimientos de los diferentes candidatos para ingresar a una empresa durante un proceso de selección, supervisar exámenes para certificaciones y licencias con el objetivo de detectar cualquier tipo de conducta irregular y acercarnos más a ese escenario presencial que nos ayude a cumplir con las metas establecidas en cada una de las áreas de interés. El proctoring es una tecnología que está ganando terreno en diversos ámbitos especialmente en donde se requiere una evaluación de habilidades y conocimientos, realizada a distancia y que sea considerada confiable y segura; en la cual los actores puedan ser guiados, orientados y retroalimentados durante todo el proceso, evitando así que se sientan solos y a su vez estimulando el proceso enseñanza-aprendizaje. Una de las características de este software es que detecta los movimientos de la cabeza del participante evaluando la posición de los ángulos de la misma y dependiendo de la configuración envía alertas en forma de mensaje o mediante voz, con la finalidad de mantener la credibilidad, la calidad y evitar la suplantación.','Rouhiainen, L.(2018).Inteligencia artificial. España: Planeta',NULL,NULL,16,2,5,686,'2024-01-30 01:03:09.000000',406),('AP-POSM094','PROTOCOLO DE ENRUTAMIENTO INTERIOR OSPF QUE USA EL ALGORITMO DIJKSTRA','Un grafo es una estructura que consiste en un conjunto de nodos o vértices y un conjunto de aristas. Las aristas representan conexiones o relaciones entre los nodos. Según las características que presente un grafo puede clasificarse de manera diferentes: grafo dirigido, no dirigido, cíclico y no ponderado. La topología de una red de computadoras puede representarse mediante un grafo y se establecen conexiones entre los diferentes router que la conforman. Los enlaces o conexiones entre los router representan las aristas y estas tienen diferentes métricas para determinar los caminos más apropiados para hacer llegar los paquetes de un nodo a otro. Los protocolos de comunicación son los encargados de realizar esta tarea como es el caso de OSFP. Mediante OSFP se construyen las tablas de enrutamiento para poder encaminar los paquetes por el enlace o arista apropiada.\r\n\r\nEl objetivo de este trabajo es mostrar el procedimiento que se implementa mediante el algoritmo de Dijkstra para calcular la ruta más corta para llegar de un nodo a otro en una red. Cada router mantiene una base de datos de enlaces y utiliza esta información para calcular la tabla de enrutamiento con las rutas más eficientes. El procedimiento puede realizarse mediante métricas utilizadas en OSPF como pueden ser el costo, que puede basarse en la velocidad del enlace o en otras consideraciones. En el contexto de OSPF, los router intercambian información sobre los enlaces a través de paquetes de estado de enlace (LSA, Link State Advertisement), y luego utilizan el algoritmo de Dijkstra para construir el árbol SPF y determinar las rutas más cortas. La conclusión es que este algoritmo permite que los router OSPF seleccionen las rutas eficientes para reenviar los paquetes en la red. \r\n\r\n\r\n','Ariganello, E. (2011). Redes Cisco: Guía de estudios para certificación CCNA 640-802. México Alfaomega Grupo Editor ISBN 978-607-07-326-0.',NULL,NULL,16,2,5,531,'2024-01-30 18:03:28.000000',813),('AP-POSM095','MODELO MATEMÁTICO  APLICADO AL DESARROLLO DE UN SISTEMA INTELIGENTE PARA PREVENIR EL ABANDONO ESCOLAR','Hay varios modelos matemáticos predictivos aplicados en inteligencia artificial para abordar diferentes tipos de problemas como la Regresión Lineal y Regresión Logística los cuales se utilizan para modelar la relación entre variables y realizar predicciones continuas o clasificaciones binarias como la detección de spam en correos electrónicos.\\\\r\\\\nEl presente trabajo muestra el uso del  modelo de regresión logística a través de  la implementación  bibliotecas de aprendizaje automático y  la clase LogisticRegression de scikit-learn  como parte del desarrollo de  una aplicación inteligente que, apoyada por el aprendizaje automático y la inteligencia artificial, se propone predecir, prevenir y mitigar el abandono escolar; esta biblioteca proporciona herramientas simples y eficientes para análisis de datos y modelado predictivo.\\\\r\\\\nEl análisis parte desde la recolección de los datos a través de una encuesta en línea así como la representación numérica de las respuestas organizados por valores numéricos del 1 al 4 para respuestas con cadenas de caracteres que dependan de un grado de clasificación con valores ordinales y nominales, mientras que para respuestas como SI y NO los valores se mantienen en 0 y 1 en respecto al modelo inteligente estos datos representan la base de conocimiento para el proceso de entrenamiento de la red neuronal que permite una predicción eficiente.','Ponce Gallegos, J. C., & Torres Soto, A. (2014). Inteligencia Artificial. Proyecto Latin',NULL,NULL,16,2,5,186,'2024-01-30 18:08:36.000000',531),('AP-POSM099','EL CONOCIMIENTO NUMÉRICO Y SU INCIDENCIA EN LA ALFABETIZACIÓN FINANCIERA: ESTUDIO EMPÍRICO EN ESTUDIANTES UNIVERSITARIOS','Esta investigación tiene por objetivo analizar la incidencia del conocimiento numérico en la alfabetización financiera de estudiantes de educación superior. En esta investigación el conocimiento numérico se define como un procedimiento para aplicar cálculos numéricos y porcentuales según Martínez-Bustos (2020) y Jiménez (2022); la alfabetización financiera se define como la habilidad para calcular el interés financiero de una inversión, comprender el efecto de la inflación sobre el poder adquisitivo y determinar los costos financieros de una deuda, según el enfoque de Lusardi (2019) y Lusardi y Tufano (2015). La muestra está conformada por 309 estudiantes que estaban cursando el último año de licenciatura, matriculados en universidades públicas y privadas en Veracruz, México. Para el análisis de la incidencia se utiliza la regresión logística binaria. Los resultados descriptivos evidencian que sólo 50% de los estudiantes universitarios cuentan con alta alfabetización financiera. En el análisis correlacional se evidencia la incidencia positiva y significativa del conocimiento numérico de los estudiantes en la alfabetización financiera. Los estudiantes que obtuvieron puntuaciones por arriba del promedio en los indicadores de conocimiento matemático, comparados con su contraparte, es más probable que estén alfabetizados financieramente. Es decir, los estudiantes que cuentan con conocimientos matemáticos para realizar cálculos con fracciones y porcentajes, variación de cantidades y montos, operaciones de razones y proporciones, es más probable que comprendan el efecto de la inflación en el poder adquisitivo, logren calcular el interés devengado en una inversión y calcular el costo financiero de una deuda. Los resultados de la investigación sugieren fortalecer el conocimiento numérico de estudiantes universitarios y su aplicación en conceptos financieros tal que les que permita tomar decisiones financieras informadas, tanto en el ámbito personal como laboral. ','Jiménez Beleño, A. (2022). Competencias matemáticas para el desarrollo de habilidades cognitivas en estudiantes universitarios. Revista Latinoamericana De Difusión Científica, 4(7), 141-167. https://doi.org/10.38186/difcie.47.10 Lusardi, A. Financial literacy and the need for financial education: evidence and implications. Swiss J Economics Statistics 155, 1 (2019).  ',NULL,NULL,16,2,5,845,'2024-02-02 13:12:54.000000',393),('AP-POSM100','LOS FRACTALES DE SIERPINSKI. UNA APLICACIÓN DEL CÁLCULO GEOMÉTRICO.','El primer fractal de Sierpinski es un triángulo, éste se construye a partir de un triángulo llamado ABC y cada lado del triángulo se divide a la mitad y se marca con un punto, por ser tres lados digamos tenemos los lados de las mitades llamados D, E y F, con los cuales se pueden generar las rectas DE, EF, DF; obteniendo un triángulo invertido llamado DEF. Para cada uno de los tres triángulos formados con los vértices ADF, BDE, FEC, llamados triángulos normales, se aplica la misma idea de dividir los lados a la mitad y generar un triángulo invertido por cada triángulo. Para cada triángulo normal que queden se aplica lo anterior. Así sucesivamente hasta el infinito. A partir de este resultado se genera un método que, con sólo puntos, se genera el triángulo de Sierpinski, el cual consiste en tener los vértices A, B y C de un triángulo dibujados en un plano y colocar un cuarto punto en cualquier lugar del plano y, hacer un gran número de veces el siguiente procedimiento: Tomar uno de los tres vértices al azar y calcular el “punto medio” entre el cuarto punto y el vértice escogido y este nuevo punto, será el cuarto punto para la siguiente ronda que escoja al azar uno de los tres vértices del triángulo.\\r\\nEste método se puede adaptar al Tapete de Sierpinski, en tres dimensiones la pirámide de Sierpinski y la esponja de Sierpinski.\\r\\nSe mostrará que se puede programar en OpenGL.','Donald Heard et al. (2006). Gráficos por computadora con OpenGL. Pearson',NULL,NULL,16,2,5,613,'2024-02-02 14:58:06.000000',114),('AP-POSM103','SECUENCIA DIDÁCTICA CON COMPETENCIAS USANDO LAS MATEMÁTICAS EN INGENIERÍA. UN EJEMPLO EN TERMODINÁMICA','Una secuencia didáctica se puede considerar como una serie de actividades, para lograr un aprendizaje significativo de cierto conocimiento, en este caso usando las matemáticas respectivas. \r\nPor otra parte, para poder establecer una secuencia didáctica actualmente un papel sumamente importante en la educación, es necesario introducir una serie de TIC S acordes al nivel académico, entorno social y por supuesto considerando las capacidades tecnológicas de la institución donde se planea implementar. \r\nEn este caso usando como ejemplo la materia de termodinámica para ingenieros.\r\n','-(1) Blanco, E., Ricoy, C. y Pino, M. (2009). Utilización y funcionalidad de los recursos tecnológicos y de las nuevas tecnologías en la educación superior. En Educ. Soc. Vol. 30, n. 109, pp. 1209-1225. ISSN 0101-7330. Recuperado de http://dx.doi.org/10.1590/S0101-73302009000400014 -(2) Cabero Almenara, J. (julio-diciembre de 2007). Las necesidades de ',NULL,NULL,16,2,5,955,'2024-02-13 21:05:06.000000',727),('AP-POSM106','CALCULAR AREAS ANALITICAMENTE POR EL METODO DEL PRODUCTO VECTORIAL Y PROGRAMADO EN JAVA','El desarrollo temático del concepto de producto vectorial en la asignatura de Calculo Vectorial para ingenierías, causa dificultades en su estudio, por la carencia de idealización y aplicación de un modelo matemático y/o prototipo, para su aplicación ingenieril en la estática, dinámica y mecánica tensorial. Para la obtención de áreas o regiones en el estudio de esfuerzos y deformaciones en ingeniería. Por lo que se realizó el cálculo analítico de áreas con los datos vectoriales (coordenadas) de un triángulo mediante el método de producto vectorial o producto cruz y se programó este algoritmo matemático en java para comparar los resultados. Esta motivación de calcular y relacionar estas soluciones con un modelo físico y/o prototipo son de gran importancia para la comprensión del significado matemático en la ingeniería y así los estudiantes visualizaran y tendrán una precepción más realista y aproximada de la aplicación del cálculo vectorial y su significado. Este modelo se construyó en coordenadas rectangulares en 3D para representar los datos vectoriales. Y finalmente se comparó este modelo con el uso y realización del software de AutoCAD. Debido a que regularmente los estudiantes reciben información directa de software para el análisis, y cálculos para diseños ingenieriles sin saber la importancia de las matemáticas y el cálculo vectorial. ','Anton, H. (2009). Cálculo multivariable. 2da Edicion, México : Limusa. G, Z. D. (2011). Cálculo de varias variables. México: Mc. Graw Hill.',NULL,NULL,16,2,5,954,'2024-02-14 13:46:31.000000',NULL),('AP-TASM005','USO DEL GEOPLANO COMO INSTRUMENTO INTEGRADOR EN LA ENSEÑANZA DE CONCEPTOS MATEMÁTICOS Y DE DISEÑO','Descripción. Se realizarán exploraciones matemáticas mediante actividades geométricas mediante el Geoplano con metodología integradora de carácter multidisciplinario de temas abordados en el programa de la asignatura de Geometría 1 de la Licenciatura en Diseño y Comunicación Visual. Objetivo: Analizar y explorar conceptos matemáticos a partir de actividades de carácter geométrico utilizando el Geoplano como recurso didáctico. A partir de principios básicos de la geometría, se introducirá a los participantes en el manejo del Geoplano. Para posteriormente, aplicar conceptos de forma creativa en la resolución de actividades, tanto matemáticas como de diseño. El taller se enmarca en el modelo de aprendizaje geométrico de Van Hiele que ha sido utilizado en numerosas investigaciones y diseños curriculares de geometría. Propone 5 niveles para el proceso de construcción del conocimiento geométrico: reconocimiento, análisis, deducción informal, deducción formal y rigor. El razonamiento geométrico transita sucesivamente dichos niveles ante cada nuevo conocimiento, independientemente de la edad, con base en conocimientos adquiridos mediante experiencias (Jaime y Gutiérrez, 1990). La visualización es un aspecto importante del pensamiento geométrico, fundamental en la construcción de modelos geométricos y el razonamiento espacial para describir el entorno; y se constituye en una herramienta importante en la resolución de problemas matemáticos o de otras áreas (NCTM, 2003). Se reconoce que “la actividad matemática no debe centrarse en el recurso en sí, sino en el modo en que dicho material permite potenciar el desarrollo de habilidades matemáticas fundamentales.” (Sgreccia, 2018, 155). Por ello se analizarán las potencialidades, aplicabilidad y limitaciones que brinda este recurso didáctico. Actividades: MÓDULO 1 Sistema de referencia, segmentos, perímetros, áreas y volumen. MÓDULO 2 Trazos en el Geoplano. Poligonales y redes a partir de formas geométricas básicas. Curvas. MÓDULO 3 Espacio geométrico. Par ordenado, distancia entre puntos. Simetría. MÓDULO 4 Tridimensionalidad. Traslación, rotación y proyección. Superficies desarrollables.','Jaime, A., y Gutiérrez, A. (1990). Una propuesta de fundamentación para la enseñanza de la geometría: El modelo de van Hiele. En S. Llinares y M. V. Sánchez (Eds.), Teoría y práctica en educación matemática (pp. 295-384). Sevilla: Alfar.',NULL,NULL,16,3,5,893,'2024-01-26 12:47:10.000000',28),('AP-TASM009','ANÁLISIS DE DATOS CON TABLAS DINÁMICAS',' Hoy en día la competencia entre las empresas es cada vez es más grande, lo que ha llevado a las organizaciones buscar nuevas estrategias que les  permitan seguir en el mercado y hacer frente a las exigencias cada día más demandantes del mundo actual, una disciplina que se usa con este fin es el análisis de datos, que permite medir el rendimiento de una empresa y determinar el avance hacia los objetivos inicialmente establecidos, de tal manera que se puedan llevar a cabo decisiones enfocados a realizar los ajustes necesarios en cuanto se detectan desviaciones de los mencionados objetivos.  Existen muchas herramientas para análisis de datos tales como Power BI, Programación en R,  Python, Tableau, tablas dinámicas con Excel, entre muchas otras;  sin embargo,  para éste taller se seleccionó el uso de  las tablas dinámicas con Excel, ya que  son una herramienta interactiva que permite llevar a cabo el análisis de grandes volúmenes de datos, presentar informes flexibles, agrupar datos de diferentes formas, además, Excel es una herramienta muy conocida y utilizada. El objetivo del taller es usar tablas dinámicas para llevar a cabo análisis de datos para la toma de decisiones encaminadas a alcanzar los objetivos de las empresas. Para la impartición del taller se proponen las siguientes actividades: 1. Introducción,  2. Crear una tabla dinámica. 3. Identificar las partes de una tabla dinámica, 4. Uso de filtros de datos, 5. Segmentación de datos, 6. Formatos de tablas dinámicas, 7. Creación de gráficos dinámicos, 8. Ejercicio de aplicación.','Rigollet, P. (2017). Análisis eficaz de datos. Barcelona: ENI.',NULL,NULL,16,3,5,516,'2024-01-29 20:51:49.000000',28),('CASM00215','HISTORIA DE LA CONCEPCIÓN DEL INFINITO EN MATEMÁTICAS','El concepto de infinidad ocupa un lugarimportante en la historia de las matemáticas, sucomprensión fue fundamental para construir y resolver problemas relacionados con el cálculo, geometría,aritmética y álgebra.\\r\\nEl término infinito se formó através de un largo periodo de tiempo, a consecuenciade preguntas e ideas de un determinado número de personajes.\\r\\nEste término hace referencia a que algo no eslimitado, que puede seguir sin tener alguna restricción.Este trabajo se centra en los personajes que aportaronconocimiento para que este concepto naciera, también delas principales preguntas que incentivaron su evolución','López. A. El infinito en la historia de la matemática. Ciencia ytecnología. Buenos Aires. 2005.Stewart. I. 2008.  Historia de las matemáticas. Inglaterra.Editorial crítica.',NULL,NULL,15,1,3,784,'2023-06-28 11:46:34.000000',NULL),('CASM00315','MEDIOS SICRONICOS DE ENERGÍA CUANTICA EN ESTADO SOLIDO','Después de presentar la hipótesis de los cuantos de luz que explicaba el efecto fotoeléctrico en 1905, Einstein demostró en 1906 que los resultados anteriores de Planck sobre la distribución de energía en la radiación electromagnética podrían derivarse utilizando dos supuestos. El primero, ya presente en su artículo de 1905, fue que la luz se compone de cuantos de luz; el segundo fue que los cuantos de luz son emitidos y absorbidos por cargas oscilantes dentro de la materia que vibran solo con ciertas energías cuantificadas. Esto significa que la luz es emitida por cargas oscilantes dentro de la materia, como podría esperarse de la teoría de Maxwell, pero las energías tanto de la luz emitida como de los osciladores están restringidas a ciertos valores permitidos, lo que contradice la teoría clásica. Los osciladores se comportaron como cargas unidas a resortes, oscilando de un lado a otro solo con ciertas frecuencias correspondientes a ciertas energías cuánticas.','https://culturacientifica.com/2020/03/24/solidos-cuanticos/',NULL,NULL,15,1,1,242,'2023-06-28 12:04:27.000000',354),('EN-CASM001','LAS MATEMÁTICAS EN EL ENTORNO DE LA PROGRAMACIÓN','\r\nLAS MATEMÁTICAS EN EL ENTORNO DE LA PROGRAMACIÓN\r\nSabemos que:\r\nLas matemáticas son la herramienta fundamental en la programación. Aunque, no todos los programadores necesitan ser expertos matemáticos, solo con tener los conceptos y habilidades básicas  de las matemáticas puede ser beneficioso en varios aspectos de la programación. Aquí hay algunas áreas donde las matemáticas son especialmente útiles en programación:\r\n1.	Algoritmos y estructuras de datos: La creación y optimización de algoritmos a menudo involucra conceptos matemáticos, como la teoría de grafos, álgebra y análisis de complejidad.\r\n2.	Geometría y gráficos: En el desarrollo de juegos, aplicaciones gráficas y diseño de interfaces de usuario, la geometría y las transformaciones matriciales son esenciales.\r\n3.	Criptografía: La seguridad en la programación, especialmente en el desarrollo de sistemas de cifrado y autenticación, se basa en conceptos matemáticos, como la teoría de números y la aritmética modular.\r\n4.	Procesamiento de señales y imágenes: En áreas como el procesamiento de señales de audio o imágenes, se utilizan conceptos matemáticos como la transformada de Fourier.\r\n5.	Inteligencia artificial y aprendizaje automático: Algoritmos de aprendizaje automático y técnicas de inteligencia artificial a menudo están respaldados por conceptos matemáticos, como álgebra lineal, cálculo y estadísticas.\r\n6.	Simulaciones y modelado: En campos como la simulación y modelado de fenómenos físicos, las ecuaciones matemáticas son esenciales.\r\n7.	Programación científica: En disciplinas científicas y de ingeniería, donde se desarrollan modelos matemáticos, la programación se utiliza para implementar y resolver esos modelos.\r\nAunque es posible programar sin un conocimiento profundo de matemáticas, tener una comprensión sólida de conceptos matemáticos puede facilitar la resolución de problemas complejos y permitir un enfoque más eficiente y elegante en el desarrollo de software. Además, en áreas específicas de la informática, como la investigación y el desarrollo de algoritmos avanzados, las matemáticas se vuelven esenciales.\r\nEnseñanza de las matemáticas a través de la programación \r\nAUTORES: \r\nIng. Guadalupe Hernández Gutiérrez\r\nCOAUTOR:\r\nIng. Rodolfo Lazos Gómez \r\n\r\n','NO APLICA',NULL,NULL,16,1,1,234,'2024-01-10 16:22:33.000000',945),('EN-CASM003','MODELO MATEMÁTICO PARA PREDECIR CRECIMIENTO DE MASA FORESTAL NATIVA Y CAPTACIÓN DE CO2, SIERRA PELADO.','Según la NOAA (National Oceanic and Atmospheric Administration) en enero del 2024 el CO2 ascendió a 422.80 ppm, (NOAA, 2024) ocasionando la tendencia al calentamiento en América Latina y el mundo. En el último año 2022 la temperatura fue de 0.97ºC. (World Meteorological Organization, 2022). Todo lo mencionado ha generado el desprendimiento de casquetes polares, provocando que corrientes marinas se suspendan por la unión de agua dulce y salada, que no debería ocurrir pues son las encargadas de regular el clima en la tierra. En México y Puebla también se han visto repercusiones en cuanto a altas temperaturas. Específicamente la mixteca poblana se ha afectado por el cambio de temperaturas:  clima extremadamente cálido, la extinción de árboles endémicos. Para contrarrestar la problemática se tiene como objetivo “Generar un modelo matemático óptimo no lineal integrado de dos partes: uno para predecir el crecimiento de la masa forestal nativa de la Sierra “El pelado” y el segundo para la captura de CO2.” \r\nPara alcanzar el objetivo se desarrolló una metodología que consistió en cinco fases: Caracterización de la masa forestal nativa. Determinación de la captura de CO2 de especies más abundantes. Determinación del modelo matemático del crecimiento de masa forestal y otro para captura de CO2. Evaluación de modelos de regresión no lineal. Determinación de la masa forestal susceptible de secuestrar la mayor cantidad de CO2. \r\nFinalmente, los resultados preliminares encontrados son: que en la Sierra El Pelado el 24.5% de las especies que tienen un diámetro mayor o igual a 7.5 cm se encuentran en las partes altas. En cuanto a la caracterización se han encontrado 53 especies nativas en las cuatro parcelas hasta el momento. Las especies más abundantes fueron tres el Palo Blanco (Acacia coulteri Benth), casahuate (Ipomoea murucoides) y el cuajiote rojo o palo mulato (Bursera longipes(rose) standl).','Información recolectada del Global Monitoring Laboratory de la NOOA (National Oceanic and Atmospheric Administration) disponible de la página: https://gml.noaa.gov/ccgg/trends/weekly.html   Estado del clima en Latinoamerica y el caribe (2021). Worl Metereological Organization. 2022 Comisión Nacional Forestal. (2025). ',NULL,NULL,16,1,5,953,'2024-02-14 20:24:07.000000',945),('EN-CASM004','DETERMINACIÓN DEL ERROR CUADRÁTICO MEDIO DE UNA SERIE DE FOURIER EMPLEANDO MAPLE','En este trabajo presentamos una secuencia didáctica que permite la enseñanza de el Teorema de Parseval y mediante el uso del software matemático Maple su utilización para determinar el número mínimo de términos que deberá tener una suma parcial de una serie de Fourier para aproximar una función para la cual se ha definido el máximo para el error cuadrático medio como criterio de utilidad.','Kourmychev, E. (2017). Principios del análisis de Fourier: Variaciones sobre un tema clásico. Editorial Universidad de Guadalajara.',NULL,NULL,16,1,1,632,'2024-02-15 11:18:44.000000',NULL),('EN-POSM002','USO DE CAS EN LA ENSEÑANZA DE LAS MATEMÁTICAS CON APLICACIONES DE MODELADO.','Las matemáticas son la rama del conocimiento que tienen un papel central no solo en el desarrollo de las demás ciencias, sino también, en el desarrollo de la sociedad, la cultura, el progreso económico y tecnológico de un país. Bajo estos hechos, la enseñanza y uso de las mismas debe de empezar desde una temprana etapa en la formación de los estudiantes con el fin de que estos desarrollen capacidades de análisis y critica para su uso laboral, profesional y en la vida diaria. \r\nAsí, en este proyecto se hara uso del CAS en la enseñanza de las matemáticas con aplicaciones de modelado en nivel medio superior. El cual pretende no solo reforzar las habilidades matemáticas y de razonamiento lógico en esta etapa educativa , sino que ademas, permitirá al estudiante familiarizarse con software científico y de ingeniería para la resolución de problemas, tal como se aborda en la actualidad, esto con la intención de realizar un modelo matemático de un problema contemporáneo que los alumnos elegirán.\r\nEste proyecto integra las habilidades que de manera paralela se aprenden en esta etapa educativa, como lo son: comprensión lectora, análisis de textos, química y física, comunicación de resultados e interpretación de los mismos. Mostrando a los alumnos el alcance y aplicación de los conocimientos que adquiere. \r\nFinalmente haciendo uso de las técnicas de regresión lineal y métodos de optimización, en particular, mínimos cuadrados, el estudiante las aplicara en un problema de su elección, construira el modelo del mismo e interpretara sus resultados. \r\n','Gaisman, M. T. (2023). Innovación Educativa. Obtenido de El uso de la modelación en la enseñanza de las matemáticas: https://www.redalyc.org/pdf/1794/179414894008.pdf',NULL,NULL,16,2,1,24,'2023-12-06 12:43:19.000000',673),('EN-POSM003','El impacto del modelo ADDIE en la enseñanza de las matemáticas','Las matemáticas tienen varios desafíos para que los jóvenes aprendan de manera significativa, sin mencionar que la situación se complicó debido a la pandemia de Covid-19. Por esto, los docentes han tenido que adaptar y buscar estrategias para que los estudiantes alcancen los conocimientos propuestos en los Programas de Estudio, por ende, esta investigación tuvo el objetivo de diseñar materiales audiovisuales basados en el modelo ADDIE que combinan aspectos disciplinarios, pedagógicos y tecnológicos para promover el desarrollo de habilidades matemáticas. Para esto, se trabajó con una muestra por conveniencia no probabilística de 26 estudiantes que cursaban el segundo semestre en la Escuela Nacional Colegio de Ciencias y Humanidades, plantel Vallejo, logrando así que los jóvenes mejoraran significativamente en habilidades de dominio de procedimientos básicos, comprensión de lenguaje, razonamiento matemático y manejo de las herramientas tecnológicas, dado que es un arquetipo que conjuga lo práctico, lo teórico y lo tecnológico a partir de un enfoque pedagógico, siendo así una alternativa viable para reforzar y consolidar conocimientos conceptuales, procedimentales y actitudinales que impacten positivamente en el proceso de aprendizaje de las matemáticas. Sin embargo, es imperativo que los docentes continúen explorando y perfeccionando estrategias que se ajusten a los desafíos de un contexto cambiante.\\r\\n','Morales, B. (2022). Diseño instruccional según el modelo ADDIE en la formación inicial docente. Apertura, 14(1), 80-95. Recuperado de: https://doi.org/10.32870/ap.v14n1.2160',NULL,NULL,16,2,1,621,'2023-12-14 00:30:06.000000',714),('EN-POSM010','ELABORACIÓN DE UN LIBRO DIGITAL DEL TEMA DE DISTRIBUCIONES DE PROBABILIDAD','En este libro digital se abordan lo temas de distribuciones de probabilidad de una manera didáctica en donde se da cuenta del estudio de las distribuciones de probabilidad de las variables aleatorias discretas, así como de las variables aleatorias continuas; igualmente, se revisan las distribuciones especiales de probabilidad tanto para las primeras como para las segundas. Con el fin de facilitar al estudiante desarrollar habilidades en los procedimientos estadísticos se hace hincapié en los conceptos básicos y se incluyen múltiples ejercicios y preguntas de repaso, además de un completo formulario. Los alumnos podrán hojear el libro con sólo deslizar un dedo en la pantalla, los contenidos audiovisuales de este libro aportan ventajas a la hora de las explicaciones y de la comprensión de los conceptos. El libro digital no se limita a una digitalización de una versión en papel, este material además de la teoría en forma de preguntas, incluye videos de solución a problemas paso a paso, material multimedia de explicación de conceptos y calculadoras digitales para diferentes temas del libro. Al ser interactivos, se aprovecharán todas las ventajas de la red y sus aplicaciones. ','Devore, J. (2011) Probability and Statistics for Engineering and the Sciences. México. CENGAGE Learning. 8 edition.',NULL,NULL,16,2,1,573,'2024-01-16 11:55:47.000000',724),('EN-POSM012','LA RESOLUCIÓN DE PROBLEMAS Y EL PENSAMIENTO COMPUTACIONAL DE LOS PROFESORES DE MATEMÁTICAS','La ciencia informática ha experimentado un crecimiento notable en las últimas décadas, superando a otras disciplinas. Su influencia en nuestra vida diaria es cada vez más evidente, aunque a menudo no estamos conscientes de los avances en esta área. Dada esta expansión, la educación no puede permanecer ajena a estos cambios. Aunque no consideramos que la integración de la tecnología sea la única manera de mejorar el sistema educativo, sí la vemos como una alternativa viable para elevar la calidad de nuestra formación (Thohir et al., 2020). Los docentes pueden desempeñar un papel crucial como aliados para incorporar la tecnología en el aula, siempre y cuando estén dispuestos a aceptar el desafío de fortalecer tres aspectos fundamentales: conocimientos tecnológicos, pedagógicos y de contenido. Por ejemplo, un profesor de matemáticas puede utilizar la tecnología como una herramienta en su enseñanza, lo que puede llevar a tres posibles escenarios: una mejora en la enseñanza si se utiliza de manera efectiva y resulta significativa para los alumnos, una demora en el proceso debido al tiempo adicional necesario para diseñar e implementar actividades tecnológicas, y desventajas como distracciones de los alumnos o un enfoque excesivo en dominar la herramienta en lugar del contenido (Pattier & Reyero, 2022). Para desarrollar conocimientos tecnológicos, es esencial fomentar el pensamiento computacional (Mouza et al., 2017), que consiste en una red de habilidades informáticas utilizadas para resolver problemas en diversas disciplinas. Este tipo de pensamiento se inculca en los estudiantes desde la educación básica como parte de la cultura general, y no está reservado exclusivamente para los ingenieros informáticos. El objetivo de esta ponencia es analizar el pensamiento computacional de cuatro profesores de matemáticas de Toluca en la resolución de problemas. Los hallazgos apuntan a que el pesamiento computacional fortalece el pensamiento matemático de los docentes para resolver problemas.','Mouza, C., Yang, H., Pan, Y., Ozden, S. Y., & Pollock, L. (2017). Resetting educational technology coursework for. Pattier, D., & Reyero, D. (2022). Aportaciones desde la teoría de la educación a la investigación de ... y tecnología digital. Thohir, M. A., Jumadi, J., & Warsono, W. (2020). Technological pedagogical',NULL,NULL,16,2,1,832,'2024-01-10 10:06:02.000000',784),('EN-POSM015','USO DEL ENFOQUE STEAM PARA MODELAR CON GRÁFICAS DE LABORATORIO VIRTUAL: LABU4 ','El enfoque STEAM es cada vez más popular dentro de la didáctica y en particular la didáctica de las matemáticas, dónde una de las principales finalidades es transversalizar matemáticas, tecnología, y ciencias al desarrollar  proyectos y actividades significativas para el estudiantado. En la experiencia didáctica que presentamos se realizó el ciclo de modelación matemáticas al aplicar las herramientas de la aplicación Lab4U cuando estudiantes de bachillerato la activaron durante los juegos mecánicos de un parque de diversiones, teniendo como resultados datos y gráficas de variables físicas que se pueden analizar con la finalidad de obtener aprendizajes significativos, planteados de la realidad de forma multidisciplinaria y con uso de la tecnología. ','modelación, STEAM, gráficas, funciones, tecnología.',NULL,NULL,16,2,1,526,'2024-01-12 09:41:03.000000',673),('EN-POSM026','RELEVANCIA DEL DISEÑO INSTRUCCIONAL ELABORACIÓN DE CONTENIDOS EDUCATIVOS DIGITALES EN MATEMÁTICAS','En la época actual la educación mediada por la tecnología de la información y la comunicación (TIC) es una necesidad cotidiana en las instituciones educativas la elaboración de contenidos y objetos digitales, sin embargo, para lograr los objetivos de aprendizaje que se persiguen es necesario que los materiales educativos digitales sean elaborados con bases pedagógicas y didácticas que les den sentido y eficacia como objetos de aprendizaje. Es en esta parte donde se requiere que se utilice una metodología para su desarrollo llamada diseño educacional o instruccional.\r\nEn esta ponencia se describe de manera general el proceso de diseño instruccional y su importancia en la generación de materiales educativos digitales aplicado al desarrollo de un objeto digital de aprendizaje matemático para motivar a los estudiantes para que sigan aprendiendo.\r\n Palabras clave: diseño instruccional, objetos de aprendizaje, enseñanza, didáctica, TIC, matemáticas\r\n','Chew C.S., Wu W.C.V, Idris N., Loh E.F. & Chua Y.P. (2020). Enhancing summary  writing of ESL learners via a theory-based online tool: System development and evaluation, Journal of Educational Computing Research, 58 (2), pp. 398-432, 10.1177/0735633119837765',NULL,NULL,16,2,1,869,'2024-01-21 20:10:19.000000',784),('EN-POSM028','IMPORTANCIA DE LOS NÚMEROS COMPLEJOS EN ELECTROMAGNETISMO','En este artículo se considera la importancia de los números complejos en electromagnetismo y en la propia aplicación de desarrollos eléctricos y electrónicos, así como su potencial impacto en el desarrollo de la ingeniería actual.\r\nSe considera algo de la historia de los números complejos, su impacto actual en circuitos eléctricos y electrónicos como el triángulo de potencias o la impedancia en electrónica. Se respalda con algunas aplicaciones actuales en la ingeniería, específicamente en el área eléctrica y de las telecomunicaciones. Y se concluye con algunos datos de actualidad\r\n','Alexander, C., & Sadiku, M. (Año de publicación). Fundamentos de Circuitos Eléctricos (5ta ed.). Editorial.',NULL,NULL,16,2,5,628,'2024-01-21 21:27:22.000000',653),('EN-POSM033','PRUEBA EVALUACION RESUMEN','Prueba','Prueba prueba',NULL,NULL,16,2,1,785,'2024-01-22 18:42:48.000000',NULL),('EN-POSM045','DISEÑO DE ACTIVIDAD DE APRENDIZAJE PARA EL ESTUDIO DE LÍMITES Y CONTINUIDAD DE FUNCIONES ','Además de los problemas que los estudiantes suelen presentar en la solución de ejercicios correspondientes a los temas de límite y continuidad de una función, se tienen también dificultades en entender las ideas y conceptos que están detrás de teoremas, axiomas y definiciones que se presentan los libros de texto cuando se abordan estos temas en el aula. La presente propuesta tiene como propósito emplear algunas de las herramientas de las que dispone GeoGebra para implementar el diseño de una tarea de aprendizaje que tenga como objetivo coadyuvar a una mejor comprensión de distintos conceptos implicados en los temas de límites y continuidad de funciones. El supuesto en el cual nos basamos es el diseño de una tarea que incluya elementos que son considerados relevantes del quehacer matemático como son: los procesos de reflexión, discusión, argumentación y comprobación, apoyándose para ello en distintos registros que puede proporcionar una herramienta digital como GeoGebra, bajo la guía del docente. Como resultado se presenta la secuencia de actividades incluidas en la tarea, así como su sustento teórico y metodológico. ','Rogawski, J., Adams, C. y Franzosa, R. (2019). Calculus: early trascendentals (4th ed.). EU: Freeman and Co. Torres-Rodríguez, A., Campos Nava, M., Reyes-Rodríguez, A. y Soto-Campos, C. (2022). Diseño de Tareas con Tecnología: entre investigación y docencia. Boletín Científico Padi, 9 (18), 29-34. DOI:  https://doi.org/10.29057/icbi.v9i18.7133',NULL,NULL,16,2,1,853,'2024-01-24 12:48:13.000000',362),('EN-POSM047','SOLUCIÓN DE PROBLEMAS MATRICIALES  MEDIANTE UN ENFOQUE DE OPTIMIZACIÓN A TRAVÉS DE ECUACIONES DIFERENCIALES','Este trabajo presenta el estudio sobre un método numérico matricial que puede derivarse mediante un paradigma computacional diferente. Se aborda este método como un problema de optimización relacionado con ecuaciones matriciales, proporcionando una perspectiva innovadora en el campo del álgebra lineal. Además, se analizaron problemas de cálculo de  matrices inversas utilizando este método y se compararon en el software Python utilizando algoritmos básicos como el método de Euler y Runge-Kutta.\r\n\r\nEn lugar de calcular directamente la operación matricial, este enfoque permite que el problema modelado como un sistema dinámico no lineal de primer orden, evolucione hasta  la convergencia en la solución deseada, lo que asegura una estabilidad asintótica lineal. Esto resulta especialmente beneficioso cuando las operaciones matriciales estándar se vuelven computacionalmente costosas debido al aumento del tamaño de la matriz para problemas más complejos.\r\n\r\nSe utilizan técnicas numéricas como una herramienta adicional para examinar y contrastar la metodología que se aplicará en los ejemplos propuestos. Como resultado de este trabajo se exponen los casos de estudio de esta metodología junto con los procedimientos correspondientes para su aplicación, detallando sus atributos, consideraciones  y aspectos a tener en cuenta para llevar a cabo su implementación. Finalmente, se discute el posible impacto de esta estrategia educativa como un proceso de enseñanza y aprendizaje.','McOwen R. (2012). Worldwide Differential Equations With Linear Algebra.  Shastri A, Shaw K, Singh M. (2023), Machine Learning and Optimization for Engineering Design. Springer. Cassel K. (2021). Matrix, Numerical, and Optimization Methods in Science and Engineering. Cambridge University Press.  Corriu J.P. (2022). Numerical Methods and Optimization: Theory Practice Engineers. Springer.',NULL,NULL,16,2,1,53,'2024-01-24 17:57:08.000000',653),('EN-POSM049','TRANSFERENCIA DE CONOCIMIENTOS DE ÁLGEBRA LINEAL EN UN PROBLEMA DE REDES CRISTALINAS','La Ingeniería en México requiere de estudiantes capacitados para la resolución de problemas algebraicos y de Ingeniería.\r\nEn la Coordinación de Matemáticas de la Facultad de Ingeniería, UNAM se están realizando esfuerzos para apoyar los procesos de enseñanza y aprendizaje, por lo que se están realizando algunos recursos didácticos entre ellos el diseño y producción de secuencias didácticas con base en los objetivos de aprendizaje del programa educativo de la asignatura de Álgebra Lineal, dichos recursos son mediados a través de estrategias pedagógicas y comunicacionales, trabajo colaborativo y tecnología digital.\r\nLas secuencias didácticas apoyan por un lado la comprensión de los conceptos y por otro lado favorecen la transferencia de conocimiento a la identificación y la resolución de problemas de la vida real, además, se promueve el trabajo colaborativo, el razonamiento crítico y reflexivo de la situación actual y da un marco de referencia hacia los avances científicos y la innovación. Los estudiantes al trabajar con actividades lúdicas y de experimentación favorecen el aprendizaje colaborativo.\r\nEn el presente trabajo da cuenta de las evidencias entregadas por los estudiantes en la transferencia de los conceptos de Álgebra Lineal a un problema contextualizado de la asignatura de Química y con la carrera de Ingeniería en Minas y Metalurgia en el uso de redes cristalinas y los resultados obtenidos con base en una intervención educativa dentro del aula con estudiantes de nivel superior de Ingeniería.\r\n','Lion, Carina, & Maggio, Mariana. (2019). Desafíos para la enseñanza universitaria en los escenarios digitales contemporáneos. Aportes desde la investigación. Cuadernos de Investigación Educativa, 10(1), 13-25. https://doi.org/10.18861/cied.2019.10.1.2878',NULL,NULL,16,2,5,685,'2024-01-24 18:59:58.000000',100),('EN-POSM055','“LA TECNOLOGÍA EDUCATIVA COMO HERRAMIENTA DE APRENDIZAJE DE LA MATEMÁTICA”','Resumen de ponencia\r\nEl aprendizaje del álgebra es importante en todo nivel educativo, Por diversas razones, entre ellas porque nos inicia en los diferentes tipos de razonamiento (deductivos, inductivos y analógicos), y nos permite ser analíticos, y transmitir ideas en la resolución de problemas, así como identificar diferentes tipos de patrones y refuerza el pensamiento abstracto del alumno(a). (Naranjo y Puga, 2016).\r\nExisten investigaciones que consideran que la tecnología educativa puede ayudar como herramienta en el aprendizaje utilizando recursos como pizarras digitales, diferentes apps matemáticas, tablet y teléfonos móviles para la enseñanza del lenguaje algebraico. De acuerdo a Bustos (2005),\r\nEs así que la dificultad  de la enseñanza aprendizaje del lenguaje algebraico, obligan a encontrar nuevas formas para abordar esta problemática; entre ellas el uso de la tecnología educativa, que puede ser una opción con sustento en el Marco Curricular Común de la Educación Media Superior (MCCEMS) y Plan de Estudios 2022, el cual asocia la capacidad de los estudiantes en el uso de las tecnologías de la información y la comunicación en procesos académicos. Por ellos se diseñó una secuencia didáctica con la finalidad de explorar los conocimientos previos de los estudiantes EMS tecnológica en las zonas 03 y 04, para dar paso a la exposición de los estudiantes con el contenido del lenguaje algebraico por medio de información del tema en diversos formatos digitales como: Notas del tema, una infografía, una presentación electrónica, un conjunto de videos, un simulador de lenguaje algebraico para computadora y una appk para sistema Android en dispositivos móviles, con el fin de sumergir al estudiante en la información del tema y evaluarlo por medio de un simulador en dispositivo móvil, sin necesidad de tener una conexión a internet, con el fin o propósito de aprender y evaluar el conocimiento aprendido del tema.\r\n','Alfonso Sánchez, Ileana R.  (2016). La sociedad de la información, la sociedad del conocimiento y la sociedad del aprendizaje.  AREA Moreira, Manuel. (2009). Introducción a la tecnología educativa. España: Universidad de La Laguna. Ausbel, D. (1976). Psicología Educativa. Un Punto de Vista Cognoscitivo. Mexica. Cognitiva. ',NULL,NULL,16,2,1,914,'2024-01-25 13:35:01.000000',945),('EN-POSM056','ALGORITMO GENÉTICO APLICADO MOVILIDAD HUMANA','El objetivo de este trabajo es analizar la evolución de la Movilidad en España entre 2011 y 2021 de la población general. Para formar Sistemas Locales de Trabajo (SLT) Se utiliza una metodología de optimización combinatorial que permite diseñar unidades geográficas formadas por códigos postales maximizando la autocontención de los trabajos (número de trabajos ocupados por residentes del área y número de residentes que trabajan en misma área) en las áreas generadas. Con los SLT en los formados para los dos años de la muestra es posible compararlos para examinar su evolución de cada uno resumida en cuatro variables lo que nos permite clasificarlos como áreas que pasan de áreas con excedentes de empleo a áreas deficitarias, o viceversa. La evidencia indica un aumento de la movilidad, la conversión de mercados excedentes en empleo a mercados deficitarios. Estas tendencias dan paso a áreas funcionales más amplias y niveles más bajos de autocontención que se reflejan en la duración del viaje al trabajo. Esto impacta en la calidad de vida, la cohesión social y la sostenibilidad de los territorios.','Carey 1966 The Regional Interpretation of Manhattan Population and Housing Patterns through Factor Analysis. Geographical Review  Farmer & Fotheringham 2011 Network-Based Functional Regions. Environment and Planning A: Economy and Space',NULL,NULL,16,2,1,603,'2024-01-25 16:08:17.000000',17),('EN-POSM057','INTRODUCCIÓN SOBRE DIFERENTES ENFOQUES DE REDES NEURONALES ARTIFICIALES','El aprendizaje de maquina han surgido de las Red Neural Artificial (RNA). Este nuevo campo del aprendizaje automatizado ha crecido rápidamente y ha sido aplicado a la mayoría de los dominios de aplicaciones tradicionales, así como a algunas áreas nuevas que presentan más oportunidades. Estos modelos de pueden superar con creces el rendimiento de formas anteriores de inteligencia artificial en tareas comunes de aprendizaje de máquina. Los resultados muestran un rendimiento de vanguardia utilizando el aprendizaje profundo en comparación con los enfoques tradicionales de aprendizaje automático en los campos del procesamiento de imágenes, visión por computadora, reconocimiento de voz, traducción automática, arte, imágenes médicas, procesamiento de información médica, robótica y control, bioinformática, procesamiento del lenguaje natural, ciberseguridad, etc. Una de las formas de arquitectura RNA es la de la red neuronal convolucional (RNC). Las RNC se utilizan principalmente para resolver tareas de reconocimiento de patrones basadas en imágenes y ofrecen un método simplificado para comenzar con las RNA. Esta es una introducción los fundamentos de las RNA y el aprendizaje automático. ','Hornik Stinchcombe & White 1989 Multilayer feedforward networks are universal approximators. Neural networks',NULL,NULL,16,2,1,603,'2024-01-25 16:18:24.000000',783),('EN-POSM058','APLICACIÓN DE ESTRATEGIAS DE RESOLUCIÓN DE PROBLEMAS DESARROLLADAS MEDIANTE EL USO DE JUEGOS ','La corriente del constructivismo de Piaget, considera que un aprendizaje efectivo debe ser activo, es decir, el estudiante debe construir su aprendizaje mediante la interacción con los objetos de conocimiento, (Sierpinska, 1998) siguiendo esta idea se ha desarrollado el aprendizaje basado en juegos o GBL (Game Based-Learnig) donde por medio de actividades lúdicas, ya sean tradicionales o digitales, se logra  la adquisición y/o desarrollo de un conocimiento. Existen una serie de investigaciones que avalan lo favorable de esta técnica  (Bragg, 2007; Del Moral et al. 2018; Bragg, 2012; Aristizábal et al. 2016; Pratama y Setyaningrum, 2018) sin embargo la mayoría están enfocados a niveles básicos y medios de educación. Así mismo algunos autores autores encontraron una relación entre los pasos de resolución de problemas de Polya con los desarrollados al momento de jugar juegos (Villagrán y Olfos, 2001) tomando esto y las heurísticas que no siempre los alumnos hacen uso de ellas, surge nuestra pregunta de investigación ¿Las fases desarrolladas durante el empleo de un juego de estrategia pueden favorecer el pensamiento algebraico en estudiantes de bachillerato, a través del diseño de una tarea de aprendizaje bajo el enfoque de resolución de problemas?. Para esto se diseñó una metodología que consta de tres etapas, la primera donde se realizará un cuestionario con el fin de identificar las heurísticas que ya poseen los participantes, en la segunda etapa se jugarán tres juegos de estrategia, donde se espera que identifiquen y desarrollen más y en la última etapa se realizará una tarea de aprendizaje con el objetivo de identificar si fueron aplicadas dichas estrategias','Bragg, L. (2007). Students’ conflicting attitudes towards games as a vehicle for learning mathematics: A methodological dilemma. Mathematics Education Research Journal, 19(1), 29-44. Bragg, L. (2012). Testing the effectiveness of mathematical games as a pedagogical tool for children’s learning. International journal of science and mathematics education, 10(6), 1445-1467.',NULL,NULL,16,2,1,900,'2024-01-25 18:54:03.000000',393),('EN-POSM062','LA RAÍZ CUADRADA Y SU UTILIDAD “FINAL”','\r\nEn los diferentes desarrollos que involucran operaciones con la raíz cuadrada, la mayoría de los libros de texto acostumbran mantener su símbolo durante varios pasos matemáticos consecutivos, y sólo hasta el final aquél desaparece al extraer la raíz cuadrada como tal. El símbolo resulta en ocasiones incluso extendido, tanto en lo largo como en lo “ancho”, con numeradores y denominadores un tanto complicados que incluyen diversas unidades, lo cual embroma mucho arrastrarlo tantas veces. En este trabajo se muestran algunas operaciones donde se evita el uso de la raíz cuadrada, y sólo al final es cuando se aplica. \r\n\r\n[1]  Halliday, D. y Resnick, R. Fundamentals of Physics.  8th Ed.\r\n\r\n[2] Merzbacher, E. (1961). Quantum Mechanics. New York, USA: John Wiley. \r\n\r\n[3] Mathematical Methods for Physicists, George B, Arfken and Hans J. Weber, Elsevier Acad. Press, 2005, San Diego, USA.\r\n\r\n[4] Gautreau, R. y Savin, W., (2001). Física Moderna, México: McGraw Hill -Scahum, 2a. ed. \r\n','[1]  Halliday, D. y Resnick, R. Fundamentals of Physics.  8th Ed.  [2] Merzbacher, E. (1961). Quantum Mechanics. New York, USA: John Wiley.   [3] Mathematical Methods for Physicists, George B, Arfken and Hans J. Weber, Elsevier Acad. Press, 2005, San Diego, USA.  [4] Gautreau, R. y Savin, W., (2001). Física Moderna',NULL,NULL,16,2,1,364,'2024-01-26 17:19:54.000000',263),('EN-POSM063','EL MANEJO SIMPLIFICADO DE RELACIONES TRIGONOMÉTRICAS EN NOTACIÓN DE COORDENADAS','Las operaciones algebraicas que contienen las diferentes funciones trigonométricas (ft) y las identidades (it) que las relacionan, son trabajadas aquí por medio de notaciones adecuadas a las mismas con el fin de facilitar su manejo. La metodología incluye el uso de simbología más simple para las ft, así como el de cierto tipo de integrales, siendo el objetivo el de tener una reducción evidente en los desarrollos y por ende una simplificación global, lo cual se desprende de los diferentes ejemplos que se presentan, teniendo como conclusión la de una mejor asimilación de los conocimientos, tanto de las matemáticas como de sus repercusiones en la física e ingeniería.  ','[1]  Advanced Calculus, Schaum-McGraw Hill, 3ª. ed., Robert Wrede y Murray Spiegel, 2010, New York. [1] Análisis Vectorial, Schaum, 2a. ed., Murray R. Spiegel, Seymour Lipschutz y Dennis Spelman, 2011, México.   [3] Mathematical Methods of Physics, Jon Mathews y Robert L. Walker, 2a. ed., Benjamin-Addison Wesly. 1973, New York.                                                            ',NULL,NULL,16,2,1,364,'2024-01-26 17:24:52.000000',516),('EN-POSM072','ANÁLISIS DE PARÁMETROS MATEMÁTICOS EN EMG: INFLUENCIA EN LA DIFERENCIACIÓN DE MOVIMIENTOS EN MIEMBRO SUPERIOR.','El movimiento musculoesquelético de miembro superior del ser humano es de interés científico, la importancia de este radica en que permite desarrollar la mayoría de las actividades de la vida diaria razón por la cual se han generado controles y aplicaciones digitales que especializan los movimientos. Las características que se han buscado descifrar y controlar son modulación del movimiento en rapidez, fuerza y especificidad, sin embargo, la propia naturaleza de estas señales EMG impide su manipulación, aún no se descubre de forma eficiente como se pueden conducir estas señales actuantes de forma artificial. Para abordar estos retos se han evaluado y cuantificado los parámetros matemáticos que mejor describen las características del movimiento y que mejor diferencian las clases a partir del EMG. Se busca observar los efectos de las operaciones matemáticas sobre la información en una base de datos Capgmyo. Se seleccionaron 5 sujetos calculando los porcentajes de reconocimiento con un algoritmo de clasificación QDA, los centroides de las distribuciones de las clases y la distancia Mahalanobis de estos centroides a cada distribución.  El estudio se realizó en dos etapas una con los datos crudos considerando los 128 electrodos, y dos se calcularon parámetros como MAV, WL, SSC, RMS y ZC a través de un ventaneo. Además, para cada etapa se utilizó un método de selección de características que nos permitió definir las mejores 3 características para observar la distribución de los datos en el espacio y el porcentaje de reconocimiento. Se obtuvieron resultados prometedores utilizando una validación cruzada 10x10 observando la información extraída de la base de datos, aunque el costo computacional es mayor el uso de técnicas de preprocesamiento permiten una mayor diferenciación de las clases, la característica que más información extrae para poder aportar información útil a un modelo de clasificación clásico como QDA es WL.','Zhang, A., Gao, N., Wang, L., & Li, Q. (2018). Combined Influence of Classifiers, Window Lengths and Number of Channels on EMG Pattern Recognition for Upper Limb Movement Classification. 2018 11th International Congress on Image and Signal Processing, BioMedical Engineering and Informatics (CISP-BMEI), 1-5. https://doi.org/10.1109/CISP-BMEI.2018.8633114',NULL,NULL,16,2,5,889,'2024-01-27 21:14:50.000000',445),('EN-POSM075','LA RETRO ALIMENTACION DOCENTE EN LA UPIICSA DEL IPN.','Las Matemáticas es una asignatura desmotivada por los alumnos generalmente por alguna mala impresión recibida Mira y López (1947), en la UPIICSA del IPN este hecho se hace crítico en el área de Matemáticas ya que está fuertemente influenciado por la cultura matemática de los docentes que conforman dicha área. Todos son profesionistas titulados en alguna licenciatura de diversas escuelas tanto oficiales como privadas están capacitados para impartir la materia, los planes de estudio vigentes en la UPIICSA establecen que las materias ahí impartidas pertenecen a un tronco común esto implica que tanto el ingeniero como el administrativo tienen que cursarlas como parte de su currículo. Los docentes egresados de alguna escuela “de ciencias” tienen una cultura matemática que les permite contestar alguna pregunta referente a un fundamento o a una aplicación, respecto a los egresados de un área diferente a ciencias específicamente una ingeniería y que han ejercido su profesión en un ámbito laboral adecuado poseen una cultura matemática que les permite responder satisfactoriamente en ambos casos fundamentos o aplicación. El gran problema en la UPIICSA es el docente que imparte clases sin haber tenido nunca una experiencia laboral que le permitiera aplicar lo aprendido para adquirir una experiencia que le haga darse cuenta que en la mayoría de los casos es imposible aplicar rígidamente lo aprendido en la escuela. A través del tiempo mejorará notablemente su forma de impartir las pocas materias de matemáticas en las que está capacitado, pero difícilmente podrá corregir su cultura matemática y mucho menos la aplicabilidad en alguna rama de la industria pues carece totalmente de experiencia por lo que la retroalimentación docente sin experiencia laboral la considero un error.\r\npalabras clave:1) desmotivada,2) capacitados,3) ciencias,4) cultura,5) aplicabilidad','Mira y López (1947). Manual de orientación profesional. 1a ed. Ed. Kapelusz, Buenos Aires',NULL,NULL,16,2,3,731,'2024-01-28 05:16:40.000000',587),('EN-POSM080','ESTRATEGIAS DIDÁCTICAS CONTEXTUALIZADAS: UNA RESPUESTA EDUCATIVA PARA LA NUEVA NORMALIDAD.','El presente estudio, realizado en el contexto postpandemia por Covid-19, aborda la adaptación de la enseñanza de las matemáticas a través de la implementación de estrategias didácticas innovadoras. El objetivo principal es preparar a los estudiantes para los retos actuales y futuros, integrando sus contextos de desarrollo profesional y cotidianidad en el aprendizaje matemático. Metodológicamente, el estudio se centra en el diseño y aplicación de actividades matemáticas contextualizadas, adaptadas a la modalidad de enseñanza a distancia, ya sea sincrónica o asincrónica. Estas actividades se basan en la Matemática en Contexto (MC), se ilustran mediante el desarrollo de una actividad específica relacionada con la ecuación diferencial en el contexto de la Ley de Torricelli. La investigación se estructura en tres fases: el desarrollo de la propuesta didáctica, su aplicación y el análisis de una encuesta de opinión estudiantil sobre la propuesta. Los resultados revelan un impacto positivo en el aprendizaje matemático de los estudiantes. La matemática contextualizada, aplicada en un entorno virtual, demostró ser eficaz en mejorar la comprensión de los procedimientos matemáticos y en incrementar la eficiencia y eficacia en la resolución de problemas. Además, se observó un desarrollo significativo en habilidades transversales como el trabajo colaborativo, la autorregulación y la autonomía. En conclusión, la propuesta didáctica no solo favorece la comprensión y aplicación efectiva de las matemáticas, sino que también contribuye al desarrollo de competencias clave para el aprendizaje autónomo y colaborativo. Este estudio subraya la importancia de adaptar la enseñanza de las matemáticas a los retos emergentes y sugiere la necesidad de explorar más a fondo la aplicación de metodologías contextualizadas en otros campos del conocimiento, abriendo así caminos para futuras investigaciones en el ámbito de la educación matemática y su adaptación a modalidades de enseñanza virtual y a distancia.','Aman & Ireland. (2019). Educational alternatives in Latin America: New Modes of Counter-Hegemonic Learning. Macmillan.  Camarena, P. G. (2015). Teoría de las ciencias en contexto y su relación con las competencias. Ingenium, 16 (31), 108-127. ',NULL,NULL,16,2,1,162,'2024-01-28 19:07:39.000000',433),('EN-POSM081','MEJORANDO EL APRENDIZAJE EN INGENIERÍA: EXPLORACIÓN Y APLICACIÓN CON ESTRATEGIAS DIDÁCTICAS BASADAS EN ALGORITMOS','El objetivo es destacar cómo el uso estratégico de diversos lenguajes de programación como Lenguaje C y Python, o paquetes como Maple, Matlab, Excel, facilitan el aprendizaje de Métodos Numéricos en Ingeniería Mecánica Eléctrica. Se busca motivar a los estudiantes a través de la implementación de estas herramientas, promoviendo un enfoque que permita desarrollar una comprensión profunda de los conceptos clave de la materia. El sustento teórico se basa en la premisa de que la diversidad de lenguajes de programación representa desafíos para los estudiantes de ingeniería, pero el uso estratégico de software puede superar estas dificultades. La implementación de herramientas como Maple, Matlab, Excel, Lenguaje C y Python se presenta como una solución para motivar a los estudiantes y facilitar el aprendizaje de Métodos Numéricos.\\r\\nEn cuanto a la metodología o desarrollo, se destaca la importancia de incorporar el desarrollo de algoritmos en un entorno de aprendizaje. Esta práctica no solo fomenta el Pensamiento Algorítmico, sino que también genera cambios significativos en el proceso educativo. La conexión práctica y significativa entre la teoría y la aplicación se logra mediante el desarrollo de códigos y algoritmos, fortaleciendo el conocimiento de los estudiantes. Este enfoque permite abordar de manera inmediata el análisis y lograr aprendizajes prácticos y sustanciales. En los resultados y/o conclusiones, se esperan mejoras en la motivación de los estudiantes, así como un mayor entendimiento y aplicación de los conceptos de Métodos Numéricos en Ingeniería Mecánica Eléctrica. Se resalta la eficacia de la estrategia que incorpora el uso de múltiples lenguajes de programación y el desarrollo de algoritmos para fortalecer el aprendizaje práctico y significativo. Además, se sugiere que este enfoque puede ser extrapolado a otras áreas de la ingeniería, generando impactos positivos en el proceso educativo.\\r\\n','•	Burden, R. L. (1999).  Análisis Numérico. México: Grupo editorial Iberoamericana, S. A.   Wirth, N. (1987). Algoritmos y Estructura de Datos. México: Prentice Hall.',NULL,NULL,16,2,1,813,'2024-01-28 19:27:24.000000',242),('EN-POSM082','UNA EXPERIENCIA DIDÁCTICA DE LA INTERPRETACIÓN GEOMÉTRICA DE LA INTEGRAL DEFINIDA','La síntesis de la exposición abarcará el objetivo de promover la comprensión profunda de la integral definida a través de la interpretación geométrica, respaldado por un sustento teórico que destaca su importancia en el aprendizaje de las matemáticas, la metodología basada en actividades prácticas y herramientas visuales, y los resultados observados que respaldan la eficacia de este enfoque didáctico.\\r\\nLa experiencia didáctica de la interpretación geométrica de la integral definida, destacando su relevancia en el ámbito de las matemáticas. La integral definida, siendo una herramienta fundamental en cálculo, a menudo se enseña desde una perspectiva puramente algebraica, lo que puede dificultar su comprensión intuitiva para los estudiantes. Se implementó una estrategia educativa que se centra en la visualización geométrica para facilitar la asimilación de conceptos clave asociados con la integral definida. Se explora una metodología innovadora que utiliza la interpretación geométrica como herramienta para enseñar la integral definida, buscando promover una comprensión profunda y significativa. Este enfoque no solo enriquece la experiencia educativa, sino que también contribuye a formar estudiantes con una base sólida en cálculo y una apreciación más profunda de la conexión entre representaciones gráficas y algebraicas.\\r\\nLa experiencia didáctica se diseñó con actividades prácticas que involucran la representación gráfica de funciones y regiones bajo la curva. Se utilizaron herramientas visuales como gráficos, animaciones y modelos para ilustrar de manera concreta los conceptos abstractos relacionados con la integral definida. Este enfoque no solo promovió la comprensión conceptual, también estimuló el interés y la participación de los estudiantes. Se presentan ejemplos de situaciones en las que la interpretación geométrica de la integral definida proporciona soluciones visualmente significativas. Además, se analizarán los resultados obtenidos, destacando mejoras en la comprensión y retención de los conceptos por parte de los estudiantes.\\r\\n','Larson, R., & Edwards, B. H. (2013). Cálculo y geometría analítica. McGraw-Hill InteramericaSwokowski, E. W., & Cole, J. A. (2012). Cálculo de una variable con trascendentes tempranas. Cengage Learning.na.',NULL,NULL,16,2,1,813,'2024-01-28 19:37:24.000000',350),('EN-POSM087','TECNOLOGÍAS Y ENSEÑANZA DE LAS ATEMÁTICAS PARA FAVORECER EL PENSAMIENTO LÓGICO MATEMÁTICO EN NIVEL SECUNDARIA','                                \r\nResumen\r\nLas tecnologías favorecen la enseñanza de las matemáticas. El objetivo planteado fue investigar si el docente utiliza situaciones problemáticas del contexto para fomentar el pensamiento lógico matemático en los estudiantes. En cuanto a la definición de pensamiento lógico matemático de acuerdo a Saguillo (2008), “la habilidad de determinar qué métodos y procedimientos son fiables y seguros en la determinación de la validez o invalidez de cierto argumento dado” (p.8). Dentro del proceso de enseñanza – aprendizaje, un elemento fundamental desde mediados del siglo XX han sido las estrategias de aprendizaje (Badia, Álvarez, Carretero, Liesa & Becerril, 2012 en Gasco, 2016), ya que sin ellas no existiría un propósito claro y conciso en la educación de cualquier nivel. Autores como Nisbet & Shuckmith (1986) en Gasco (2016), Con respecto a los antecedentes se indicaron los siguientes estudios realizados.  Vargas (2021) con su proyecto llamado Incidencia del uso de las tic en el desarrollo del razonamiento lógico matemático de los estudiantes de educación general básica del subnivel medio de la escuela de educación básica lomas de sargentillo, tuvo como objetivo determinar cómo el uso de las TIC incide en el razonamiento lógico matemático. Así mismo, el proyecto realizado por Gualdrón, Cudris, Barrios, Olivella, Bermúdez y Gutiérrez (2020), con el tema los AVA como estrategia didáctica en la enseñanza del pensamiento lógico matemático. Con fundamento en la metodología el enfoque fue cuantitativo, el diseño no experimental, la muestra fue de 250 alumnos, tipo de muestra probabilística. La técnica utilizada para la recolección de información fue cuestionario escala Likert y el manejo de información se utilizó el spss (Statistical Package for Social Sciences). Los resultados de la investigación confirmaron que el uso de las tecnologías en la enseñanza de las matemáticas fortalece el pensamiento lógico matemático.                                \r\nPalabras clave: tecnologías, enseñanza, pensamiento, lógico. Matemáticas.\r\n\r\n',' Badia, A., Álvarez, I., Carretero, R., Liesa, E. & Becerril, L.  Gualdrón Ortiz, D. P., Cudris Torres, L., Barrios Núñez, A., Olivella López, G., Bermúdez Cuello, J. C., y Gutiérrez García, R.  Nisbet, J. & Shucksmith, J.  Vargas Álvarez, K. C.  Sagüillo, J. M., y Fernández Vega, J. M. S. ',NULL,NULL,16,2,1,391,'2024-01-28 22:19:36.000000',433),('EN-POSM088','USO DEL WHATSAPP DENTRO DE LA ESEÑANZA SUPERIOR APLICADO A  MATEMATICAS','Resumen\\\\\\\\r\\\\\\\\n\\\\\\\\r\\\\\\\\nA pesar de que en México se han realizado algunos estudios relacionados al uso de esta aplicación, aún no existe información relacionada con los posibles beneficios que tiene o puede tener WhatsApp dentro del quehacer escolar de las y los estudiantes, tampoco existe algún antecedente del uso específico  aplicado a las matemáticas o que intervenga esta aplicación de alguna manera para resolver algún tipo de cálculo.\\\\\\\\r\\\\\\\\nEs cierto que el uso de esta aplicación de  mensajería instantánea llamada  WhatsApp, hoy en día es muy común por los estudiantes y la principal herramienta de comunicación, por lo que es necesario conocer la realidad en cuanto a la frecuencia de uso de mencionada aplicación dentro del proceso enseñanza – aprendizaje, en especifico como apoyo o empleo de las matemáticas. Tal vez los estudiantes hallan utilidad para resolver algún tipo de cálculo.\\\\\\\\r\\\\\\\\nSe plantearon una serie de preguntas para realizar una investigación cuantitativa dentro de la UPIICSA a estudiantes de Ingeniería Industrial, con la finalidad de conocer el posible uso, beneficio o utilidad de la aplicación de WhatsApp dentro de su quehacer escolar, en específico de las matemáticas.\\\\\\\\r\\\\\\\\n¿Con que frecuencia usa WhatsApp para alguna actividad escolar o académica?\\\\\\\\r\\\\\\\\n¿ Con que frecuencia usa WhatsApp para alguna actividad escolar o académica para resolver algún cálculo o tarea relacionada a la aplicación de las matemáticas?\\\\\\\\r\\\\\\\\nPalabras clave: WhatsApp, educación, matemáticas, enseñanza, TICs\\\\\\\\r\\\\\\\\n','Limas, S., y Vargas, G. (2021). Redes sociales como estrategia académica en la educación superior: ventajas y desventaja. Educación y educadores  Domínguez, F. y López, r. (2015). Uso de las redes sociales digitales entre los jóvenes universitarios en México. Hacia la construcción de un estado del conocimiento (2004-2014). Revista comunicación',NULL,NULL,16,2,1,830,'2024-01-28 22:20:26.000000',445),('EN-POSM089','PROPUESTA DE ESTRATEGIAS COMPUTACIONALES PARA LA  ENSEÑANZA DE LAS MATEMÁTICAS EN LA ECONOMÍA','Se presenta una propuesta de estrategia para la enseñanza de las matemáticas, en el campo de la \\r\\neconomía. Primeramente, se clasifica el contenido matemático en función de sus aplicaciones. \\r\\nPosteriormente, se hace una presentación teórica de los conceptos y se acompaña de problemas. \\r\\nFinalmente se traducen dichos problemas a un entorno computacional para su resolución. Se incluyen \\r\\nejemplos de aplicación práctica de temas de álgebra lineal, específicamente sobre matrices; \\r\\noptimización de funciones a través del método clásico; ecuaciones en diferencia de segundo orden, \\r\\nanálisis y clasificación de sus soluciones y por último, las ecuaciones diferenciales y sistemas de \\r\\necuaciones diferenciales. La propuesta didáctica puede aplicarse a campos afines a la economía, como \\r\\nson la actuaría, las matemáticas aplicadas y las finanzas. Para la resolución computacional de los \\r\\nproblemas, se utilizaron el sistema de álgebra computacional Maxima, mediante el entono WxMaxima\\r\\ny el motor de conocimiento WolframAlpha.','• Anthony, M., & Biggs, N. (2001). Matemáticas para la economía y las finanzas:  Una introducción. Madrid: Cambridge University Press.',NULL,NULL,16,2,1,730,'2024-01-29 20:38:07.000000',531),('EN-POSM092','MÉTODO DE PÓLYA COMO ESTRATEGIA DE APRENDIZAJE PARA FORTALECER LA RESOLUCIÓN DE PROBLEMAS','El presente trabajo de investigación surge de la problemática relacionada al aprendizaje del algebra por parte de los estudiantes que cursan el primer semestre del bachillerato tecnológico. Prestando mayor atención al déficit de comprensión del tema de ecuaciones lineales de primer grado con una incógnita, en el cual no se logra una comprensión adecuada del tema, dando como resultado un bajo rendimiento académico.\r\n\r\nEn atención a esta problemática se propone la aplicación de la estrategia de aprendizaje basada en la metodología de Pólya, que tiene por objetivo evidenciar el incremento de las habilidades de los estudiantes para resolver problemas matemáticos. El estudio tiene un enfoque de carácter cuantitativo,  con un diseño preexperimental en el cual se aplico una preprueba y una postprueba a un grupo experimental formado a partir de una muestra de 42 estudiantes de primer año de bachillerato. \r\n\r\nPosteriormente se analizo e interpreto los datos obtenidos del pretest, para el diseño de la propuesta de intervención y con base, a los datos obtenidos en el postest, se concluye que la aplicación del método de Pólya como estrategia de aprendizaje puede beneficiar la competencia de resolución de problemas y  incremento en el rendimiento académico de los estudiantes. \r\n','Aguilar, B. (2014). Resolución de problemas matemáticos con el método de Pólya mediante el uso de GeoGebra en primer grado de secundaria. (Tesis de maestría). Instituto Tecnológico y de Estudios Superiores de Monterrey, Ibagué, Colombia.',NULL,NULL,16,2,2,921,'2024-01-30 13:44:58.000000',404),('EN-POSM093','NÚMEROS MULTIDIMENSIONALES','Hace más de 2500 años, la escuela pitagórica estableció los fundamentos que permiten imaginar a los números naturales como lineales, superficiales y sólidos. Acomodando el mismo número de piedras que representaban determinadas cantidades, los pitagóricos imaginaron a los números como triangulares, cuadrados, pentagonales, etc. Algunos de estos números naturales los concibieron como cuadrados aritméticamente perfectos. Juan Gracian en el siglo XVI, señaló la existencia de cuadrados irracionales cuyas raíces según él, no se daban en números que sirvieran, a estos cuadrados los llamó sordos porque cuando se “nombraban” no se entendían…\r\n\r\nCon los principios de la escuela pitagórica, distinguidos personajes como Euler, Gauss y Fermat establecieron diferentes conjeturas relacionadas con los números cuadrados y cúbicos que conocieron en sus respectivas épocas. Incluso Fermat, postuló la que se conoce como su conjetura más famosa que establece la imposibilidad de encontrar la suma de dos potencias de la misma clase cuando estas sean más altas que el cuadrado. Si bien es reconocido que en 1994 Andrew Wiles usando la ecuación x^n+y^n=z^n demostró lo que se supone que postuló Fermat.\r\n\r\nEn esta ponencia presento mi conceptualización de los números multidimensionales, que permite concebir a los números de una manera diferente; planteo que la ecuación x^n+y^n=z^n no representa a todas las potencias enteras que se pueden obtener en la realidad y de forma abstracta y usando solamente números naturales, operaciones básicas y modelizaciones simples y cotidianas, presento: una forma distinta de expresar el teorema de Pitágoras, rebato una conjetura formulada por Gauss y tres postuladas por Fermat y demuestro que:\r\n\r\n“Sí es posible convertir un cubo en la suma de 2 cubos, una potencia cuarta en la suma de 2 potencias cuartas y en general, cualquier potencia más alta que el cuadrado en suma de 2 potencias de la misma clase”.\r\n','[1] H Rodríguez,(2023) Números multidimensionales, una forma diferente de concebir los números [2] N.C Castañeda y C. Castañeda, (2022) Una mirada a los números cuadrados triangulares, Miscelánea matemática 75. [6] Gracian Juan (1573); Tratado de matemáticas en que se contienen cosas de aritmética, geometría, Cosmografía y Filosofía Natural ',NULL,NULL,16,2,3,828,'2024-01-30 17:59:16.000000',393),('EN-POSM096','MINIMIZACIÓN DE FUNCIONES DE VARIAS VIABLES EN EL MÉTODO DE REGRESIÓN LINEAL USANDO MAPLE.','En este trabajo se desarrolla una propuesta de actividades que integra conocimientos de las asignaturas de cálculo, estadística y algebra haciendo uso del software matemático Maple.\r\nLa secuencia comienza presentando el problema de la regresión lineal de un conjunto de puntos, considerando que el criterio de mejor ajuste es aquel que permite que la suma de los errores al cuadrado sea la mínima.\r\nLa secuencia propone la construcción de una función de dos variables que debe ser minimizada, el procedimiento requiere el computo de sus derivadas parciales y la solución de un sistema de ecuaciones para encontrar los puntos críticos. Que serán caracterizados como máximos o mínimos de acuerdo con el determinade Hessiano.\r\nPor último, se construye la gráfica de dispersión y la recta de ajuste.\r\nToda la secuencia de actividades se realiza empleando el software matemático Maple.\r\n','Walpole, R. E., Myers, R. H., Myers, S. L., & Keying, Y. (2012). Probabilidad y estadística para ingeniería y ciencias (Novena edición). Pearson Educación. Thomas, G. B., Weir, M. D., Hass, J., & Heil, C. (2015). Cálculo: Varias variables (A. E. García Hernández, Trad.; (Decimotercera edición). México: Pearson Educación.',NULL,NULL,16,2,1,632,'2024-01-30 20:17:52.000000',289),('EN-POSM097','LIBRETAS JUPYTER PARA LA ENSEÑANZA DE SOLUCIÓN DE ECUACIONES POR EL MÉTODO DEL PUNTO FIJO.','En este trabajo se presenta una propuesta de actividades usando las TIC para mejorar la enseñanza de las matemáticas, la secuencia presentada desarrolla el tema de resolución de ecuaciones empleando el método del punto fijo, este trabajo muestra como el uso de libretas Jupyter proporciona una plataforma ideal para enseñanza de este tema en el contexto de un curso de Cálculo Diferencial e Integral como los impartidos en diversas carreras de la Facultad de Estudios Superiores Cuautitlán de la UNAM, ya que la mayoría de los estudiantes de estos curso aún no ha  tomado un curso foral de computación la propuestas emplea el lenguaje de programación Python por su popularidad y facilidad relativa de uso en el ambiente de las libretas Jupyter.','Federico, D. S. C., & Antonio, N. H. (2014). Métodos Numéricos Aplicados a la Ingeniería. Grupo Editorial Patria. Menke, E. J. (2020). Series of Jupyter Notebooks Using Python for an Analytical Chemistry Course. Journal of Chemical Education, 97(10), 3899–3903.',NULL,NULL,16,2,1,632,'2024-01-30 20:19:22.000000',945),('EN-POSM101','TECNOLOGÍAS Y ENSEÑANZA DE LAS MATEMÁTICAS PARA FAVORECER EL PENSAMIENTO LÓGICO MATEMÁTICO EN NIVEL SECUNDARIA','Las tecnologías favorecen la enseñanza de las matemáticas. El objetivo planteado fue investigar si el docente utiliza situaciones problemáticas del contexto para fomentar el pensamiento lógico matemático en los estudiantes. En cuanto a la definición de pensamiento lógico matemático de acuerdo a Saguillo (2008), “la habilidad de determinar qué métodos y procedimientos son fiables y seguros en la determinación de la validez o invalidez de cierto argumento dado” (p.8). Dentro del proceso de enseñanza – aprendizaje, un elemento fundamental desde mediados del siglo XX han sido las estrategias de aprendizaje (Badia, Álvarez, Carretero, Liesa & Becerril, 2012 en Gasco, 2016), ya que sin ellas no existiría un propósito claro y conciso en la educación de cualquier nivel. Autores como Nisbet & Shuckmith (1986) en Gasco (2016), Con respecto a los antecedentes se indicaron los siguientes estudios realizados.  Vargas (2021) con su proyecto llamado Incidencia del uso de las tic en el desarrollo del razonamiento lógico matemático de los estudiantes de educación general básica del subnivel medio de la escuela de educación básica lomas de sargentillo, tuvo como objetivo determinar cómo el uso de las TIC incide en el razonamiento lógico matemático. Así mismo, el proyecto realizado por Gualdrón, Cudris, Barrios, Olivella, Bermúdez y Gutiérrez (2020), con el tema los AVA como estrategia didáctica en la enseñanza del pensamiento lógico matemático. Con fundamento en la metodología el enfoque fue cuantitativo, el diseño no experimental, la muestra fue de 250 alumnos, tipo de muestra probabilística. La técnica utilizada para la recolección de información fue cuestionario escala Likert y el manejo de información se utilizó el spss (Statistical Package for Social Sciences). Los resultados de la investigación confirmaron que el uso de las tecnologías en la enseñanza de las matemáticas fortalece el pensamiento lógico matemático.                                \\\\r\\\\nPalabras clave: tecnologías, enseñanza, pensamiento, lógico. Matemáticas.\\\\r\\\\n\\\\r\\\\n','Badia, A., Álvarez, I., Carretero, R., Liesa, E. & Becerril, L. (2012). Del aprendiz estrátegico al aprendiz competente. En A. Badia (coord.), Estrategias y competencias de aprendizaje en educación (pp.17-38). Madrid: Editorial Síntesis',NULL,NULL,16,2,1,902,'2024-02-02 22:08:28.000000',686),('EN-POSM102','USO DE VIDEOS DE EXPERIMENTOS FÍSICOS Y SIMULADORES PARA ABORDAR CONCEPTOS MATEMÁTICOS','El Colegio de Ciencias y Humanidades (CCH) ha propiciado, a lo largo de sus más de 50 años de historia, brindar una formación integral a sus estudiantes en los campos de las ciencias experimentales, exactas, sociales y humanidades; su modelo educativo que se basa en los principios de aprender a aprender, aprender a hacer y aprender a ser, así como su enfoque pedagógico centrado en el estudiante y su aprendizaje, permiten establecer el proceso de aprendizaje no como una simple adquisición y acumulación de información, sino como un proceso dinámico que da pie al análisis y la reflexión, siendo el alumno autor y actor de su propio aprendizaje.\r\n\r\nEl caracter innovador del modelo educativo del Colegio ha impulsado a sus docentes a buscar de manera continua nuevas didácticas y recursos tecnológicos que permitan transformar el proceso de enseñanza y aprendizaje. En Matemáticas y Física los profesores han explorado la forma de integrar las TIC en el salón de clase, a través del uso de videos de experimentos, simuladores y sofware de Geometría Dinámica que permiten obtener, analizar y modelizar ciertos fenómenos que serían muy complicados de replicar en el aula, ya sea por el tiempo, espacio, costo o riesgo que implican.\r\n\r\nEn este trabajo se presentan algunos ejemplos de cómo empleando el video de un experimento físico y simuladores construidos en GeoGebra sobre el Movimiento Circular Uniforme se pueden abordar algunos conceptos de Trigonometría. Además, se realizará una reflexión sobre las ventajas y retos que conlleva trabajar con este tipo de recursos potenciadores de aprendizaje en Matemáticas.','Gutiérrez,  R.  E.  (2017).  Elaboración  de  simuladores  con  GeoGebra.  Una  actividad  de modelación matemática mediada por  tecnologías digitales.  In J. L.  Prieto & R.  E. Gutiérrez (Eds.),  Memorias del  III Encuentro de Clubes  GeoGebra del Estado Zulia (pp. 234–252). Maracaibo: A. C. Aprender en Red. ',NULL,NULL,16,2,1,738,'2024-02-02 23:12:38.000000',641),('EN-POSM104',' USO DEL ENFOQUE STEAM PARA MODELAR CON GRÁFICAS DE LABORATORIO VIRTUAL: LABU4 ','El enfoque STEAM  (Science, Technology, Engineering, Art, Math) es cada vez más popular dentro de la didáctica y en particular la didáctica de las matemáticas, dónde una de las principales finalidades es transversalizar matemáticas, tecnología, arte y ciencias al desarrollar  proyectos y actividades significativas para el estudiantado. En la experiencia didáctica que presentamos se realizó el ciclo de modelación matemática al aplicar las herramientas de la aplicación Lab4U cuando estudiantes de bachillerato la activaron durante los juegos mecánicos de un parque de diversiones, teniendo como resultados datos y gráficas de variables físicas que se pueden analizar con la finalidad de obtener aprendizajes significativos, planteados de la realidad de forma multidisciplinaria y con uso de la tecnología.','Ferrando P., Hurtado S., y Beltrán M.  (2018). Formación STEM en el grado de maestro: una experiencia docente. @tic. revista d\'innovació educativa, 20, 35-42. Muñoz, L., Londoño, S., Jaramillo, C., Villa-Ochoa, J.(2014). Contextos auténticos y la producción de modelos matemáticos escolares. Revista Virtual Universidad Católica Del Norte, (42), 48–67.',NULL,NULL,16,2,1,526,'2024-02-13 22:38:58.000000',289),('EN-POSM105','PROPUESTA DE UNA SECUENCIA DIDÁCTICA PARA LA ENSEÑANZA DEL INTERÉS COMPUESTO EN EL NIVEL BACHILLERATO','La presente investigación se centra en el diseño de una secuencia didáctica para la enseñanza del interés compuesto con el objetivo de apoyar la formación del docente. La intención es que los conocimientos del profesorado se complementen y fortalezcan, fomentando la articulación con otros saberes, por lo cual, la estructura de la secuencia se fundamenta en la aproximación teórica de la articulación de saberes matemáticos, con el propósito de superar la presentación desarticulada y conceptualmente débil que a menudo se encuentra en las aulas. Se pretende incluir elementos histórico-epistemológicos y problemas contextualizados en la secuencia de modo que los estudiantes valoren la relevancia del tema en la vida cotidiana yreconozcan su impacto como futuros ciudadanos que gestionarán servicios financieros vinculados al interés compuesto. Los referentes histórico epistemológicos han surgido como un componente esencial que algunos profesores consideran crucial para enriquecer la comprensión conceptual de los estudiantes. Los resultados también destacan la importancia de integrar problemas contextualizados en la enseñanza, lo que podría influir en la forma en que los docentes diseñan actividades prácticas que vinculen el interés compuesto con situaciones de la vida real. Asimismo, la articulación con otros saberes matemáticos, como la progresión geométrica, se presenta como una estrategia valiosa para fortalecer la conexión entre conceptos matemáticos.\\\\r\\\\n\\\\r\\\\nPalabras clave: formación de profesores, interés compuesto, objetos matemáticos, articulación de saberes, secuencia didáctica, matemáticas financieras, epistemología.','Chevallard, Y 1999 El análisis de las prácticas docentes en la teoría antropológica de lo didáctico Recherches en didactique des mathématiques 19 2 221 266',NULL,NULL,16,2,3,952,'2024-02-14 10:57:20.000000',263),('EN-TASM001','FRACTALES EN LA ENSEÑANZA DE LÍMITES CON ESTUDIANTES DE EDUCACIÓN MEDIA SUPERIOR','LA PALABRA “FRACTAL” PROVIENE DEL LATÍN FRACTUS, QUE SIGNIFICA “FRAGMENTADO”, APROPIADO PARA OBJETOS CUYA DIMENSIÓN ES FRACCIONARIA. EL TÉRMINO FUE ACUÑADO POR BENOÎT MANDELBROT EN SU LIBRO THE FRACTAL GEOMETRY OF NATURE. \\\\\\\\r\\\\\\\\nUN FRACTAL ES UN CONJUNTO MATEMÁTICO QUE PUEDE GOZAR DE AUTOSIMILITUD A CUALQUIER ESCALA, SU DIMENSIÓN NO ES ENTERA O SI ES ENTERA NO ES UN ENTERO NORMAL. EL HECHO QUE GOCE DE AUTOSIMILITUD SIGNIFICA QUE EL OBJETO FRACTAL NO DEPENDE DEL OBSERVADOR PARA SER EN SÍ, ES DECIR, SI TOMAMOS ALGUNOS TIPOS DE FRACTALES PODEMOS COMPROBAR QUE AL HACER UN AUMENTO DOBLE EL DIBUJO ES EXACTAMENTE IGUAL AL INICIAL, SI HACEMOS UN AUMENTO 1000 COMPROBAREMOS LA MISMA CARACTERÍSTICA, ASÍ PUES, SI HACEMOS UN AUMENTO N, EL DIBUJO RESULTA IGUAL LUEGO LAS PARTES SE PARECEN AL TODO.\\\\\\\\r\\\\\\\\nPOR OTRA PARTE, SE RETOMA LA TEORÍA DE SITUACIONES DIDÁCTICAS, QUE FUE DESARROLLADA POR EL MATEMÁTICO Y EDUCADOR FRANCÉS GUY BROUSSEAU, LA CUAL SE CENTRA EN DISEÑAR Y ANALIZAR SITUACIONES DE APRENDIZAJE ESPECÍFICAS PARA FAVORECER LA CONSTRUCCIÓN DEL CONOCIMIENTO. ALGUNOS PUNTOS CLAVE QUE SE CONSIDERARON SON LA IDENTIFICACIÓN DEL OBJETO DE CONOCIMIENTO, ES DECIR ANTES DE DISEÑAR LA SITUACIÓN DIDÁCTICA, ES CRUCIAL IDENTIFICAR EL OBJETO DE CONOCIMIENTO QUE SE VA A ENSEÑAR. ESTO SE REFIERE AL CONTENIDO ESPECÍFICO QUE SE QUIERE QUE LOS ESTUDIANTES APRENDAN, DURANTE EL DISEÑO DE LA SITUACIÓN DIDÁCTICA SE IDENTIFICA EL ESCENARIO DE APRENDIZAJE DISEÑADO PARA PRESENTAR EL OBJETO DE CONOCIMIENTO DE MANERA ATRACTIVA Y COMPRENSIBLE. PUEDE INCLUIR PROBLEMAS, ACTIVIDADES, RECURSOS Y DESAFÍOS RELACIONADOS CON EL TEMA.\\\\\\\\r\\\\\\\\nPOR OTRA PARTE, EL CONTRATO DIDÁCTICO HACE ALUSIÓN A QUE ES UN ACUERDO IMPLÍCITO ENTRE EL PROFESOR Y LOS ESTUDIANTES SOBRE CÓMO SE LLEVARÁ A CABO LA ENSEÑANZA Y EL APRENDIZAJE EN UNA SITUACIÓN ESPECÍFICA. ESTO INCLUYE LAS REGLAS, ROLES Y EXPECTATIVAS DE AMBAS PARTES.\\\\\\\\r\\\\\\\\n','SADOVSKY, P. (2005). LA TEORÍA DE SITUACIONES DIDÁCTICAS: UN MARCO PARA PENSAR Y ACTUAR LA ENSEÑANZA DE LA MATEMÁTICA. REFLEXIONES TEÓRICAS PARA LA EDUCACIÓN MATEMÁTICA, 5, 13-66. VALDÉS VÁSQUEZ, P. A. (2016). INTRODUCCIÓN A LA GEOMETRÍA FRACTAL.',NULL,NULL,16,3,1,822,'2023-12-18 15:12:23.000000',28),('EN-TASM004','ENSEÑANZA DE ECUACIONES DIFERENCIALES ORDINARIAS CON MATHEMATICA','En la teoría de las Ecuaciones Diferenciales Ordinarias de primer orden existen varias técnicas de solución dependiendo de la forma de la ecuación diferencial, entre las que figuran: ecuaciones de variables separables, ecuaciones homogéneas, ecuaciones exactas, ecuaciones lineales, etc. \r\n\r\nEs bien sabido que \"Mathematica\" posee el comando \"DSolve\" para resolver diferentes tipos de ecuaciones diferenciales, incluyendo las mencionadas. Sin embargo, al usar el comando \"DSolve\", perdemos certeza e ilustración de la técnica utilizada en dicha solución. \r\n\r\nEn este Taller mostraremos cómo se utiliza \"Mathematica\" para la enseñanza de las diferentes técnicas de solución de las ecuaciones diferenciales ordinarias, pasando por los conceptos, ejemplificación y graficación de solución general, solución particular, solución implícita, problemas de valores iniciales y algunas aplicaciones.','1.- Wolfram, S. (2023). An Elementary Introduction to the Wolfram Language (3rd Ed.). Wolfram Media, 2023.',NULL,NULL,16,3,1,915,'2024-01-25 23:19:19.000000',28),('EN-TASM006','MATEMÁTICAS FINANCIERAS CON EXCEL','Objetivo:\r\nActualizar el conocimiento, Utilizando el Software Matemático, Excel, Aplicado en \r\n las Matemáticas Financieras, \r\n\r\nContenido:\r\nProgresiones Aritméticas, empleando Excel.\r\nProgresiones Geométricas empleando Excel.\r\nInterés Simple utilizando Excel.\r\nInterés Compuesto utilizando Excel.\r\nAnualidades: Vencidas, Anticipadas, Diferidas y Perpetuas utilizando, Excel.\r\nAmortización, realizando los Cuadros de Amortización, por medio de Excel.\r\nFondo de Amortización, realizando los Cuadros de Fondo de Amortización, con Excel.\r\nDepreciaciones, realizar los principales Cuadros de Depreciación, utilizando Excel.\r\n\r\nJustificación:\r\nEsté curso es necesario par actualizar a los Interesados, Empleando las Nuevas Tecnologías que actualmente se emplean en las, Matemáticas Financieras.\r\n\r\nRequerimientos para el  Taller:\r\nSe necesita que cada participante cuente con una Computadora, para que lo realice los ejercicios empleando la Tecnología y tenga habilitado el Excel. \r\n','Oaxaca J. A. y Sánchez J. M. (2007), Matemáticas Aplicadas a los Negocios con Excel Financiero, cuarta edición. México: UNAM',NULL,NULL,16,3,1,415,'2024-01-26 17:37:49.000000',28),('EN-TASM007','USO DE RECURSOS MATEQ PARA LA COLABORACIÓN DOCENTE EN LA ENSEÑANZA EQUITATIVA DE LAS MATEMÁTICAS.','Contenido\\\\r\\\\nDescripción del Objetivo \\\\r\\\\nEl taller tiene como objetivo principal, crear conceptos, objetivos comunes y fomentar prácticas colaborativas entre docentes para lograr la enseñanza equitativa de las matemáticas, a partir del protocolo para la mejora continua MATEQ (para los autores).\\\\r\\\\n •	Las actividades a realizar \\\\r\\\\nLas actividades diseñadas para el taller, están organizadas de la siguiente manera:\\\\r\\\\nPara la primera sesión (2 horas): \\\\r\\\\n1. Discusión entre los participantes sobre la colaboración docente para la enseñanza de las matemáticas, sus rasgos e implicaciones.\\\\r\\\\n2. Analizar y comprender los conceptos clave, objetivos y dominios sobre la Enseñanza Equitativa de las Matemáticas (EEM). \\\\r\\\\n3. Revisar la Rúbrica MATEQ, sus dominios, indicadores y criterios para la enseñanza equitativa de las matemáticas.\\\\r\\\\n4. Analizar el Protocolo de Colaboración MATEQ que guía a los docentes para realizar a través de fases, la colaboración para la EEM.\\\\r\\\\n5. Socializar los aprendizajes de la sesión, plantear y aclarar dudas con la participación de los asistentes. \\\\r\\\\nPara la segunda sesión (2 horas):\\\\r\\\\n6. Analizar y seleccionar contenidos matemáticos de algún programa educativo del Sistema Educativo Mexicano (educación obligatoria). \\\\r\\\\n7. Organizados en equipos, llevar a cabo un ejercicio de planeación colaborativa, utilizando las rúbricas MATEQ y siguiendo las orientaciones del Protocolo de Colaboración MATEQ. Socializar las planeaciones.\\\\r\\\\n8. Observar y analizar un breve video que muestra las fases: hacer, del protocolo de colaboración. \\\\r\\\\n9. Observar y analizar un breve video que muestra la fase: análisis y reflexión de colaboración.\\\\r\\\\n10. Diálogo entre participantes sobre cómo lo materiales de MATEQ favorecen el trabajo colaborativo para la EEM.\\\\r\\\\n\\\\r\\\\nLos logros que se pretenden alcanzar:\\\\r\\\\nQue los participantes comprendan las características y el proceso para llevar a cabo la colaboración docente en la EEM. Además, conozcan y ejerciten el uso de los materiales MATEQ, que guían la colaboración entre docentes y favorecen la EEM.','Andrews-Larson, C., Wilson, J. y Larbi-Cherif, A. (2017). Jensen, B., Mejía, R. y Aguilar, R. (2017). La enseñanza equitativa para los niños retornados a México. Sinéctica, (48). Jensen, B., Mejía, R., Grajeda, S., Toranzo, S., Encinas, J. y Larsen, R. (2020).',NULL,NULL,16,3,2,938,'2024-01-28 22:08:20.000000',28),('EN-TASM008','PODCAST COMO RECURSO EN LA ENSEÑANZA DE LAS MATEMÁTICAS EN EDUCACIÓN SUPERIOR','El presente taller tiene como finalidad:\r\nProporcionar información de manera clara y comprensible sobre matemáticas.\r\nPromover la retención de información especifica sobre temas de matemáticas y sobre todo temas abstractos.\r\nFomentar pensamiento crítico y de reflexión sobre el contenido expuesto al alumno, animándolo a cuestionar, analizar, aplicar e investigar sobre el contenido.\r\nExplicación de un ¿Podcast educativo?, su estructura y finalidad. En este apartado se explicará en que consiste un podcast, se describirá su estructura básica, el tiempo adecuado y rubrica de evaluación entre otras cosas. \r\nSe trabajará con grupo de trabajo y se realizaran las siguientes actividades:\r\n•	Análisis de contenido:\r\no	Identificación de contenido para realizar el podcast.\r\no	Definir los objetivos de aprendizaje del contenido.\r\no	Definir evaluación de contenido.\r\n•	Diseño:\r\no	Guion\r\no	Selección de software ( Audacity, Podcaster, vocaroo entre otros).\r\n•	Desarrollo:\r\no	Realización prueba de la grabación, grabación del podcasts y edición (de ser posible).\r\n•	Implementación:\r\no	Socialización del podcast en el taller.\r\no	Evaluación y discusión en el taller.\r\nEstas actividades permitirán a los participantes de crear un contenido en su catedra de clases, con objetivos de contenido y rubrica de evaluación; que permitirá que los estudiantes tengan una nueva forma de aprender. El docente actualizara sus habilidades de investigación, didáctica, pedagogía y pensamiento crítico a través de competencias digitales adaptadas a estilos de aprendizajes; Campos et al (2023) señalan que los docentes deben reflexionar sobre las nuevas preferencias hacia los estilos de aprendizajes de los estudiantes que permitan tener aprendizajes significativos esto en respuesta a los estudiantes llamados “nativos digitales”. Moreira (2023) considera que “las políticas de tecnología educativa han de ser escalables y replicables”, en sintonía con ambos autores los docentes debemos ir a la vanguardia de la tecnología educativa y poder evolucionar a través del tiempo y no seguir con modelos educativos desfasados.\r\nMateriales: computador portátil, teléfono celular, tener acceso a internet, softwares libres para editar audio como ser Audacity, Podcaster, vocaroo entre otros.\r\n','Campos Ortuño, R., Hernández-Serrano,  (2023). Los Recursos Educativos Abiertos adaptados a estilos de aprendizaje en la enseñanza de competencias digitales en educación superior. Moreira-Zamora, V. (2023). Los niños de era digital: estilos de aprendizaje y los retos de la participación. REVISTA REVICC, 3(4), 69–78. https://doi.org/10.59764/revicc.v3i4.35',NULL,NULL,16,3,1,933,'2024-01-28 22:29:45.000000',28),('ID-POSM004','La aplicación de la inteligencia artificial (IA)para potenciar el aprendizaje de las matemáticas','La Inteligencia Artificial (IA) ofrece múltiples beneficios en varios campos, incluyendo la educación. Por ello, este trabajo destaca el impacto de la IA en la enseñanza de la asignatura de Matemáticas II, por lo que el objetivo fue diseñar actividades de aprendizaje respaldadas por la IA que fomenten la autorreflexión y la metacognición en los estudiantes a través de una evaluación continua y oportuna. Es importante señalar que se utilizó un enfoque alternativo y metodologías activas que integraron aspectos disciplinares, pedagógicos y tecnológicos que se aplicó a una muestra por conveniencia a 26 estudiantes de primer año del turno vespertino en la Escuela Nacional Colegio de Ciencias y Humanidades, plantel Vallejo. Los resultados indican que la IA es un aliado valioso para personalizar el aprendizaje, adaptándolo a los estilos y tipos de aprendizaje individuales, ya que los jóvenes desarrollaron distintas habilidades matemáticas, que ayudaron en la resolución de problemas complejos y en una retroalimentación adaptativa, lo que promueve un aprendizaje sólido, significativo, motivador y centrado en el estudiante. En conclusión, esta propuesta aprovechó las ventajas y capacidades de la IA, no obstante, es crucial entender que no reemplaza la interacción humana y debe ser utilizada de manera informada y planificada.\\r\\n','Abeliuk, A., & Gutiérrez, C. (2021). Historia y evoluación de la inteligencia artificial. Revista Bits de Ciencia, (21), 14-21. Becerra, G. (2016). Los usos del constructivismo en las publicaciones científicas de Latinoamérica. Revista Mad, (35), 38-59. Biggs, J. (2006).  Calidad del aprendizaje universitario. España: Narcea.',NULL,NULL,16,2,2,621,'2023-12-14 00:38:56.000000',406),('ID-POSM005','REFLEXIONES DEL USO DE FRACTALES EN LA ENSEÑANZA DE LIMITES EN ESTUDIANTES NIVEL MEDIO SUPERIOR','LA PALABRA “FRACTAL” PROVIENE DEL LATÍN FRACTUS, QUE SIGNIFICA “FRAGMENTADO”, APROPIADO PARA OBJETOS CUYA DIMENSIÓN ES FRACCIONARIA. EL TÉRMINO FUE ACUÑADO POR BENOÎT MANDELBROT EN SU LIBRO THE FRACTAL GEOMETRY OF NATURE. UN FRACTAL ES UN CONJUNTO MATEMÁTICO QUE PUEDE GOZAR DE AUTOSIMILITUD A CUALQUIER ESCALA, SU DIMENSIÓN NO ES ENTERA O SI ES ENTERA NO ES UN ENTERO NORMAL. EL HECHO QUE GOCE DE AUTOSIMILITUD SIGNIFICA QUE EL OBJETO FRACTAL NO DEPENDE DEL OBSERVADOR PARA SER EN SÍ, ES DECIR, SI TOMAMOS ALGUNOS TIPOS DE FRACTALES PODEMOS COMPROBAR QUE AL HACER UN AUMENTO DOBLE EL DIBUJO ES EXACTAMENTE IGUAL AL INICIAL, SI HACEMOS UN AUMENTO 1000 COMPROBAREMOS LA MISMA CARACTERÍSTICA, ASÍ PUES, SI HACEMOS UN AUMENTO N, EL DIBUJO RESULTA IGUAL LUEGO LAS PARTES SE PARECEN AL TODO.POR OTRA PARTE, SE RETOMA LA TEORÍA DE SITUACIONES DIDÁCTICAS, QUE FUE DESARROLLADA POR EL MATEMÁTICO Y EDUCADOR FRANCÉS GUY BROUSSEAU, LA CUAL SE CENTRA EN DISEÑAR Y ANALIZAR SITUACIONES DE APRENDIZAJE ESPECÍFICAS PARA FAVORECER LA CONSTRUCCIÓN DEL CONOCIMIENTO. ALGUNOS PUNTOS CLAVE QUE SE CONSIDERARON SON LA IDENTIFICACIÓN DEL OBJETO DE CONOCIMIENTO, ES DECIR ANTES DE DISEÑAR LA SITUACIÓN DIDÁCTICA, ES CRUCIAL IDENTIFICAR EL OBJETO DE CONOCIMIENTO QUE SE VA A ENSEÑAR, ESTO SE REFIERE AL CONTENIDO ESPECÍFICO QUE SE QUIERE QUE LOS ESTUDIANTES APRENDAN, DURANTE EL DISEÑO DE LA SITUACIÓN DIDÁCTICA SE IDENTIFICA EL ESCENARIO DE APRENDIZAJE DISEÑADO PARA PRESENTAR EL OBJETO DE CONOCIMIENTO DE MANERA ATRACTIVA Y COMPRENSIBLE,  EN ESTE CASO TEORÍA DE LÍMITES MATEMÁTICOS. PUEDE INCLUIR PROBLEMAS, ACTIVIDADES, RECURSOS Y DESAFÍOS RELACIONADOS CON EL TEMA.  AL TRABAJAR CON FRACTALES Y LIMITES TENDREMOS UNA SERIE DE REFLEXIONES QUE CONTAR COMO EXPERIENCIA EDUCATIVA.','SADOVSKY, P. (2005). LA TEORÍA DE SITUACIONES DIDÁCTICAS: UN MARCO PARA PENSAR Y ACTUAR LA ENSEÑANZA DE LA MATEMÁTICA. REFLEXIONES TEÓRICAS PARA LA EDUCACIÓN MATEMÁTICA, 5, 13-66. VALDÉS VÁSQUEZ, P. A. (2016). INTRODUCCIÓN A LA GEOMETRÍA FRACTAL.',NULL,NULL,16,2,2,16,'2023-12-19 09:15:04.000000',362),('ID-POSM013','EL IMPACTO DE LA INTELIGENCIA ARTIFICIAL EN EL APRENDIZAJE DE ALUMNOS DE BACHILLERATO','El presente trabajo muestra las opiniones de un grupo de estudiantes de la Escuela Nacional Preparatoria de la UNAM, sobre el uso de diferentes inteligencias artificiales, cuando se pidió como actividad que buscaran los principales indicadores financieros en México, situado en  el tema de indicadores financieros que se imparte en la asignatura de Matemáticas VI, área III.\r\nLos resultados sorprendieron a las investigadoras, porque aunque algunos alumnos ya utilizaban la IA para hacer sus tareas, la gran mayoría no las había usado, varios de ellos sólo conocían Chat GPT y algunos alumnos no estuvieron dispuestos a seguirlo usando, por pensar que no era correcto y eso los haría dependientes.\r\nTambién se les pidió una reflexión sobre el uso de las IA en la escuela y muchos coincidieron que aunque es de gran ayuda, ellos mismos están conscientes de que debe ser utilizada con cuidado, con responsabilidad y que no necesariamente los resultados que arroja la IA son válidos o correctos.\r\n','International Baccalaureate®. (2019). La inteligencia artificial en el aprendizaje, la enseñanza y la evaluación1, 3.	Universidad del Valle de México. (2019). Inteligencia artificial en la educación: retos usos y aplicaciones',NULL,NULL,16,2,2,433,'2024-01-10 19:51:08.000000',686),('ID-POSM016',' APRENDIZAJE INVERTIDO PARA CÁLCULO DIFERENCIAL: UNA EXPERIENCIA DIDÁCTICA.','En en proceso de enseñanza y aprendizaje tradicional centrado en el profesor, ha dado un giro en el que el alumno ahora debe ser un participante activo en su formación profesional, obligando a implementar nuevas metodologías didácticas, como es el caso del Aprendizaje Invertido a la asignatura de Cálculo Diferencial para alumnos de la carrera de Ingeniería Logística del Tecnológico de Estudios Superiores de Jilotepec. Antes de iniciar el curso, se aplicó un cuestionario de estilo de aprendizaje, lo que facilitó diseñar las actividades a los largo del curso, las que fueron apoyadas con uso de Internet, herramientas digitales y software matemático. El trabajo individual y por equipo fueron importantes para la realimentación entre los alumnos de los conceptos vistos en cada unidad y en la resolución de ejercicios y problemas de aplicación de la derivada, lo cual permitió a los estudiantes ubicar a la asignatura en su formación profesional. Es importante considerar que los conceptos no se aprenden, se construyen siendo el alumno el que adquiere el rol protagónico mientras que el profesor es su guía a lo largo del curso, Finalmente la flexibilidad del Aprendizaje Invertido permite utilizar diversas estrategias de evaluación enfocadas en el aprendizaje significativo.','Zuñiga , César (2021) Aprendizaje Invertido; Centro de Enseñanza y Aprendizaje en Tecnología Educativa, Universidad Rafael Landívar.',NULL,NULL,16,2,2,669,'2024-01-12 12:57:13.000000',353),('ID-POSM021','IMPACTO DE LA EVALUACIÓN FORMATIVA EN ESTUDIANTES','Considerando que la evaluación formativa enfatiza el proceso de retroalimentación del aprendizaje, como un medio que proporciona información para modificar interacciones entre docentes, tecnología y estudiantes, mediante actividades de enseñanza y aprendizaje, un tema que aún no ha sido explorado con suficiente profundidad, se encuentra en saber cómo estudiantes de licenciatura utilizan pruebas (tests) formativas en línea y sus impactos en el aprendizaje. El objetivo se orienta al impacto, esto es, generar una estructura que permita clasificar y analizar cómo se aprovecha este tipo de recursos en clase y fuera de ella, y cómo esto se relaciona con estrategias de aprendizaje. Esta intención se encuentra en el entorno de un proyecto de innovación y mejora a la educación para la asignatura de Álgebra Lineal. Se emplea como marco teórico, la autorregulación del aprendizaje. Los autores generaron el diseño de la estructura que, posteriormente, fue validado por tres especialistas. En una etapa piloto, participaron 16 estudiantes que realizaron tests de temas de Álgebra Lineal según su programa de estudio. Los resultados muestran que los alumnos emplean los tests formativos para una variedad de propósitos, incluyendo la planificación de su aprendizaje y la profundización de su comprensión del contenido del curso. A partir de los resultados, se sugieren recomendaciones en cómo diseñar tests, y en proporcionar una adecuada retroalimentación.\\\\r\\\\n','Hattie, J. A. C., and Gan, M. (2011). “Instruction Based on Feedback,” in Handbook of Research on Learning and Instruction. Editors R. Mayer and P. Alexander New York: Routledge), 249–271.',NULL,NULL,16,2,2,587,'2024-01-19 08:23:24.000000',100),('ID-POSM030','CHATBOT CONVERSACIONAL PARA EVALUACIÓN FORMATIVA EN LA ASIGNATURA DE ANÁLISIS NUMÉRICO','La palabra chatbot surge de las raíces chat, que significa conversar, y bot (contracción de robot) que engloba una serie de algoritmos capaces de ejecutar acciones. En concreto, un chatbot es una aplicación de software que simula mantener una conversación con un usuario. Aunque el uso de los chatbots se ha popularizado en ambientes comerciales, sus potenciales incursiones en el ámbito educativo aún están siendo ampliamente estudiadas. Según su función (en entornos académicos), los chatbots se clasifican en dos: con y sin intencionalidad educativa. La finalidad de los chatbots sin intencionalidad educativa es responder preguntas frecuentes en procesos administrativos. Dentro de la rama de chatbots con fines educacionales se encuentran dos: aquellos con funciones de tutoría y los que fortalecen la ejercitación y práctica en adquisición de destrezas y competencias. El chatbot descrito en este proyecto pertenece a esta última sub-categoría ya que provee y evalúa problemas de Análisis Numérico personalizados de forma inmediata las 24 horas los 7 días de la semana. Al estar alojado en la aplicación de mensajería instantánea Telegram el chatbot disminuye obstáculos en el acceso a contenidos y se adapta a los diferentes estilos y horarios de estudio. Al estar dotado con potencialidades de evaluación, se espera que el chatbot constituya un recurso alternativo en el proceso de evaluación formativa del estudiantado. Además, al estar basado en microactividades, se espera que mejore la retención de conceptos y que diversifique los recursos de evaluación con fines de ajuste aplicados de forma masiva y recurrente.','Wang, J., Hwang, G.,  Chang, C.(2021). Directions of the 100 most cited chatbot-related human behavior research: A review of academic  publications. Computers and Education: Artificial Intelligence, 2, 1–12. https://doi.org/10.1016/j.caeai.2021.100023, Shail, M. S. (2019). Using micro-learning on mobile applications to increase knowledge retention and work performance: A review of literature. Cureus, 11(8). https://doi.org/10.7759/cureus.5307',NULL,NULL,16,2,2,864,'2024-01-22 09:36:28.000000',406),('ID-POSM034','PROCESOS COGNITIVOS PROMOVIDOS EN LIBROS DE TEXTO DE SEGUNDO GRADO DE SECUNDARIA: FUNCIONES LINEALES','Se identifican los procesos cognitivos que se promueven en dos libros de matemáticas, autorizados por la SEP para segundo grado de secundaria en México, durante el ciclo escolar 2022-2023. Se analizan tareas asociadas con funciones lineales, porque esta idea permea todas las ramas matemáticas, desde nivel básico hasta el superior. Los libros de texto son la herramienta principal con la que cuentan los docentes para orientar el proceso de aprendizaje de los estudiantes y, por ello, influyen en la práctica de las aulas y sobre las características del conocimiento que los estudiantes construyen. Se analizan los contenidos de segundo grado ya que existen diversas deficiencias sobre el tema en estudiantes de tercer grado. El fundamento teórico del trabajo incluye la taxonomía de procesos cognitivos de Anderson el al. (2001) y el modelo de resolución de problemas. El marco también considera las diferentes perspectivas desde las cuales se puede analizar el contenido de un libro de texto (Stylianides, 2009). La metodología incluye un análisis cualitativo de contenido (Kuckartz y Rädiker, 2023) desde un punto de vista matemático. La unidad de análisis son las tareas. El análisis de la información incluyó un proceso de segmentación de las tareas, la identificación del contenido explícito y el subyacente. Las herramientas de análisis incluyeron el conteo, nubes de palabras y redes gráficas que muestran un “flujo” de procesos cognitivos. Entre los principales resultados se destaca que la mayor parte de las tareas son algorítmicas, e involucran los procesos cognitivos de recordar e implementar tanto definiciones como algoritmos. Solo en contados casos, las tareas proporcionan a los estudiantes oportunidades para comunicar resultados, expresar ideas o bien explicar la ruta que siguió para resolver el problema que se le plantea. Se detectó además una falta de uniformidad y consistencia en la terminología matemática.','Anderson, L. W., Krathwohl, D. R., Airasain, P. W., Cruikshank, K. A., Mayer, R. E., Pintrich, P. R., Raths, J. & Wittrock, M. C. (2001). A Taxonomy for Learning, Teaching, and Assessing A Revision of Bloom \'s Taxonomy of Educational Objectives. Pearson Education.',NULL,NULL,16,2,2,857,'2024-01-22 19:59:09.000000',415),('ID-POSM037','REVISIÓN BIBLIOGRÁFICA EN BASES DE DATOS CIENTÍFICAS COMPARANDO DATOS ESTADÍSTICOS','En este trabajo se hace la búsqueda de información en distintas plataformas de búsqueda de textos científicos para realizar y observar el volumen de información existente sobre un tema en específico que se desea plantear para la elaboración previa de la pregunta investigación abordada. Por tal motivo esta actividad pretende registrar la documentación obtenida de bases de datos de información científica y recursos digitales para la revisión de literatura que le permite al estudiante ir comprendiendo los elementos necesarios para realizar un reporte de investigación experimental. \r\nPara el desarrollo de esta actividad se emplearon diferentes tipos de bases de datos que contienen información científica y buscadores con recursos digitales tales como: Google, Google Académico, Science Direct, Mendeley y Microsoft Académico. Se utilizó una revisión sistemática de los recursos mencionados anteriormente como técnica exploratoria y analítica para realizar una revisión de la literatura, con el objetivo de hacer una comparación del número de textos encontrados en cada base de datos. La acción de revisar según el diccionario de la RAE es observar con atención y cuidado algo en específico o someter algo a un examen para corregirlo o repararlo.\r\nLa Búsqueda se puede realizar por concepto de lo que se quiere obtener de información o mediante el uso de palabras clave, como a continuación se muestrea en un ejemplo.\r\nEjemplo de Búsqueda:\r\n•	General: Photoacoustic signals\r\n•	Definida: Photoacoustic signal analysis\r\n•	Focalizada: Systemic design of a mathematical model for the analysis of photoacoustic signals\r\nSe hizo un ANOVA elaborada con el software STATGRAPHICS en dónde se muestran los valores obtenidos comparando las muestras de los buscadores por lo que con este análisis se busca observar si las medias de los buscadores tienen o no una diferencia estadísticamente significativa.','Real Academia Española. (2007). Disquisición. En Diccionario de la lengua española (22.a ed.). Recuperado de http://buscon.rae.es/draeI/SrvltConsulta?TIPO_BUS=3&LEMA=disquisici%F3n',NULL,NULL,16,2,2,893,'2024-01-23 14:19:01.000000',587),('ID-POSM039','ESTRATEGIAS QUE IMPLEMENTAN PROFESORES DE MATEMÁTICAS AL RESOLVER TAREAS CON MÚLTIPLES SOLUCIONES USANDO GEOGEBRA','En este trabajo se identifican y clasifican estrategias que emplean profesores de matemáticas, de secundaria y bachillerato, cuando abordan tareas con múltiples soluciones con GeoGebra. Particularmente, se identifica cómo GeoGebra apoya la utilización de ciertas estrategias, lo cual no ocurre en la mayoría de las investigaciones sobre tareas con múltiples soluciones basadas en ambientes de papel y lápiz (Guberman y Leikin, 2012; Levav-Waynberg et al., 2012). El sustento teórico de la investigación es el marco de resolución de problemas, específicamente las heurísticas propuestas por Polya (1985); así como el constructo de aprendizaje por descubrimiento (Ausubel, 1983). Los participantes en la investigación fueron ocho docentes inscritos en un posgrado en educación matemática de una universidad pública del estado de Hidalgo, seleccionados por conveniencia. Se diseñaron tres tareas con múltiples soluciones, las cuales se implementaron en ocho sesiones de dos horas cada una, durante el periodo escolar julio-diciembre 2023. En el problema base de la primera tarea se pide maximizar el área de un triángulo; en la segunda tarea los participantes deben encontrar la longitud de un segmento en una configuración geométrica y la tercera tarea es el Problema del Tesoro del Pirata (Ratliff, 2011). La primera y tercera tarea se abordan individualmente, mientras que para la segunda tarea los participantes trabajan en equipos. En todos los casos, se realizaron exposiciones plenarias, para comunicar las estrategias de solución. Las fuentes de recolección de la información fueron los reportes escritos de los participantes, y notas de campo de los investigadores. En todas las tareas se solicitó reportar, como mínimo, tres soluciones diferentes. Dadas las características de GeoGebra las principales estrategias que utilizaron los participantes fueron: el arrastre, trazado de mediatrices, así como medición de longitudes y ángulos. Además, se identificó una mejora en las habilidades de resolución de problemas de los participantes.','Ausubel, D. (1983). Psicología educativa: un punto de vista cognoscitivo (2da ed.). México: Trillas.',NULL,NULL,16,2,2,854,'2024-01-24 11:17:31.000000',706),('ID-POSM040','LA TRASCENDENCIA DE CONCEPTUALIZAR, CONTEXTUALIZAR Y APLICAR LOS APRENDIZAJES EN EL PENSAMIENTO MATEMÁTICO','El Pensamiento Matemático se incluye dentro del nuevo Marco Curricular Común de la Educación Media Superior (MCCEMS) de la Nueva Escuela Mexicana (NEM). Considerando el análisis que se ha realizado para determinar la problemática a nivel nacional, del cual no están exentos los estudiantes del CECYTEO plantel 25 San Pablo Huixtepec, Oaxaca, al no adquirir los aprendizajes situados y esperados en los estudiantes de la Educación Media Superior, como los siguientes: No se logran dominar los conocimientos básicos, hasta ahora se sigue en los procesos de conocimientos memorísticos en lugar de la solución de problemas específicos y otras competencias son fundamentales en el mundo moderno. Los aprendizajes se pueden considerar delimitados, insuficientes, desiguales e inadecuados, contenidos poco estimulantes e irrelevantes. En lo que concierne al aprendizaje y enseñanza de las matemáticas en el primer semestre de la Educación Media Superior, se plantea que se debe manejar estrategias que permitan la conceptualización de los conocimientos matemáticos, no únicamente algoritmos. Es necesario manejar por parte del docente la contextualización del aprendizaje, para que los contenidos que enmarcan las quince progresiones para el Pensamiento Matemático 1, no solo queden en carácter informativo, ya que actualmente predominan los modelos educativos con viejos hábitos. Para manejar la motivación e interés en los estudiantes, se deben establecer contenidos estimulantes y relevantes, que permitan que los aprendizajes adquiridos lo vinculen en su contexto, con situaciones sociales, económicas, políticas y culturales, que son demanda de nuestros tiempos actuales. Por tal razón, se maneja la propuesta de establecer en nuestra labor docente la relación intrínseca CONCEPTUALIZACIÓN DE TEMAS-CONTEXTUALIZACIÓN DE LA PRÁCTICA –APRENDIZAJES SITUADOS, involucrando siempre al estudiante en la construcción de su aprendizaje. Así como el diseño de estrategias para el trabajo multidisciplinario y la transversalidad.','AUSUBEL-NOVAK-HENESIAN. (1983). Psicología Educativa. Un punto de vista cognoscitivo. México: Ed. Trillas.',NULL,NULL,16,2,2,843,'2024-01-24 11:29:06.000000',433),('ID-POSM043','USO DE TUTORES AUTÓNOMOS EN PROBABILIDAD Y ESTADÍSTICA','En los últimos años la educación en México se ha enfrentado a varios retos desde el año 2020 con la declaración de COVID-19 (febrero 2020 primer caso confirmado) al paralizar la vida “normal” escolar, se incrementó el rezago educativo en todos los niveles. Según el Instituto Nacional de Estadística y Geografía (INEGI), 5.2 millones de niños, adolescentes y jóvenes entre los 3 y los 29 años, no se inscribieron al ciclo escolar 2020-2021 por motivos económicos y por causas de la COVID-19.  Actualmente, con la evolución e implementación de la tecnología el profesor debe enfrentarse a la inserción de nuevas herramientas educativas. Una de las más populares es el uso de los Chatbots de inteligencia artificial (IA) como tutores inteligentes, diseñados para fortalecer el aprendizaje dentro y fuera del aula. Por eso, el objetivo del trabajo es analizar el uso y alcances de los diversos programas de IA. De este objetivo se desprende la pregunta de investigación de qué manera es utilizado el Chatbots durante el proceso de enseñanza aprendizaje y cuáles son las estrategias utilizadas en la aplicación de ejercicios de clase. Una causa de temor de los profesores es el uso desmedido de dicha herramienta por parte del estudiante sin los conocimientos previos sobre el tema, además de aumentar la tasa de plagio al presentar como propio el contenido generado por la IA.','Fahimirad, M. and Kotamjani, S.S., 2018. A review on application of artificial intelligence in teaching and learning in educational contexts. International Journal of Learning and Development, 8(4), pp. 106-118.  Kaur, K. 2021. Role of artificial intelligence in education: Peninsula College Central Malaysia. International Journal of Academic Research in Progressive.',NULL,NULL,16,2,2,268,'2024-01-24 12:31:02.000000',69),('ID-POSM044','MATERIAL DIDÁCTICO DE APOYO PERSONALIZADO PARA EL DESARROLLO DE HABILIDADES EN INTEGRACIÓN DE FUNCIONES REALES','Algunos organismos internacionales como el Banco Mundial, la Organización para la Cooperación y el Desarrollo Económico y el Banco Interamericano de Desarrollo se han pronunciado sobre la necesidad de una reforma de la educación superior; ésta, tiene que responder a las demandas actuales de la sociedad, al acelerado desarrollo de las tecnológicas y a la sostenibilidad. La tendencia mundial se orienta a la adopción de tecnologías educativas para el desarrollo de la enseñanza, aprendizaje e investigación, definiéndose ésta como las herramientas y recursos que se utilizan para mejorar la enseñanza, el aprendizaje y la investigación creativa, e incluyen tanto herramientas y recursos desarrollados expresamente para el sector de la educación, como otras herramientas adaptadas de otros fines que potencialmente sean útiles para el aprendizaje. Es indudable que la adopción de tecnologías está cambiando el panorama de la educación, haciéndola más accesible y personalizada. El aprendizaje adaptativo permite atender a la diversidad de requerimientos de cada alumno, con actividades complementarias de acuerdo con el reforzamiento de saberes que se necesita, implementando así la personalización del aprendizaje, así como también su evaluación. Dentro de los desarrollos tecnológicos se encuentran los Sistemas de Tutoría Inteligente (STI) que utilizan tecnologías avanzadas para ofrecer instrucción personalizada y apoyo educativo; entre ellos, para el área matemática se encuentran Cognitive Tutor, ASSISTments, ALEKS y Newton. El presente trabajo, presenta un material didáctico desarrollado en Power Point, de uso personalizado y adaptativo, que emula un sistema de tutoría, para el perfeccionamiento de habilidades en integración de funciones reales, que aborda las diferentes técnicas de integración. La aplicación es portátil y aplicable tanto en salón de clase como extramuros. En la aplicación, cada estudiante o profesor puede seleccionar el grado de dificultad y tipo de integrales y recibir retroalimentación del proceso paso a paso.','René Pedroza. R. y Reyes, A. (2022). Perspectiva de la educación superior en México 2030. Interdisciplina 10, 27, 289-313. Johnson, L., Becker, S., Cummins, M., Estrada, V., Freeman, A., y Hall, C. (2016). Desarrollos importantes en la tecnología educativa para la educación superior. NMC Horizon Report: Edición Educación Superior. 1-56.',NULL,NULL,16,2,2,331,'2024-01-24 12:41:07.000000',362),('ID-POSM050','PENSAMIENTO CRÍTICO EN UNA SINERGIA DE INTELIGENCIA ARTIFICIAL Y ÁLGEBRA LINEAL EN INGENIERÍA','La formación científica del estudiante en Ingeniería se apoya en la comprensión de los conceptos y la resolución de problemas algebraicos y de ingeniería aplicada.\r\nActualmente las Tecnologías de la información y la Comunicación junto con la Inteligencia Artificial están haciendo sinergia de tal forma que con solo dar unas instrucciones se arrojan diversos trabajos escolares en minutos, casi perfectos, tal como los solicitó el profesor. Por lo que algunos estudiantes están tomando estas bondades que se les ofrece a través de Internet, sin embargo, tiene sus limitaciones como son que el estudiante muchas veces no lea y revise lo que entrega, ni siquiera vea las referencias del trabajo, si es confiable o no, o si se apega al objetivo de aprendizaje.\r\nPor lo que la educación 4.0 ante el desafío de la Inteligencia Artificial en la educación exige que los docentes estemos capacitados para afrontar y reconocer cuando los trabajos son entregados usando Inteligencia Artificial, además que dichos trabajos sean dirigidos con estrategias didácticas y comunicacionales adecuadas donde se promueva el pensamiento crítico y reflexivo y se le fomente al estudiante la lectura crítica.\r\nEn este trabajo se plasman las ideas de cómo el uso de las teorías críticas emancipa al estudiante a investigar, leer y dar sus puntos de vista de manera crítica, analítica y reflexiva y sobre todo a que haya un acercamiento entre seres humanos el cual se debe promover haciendo análisis, reflexión, crítica, entre otros. En este trabajo se da cuenta de los resultados obtenidos de los estudiantes que colaboraron y resolvieron un cuestionario, además, de ver el uso de estrategias de aprendizaje como es la elaboración de ensayos de la transferencia de conceptos de transformaciones lineales en la resolución de problemas de ingeniería y estrategias de trabajo colaborativo.\r\n','Harris, P., Romero, G., Harris, M.A. y Llanos, R.(2022).Análisis de las tendencias educativas con relación al desarrollo  de  las competencias  digitales. RiiTE Revista  Interuniversitaria  de  Investigación  en  Tecnología Educativa, 12, 158-174. https://doi.org/10.6018/riite.520771',NULL,NULL,16,2,2,685,'2024-01-24 19:35:23.000000',587),('ID-POSM071','PROPUESTA PARA UTILIZAR EL GEOPLANO EN LA ENSEÑANZA Y DISEÑO DE ACTIVIDADES DIDÁCTICAS EN MATEMÁTICAS','La propuesta de utilizar el Geoplano inició hace un par de años con la inquietud de realizar la representación geométrica de algunas transformaciones lineales en la asignatura de álgebra lineal para estudiantes de ingeniería. Sin embargo, al ir diseñando otras actividades nos dimos cuenta que podríamos incorporar una cantidad considerable de conceptos matemáticos y lo más importante es que puede aplicarse en varios niveles educativos. El objetivo de nuestra propuesta es utilizar el Geoplano para estudiar conceptos como: figuras geométricas, vectores, área, perímetro, distancia entre puntos, proyección, rotación, traslación, etc. Los fundamentos teóricos que se incluyen en los diseños dependen del nivel educativo de aplicación. En este trabajo reportamos algunas experiencias y regularidades obtenidas de un taller en el que se puso en escena de manera sistemática su uso para el análisis de diversos conceptos porque participaron estudiantes de distintas edades de manera simultánea. Algunos estudios lo definen como una herramienta pedagógica que se utiliza en la enseñanza de las matemáticas y consta de una superficie cuadrada con clavos que se colocan con la misma separación. Para alcanzar a resolver las actividades propuestas los estudiantes utilizan ligas elásticas para crear figuras geométricas y explorar los conceptos matemáticos involucrados. Otras exploraciones en el aula de clase incluyen el uso del Geoplano con el apoyo de software libre ya que permite verificar los resultados realizados en físico y los alcanzados con lápiz y papel. Además, se ha trabajado en conjunto con otras áreas de estudio como es el diseño gráfico en donde estamos incorporando la categoría del juego y su importancia. También, se puede utilizar en una variedad de disciplinas, incluyendo geometría, álgebra y estadística. Esto fomenta un enfoque interdisciplinario en la enseñanza de las matemáticas Los resultados incluyen imágenes que dan cuenta de la participación de estudiantes en diferentes niveles educativos.','García, M. A. (1997). El Geoplano. La manera más agradable de enseñar y aprender matemáticas. Editorial Trillas.',NULL,NULL,16,2,2,931,'2024-01-27 18:34:32.000000',516),('ID-POSM076','EL USO DE LA MODELACIÓN MATEMÁTICA EN EL AULA PARA EL ESTUDIO DE FUNCIONES POLINOMIALES','Es reconocido el papel que ha desempeñado la modelación matemática para el surgimiento, desarrollo y formalización de conceptos matemáticos y de otras áreas, sin embargo, su incorporación como un recurso para la enseñanza es reciente. La importancia de la modelación de fenómenos reales es que permite al alumno: a) Identificar las variables y su dependencia, b) Determinar el dominio y tipo de variable, c) Recolectar datos y analizar su confiabilidad, d) Buscar la expresión matemática que mejor relacione los mismos, considerando principios matemáticos,  modelos preestablecidos, leyes y operaciones entre otros, e) Formular el modelo matemático, a través de la expresión analítica del fenómeno estudiado, f) Validar el fenómeno comparando los datos obtenidos con los datos de la predicción, g) Aplicar el modelo una vez validado y verificar su pertinencia (Rondón, 2013). En esta ponencia presentamos una experiencia sobre  el uso de la modelación matemática con estudiantes de educación media superior, en la enseñanza de funciones polinomiales, donde se buscaba estudiar a las funciones como modelos que permiten el estudio de fenómenos sociales y físicos.\r\n\r\nPalabras clave: Modelación matemática, funciones polinomiales, enseñanza. \r\n\r\n\r\n','Cervantes, L. (2015). Modelización Matemática, principios y aplicaciones. México: textos científicos; Rondón, J. E. (2013). Una introducción al modelamiento de fenómenos físicos a través de funciones. Bogotá: Universidad Nacional de Colombia; Saleett, M. & Hein, N. (2004). Modelación matemática y los desafios para enseñar matemática. Educación Matemática, Vol.16, 105- 125',NULL,NULL,16,2,2,890,'2024-01-28 14:36:16.000000',831),('ID-POSM077','ESTUDIO DE LA APROXIMACIÓN POR MÍNIMOS CUADRADOS PARA EL CÁLCULO DEL ÁREA DE RECTÁNGULOS','El tópico de la aproximación por mínimos cuadrados es un tema abordado a nivel superior en distintas áreas de las matemáticas, tales como el Análisis Matemático (Burden y Faires, 2011) y en el tema de regresión lineal en Probabilidad y Estadística (Walpole, Myers, Myers y Ye, 2012). Comúnmente, sólo se estudia dicha aproximación relacionando una variable dependiente con sólo una independiente; el problema abordado en este estudio relaciona dos variables independientes (largo y ancho de los rectángulos) con una variable dependiente (área de los rectángulos). El objetivo de este estudio es obtener la aproximación por mínimos cuadrados para el cálculo del área de rectángulos con tres técnicas distintas (una de ellas a través de una función de Matlab) mostrando que las tres técnicas son equivalentes, estimar el error de aproximación y determinar si a partir de los datos obtenidos se puede deducir algo sobre la naturaleza del problema aproximado. Se hace uso de Matlab para realizar los cálculos de las técnicas antes mencionadas y sus respectivas gráficas, haciendo transitar el tópico estudiado entre distintos registros de representación, en distintos dominios. Una vez obtenidos los parámetros de la aproximación, se estudia si se pueden encontrar relaciones de éstos con los datos originales y, si se encuentran, determinar si dichas relaciones se pueden aplicar a otros problemas.','Burden, R. L. y Faires, J. D. (2011). Análisis numérico (9na ed.). México: Cengage Learning. Walpole, R. E., Myers, R. H., Myers, S. L. y Ye, K. (2012). Probabilidad y estadística para ingeniería y ciencias (9na ed.). México: Pearson Educación.',NULL,NULL,16,2,2,350,'2024-01-28 16:04:55.000000',325),('ID-POSM090','USO DE LAS MATEMATICAS EN EL DISEÑO Y DESARROLLO DE LAS APLICACIONES WEB.','Las matemáticas juegan un papel fundamental en la vida cotidiana, asimismo es importante resaltar la utilización de las mismas en la creación de la estructura de un sitio web, diseñar la interfaz, optimizar el contenido y calcular el tiempo de uso para llevar a cabo una tarea especifica, son algunas de las actividades que podemos realizar. El diseño y desarrollo de aplicaciones web está basado en las matemáticas y su exactitud, ya que a través del uso de dimensiones en las páginas web, estas pueden adaptarse a cualquier plataforma, se utilizan figuras geométricas para dar un enfoque más práctico y organizar el contenido a través de diferentes elementos, por lo que podemos entender que la geometría se usa para crear diseños visuales, el álgebra para calcular los espacios, la estadística para determinar los patrones de uso y la lógica para comprender los flujos de trabajo. Cuando mencionamos el desarrollo web, sabemos que vamos a utilizar lenguajes de marcado y programación, así como framework o un método para una función, un algoritmo para entender el proceso que se lleva a cabo en la elaboración de aplicaciones o desarrollo de sistemas, por lo que se deben tener habilidades para dividir los problemas en partes más pequeñas y resolverlos a partir de la lógica.','Berenguel, J.(2015).Desarrollo de aplicaciones web en el entorno servidor. España: Paraninfo',NULL,NULL,16,2,2,686,'2024-01-29 21:33:50.000000',350),('ID-TASM002','OPERACIONES CON MATRICES Y CÁLCULOS FINANCIEROS CON EXCEL ','Realizar operaciones a base de lápiz y papel en estos tiempos resulta bastante tedioso, sin embargo utilizando la herramienta de Excel que forma parte del software de toda computadora resulta rápido y directo. Las funciones matriciales y financieras nos permiten comprobar y realizar cálculos cuya demostración y aplicaciones interesan a algunos estudiosos de ingeniería y científicos liberándolos de cálculos engorrosos y a medida de su práctica proporcionan seguridad en los resultados. \r\nObjetivo: Inducir al asistente a adquirir habilidad realizar operaciones con matrices aplicando funciones matemáticas propias de Excel e interpretación de resultados.\r\n','Mayer, R. (2020). Análisis Financieros con Microsoft Excel. México: Cengace Lerarnihg quinta edición.  Oaxaca, J, & Sánchez, J. (2020). Matemáticas Aplicadas a los Negocios con Excel Financiero. México: Comité Editorial FES-C Cuarta edición decima segunda reimpresión.',NULL,NULL,16,3,2,382,'2024-01-24 13:01:30.000000',28),('ID-TASM003','ANÁLISIS Y CONSTRUCCIÓN DE MODELOS POLINÓMICOS DE FUNCIONES DEFINIDAS A PARTIR DE CONJUNTOS DE VALORES','Descripción:\r\nEn medio de las continuas transformaciones, no basta tener conocimiento específico sobre un asunto y ejercer su mera transmisión. Es fundamental, cada día, obtener nuevos conocimientos y habilidades en la aplicación y socialización de ellos. Y, con ese pretexto, la modelación matemática viene siendo muy defendida como método de enseñanza, ya que no sólo permite aplicar conocimientos a otras áreas, sino que contribuye a mejorar la capacidad para leer, interpretar, formular y solucionar problemas (Salett & Hein, 2004).\r\nUn modelo matemático de un fenómeno o situación problema es un conjunto de símbolos y relaciones matemáticas que representa, de alguna manera, el fenómeno en cuestión. […] En la práctica, ese conjunto de símbolos y relaciones puede estar vinculado a cualquier rama de las matemáticas, en particular, a los instrumentos fundamentales de las aplicaciones matemáticas (Salett & Hein, 2004, p. 106). \r\nPor otra parte, la teoría de los Registros de Representación Semiótica (TRRS) de Duval, nos da la fundamentación teórica para el análisis de  las  representaciones semióticas usadas en la realización de tareas matemáticas, sus transformaciones y conversiones, su papel en la interiorización, comunicación, construcción y comprensión de la matemática (Duval, 2004).\r\nObjetivo:\r\nAnalizar y discutir las conjeturas planteadas al encontrar el modelo general de un conjunto de valores y utilizar distintos registros de representación para los modelos encontrados.\r\nActividades\r\nPRIMER DÍA\r\na).- Primer etapa.\r\nResolver una serie de problemas para poner en uso diversas estrategias de solución para la obtención de un modelo general que describa el conjunto de valores proporcionado.\r\nb).- Segunda etapa.\r\nReflexionar y discutir en colectivo la relevancia del tránsito entre distintos registros de representación incorporando el uso de recursos tecnológicos. \r\nSEGUNDO DÍA\r\nAnalizar propuestas de solución elaboradas por los participantes para retroalimentar las dos etapas propuestas en el primer día y nutrir sus resoluciones.\r\nRealizar una síntesis de los resultados alcanzados durante el desarrollo del taller.\r\n','Duval, R. (2004). Semiosis y pensamiento humano. Registros semióticos y aprendizajes intelectuales. Colombia: Grupo de Educación Matemática; Saleett, M. & Hein, N. (2004). Modelación matemática y los desafios para enseñar matemática. Educación Matemática, Vol. 16, Núm. 2, 105- 125.',NULL,NULL,16,3,2,890,'2024-01-24 15:22:10.000000',28),('IP-POSM007','APLICACIÓN DE SERIES DE TIEMPO EN LA REALIZACIÓN DE PRONÓSTICOS UTILIZANDO RSTUDIO','Durante el año 2023, el colegio de profesores de la academia de Estadística Aplicada, dirigió sus trabajos de investigación académica hacia la elaboración de una propuesta de aplicación de una serie de tiempo para la elaboración de pronósticos a corto plazo, utilizando metodología de suavizamiento exponencial simple con Rstudio, dirigida a los estudiantes que cursan la unidad de aprendizaje de Estadística Aplicada del programa académico de Ingeniería en Transporte, que se imparte en la UPIICSA del IPN\r\nEl objetivo general es pronosticar para el 2023, el número de accidentes de tránsito terrestre en zonas urbanas y suburbanas en la alcaldía Iztacalco, a partir de una muestra compuesta por los datos históricos proporcionados por el Instituto Nacional de Estadística y Geografía (INEGI) desde 1997 hasta 2022\r\nEste articulo describe los pasos que los profesores realizaron para el diseño y desarrollo de la propuesta metodológica. Como primer punto se incluye una revisión teórica documental sobre Series de Tiempo, métodos cuantitativos para hacer pronósticos, así como las principales métricas para determinar su precisión. A continuación, para realizar el análisis estadístico y gráficos de la serie de tiempo, se propone trabajar los datos con Rstudio \r\n(entorno de desarrollo integrado) ya que es una herramienta que simplifica notablemente el manejo y la programación con el lenguaje R. Finalmente se presentan resultados, conclusiones y sugerencias para futuras líneas de investigación de interés. \r\nLa motivación y el interés de los estudiantes aumenta, cuando identifican las grandes ventajas que ofrece el uso de lenguaje de programación R con respecto al cálculo manual de los pronósticos, principalmente en la reducción del tiempo de análisis, aumentar su precisión, la obtención de gráficos de manera inmediata y con excelente calidad.\r\nPalabras clave. Pronósticos, Series de tiempo, Ingeniería en transporte, programación\r\n\r\n','CADENA LOZANO, J. B. Gestión del Pronóstico Estratégico: una herramienta de planificación en las empresas. 1. ed. Bogotá: Colegio de Estudios Superiores de Administración - CESA, 2016. 336 p.  Ortuzar, J ( 2012).  Modelos de Demanda de Transporte. Ediciones Universidad Catolica de Chile.',NULL,NULL,16,2,3,51,'2024-01-08 21:53:22.000000',603),('IP-POSM009','RELACIÓN DE LAS TAREAS DE ENSEÑANZA CON LAS ACTITUDES DE LOS ESTUDIANTES HACIA LAS MATEMÁTICAS','Relación de las Tareas de Enseñanza con las Actitudes de los Estudiantes hacia las Matemáticas\r\nCategoría: Investigación del proceso de enseñanza de las matemáticas.\r\nResumen\r\nLa investigación nace de la problemática de las actitudes hacia las matemáticas en el CECyTE 01 Tlaxcala y trata de conocer las actitudes de los estudiantes hacia “la evaluación de expresiones algébricas” que generan las tareas de enseñanza con enfoque constructivista, en comparación con las tareas de enseñanza con enfoque tradicionalista.\r\nExisten extensos estudios sobre la relación entre género, etnia, ramas de estudios universitarios, grados, uso de tecnología, desempeño, entre otras, con las actitudes hacia las matemáticas. Sin embargo, no se encontró investigación empírica que analice la relación de las tareas de enseñanza con las actitudes de los estudiantes hacia las matemáticas.\r\nLa metodología se ubica en un paradigma cuantitativo de tipo descriptivo y un diseño cuasiexperimental. En efecto, la muestra se conformó por 60 estudiantes de bachillerato de primer semestre del CECyTE 01.\r\nLas actitudes se midieron a través de una adaptación de la escala Actitudes hacia la estadística de Auzmendi (1992). Se realizaron varios análisis, entre ellos, análisis de consistencia interna del instrumento de medición de actitudes, pruebas de normalidad de muestras independientes, análisis de estadística descriptiva de las actitudes, pruebas para evaluar la significancia de las diferencias entre las actitudes de los dos grupos de estudio y análisis de correlación lineal de factores actitudinales.\r\nEl estudio permite afirmar que la actitud global de los estudiantes hacia “la evaluación de expresiones algebraicas” generadas con tareas de enseñanza constructivistas, es mayor y estadísticamente significativa que la actitud generada con tareas de enseñanza tradicionalista. Asimismo, los resultados permiten aseverar que las tareas de enseñanza constructivistas tienen mayor influencia positiva en la correlación de los factores actitudinales de Utilidad-Agrado y Motivación-Confianza, que las tareas de enseñanza tradicionalistas.\r\nRolando Castillo Filomeno','Auzmendi, Elena. (1992). Las actitudes hacia la Matemática-Estadística en las enseñanzas medias y universitarias. Características y medición. [Archivo PDF]. https://www.researchgate.net/publication/316665759_Las_actitudes_hacia_la_Matematica-Estadistica_en_las_ensenanzas_medias_y_universitarias_Caracteristicas_y_medicion/citation/download',NULL,NULL,16,2,3,825,'2024-01-09 12:41:36.000000',108),('IP-POSM014','DISEÑO DE UN RECURSO DIGITAL PARA ENSEÑAR CÁLCULO A PARTIR DE LAS PERCEPCIONES DEL ESTUDIANTADO','Se presenta un avance de investigación en donde a través de un diagnóstico de intervención se reconocen las emociones, percepciones y necesidades de estudiantes de nivel bachillerato y cómo estas inciden en el aprendizaje de las matemáticas. Se busca que, a partir de las dimensiones identificadas en la investigación, se logre construir un recurso digital, específicamente un Recurso Educativo Abierto (REA) que ayude al estudiantado a apreciar el aprendizaje de las matemáticas por medio de actividades que surjan de sus intereses, incluyendo en su elaboración y diseño recursos tecnológicos, modelación matemática y la metodología STEAM como elementos medulares para el aprendizaje de las matemáticas, particularmente en la asignatura de Cálculo diferencial.','García-Mejía, R. O., & García-Vera, E. (2020). Metodología STEAM y su uso en Matemáticas para estudiantes de bachillerato en tiempo de pandemia Covid-19. Dominio de Las Ciencias, 6(2), 163–180. https://doi.org/10.23857/dc.v6i3.1212 Gómez Chacón, I. (2002). Matemática emocional. Los afectos en el aprendizaje matemático. Moriña, A. (2016). Investigar con historias de vida.',NULL,NULL,16,2,3,839,'2024-01-11 21:10:25.000000',289),('IP-POSM018','EL PENSAMIENTO VARIACIONAL DEL DOCENTE Y SU INFLUENCIA EN EL PROCESO DE EVALUACIÓN DEL DESEMPEÑO','La evaluación como herramienta de la mejora continua requiere la habilidad de identificar las variables del proceso de enseñanza-aprendizaje y su interrelación. Las estrategias para la identificación de variables y su análisis pertenecen al campo de las matemáticas y son ampliamente utilizadas en los modelos de gestión de calidad. Por otra parte, considerando la Teoría Socioepistemológica, Cantoral, (2016), se establece una filiación entre el conocimiento matemático y las prácticas humanas, esta investigación considera el proceso de evaluación una práctica relevante en la docencia. \r\nEl estudio da respuesta a la interrogante: ¿Qué relación tiene el desarrollo del pensamiento variacional del docente en la implementación del proceso de evaluación del desempeño en el aula bajo el Modelo de Aprendizaje Basado en Competencias? A través de una metodología positivista, de alcance correlacional, de tipo cuantitativo y un diseño no experimental y transversal, se analizó la relación entre la manifestación del pensamiento variacional de los docentes y el proceso de evaluación del desempeño. Como estrategia de cambio se propone un Modelo Sistémico de Evaluación. Las evidencias obtenidas demuestran que los docentes con perfil profesional en el área de matemáticas comprenden mejor el proceso de evaluación de desempeño dentro del aula como los procesos de evaluación laboral. Adicionalmente, la estrategia implementada permitió a los docentes participantes mejorar la comprensión del proceso de evaluación.\r\nCon los resultados se confirma la poca efectividad de la capacitación docente específicamente en los procesos de evaluación del aprendizaje, (INEE, 2017 y 2018), se recomienda desarrollar destrezas complejas propias del pensamiento matemático para para mejorar los procesos de evaluación con base en evidencias. La presente investigación se une a la propuesta de Pastore y Andrade, (2019), para fortalecer en la identidad de los profesores el ser evaluadores del aprendizaje profesionales y éticos.','Cantoral, R. (2016). Teoría Socioepistemológica de la Matemática Educativa. Estudios sobre la construcción social del conocimiento. Gedisa. INEE (2017). La educación obligatoria en México. INEE. Pastore, S. & Andrade, H. (2019). Teacher assessment literacy: A three-dimensional model. Teaching and Teacher Education. 84. 10.1016/j.tate.2019.05.003. Disponible en https://www.researchgate.net/publication/333856284_Teacher_assessment_literacy_A_three-dimensional_model',NULL,NULL,16,2,5,684,'2024-01-15 10:38:37.000000',350),('IP-POSM025','REFLEXIÓN Y CONTINGENCIA: DINAMIZANDO EL CONOCIMIENTO EN LA ENSEÑANZA DE LA FUNCIÓN CUADRÁTICA ','Este estudio examina la interacción entre la contingencia y la reflexión en la práctica docente y cómo estas dinámicas contribuyen al conocimiento del profesor de matemáticas. A través del análisis detallado de videograbaciones de las clases de dos profesores del CCH Azcapotzalco enseñando la función cuadrática, se destaca que las situaciones de contingencia —eventos imprevistos en el aula— son fundamentales para la enseñanza efectiva de las matemáticas, ofreciendo oportunidades singulares para el aprendizaje y la adaptación docente. \r\n\r\nEl artículo subraya la importancia de la reflexión en dos momentos esenciales: durante la acción y después de ella definidos en Schön (1983). Se demuestra que la reflexión durante la acción permite a los docentes adaptarse en tiempo real a las contingencias del aula, mientras que la reflexión después de la acción fomenta un análisis profundo de la práctica docente, llevando a una mejora continua y una planificación más efectiva. \r\n\r\nLos hallazgos resaltan que enfrentar y reflexionar sobre las contingencias enriquece el conocimiento del profesor, especialmente en las dimensiones de Fundamentación y Conexión componentes del Cuarteto del Conocimiento (KQ) de Rowland et. al. (2005). Este proceso no solo mejora la comprensión y la adaptabilidad a las necesidades del estudiante, sino que también fortalece la práctica docente en general. ','Schön, D. A. (1983). The reflective practitioner: How profesionals think in action. Basic Books.   Rowland, T., Huckstep, P., & Thwaites, A. (2005). Elementary Teachers’ Mathematics Subject Knowledge: The Knowledge Quartet and the Case of Naomi. Journal of Mathematics Teacher Education, 8(3), 255–281. https://doi.org/10.1007/s10857-005-0853-5 ',NULL,NULL,16,2,3,567,'2024-01-20 18:01:48.000000',404),('IP-POSM029','OMISIONES Y ERRORES DE ESTUDIANTES DE BACHILLERATO CUANDO CONSTRUYEN HISTROGRAMAS','Se presenta un estudio de caso sobre una exploración de omisiones y errores que los estudiantes de quinto semestre de bachillerato (17-18 años) cometen cuando construyen histogramas. Este tipo de gráficos, en general todos, son importantes porque a través de ellos se presenta la información resumida y se pueden observar tendencias descritas por los datos. Se solicitó a los estudiantes que construyeran el histograma (con sus respectivos procedimientos en tablas de frecuencias) a partir de un conjunto de datos dados, se observó que omiten uno o varios elementos que componen a un gráfico tales como el título, las etiquetas de los ejes y comenten errores como escribir mal las escalas en los ejes. Esto indica que se debe poner más énfasis en la enseñanza de la construcción de gráficos, en particular de histogramas, para que se pueda hacer una correcta interpretación de ellos, lo que permitiría una mirada crítica sobre los datos que se nos presentan en los diversos medios de comunicación, informes laborales o escolares.','Álvarez, I., Guerrero, Y. & Torres, Y. (2020). Taxonomía de errores y dificultades en la construcción e interpretación de tablas de frecuencias. Zetetiké, 28. 1-22. DOI: 10.20396/zet.v28i0.8656553',NULL,NULL,16,2,3,700,'2024-01-21 23:14:16.000000',325),('IP-POSM032','DIFICULTADES DE COMPRENSIÓN DE LA SUMA DE FRACCIONES EN ALUMNOS DE BACHILLERATO','Se identifican las dificultades de comprensión de la suma de fracciones en alumnos de un bachillerato público, ubicado en una zona semiurbana del estado de Hidalgo, México. La revisión de la literatura permitió identificar que la mayoría de las investigaciones se han realizado con estudiantes de primaria, por lo que hace falta analizar las dificultades que persisten en estudiantes de bachillerato. Las principales dificultades identificadas son que los estudiantes transfieren, de manera incorrecta, las propiedades de las operaciones con números enteros a las fracciones, lo que es evidencia de una conceptualización errónea o incompleta de la fracción (Lamon, 2020). El referente teórico del estudio son las diferentes interpretaciones de una fracción propuestas por Lamon (2020) y Lesh (1976). Se eligieron y adaptaron nueve problemas verbales que involucran suma de fracciones, retomados de artículos de investigación y de páginas de internet. Los problemas incluyeron fracciones propias, impropias y mixtas. Los participantes de la investigación fueron 10 estudiantes voluntarios (cinco hombres y cinco mujeres) de tercer semestre de bachillerato, quienes resolvieron los problemas en una sesión de una hora, durante el semestre julio-diciembre 2023, y a quienes se les otorgó un punto extra por su participación. Las fuentes de recolección de la información fueron las producciones escritas de los participantes, a partir de las cuales se identificaron los errores que cometieron al sumar fracciones. También se trató de establecer cuáles son las fuentes de tales errores, para de ahí deducir las posibles dificultades de comprensión. Entre los principales resultados se destaca que los errores más comunes que cometen los participantes, al sumar fracciones son, la adición de los denominadores en sumas con diferente denominador, así como el uso parcial del algoritmo estándar en combinación con otros procedimientos, lo cual es indicador de una falta de comprensión de la fracción como un número.\r\n','Lamon, S. J. (2020). Teaching fractions and ratios for understanding. (4a. ed.). Routledge Taylor & Francis Group. Valdemoros, M. & Ruiz, E. (2008). El caso de Lucina para el estudio de las fracciones en la escuela de adultos. Revista Latinoamericana de Investigación en Matemática Educativa, 11(1), 127-156.',NULL,NULL,16,2,3,851,'2024-01-22 16:41:38.000000',415),('IP-POSM035','LA ALFABETIZACIÓN MATEMÁTICA DE LOS FUTUROS DOCENTES, UNA PROPUESTA PARA IMPLEMENTAR P.E. 2022 ','En la Escuela Normal No. 2 de Nezahualcóyotl está en marcha una investigación sobre la Alfabetización Matemática, misma que ha generado una serie de conocimientos y propuestas para su implementación con los alumnos que cursan los Planes de Estudio (PE) 2022 en la Licenciatura en Enseñanza y Aprendizaje de las Matemáticas (LEAM). Entre estas está la implementación de un Taller donde se ejemplifique como se puede atender. De igual modo se presenta el concepto que maneja, tanto la Organización para la Cooperación y el Desarrollo Económico (OCDE) como algunos autores, a su vez se consideran datos sobre los resultados obtenidos en la prueba del Programa Para la Evaluación Internacional de los Estudiantes (PISA) desde el 2000 hasta la fecha, los cuales nos refieren la necesidad de abordar el tema con los futuros docentes, de manera inicial porque tendrán que afrontar esa evaluación, la Nueva Escuela Mexicana (NEM), que pone a la comunidad al centro y se demanda una contextualización del aprendizaje que se imparte en educación básica, la investigación sigue su curso, brindando condiciones para poder tomar información derivada de ésta, para ir diseñando actividades que contribuyan a una implementación de los cursos que están por realizarse. Del mismo modo apoyar a los docentes en formación del plan 2018 de la Licenciatura en Enseñanza y Aprendizaje de las Matemáticas en Educación Secundaria (LEAMES), a contar con elementos que les permitan tomar el contexto como base para el desarrollo de planteamientos matemáticos en su labor frente a grupos, también se incluirán a los docentes en formación de la Licenciatura en Educación Primaria, planes 2018 y 2022, quienes también implementan, desde sus prácticas profesionales, los planes de estudio de la NEM. Cabe destacar que el taller ha de contribuir al desarrollo de una alfabetización matemática de los futuros docentes de manera efectiva.','Ángel Alsina, Marcos teóricos de PISA 2003,. Ramón Pajares, Angel Sanz, Luis Rico, El proyecto PISA 2000, Mg. Cesar Hilton Aguilar Ramos, DGESUM. Planes y programas de estudio 2022. DOF:19/08/2022. Acuerdo número 14/08/22, Ley General de Educación DGESUM. Planes y programas de estudio 2022',NULL,NULL,16,2,3,826,'2024-01-23 11:24:27.000000',342),('IP-POSM036','ANÁLISIS DE ERRORES EN LA RESOLUCIÓN DE ECUACIONES DIFERENCIALES DE 1° Y 2° ORDEN','Objetivos: Analizar las resoluciones desarrolladas y los errores cometidos por los estudiantes en los ejercicios correspondientes a ecuaciones diferenciales ordinarias de 1° y 2° orden, de la asignatura Matemática de las carreras de Farmacia y Bioquímica de la Facultad de Farmacia y Bioquímica de la Universidad de Buenos Aires.\r\nSustento teórico: Se identifican un conjunto de obstáculos en el aprendizaje de las ecuaciones diferenciales ordinarias que problematizan la comprensión y el aprendizaje de este nuevo saber (García Romero, Arcia Oliveros y otros, 2021). Estos obstáculos pueden ser analizados desde los terrenos epistemológico, didáctico y psicológico (Túregano, 1998). En el plano didáctico, por ejemplo, se asocian tales dificultades con el enfoque algebraico y reduccionista de la enseñanza del cálculo (Milevicich, 2008). Entre los obstáculos epistemológicos que deben atravesar los alumnos, se puede identificar, dualidad del lenguaje utilizado. Mena, Montoya y otros (2007) indican que los obstáculos epistemológicos suelen tener raíces profundas en la propia matemática, y se caracterizan por la persistencia con la cual reaparecen en diversas situaciones y lo determinante que son para el logro del aprendizaje matemático. \r\nMetodología: Se realizó un análisis cualitativo de exámenes parciales y recuperatorios durante los segundos cuatrimestres de las cursadas de 2019, 2022 y 2023. Se analizaron las resoluciones de aquellos ejercicios que involucraban ecuaciones de 1° orden y 2° orden, diferenciándolos y categorizando los tipos de errores. \r\nResultados y conclusiones: Pudimos observar que los estudiantes: 1) Cometieron distintos tipos de errores: algebraicos, mal planteo de las soluciones (homogénea, particular y general), cálculo de la integral, método de resolución que aplican, despeje, entre otros. 2) En el año 2022 presentaron mayores dificultades que en los otros 2 años. \r\nEstas conclusiones se constituyen en elementos imprescindibles para repensar y reformular actividades vinculadas a la enseñanza de las ecuaciones diferenciales ordinarias.\r\n\r\nPalabras clave: Cualitativo, didáctica, ecuaciones, epistemología, obstáculos,universidad\r\n','•	García Romero, T.; Arcia Oliveros, E.; Meza Pallares, D. Pertuz Rincón, J. (2021). Obstáculos epistemológicos en la resolución de problemas de libros de textos de ecuaciones diferenciales ordinarias. Revista Boletín R E D I P E  1 0 (9), 4 3 0 - 4 5 8. ',NULL,NULL,16,2,3,875,'2024-01-23 13:38:23.000000',653),('IP-POSM042','SISTEMAS CONCEPTUALES GENERADOS POR ESTUDIANTES DE NUEVO INGRESO A MATEMÁTICAS APLICADAS EN TAREAS DE MODELACIÓN','Se identifican y caracterizan modelos generados por estudiantes de nuevo ingreso a una licenciatura en matemáticas aplicadas, cuando abordan una tarea que es una adaptación de la Model Eliciting Activity (MEA) denominada “El hotel histórico”. La tarea se adaptó, implementó y analizó con base en la Perspectiva de Modelos y Modelación (PMM), propuesta por Lesh y colaboradores (2003). La tarea tiene tres secciones: (i) actividad de calentamiento, (ii) actividad principal, y (iii) exposiciones plenarias. En la investigación participaron 19 estudiantes, seleccionados por conveniencia, inscritos en una universidad pública del estado de Hidalgo, México. Las actividades se implementaron durante el ciclo académico julio-diciembre 2023, como parte de una de sus asignaturas de primer semestre. La implementación se llevó a cabo en dos sesiones de trabajo de tres horas cada una. En la primera sesión, los participantes abordaron la actividad de calentamiento y la actividad principal, en equipos integrados por cuatro estudiantes. En la segunda sesión se efectuaron las presentaciones plenarias de los cinco equipos. Las fuentes de recolección de la información fueron las producciones escritas de los estudiantes, así como grabaciones en video de las exposiciones plenarias. El análisis de la información consistió en identificar los sistemas conceptuales (modelos) generados por los estudiantes, así como los procesos de mejora, adaptación y refinamiento. Se identificaron tres tipos de modelos, tabular, gráfico y algebraico. Uno de los equipos elaboró los tres modelos y realizó el refinamiento de su aproximación inicial. Cada uno de los integrantes creó su propio modelo y mediante la comparación y discusión se logró el refinamiento de los modelos individuales. En otro caso, en uno de los equipos se crearon tres modelos algebraicos, en los dos primeros dos se omitía información relevante, pero en el tercer modelo corrigió esa deficiencia, lo cual es evidencia de un proceso de refinamiento.\r\n','Aliprantis, C. D., & Carmona, G. (2003). Introduction to an economic problem: a models and modeling perspective. In R. Lesh & H. M. Doerr (Eds.), Beyond constructivism: Models and Modeling perspectives on mathematics problem solving, Learning, and Teaching (pp. 255-264). Mahwah, NJ: Lawrence Erlbaum Associates.',NULL,NULL,16,2,3,865,'2024-01-24 12:15:32.000000',727),('IP-POSM046','CURIOSIDADES DE LOS DETERMINANTES DE TERCER ORDEN','En este artículo se pretende rescatar momentos históricos y aplicaciones de los determinantes como un arreglo  y operación.  Los determinantes aparecieron en la literatura matemática más de un siglo antes que las matrices. El término matriz fue utilizado por primera vez por Joseph Silvestre cuya intención era que su significado fuera  “madre de los determinantes”. Quien contribuyo de manera importante en la teoría de los determinantes fue el matemático francés Augustin- Louis Cauchy (1789 - 1857). Una aportación importante de la teoría de los determinantes fue la del matemático alemán Carl Gustav Jacobi  (1804 – 1851), quien dio la palabra determinante logrando su aceptación final . Jacobi usó primero un determinante aplicado a las funciones para establecer la teoría de funciones de varias variables, pero Sylvester es quien bautiza a ese determinante como Jacobiano. En el artículo se muestra como a través de la aplicación de un determinante se puede demostrar que varias rectas son concurrentes, así como obtener la ecuación de una recta que pasa por dos puntos haciendo uso de los determinantes, de la misma forma se hace inca pie en el cálculo de la matriz hermitica  y la solución de la derivada de un determinante enfatizando en el producto vectorial.','Collette, J.l (2006). Historia de las Matemáticas. México. México: Editorial Siglo Veintiuno.  Edwards, C.H. (2009). The Historical Development of the Calculus. New York, Inc. USA: Springer-Verlag Newman. Grossman, S. (2008). Álgebra lineal. México: Mc Graw Hill',NULL,NULL,16,2,3,382,'2024-01-24 12:54:11.000000',108),('IP-POSM048','DIFICULTADES  QUE PRESENTAN ESTUDIANTES DE SECUNDARIA AL RESOLVER PROBLEMAS DE CÁLCULO MENTAL ','Desarrollar y consolidar habilidades matemáticas, es de suma importancia para todo individuo.  En el mundo actual numerosos procesos se asisten y giran en torno a esta disciplina, las matemáticas están en todas partes, en los lugares más inesperados, en los rincones más recónditos conduciendo la rutina del ser humano, y a menudo no se es consciente de ello (Álvarez,2006).\r\nUna de las competencias matemáticas utilizadas con mayor frecuencia en la vida cotidiana, sin importar la actividad laboral, es el cálculo mental, por lo que esta habilidad cobra especial relevancia, ya que se usa dentro y fuera del contexto escolar. En este orden de ideas, la presente investigación se sitúa con estudiantes de secundaria, con el objetivo de identificar las dificultades que presentan al resolver problemas en los que deben emplear el cálculo mental.\r\nEn la propuesta presentada, este fenómeno se analiza desde la perspectiva del desarrollo del sentido numérico. La literatura sugiere que el desarrollo del sentido numérico, puede dar significado a los conocimientos que los estudiantes elaboran en sus clases de aritmética y no solo eso, sino que el sentido numérico puede considerarse de manera transversal: está presente en problemas de otras áreas de las matemáticas, así como se puede afirmar que cada que se tenga que resolver un problema que implique números se puede hacer uso del sentido numérico (García 2014).\r\nDebido a que la investigación está en proceso, en esta etapa se presentan los principales hallazgos documentales de la revisión de la literatura y el diseño metodológico, aun no se cuentan con resultados empíricos, sin embargo, se presume que los resultados que se obtendrán de esta investigación pueden servir como guía para el diseño de estrategias de intervención en el aula, que favorezcan el desarrollo de la habilidad del cálculo mental. ','Álvarez, Y. (2006). ¡Auxilio. No Puedo Con la Matemática!.Revista Iberoamericana de Educación Matemática Equisangulo, 2 (1), 4-16. García, S. (2014). Sentido numérico. Materiales para Apoyar la Práctica Educativa. México: INEE.',NULL,NULL,16,2,3,899,'2024-01-24 18:32:42.000000',17),('IP-POSM064','FACTORES QUE INFLUYEN EN EL DESEMPEÑO DEL APRENDIZAJE DE MATEMÁTICAS DISCRETAS EN CIENCIAS COMPUTACIONALES','La matemática discreta se compone de conceptos y métodos matemáticos que ayudan a resolver problemas que involucran una cantidad generalmente finita de elementos o procesos, y las conexiones entre ellos (Hart, E. W., et. al, 2016; Sandefur, J., et al. 2022).  Esta Unidad de Aprendizaje (UA) tiene un carácter formativo para carreras en sistemas computacionales ya que permite al estudiante desarrollar habilidades fundamentales en su formación como son: redactar con claridad, formalizar conceptos y adquirir destrezas lógicas para enfrentar situaciones nuevas con precisión (Serna, et. al., 2013).\\\\r\\\\nLa UA de Matemáticas discretas es un curso clave en la formación inicial de los estudiantes de las carreras de la Escuela Superior de Cómputo del IPN, dónde es reconocida como una asignatura difícil de aprender por los alumnos. Este trabajo presenta los resultados del diagnóstico realizado a los estudiantes para detectar los factores que influyen en el aprendizaje de esta UA en los estudiantes.\\\\r\\\\n A partir del análisis de las respuestas proporcionadas por los estudiantes, se llegó a la conclusión de que las dificultades no se centran únicamente en la complejidad de los conceptos abstractos, sino también en la capacidad de los alumnos a sobre ponerse al estrés que ocasiona este tipo de asignaturas, así como en problemas para formalizar las respuestas, el número de estudiantes por aula y la dedicación de los docentes a la retroalimentación. De esta forma, las dificultades se condensaron en tres factores: (AP) autopercepción, (AA) autoeficacia y autonomía y, (AR) actividad en el aula y retroalimentación; encontrando que el factor (AR) es señalado como factor predominante que influye en el desempeño de los alumnos.  Esto supone un mayor compromiso tanto de los profesores como de los alumnos para lograr los objetivos deseados por ambos.','Hart, E.W., Gary-Martin, W. (2016) Discrete-Mathematics Is Essential Mathematics in 21st Century-School Curriculum. Sandefur, J., Lockwood, E., Hart, E. (2022). Teaching and learning discrete-mathematics. Mathematics Education 54, 753–775. Serna, E., Polo, J.E. (2013) Lógica y abstracción en la formación de ingenieros: una relación necesaria. Ingeniería Investigación Y Tecnología, 15(2).',NULL,NULL,16,2,3,888,'2024-01-26 17:37:38.000000',114),('IP-POSM065','LA ENSEÑANZA DE LA FUNCIÓN LINEAL Y SUS REPRESENTACIONES EN SECUNDARIA','Esta ponencia esta destina a compartir el análisis de la enseñanza de la función lineal y sus representaciones en primer grado de secundaria.  La investigación toma como marco teórico la Teoría de Registros de Representación Semiótica (Duval, 2004) con el objetivo de analizar la enseñanza de la función lineal y sus representaciones mediante la teoría de registros de representaciones semióticas y profundizar en las transformaciones que se proponen en la enseñanza de este objeto matemático.\r\nPara ello, se realiza un estudio de caso con cuatro profesores del Estado de México, quienes abordaron el tema de función lineal en primer grado de secundaria. Para el logro del objetivo de esta investigación, se realizaron transcripciones sobre las sesiones de los profesores de matemáticas, haciendo énfasis en sus acciones para identificar y dar a conocer los elementos de la función lineal mientras realizar diversas transformaciones. Además, se implementó un cuestionario de conocimientos y una entrevista semiestructurada para comprender con mayor profundidad lo rescatado por las transcripciones de las sesiones. \r\nDe lo anterior, se han destacado diferentes tipos de secuencias de conversiones y tratamientos empleados por los profesores de matemáticas para intentar coordinar diferentes representaciones del objeto matemático y permitir la identificación de sus elementos. Además, de que no siempre se hace énfasis en los elementos de este objeto matemático. \r\nEl análisis de la información revela que la enseñanza de la función lineal en primer grado de secundaria puede ser enriquecida desde la teoría de las representaciones semióticas para favorecer la coordinación de registros semióticos mediante la identificación de unidades significativas al interior de cada representación al momento de generar secuencias de conversión y favorecer la comprensión de la función lineal.\r\nPalabras clave: Profesores de matemáticas, enseñanza, elementos de la función lineal y representaciones semióticas.\r\n','Duval, R. (2004). Semiosis y pensamiento humano: registros semióticos y aprendizajes intelectuales. Universidad del Valle.',NULL,NULL,16,2,3,877,'2024-01-26 18:16:48.000000',114),('IP-POSM070','RESOLUCIÓN DE PROBLEMAS EN LA ENSEÑANZA DE MATEMÁTICAS CON ESTUDIANTES DE TERCER GRADO DE SECUNDARIA.','El actual modelo educativo considera la resolución de problemas como una estrategia de aprendizaje para la enseñanza de contenidos y fomentar actitudes positivas en el estudio de las Matemáticas. En esta investigación se busca caracterizar e identificar las estrategias utilizadas por un grupo de 10 estudiantes de tercer grado de secundaria, en la modalidad de telesecundaria, con edades de 14 y 15 años, los cuales participaron de forma voluntaria en un taller de 20 sesiones con duración de 90 minutos, en donde se examinaron problemas de geometría aplicados en pruebas de la olimpiada de matemáticas del estado de Hidalgo. Este estudio tiene como objeto responder a la pregunta, ¿Cuáles son las estrategias que usan los estudiantes de tercer grado de telesecundaria al resolver problemas de matemáticas? Cabe señalar que durante el taller se utilizó el software GeoGebra como una herramienta de apoyo en donde los estudiantes interactúan con los objetos geométricos durante la representación de la información, la reflexión e identificación de regularidades, lo cual permite el diseño de una solución. El análisis de la información se basa en el marco de resolución de problemas, principalmente de las ideas de G. Pólya (1945), Santos Trigo (2007) y A. Schoenfeld (1985), centrando la atención en los procesos cognitivos puestos en práctica por los estudiantes en el planteamiento de problemas matemáticos, el uso de recursos y heurísticas, que permitan obtener una solución apropiada. La investigación desarrolló una metodología cualitativa para analizar las respuestas planteadas a los problemas propuestos. En este estudio se identifican los resultados obtenidos sobre la práctica educativa docente respecto a la resolución de problemas en el aula escolar, lo cual permite mejorar el desempeño y el aprendizaje de los alumnos al estudiar matemáticas en el nivel de secundaria.','Barrera, F., & Reyes, A. (2018). El rol de la tecnología en el desarrollo de entendimiento matemático vía la resolución de problemas. Polya, G. (1965). Cómo planear y resolver problemas.  Santos Trigo, L. M. (2007). La resolución de problemas matemáticos: Fundamentos cognitivos. Schoenfeld, A. (1985). Mathematical Problem Solving. ',NULL,NULL,16,2,3,849,'2024-01-27 15:55:09.000000',100),('IP-POSM073','IDENTIFICACIÓN DE REPRESENTACIONES Y FORMAS DE INTERPRETACIÓN PARA LA ENSEÑANZA DE FRACCIONES EN EDUCACIÓN BÁSICA','Se identificaron y caracterizaron las características de representación y conceptualización (interpretación) de fracciones, que están presentes en los planes de clase que se utilizan en tercer grado de primaria, para la enseñanza de fracciones por primera vez, debido a que dicho tema es de interés en la didáctica de las matemáticas por las dificultades documentadas en diferentes niveles educativos. Para este análisis se tomaron dos perspectivas teóricas, la primera es la teoría de situaciones didácticas propuesta por (Duval, 2006) y la segunda es las 4 interpretaciones para las fracciones propuesta por (Lamon, 2020). La metodología seleccionada por el tipo de investigación fue la cualitativa y exploratoria; Para la recolección de datos se realizó un estudio de casos a dos docentes de diferentes instituciones del estado de hidalgo, con base a entrevistas semiestructuradas y aplicación de un cuestionario breve. En los resultados se encontró una semejanza con estudios que se han realizado en México y en otros lugares del mundo, bajo diferentes enfoques y teorías, que muestran la carencia en la comprensión conceptual de la fracción, el usos casi exclusivo de la interpretación “parte todo” y  que predomina el uso de representaciones gráficas y manipulables en la enseñanza actual del tema, sin embargo pese a la identificación de una variedad de representaciones y conceptualizaciones en este primer acercamiento formal se identifica que va encaminado a una enseñanza que promueve procesos algorítmicos y de memorización.','Lamon, S. (2020). Fractions as part–whole comparisons. En S. Lamon (Eds.), Teaching fractions  and ratios for understanding New York: Routledge Taylor &amp; Francis group, (pp. 153-170). Duval, R. (2006). A cognitive analysis of problems of comprehension in a learning of mathematics.  Educational Studies in Mathematics, 61, 103-131.',NULL,NULL,16,2,3,880,'2024-01-27 23:29:33.000000',342),('IP-POSM074','UN ESTUDIO DEL CONCEPTO DE VARIACIÓN EN LA RESOLUCIÓN DE PROBLEMAS DE TIPO GEOMÉTRICO','En este artículo se reportan los resultados del trabajo llevado a cabo por estudiantes de bachillerato que cursaban la asignatura Matemáticas V al resolver actividades en torno al concepto de variación desde la Geometría, diseñadas e implementadas primero en el ambiente de lápiz-y-papel y después en el ambiente tecnológico GeoGebra, las cuales son de carácter colaborativo, de reflexión y análisis de los procedimientos con el fin de lograr aprendizajes significativos en los estudiantes.\r\nSe toma como marco de referencia el estudio de Radford (2012, p. 284) sobre la mediación del artefacto, que consiste en que el usuario piensa con el artefacto y a través del artefacto; así, el sujeto modifica el artefacto y éste modifica el pensamiento del usuario. \r\nLos resultados muestran que la propuesta implementada ofrece mejoras significativas en el aprendizaje del concepto de variación.\r\n','Radford, L. (2012). On the cognitive, epistemic, and ontological roles of artifacts. In G. Gueudet, B. Pepin, & L. Trouche, (Eds.), From text to ‘lived’ resources (pp. 283-288). New York: Springer.',NULL,NULL,16,2,3,847,'2024-01-28 01:42:09.000000',108),('IP-POSM083','NEUROCIENCIAS: ESTRATEGIAS COGNITIVAS PARA EL DESARROLLO DEL PENSAMIENTO MATEMÁTICO EN ALUMNOS DE PRIMERO DE PRIMARIA','La presente propuesta de investigación tiene como objetivo explicar cómo la implementación de estrategias cognitivas basadas en la neurociencia favorece los procesos cerebrales en el aprendizaje de las matemáticas en estudiantes de primer grado de educación primaria.\r\nA partir de un enfoque mixto, con alcance explicativo, del tipo de diseño cuasi-experimental y de ejecución en la Escuela Primaria Ignacio Allende de San Miguel Coatlinchan, Municipio de Texcoco, Estado de México, con una población de 132 educandos de primer grado, de los cuales 64 alumnos formaron parte del grupo experimental (32 estudiantes) y control (32 colegiados).\r\nPara la evaluación de la estrategia se implementó el instrumento Evaluación Neuropsicológica Infantil (ENI-2) en dos momentos PRETEST y POSTEST, valorando la evolución progresiva de la condición neurológica de los sujetos en relación del pensamiento matemático, determinando el seguimiento neuropsicológico, contribuyendo al desarrollo versus proceso adquirido, correspondiente a la historia clínica de los alumnos y confeccionando el contenido ontogenético y holístico de la investigación, como lo explican Saldarriaga, Bravo y Loor (2016) “descubrir y explicar las formas más elementales del pensamiento humano desde sus orígenes y seguir su desarrollo [...] hasta los niveles de mayor elaboración y alcance, identificados por él con el pensamiento científico en los términos de la lógica formal” (p. 1). \r\nEn particular desde la corriente conductual de la neurociencia, se brinda un inicio y evolución del educando, por medio de datos generales, exploración física, historia familiar, antecedentes prenatales, natales y posnatales, así como el comportamiento de los individuos desde la perspectiva del padre de familia y los métodos de disciplina en el hogar para el proceso de enseñanza-aprendizaje.   ','Saldarriaga, P. J., Bravo, G. R. y Loor, M. R. (2016). La teoría constructivista de Jean Piaget y su significación para la pedagogía contemporánea. Revista científica: Dominio de las ciencias, Vol. II, pp. 127-137. https://dominiodelasciencias.com/ojs/index.php/es/index ',NULL,NULL,16,2,3,905,'2024-01-28 19:51:11.000000',706),('IP-POSM098','INCIDENCIA DE UNA METODOLOGIA INDUCTIVA EN MATEMATICAS EN EL SISTEMA DE BACHILLERATO ABIERTO','El Instituto de Enseñanza Abierta es un bachillerato no escolarizado de la Universidad Autónoma de Coahuila, donde los docentes diseñan los materiales didácticos. Esta investigación tuvo el objetivo de comprobar la influencia de la metodología Aprendizaje Basado en Problemas (ABP) en la motivación y estrategias de aprendizaje en el logro del aprendizaje de las Matemáticas mediante el diseño y aplicación de un material didáctico en  Matemáticas I. Se plantearon dos hipótesis que señalaron que la intervención ABP incide positivamente en la motivación y estrategias de aprendizaje, respectivamente. Se llevó a cabo bajo un diseño cuasi experimental, enfoque cuantitativo y tipología explicativa. La población es un censo de 98 estudiantes, entre 15 y 20 años, durante el semestre agosto-diciembre de 2022. Se empleó el Cuestionario de Motivación y Estrategias de Aprendizaje Forma Corta, validado con el coeficiente Alpha de Cronbach, con un valor de .908. Los resultados demostraron que la motivación no presentó diferencia en los niveles de significancia entre los grupos (p>0.05), de esto se desprendió que no existe influencia de factores para esta variable, en relación con los componentes de valor y componentes afectivos, según el instrumento aplicado. Sin embargo, en cuanto a las estrategias de aprendizaje si se encontró diferencia estadísticamente significativa (p<0.05) en dos variables que corresponden a la dimensión de estrategias cognitivas y metacognitivas. Con base a ello, se rechazó la primera hipótesis de investigación y en contra parte, se aceptó la segunda hipótesis de investigación que sostuvo que la metodología del ABP incide positivamente en las estrategias de aprendizaje en el logro del aprendizaje de las Matemáticas. Este trabajo genera una aportación teórica, metodológica y pedagógica de trascendencia en las investigaciones educativas para el área de Matemáticas y a la vez, para los sistemas abiertos que se interesen en la ejecución de metodologías inductivas.','Borochovicius, E. y Martins Tassoni, E. C.  (2021), Cardeñoso-Ramírez, O., Larruzea-Urkixo, N. y Bully-Garay, P. (2022), Flavell, J. H. (1979), García, T., McKeachie y Wilbert, J. (1988), Kleinginna, P.R. y Kleinginna, A.M. (1981), París-Muñoz, A. (2023), Pekrun, R. (1992), Pintrich, P. y De Groot, E. (1990).',NULL,NULL,16,2,3,949,'2024-01-31 11:56:14.000000',706),('POSM00115','PRUEBA 1 DE PONENCIA ORAL','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 16:56:13.000000',752),('POSM00215','PRUEBA 2 DE PONENCIA TALLER','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 17:25:56.000000',752),('POSM00315','PRUEBA 3 DE PONENCIA PONENCIA','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 17:49:35.000000',752),('POSM00415','PRUEBAS PDF POR TIPOGHASD','asdfasfj\r\n','dsdfsdf',NULL,NULL,15,2,1,488,'2023-06-21 02:04:38.000000',782),('POSM00615','ENRUTAMIENTO CON PT','Resumen de ponencia pt','Referencias de ponencia pt',NULL,NULL,15,2,2,531,'2023-06-28 11:35:27.000000',783),('POSM00715','SEGURUDAD CON LAS MATEMÁTICAS ','Prueba de actualización de trabajos','Seguridad información ',NULL,NULL,15,2,1,783,'2023-06-28 11:35:52.000000',NULL),('POSM00815','PRUEBA DE PONENCIA','Esta es una prueba para registrar una ponencia en el Congreso de Matemáticas','Herrera Cáceres, C. y Rosillo Peña, M. (2019). Confort y eficiencia energética en el diseño de edificaciones. Universidad del Valle.',NULL,NULL,15,2,2,784,'2023-06-28 11:42:08.000000',NULL),('POSM00915','PLATAFORMA LMS EN LA PL','Resumen. Por favor aporbar','Referencias de PL',NULL,NULL,15,2,2,531,'2023-06-28 11:45:14.000000',783),('POSM01015','TITULO DE LA PONENCIA DE MATEMÁTICAS','Resumen de la ponencia','Referencias',NULL,NULL,15,2,1,531,'2023-06-28 11:48:09.000000',784),('POSM01115','PRUEBA','prueba este es una prueba de tu modificación','prueba',NULL,NULL,15,2,1,783,'2023-06-28 11:53:29.000000',NULL),('POSM01315','LA EDUCACIÓN AUTONÓMA COMO SÍNDROME DE LAS NUEVAS GENERACIONES','La formación en el ámbito educativo a nivel superior se centra en jóvenes que pertenecen a la generación “Y” o a los famosos Millennials los cuales son nacidos entre 1981 y 2000, son considerados los que inventan, innovan, cambian paradigmas, disfrutan de la tecnología, los que desean aprender haciendo, son a los que les apasionan los desafíos, a los que se considera “nativos digitales”; se les atribuye la categoría de la primera generación global, la poseedora de una conexión inmediata con todo el mundo.','https://www.bing.com/search?q=LA+EDUCACI%C3%93N+AUTON%C3%93MA+COMO+S%C3%8DNDROME+DE+LAS+NUEVAS+GENERACIONE&cvid=bebec123d41d47fb93f208d7f44679d1&aqs=edge..69i57.405j0j9&FORM=ANAB01&PC=U531',NULL,NULL,15,2,2,242,'2023-06-28 12:08:24.000000',NULL),('POSM01415','PLATAFORMA VIRTUAL CON EJEMPLOS DE SERIES DE FURIER','En numerosos problemas de ingenierÌa aparecen funciones periÛdicas que\r\nse necesitan aproximar mediante sumas de las funciones trigonomÈtricas\r\nseno y coseno, lo que conduce a las series de Fourier.\r\nLas series de Fourier admiten m·s posibilidades de aplicaciÛn que las series\r\nde Taylor, ya que muchas funciones discontinuas se pueden desarrollar en\r\nserie de Fourier pero, por supuesto, no tienen representaciÛn en serie de\r\nTaylor. Recordemos que para que una funciÛn f (x) admita serie de Taylor\r\nen el punto x = a es condiciÛn necesaria que sea indeÖnidamente derivable\r\nen ese punto.\r\n','https://www.unioviedo.es/bayon/docen/AM-Tema-4.pdf',NULL,NULL,15,2,1,242,'2023-06-28 12:16:08.000000',NULL),('POSM01515','PRUEBA 3','Resumen 3','Referencias 3',NULL,NULL,15,2,2,531,'2023-06-28 12:55:53.000000',NULL),('PRSM00115','PROTOTIPO DE REDES','Resumen del prototipo modificado','Referencias del prototipo',NULL,NULL,15,4,3,531,'2023-06-28 11:36:50.000000',784),('PRSM00215','ROBOT QUE RESPONDE A CUASTIONAMIENTOS MATEMÁTICOS','Gracias por interesarse en nuestro contenido, sin embargo todo el contenido de este sitio web, incluyendo de manera enunciativa más no limitativa, textos, logotipos, contenido fotográfico, audio o video, son derechos reservados y propiedad de EMPRESAS EL DEBATE SA DE CV, protegidos por la Ley Federal del Derecho de Autor conforme a su artículo 17, 27 y los demás aplicables. Este contenido, al tratarse de derechos reservados, prohíbe todo tipo de distribución, publicación, edición o venta no autorizada, requiriendo licencia especial para cualquiera de las acciones mencionadas anteriormente, de manera enunciativa más no limitativa. Si desea adquirir licencia para reproducir de manera lícita el contenido propiedad de EMPRESAS EL DEBATE SA DE CV, contactar a Cristina Muñoz Grageda al teléfono 668 816 04 00 Ext. 68050, disponible de lunes a viernes en horarios de oficina, o al correo electrónico cristina.munoz@debate.com.mx. - Derechos Reservados © Empresas EL DEBATE SA de CV 2020','https://www.robotina.us/conectividad/Google-presenta-Minerva-la-Inteligencia-Artificial-que-resuelve-problemas-de-matematicas-20220703-0004.html',NULL,NULL,15,4,5,242,'2023-06-28 12:13:10.000000',354),('PRSM00315','CARTEL ','ysusus','usus',NULL,NULL,15,4,1,750,'2023-06-28 12:47:56.000000',NULL),('TASM00215','CDI CON TICS','Es de pureba','Zill',NULL,NULL,15,3,1,289,'2023-06-28 11:26:41.000000',NULL),('TASM00315','TALLER DE INSTRUMENTOS DE EVALUACIÓN','Resumen del taller','Referencias de la evaluación',NULL,NULL,15,3,4,531,'2023-06-28 11:44:12.000000',784),('TASM00415','AULA VIRTUAL DE MATEMATICAS','AULA VIRTUAL DE MATEMATICAS','AULA VIRTUAL DE MATEMATICAS',NULL,NULL,15,3,1,783,'2023-06-28 11:45:00.000000',NULL),('TASM00515','ENRUTAMIENTO ESTATICO CON CISCO','En asignaturas de redes de computadoras es fundamental el conocimiento y aplicación de sistemas numéricos, así como operaciones de cambio de base, esto hace necesario contar con los conocimientos y habilidades necesarias por parte de los alumnos que cursan estas asignaturas. Este documento tiene como objetivo utilizar los sistemas numéricos como herramienta de apoyo con la cual los alumnos desarrollarán una metodología y la aplicarán en la solución de problemas  de cálculo de redes y subredes y junto a la estrategia de Aprendizaje Basado en Problemas (ABP), los alumnos desarrollaran la competencia de configurar sistemas de asignación automática  de direcciones IP (DHCP) como parte de su formación  para automatizar procesos en la administración de redes de computadoras.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nSe desarrollará una metodología con la cual los alumnos tendrán la habilidad de automatizar procesos de configuración de redes de computadoras, además de conocer y aplicar operaciones con sistemas numéricos como son cambios de base, operaciones de conversión de base de decimal a binario y viceversa.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nLa metodología consiste en realizar una introducción a través de ejercicios didácticos con ejemplos ilustrativos de cambios de base decimal a binaria y binaria a decimal, posteriormente proponer a los alumnos ejercicios prácticos a través de la resolución de ejercicios de cálculo de redes y subredes y así desarrollen la habilidad descrita.   \\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nDe igual manera se utilizarán herramientas en línea que permitan a los alumnos comprobar que las operaciones de cálculo que realizan con base en los sistemas numéricos son correctas y con ello, llevar a cabo prácticas de configuración de un sistema de asignación automática de dicciones IP versión 4. ','Wendell Odo (2020).  CCNA 200-301 Official Cert Guide, Volume 1. Perspectives on IPv4 Subnetting (pp 268-274). Hoboken, NJ: Pearson Education, Inc.',NULL,NULL,15,3,2,354,'2023-06-28 11:46:40.000000',NULL),('TASM00615','TALLER DE MATEMATICAS ESPECIALIZADAS EN COHETES DE PROPULSIÓN CINÉTICO ','Ahora tratamos el caso en el que la masa de un objeto cambia. Analizamos el movimiento de un cohete, que cambia su velocidad (y, por ende, su momento) al expulsar los gases del combustible quemado, lo que hace que se acelere en la dirección opuesta a la velocidad del combustible expulsado (vea la Figura 9.32). Específicamente: Un cohete con todo el combustible en el espacio profundo tiene una masa total  m0\r\n  (esta masa incluye la masa inicial del combustible). En algún momento, el cohete tiene una velocidad  v⃗ \r\n  y masa m; esta masa es una combinación de la masa del cohete vacío y la masa del combustible restante no quemado que contiene. (Nos referimos a m como la \"masa instantánea\" y  v⃗ \r\n  como \"velocidad instantánea\"). El cohete acelera al quemar el combustible que lleva y expulsar los gases quemados de escape. Si la tasa de combustión del combustible es constante, y la velocidad a la que se expulsa el escape también es constante, ¿cuál es el cambio de velocidad del cohete como resultado de la quema de todo su combustible?','https://openstax.org/books/f%C3%ADsica-universitaria-volumen-1/pages/9-7-propulsion-de-cohetes',NULL,NULL,15,3,4,242,'2023-06-28 12:11:28.000000',NULL),('TASM00715','TALLER','modifier','usus',NULL,NULL,15,3,1,750,'2023-06-28 12:47:11.000000',NULL);
