INSERT INTO `ponencia_18012024` VALUES ('AP-POSM001','EL MODELO DE OFERTA Y DEMANDA: UNA PROPUESTA DESDE LA PERSPECTIVA HETERODOXA','La Economía tiene una controversia: ¿Estado o Mercado? Dos campos de la disciplina ayudan a encontrar la respuesta. La visión ortodoxa asume al mercado como el mejor mecanismo de ajuste para encontrar una equitativa distribución de los recursos en una economía. En la mirada heterodoxa apela a una mayor intervención del Estado para regular la acción de los agentes en una economía de mercado. Para un estudiante, la discusión es irrelevante y abstracta. La propuesta es tomar un modelo para señalar los atributos de cada campo. En ese sentido, la ponencia tiene como objetivo mostrar las bondades del uso de las matemáticas para enseñar los dos campos que forman la disciplina de la Economía, a partir del Modelo de Oferta y Demanda (MOD). \r\nDesde los hechos, las Universidades pugnan por explicaciones menos fantasiosas y más reales, los involucrados en la enseñanza demandan más elementos heterodoxos y menos ortodoxos a partir de las crisis recientes (2008 y 2020).\r\nDesde el estado del arte, Lavoie (2011) propone tomar manuales ortodoxos (instrumentos convencionales) e introducir elementos heterodoxos para enseñar economía desde un punto de vista plural y empleando matemáticas (Lavoie, 2015; Lavoie y Seccareccia, 2022) para darle formalidad y entablar un diálogo entre ortodoxos y heterodoxos.\r\nLa metodología consiste en realizar una revisión documental de los principales autores de los dos campos, explicar el MOD con ayuda de elementos matemáticos desde las dos visiones y empleando el instrumento para generar política económica.\r\nLa conclusión principal es desarrollar el MOD desde una perspectiva matemátia heterodoxa, para mostrar al lector que la controversia de la ciencia económica puede compartirse desde la parsimonia a un público no contextualizado en Economía. Otro objetivo que busca la ponencia es impulsar una agenda de uso de matemáticas en modelos e ideas heterodoxas, insistiendo en la necesidad de pluralidad académica.\r\n','Lavoie, M. (2011). La enseñanza de economía post-keynesiana en un departamento ortodoxo. Lavoie, M. (2015). ¿Debería la economía heterodoxa ser enseñada en departamentos de economía, o existe algún espacio para la economía backwater? Lavoie, M. y M. Seccareccia (2022). La economía poskeynesiana, ¿un pensamiento heterodoxo desconocido?',NULL,NULL,16,2,5,801,'2023-12-02 16:59:25.000000',NULL),('AP-POSM009','RALLY MATEMÁTICO, UNA ACTIVIDAD LÚDICA Y COMPLEMENTARIA AL CURRÍCULO EN EL CCH VALLEJO.','¡Las matemáticas son aburridas!, expresión que suele mencionar el alumnado de cualquier nivel académico, ya que su aprendizaje suele ser memorístico o con la simple repetición y aplicación de fórmulas sin significado, por ello se buscó implementar actividades de carácter lúdico o experimental que contribuyeran al aprendizaje y que favorecieran el razonamiento lógico, la imaginación y creatividad en búsqueda del aprendizaje significativo.\r\nDe lo anterior se propuso realizar un Rally Matemático como una opción al aire libre que permitiera a los alumnos del Colegio de Ciencias y Humanidades plantel Vallejo utilizar diversas habilidades y destrezas para resolver los retos y juegos ubicados en diferentes estaciones favoreciendo aspectos cognitivos y sociales de los alumnos.\r\nEl Rally Matemático busco la participación por equipos de los estudiantes inscritos en cualquier semestre donde debían ejecutar adecuadamente una serie de 8 juegos matemáticos que tenían la intención de estimular la concentración, la memoria y el razonamiento, contribuyendo en la adquisición de conocimientos, pero sobre todo incrementar el gusto por las matemáticas.     En el presente trabajo se muestran los resultados de la aplicación del Rally Matemático en el CCH Vallejo y parte de las actividades desarrolladas.       ','Morera, M y Serrano, A. (2007). Rally… naturaleza, recreación y salud. Revista MHSalud, 1(4), 1-7.',NULL,NULL,16,2,5,55,'2024-01-13 01:05:55.000000',NULL),('AP-POSM012','LA IMPORTANCIA DE LA SIMULACIÓN Y MODELACIÓN MATEMÁTICA EN LA ENSEÑANZA DE LA FÍSICA EXPERIMENTAL','En este trabajo se presenta la aplicación de la simulación y modelación matemática para el diseño de actividades experimentales con estudiantes de bachillerato que cursan la asignatura de Física III en la Escuela Nacional Colegio de Ciencias y Humanidades (ENCCH). El problema se limita a estudiar la variación del momento de inercia con respecto a la distribución de masa de un sistema rotativo que desciende sobre un plano inclinado. La simulación y modelación se llevó a cabo con GeoGebra, mientras que para el trabajo experimental se implementaron las TIC, en particular, el uso de video en cámara lenta, así como el software video tracker para la toma, análisis e interpretación de datos experimentales. Esta propuesta de enseñanza permitirá a los alumnos desarrollar su autonomía intelectual en ambientes presenciales, virtuales e híbridos, ya que se utilizan materiales accesibles y de bajo costo, así como  softwares de uso libre como los mencionados anteriormente. \\r\\n\\r\\nAdemás, dicho trabajo puede contribuir a la actualización de los Programas de Estudio de la asignatura de Física III que se está llevando a cabo en el presente año en la ENCCH, así como proporcionar a los docentes recursos didácticos tecnológicos innovadores para mejorar los procesos de enseñanza y dar frente a la transformación digital educativa acelerada debida por eventualidades como la ocurrida por la contingencia sanitaria causada por el COVID-19.  \\r\\n','Aguirre. (2006). Actividades expérimentales de Física I. Mecánica. México: Trillas. ',NULL,NULL,16,2,5,390,'2024-01-18 11:52:43.000000',NULL),('CASM00215','HISTORIA DE LA CONCEPCIÓN DEL INFINITO EN MATEMÁTICAS','El concepto de infinidad ocupa un lugarimportante en la historia de las matemáticas, sucomprensión fue fundamental para construir y resolver problemas relacionados con el cálculo, geometría,aritmética y álgebra.\\r\\nEl término infinito se formó através de un largo periodo de tiempo, a consecuenciade preguntas e ideas de un determinado número de personajes.\\r\\nEste término hace referencia a que algo no eslimitado, que puede seguir sin tener alguna restricción.Este trabajo se centra en los personajes que aportaronconocimiento para que este concepto naciera, también delas principales preguntas que incentivaron su evolución','López. A. El infinito en la historia de la matemática. Ciencia ytecnología. Buenos Aires. 2005.Stewart. I. 2008.  Historia de las matemáticas. Inglaterra.Editorial crítica.',NULL,NULL,15,1,3,784,'2023-06-28 11:46:34.000000',NULL),('CASM00315','MEDIOS SICRONICOS DE ENERGÍA CUANTICA EN ESTADO SOLIDO','Después de presentar la hipótesis de los cuantos de luz que explicaba el efecto fotoeléctrico en 1905, Einstein demostró en 1906 que los resultados anteriores de Planck sobre la distribución de energía en la radiación electromagnética podrían derivarse utilizando dos supuestos. El primero, ya presente en su artículo de 1905, fue que la luz se compone de cuantos de luz; el segundo fue que los cuantos de luz son emitidos y absorbidos por cargas oscilantes dentro de la materia que vibran solo con ciertas energías cuantificadas. Esto significa que la luz es emitida por cargas oscilantes dentro de la materia, como podría esperarse de la teoría de Maxwell, pero las energías tanto de la luz emitida como de los osciladores están restringidas a ciertos valores permitidos, lo que contradice la teoría clásica. Los osciladores se comportaron como cargas unidas a resortes, oscilando de un lado a otro solo con ciertas frecuencias correspondientes a ciertas energías cuánticas.','https://culturacientifica.com/2020/03/24/solidos-cuanticos/',NULL,NULL,15,1,1,242,'2023-06-28 12:04:27.000000',354),('EN-CASM001','LAS MATEMÁTICAS EN EL ENTORNO DE LA PROGRAMACIÓN','\r\nLAS MATEMÁTICAS EN EL ENTORNO DE LA PROGRAMACIÓN\r\nSabemos que:\r\nLas matemáticas son la herramienta fundamental en la programación. Aunque, no todos los programadores necesitan ser expertos matemáticos, solo con tener los conceptos y habilidades básicas  de las matemáticas puede ser beneficioso en varios aspectos de la programación. Aquí hay algunas áreas donde las matemáticas son especialmente útiles en programación:\r\n1.	Algoritmos y estructuras de datos: La creación y optimización de algoritmos a menudo involucra conceptos matemáticos, como la teoría de grafos, álgebra y análisis de complejidad.\r\n2.	Geometría y gráficos: En el desarrollo de juegos, aplicaciones gráficas y diseño de interfaces de usuario, la geometría y las transformaciones matriciales son esenciales.\r\n3.	Criptografía: La seguridad en la programación, especialmente en el desarrollo de sistemas de cifrado y autenticación, se basa en conceptos matemáticos, como la teoría de números y la aritmética modular.\r\n4.	Procesamiento de señales y imágenes: En áreas como el procesamiento de señales de audio o imágenes, se utilizan conceptos matemáticos como la transformada de Fourier.\r\n5.	Inteligencia artificial y aprendizaje automático: Algoritmos de aprendizaje automático y técnicas de inteligencia artificial a menudo están respaldados por conceptos matemáticos, como álgebra lineal, cálculo y estadísticas.\r\n6.	Simulaciones y modelado: En campos como la simulación y modelado de fenómenos físicos, las ecuaciones matemáticas son esenciales.\r\n7.	Programación científica: En disciplinas científicas y de ingeniería, donde se desarrollan modelos matemáticos, la programación se utiliza para implementar y resolver esos modelos.\r\nAunque es posible programar sin un conocimiento profundo de matemáticas, tener una comprensión sólida de conceptos matemáticos puede facilitar la resolución de problemas complejos y permitir un enfoque más eficiente y elegante en el desarrollo de software. Además, en áreas específicas de la informática, como la investigación y el desarrollo de algoritmos avanzados, las matemáticas se vuelven esenciales.\r\nEnseñanza de las matemáticas a través de la programación \r\nAUTORES: \r\nIng. Guadalupe Hernández Gutiérrez\r\nCOAUTOR:\r\nIng. Rodolfo Lazos Gómez \r\n\r\n','NO APLICA',NULL,NULL,16,1,1,234,'2024-01-10 16:22:33.000000',NULL),('EN-POSM002','USO DE CAS EN LA ENSEÑANZA DE LAS MATEMÁTICAS CON APLICACIONES DE MODELADO.','Las matemáticas son la rama del conocimiento que tienen un papel central no solo en el desarrollo de las demás ciencias, sino también, en el desarrollo de la sociedad, la cultura, el progreso económico y tecnológico de un país. Bajo estos hechos, la enseñanza y uso de las mismas debe de empezar desde una temprana etapa en la formación de los estudiantes con el fin de que estos desarrollen capacidades de análisis y critica para su uso laboral, profesional y en la vida diaria. \r\nAsí, en este proyecto se hara uso del CAS en la enseñanza de las matemáticas con aplicaciones de modelado en nivel medio superior. El cual pretende no solo reforzar las habilidades matemáticas y de razonamiento lógico en esta etapa educativa , sino que ademas, permitirá al estudiante familiarizarse con software científico y de ingeniería para la resolución de problemas, tal como se aborda en la actualidad, esto con la intención de realizar un modelo matemático de un problema contemporáneo que los alumnos elegirán.\r\nEste proyecto integra las habilidades que de manera paralela se aprenden en esta etapa educativa, como lo son: comprensión lectora, análisis de textos, química y física, comunicación de resultados e interpretación de los mismos. Mostrando a los alumnos el alcance y aplicación de los conocimientos que adquiere. \r\nFinalmente haciendo uso de las técnicas de regresión lineal y métodos de optimización, en particular, mínimos cuadrados, el estudiante las aplicara en un problema de su elección, construira el modelo del mismo e interpretara sus resultados. \r\n','Gaisman, M. T. (2023). Innovación Educativa. Obtenido de El uso de la modelación en la enseñanza de las matemáticas: https://www.redalyc.org/pdf/1794/179414894008.pdf',NULL,NULL,16,2,1,24,'2023-12-06 12:43:19.000000',NULL),('EN-POSM003','El impacto del modelo ADDIE en la enseñanza de las matemáticas','Las matemáticas tienen varios desafíos para que los jóvenes aprendan de manera significativa, sin mencionar que la situación se complicó debido a la pandemia de Covid-19. Por esto, los docentes han tenido que adaptar y buscar estrategias para que los estudiantes alcancen los conocimientos propuestos en los Programas de Estudio, por ende, esta investigación tuvo el objetivo de diseñar materiales audiovisuales basados en el modelo ADDIE que combinan aspectos disciplinarios, pedagógicos y tecnológicos para promover el desarrollo de habilidades matemáticas. Para esto, se trabajó con una muestra por conveniencia no probabilística de 26 estudiantes que cursaban el segundo semestre en la Escuela Nacional Colegio de Ciencias y Humanidades, plantel Vallejo, logrando así que los jóvenes mejoraran significativamente en habilidades de dominio de procedimientos básicos, comprensión de lenguaje, razonamiento matemático y manejo de las herramientas tecnológicas, dado que es un arquetipo que conjuga lo práctico, lo teórico y lo tecnológico a partir de un enfoque pedagógico, siendo así una alternativa viable para reforzar y consolidar conocimientos conceptuales, procedimentales y actitudinales que impacten positivamente en el proceso de aprendizaje de las matemáticas. Sin embargo, es imperativo que los docentes continúen explorando y perfeccionando estrategias que se ajusten a los desafíos de un contexto cambiante.\\r\\n','Morales, B. (2022). Diseño instruccional según el modelo ADDIE en la formación inicial docente. Apertura, 14(1), 80-95. Recuperado de: https://doi.org/10.32870/ap.v14n1.2160',NULL,NULL,16,2,1,621,'2023-12-14 00:30:06.000000',NULL),('EN-POSM006','PROTOCOLO DE ENRUTAMIENTO INTERIOR OSPF QUE USA EL ALGORITMO DIJKSTRA','\r\nOSPF implementa el algoritmo de Dijkstra para calcular las rutas más cortas dentro de una red. Cada router OSPF mantiene una base de datos de enlaces y utiliza esta información para calcular la tabla de enrutamiento con las rutas más eficientes. La métrica utilizada en OSPF puede ser el costo, que puede basarse en la velocidad del enlace o en otras consideraciones.\r\n\r\nEn el contexto de OSPF, los routers intercambian información sobre los enlaces a través de paquetes de estado de enlace (LSA, Link State Advertisement), y luego utilizan el algoritmo de Dijkstra para construir el árbol SPF y determinar las rutas más cortas. Esto permite que los routers OSPF seleccionen las rutas óptimas para reenviar los paquetes en la red.\r\n\r\n\r\n\r\n\r\n\r\n','Kurose, J. F.,Ross, K. W. (2010).  Redes de computadoras un enfoque descendente. España: Addison Wesley ISBN: 978-84-7829-119-9',NULL,NULL,16,2,1,531,'2024-01-06 12:20:24.000000',NULL),('EN-POSM007','PRUEBA FINAL','Resumen final','APA',NULL,NULL,16,2,1,531,'2024-01-09 11:20:52.000000',NULL),('EN-POSM008','LA RESOLUCIÓN DE PROBLEMAS Y EL PENSAMIENTO COMPUTACIONAL DE LOS PROFESORES DE MATEMÁTICAS','La ciencia informática ha experimentado un crecimiento notable en las últimas décadas, superando a otras disciplinas. Su influencia en nuestra vida diaria es cada vez más evidente, aunque a menudo no estamos conscientes de los avances en esta área. Dada esta expansión, la educación no puede permanecer ajena a estos cambios. Aunque no consideramos que la integración de la tecnología sea la única manera de mejorar el sistema educativo, sí la vemos como una alternativa viable para elevar la calidad de nuestra formación (Thohir et al., 2020). Los docentes pueden desempeñar un papel crucial como aliados para incorporar la tecnología en el aula, siempre y cuando estén dispuestos a aceptar el desafío de fortalecer tres aspectos fundamentales: conocimientos tecnológicos, pedagógicos y de contenido. Por ejemplo, un profesor de matemáticas puede utilizar la tecnología como una herramienta en su enseñanza, lo que puede llevar a tres posibles escenarios: una mejora en la enseñanza si se utiliza de manera efectiva y resulta significativa para los alumnos, una demora en el proceso debido al tiempo adicional necesario para diseñar e implementar actividades tecnológicas, y desventajas como distracciones de los alumnos o un enfoque excesivo en dominar la herramienta en lugar del contenido (Pattier & Reyero, 2022). Para desarrollar conocimientos tecnológicos, es esencial fomentar el pensamiento computacional (Mouza et al., 2017), que consiste en una red de habilidades informáticas utilizadas para resolver problemas en diversas disciplinas. Este tipo de pensamiento se inculca en los estudiantes desde la educación básica como parte de la cultura general, y no está reservado exclusivamente para los ingenieros informáticos. El objetivo de esta ponencia es analizar el pensamiento computacional de cuatro profesores de matemáticas de Toluca en la resolución de problemas. Los hallazgos apuntan a que el pesamiento computacional fortalece el pensamiento matemático de los docentes para resolver problemas.','Mouza, C., Yang, H., Pan, Y., Ozden, S. Y., & Pollock, L. (2017). Resetting educational technology coursework for. Pattier, D., & Reyero, D. (2022). Aportaciones desde la teoría de la educación a la investigación de ... y tecnología digital. Thohir, M. A., Jumadi, J., & Warsono, W. (2020). Technological pedagogical',NULL,NULL,16,2,1,832,'2024-01-10 10:06:02.000000',NULL),('EN-POSM009','USO DEL ENFOQUE STEAM PARA MODELAR CON GRÁFICAS DE LABORATORIO VIRTUAL: LABU4 ','El enfoque STEAM es cada vez más popular dentro de la didáctica y en particular la didáctica de las matemáticas, dónde una de las principales finalidades es transversalizar matemáticas, tecnología, y ciencias al desarrollar  proyectos y actividades significativas para el estudiantado. En la experiencia didáctica que presentamos se realizó el ciclo de modelación matemáticas al aplicar las herramientas de la aplicación Lab4U cuando estudiantes de bachillerato la activaron durante los juegos mecánicos de un parque de diversiones, teniendo como resultados datos y gráficas de variables físicas que se pueden analizar con la finalidad de obtener aprendizajes significativos, planteados de la realidad de forma multidisciplinaria y con uso de la tecnología. ','modelación, STEAM, gráficas, funciones, tecnología.',NULL,NULL,16,2,1,526,'2024-01-12 09:41:03.000000',NULL),('EN-POSM010','ELABORACIÓN DE UN LIBRO DIGITAL DEL TEMA DE DISTRIBUCIONES DE PROBABILIDAD','En este libro digital se abordan lo temas de distribuciones de probabilidad de una manera didáctica en donde se da cuenta del estudio de las distribuciones de probabilidad de las variables aleatorias discretas, así como de las variables aleatorias continuas; igualmente, se revisan las distribuciones especiales de probabilidad tanto para las primeras como para las segundas. Con el fin de facilitar al estudiante desarrollar habilidades en los procedimientos estadísticos se hace hincapié en los conceptos básicos y se incluyen múltiples ejercicios y preguntas de repaso, además de un completo formulario. Los alumnos podrán hojear el libro con sólo deslizar un dedo en la pantalla, los contenidos audiovisuales de este libro aportan ventajas a la hora de las explicaciones y de la comprensión de los conceptos. El libro digital no se limita a una digitalización de una versión en papel, este material además de la teoría en forma de preguntas, incluye videos de solución a problemas paso a paso, material multimedia de explicación de conceptos y calculadoras digitales para diferentes temas del libro. Al ser interactivos, se aprovecharán todas las ventajas de la red y sus aplicaciones. ','Devore, J. (2011) Probability and Statistics for Engineering and the Sciences. México. CENGAGE Learning. 8 edition.',NULL,NULL,16,2,1,573,'2024-01-16 11:55:47.000000',NULL),('EN-TASM001','FRACTALES EN LA ENSEÑANZA DE LÍMITES CON ESTUDIANTES DE EDUCACIÓN MEDIA SUPERIOR','LA PALABRA “FRACTAL” PROVIENE DEL LATÍN FRACTUS, QUE SIGNIFICA “FRAGMENTADO”, APROPIADO PARA OBJETOS CUYA DIMENSIÓN ES FRACCIONARIA. EL TÉRMINO FUE ACUÑADO POR BENOÎT MANDELBROT EN SU LIBRO THE FRACTAL GEOMETRY OF NATURE. \\\\\\\\r\\\\\\\\nUN FRACTAL ES UN CONJUNTO MATEMÁTICO QUE PUEDE GOZAR DE AUTOSIMILITUD A CUALQUIER ESCALA, SU DIMENSIÓN NO ES ENTERA O SI ES ENTERA NO ES UN ENTERO NORMAL. EL HECHO QUE GOCE DE AUTOSIMILITUD SIGNIFICA QUE EL OBJETO FRACTAL NO DEPENDE DEL OBSERVADOR PARA SER EN SÍ, ES DECIR, SI TOMAMOS ALGUNOS TIPOS DE FRACTALES PODEMOS COMPROBAR QUE AL HACER UN AUMENTO DOBLE EL DIBUJO ES EXACTAMENTE IGUAL AL INICIAL, SI HACEMOS UN AUMENTO 1000 COMPROBAREMOS LA MISMA CARACTERÍSTICA, ASÍ PUES, SI HACEMOS UN AUMENTO N, EL DIBUJO RESULTA IGUAL LUEGO LAS PARTES SE PARECEN AL TODO.\\\\\\\\r\\\\\\\\nPOR OTRA PARTE, SE RETOMA LA TEORÍA DE SITUACIONES DIDÁCTICAS, QUE FUE DESARROLLADA POR EL MATEMÁTICO Y EDUCADOR FRANCÉS GUY BROUSSEAU, LA CUAL SE CENTRA EN DISEÑAR Y ANALIZAR SITUACIONES DE APRENDIZAJE ESPECÍFICAS PARA FAVORECER LA CONSTRUCCIÓN DEL CONOCIMIENTO. ALGUNOS PUNTOS CLAVE QUE SE CONSIDERARON SON LA IDENTIFICACIÓN DEL OBJETO DE CONOCIMIENTO, ES DECIR ANTES DE DISEÑAR LA SITUACIÓN DIDÁCTICA, ES CRUCIAL IDENTIFICAR EL OBJETO DE CONOCIMIENTO QUE SE VA A ENSEÑAR. ESTO SE REFIERE AL CONTENIDO ESPECÍFICO QUE SE QUIERE QUE LOS ESTUDIANTES APRENDAN, DURANTE EL DISEÑO DE LA SITUACIÓN DIDÁCTICA SE IDENTIFICA EL ESCENARIO DE APRENDIZAJE DISEÑADO PARA PRESENTAR EL OBJETO DE CONOCIMIENTO DE MANERA ATRACTIVA Y COMPRENSIBLE. PUEDE INCLUIR PROBLEMAS, ACTIVIDADES, RECURSOS Y DESAFÍOS RELACIONADOS CON EL TEMA.\\\\\\\\r\\\\\\\\nPOR OTRA PARTE, EL CONTRATO DIDÁCTICO HACE ALUSIÓN A QUE ES UN ACUERDO IMPLÍCITO ENTRE EL PROFESOR Y LOS ESTUDIANTES SOBRE CÓMO SE LLEVARÁ A CABO LA ENSEÑANZA Y EL APRENDIZAJE EN UNA SITUACIÓN ESPECÍFICA. ESTO INCLUYE LAS REGLAS, ROLES Y EXPECTATIVAS DE AMBAS PARTES.\\\\\\\\r\\\\\\\\n','SADOVSKY, P. (2005). LA TEORÍA DE SITUACIONES DIDÁCTICAS: UN MARCO PARA PENSAR Y ACTUAR LA ENSEÑANZA DE LA MATEMÁTICA. REFLEXIONES TEÓRICAS PARA LA EDUCACIÓN MATEMÁTICA, 5, 13-66. VALDÉS VÁSQUEZ, P. A. (2016). INTRODUCCIÓN A LA GEOMETRÍA FRACTAL.',NULL,NULL,16,3,1,822,'2023-12-18 15:12:23.000000',NULL),('ID-POSM004','La aplicación de la inteligencia artificial (IA)para potenciar el aprendizaje de las matemáticas','La Inteligencia Artificial (IA) ofrece múltiples beneficios en varios campos, incluyendo la educación. Por ello, este trabajo destaca el impacto de la IA en la enseñanza de la asignatura de Matemáticas II, por lo que el objetivo fue diseñar actividades de aprendizaje respaldadas por la IA que fomenten la autorreflexión y la metacognición en los estudiantes a través de una evaluación continua y oportuna. Es importante señalar que se utilizó un enfoque alternativo y metodologías activas que integraron aspectos disciplinares, pedagógicos y tecnológicos que se aplicó a una muestra por conveniencia a 26 estudiantes de primer año del turno vespertino en la Escuela Nacional Colegio de Ciencias y Humanidades, plantel Vallejo. Los resultados indican que la IA es un aliado valioso para personalizar el aprendizaje, adaptándolo a los estilos y tipos de aprendizaje individuales, ya que los jóvenes desarrollaron distintas habilidades matemáticas, que ayudaron en la resolución de problemas complejos y en una retroalimentación adaptativa, lo que promueve un aprendizaje sólido, significativo, motivador y centrado en el estudiante. En conclusión, esta propuesta aprovechó las ventajas y capacidades de la IA, no obstante, es crucial entender que no reemplaza la interacción humana y debe ser utilizada de manera informada y planificada.\\r\\n','Abeliuk, A., & Gutiérrez, C. (2021). Historia y evoluación de la inteligencia artificial. Revista Bits de Ciencia, (21), 14-21. Becerra, G. (2016). Los usos del constructivismo en las publicaciones científicas de Latinoamérica. Revista Mad, (35), 38-59. Biggs, J. (2006).  Calidad del aprendizaje universitario. España: Narcea.',NULL,NULL,16,2,2,621,'2023-12-14 00:38:56.000000',NULL),('ID-POSM005','REFLEXIONES DEL USO DE FRACTALES EN LA ENSEÑANZA DE LIMITES EN ESTUDIANTES NIVEL MEDIO SUPERIOR','LA PALABRA “FRACTAL” PROVIENE DEL LATÍN FRACTUS, QUE SIGNIFICA “FRAGMENTADO”, APROPIADO PARA OBJETOS CUYA DIMENSIÓN ES FRACCIONARIA. EL TÉRMINO FUE ACUÑADO POR BENOÎT MANDELBROT EN SU LIBRO THE FRACTAL GEOMETRY OF NATURE. UN FRACTAL ES UN CONJUNTO MATEMÁTICO QUE PUEDE GOZAR DE AUTOSIMILITUD A CUALQUIER ESCALA, SU DIMENSIÓN NO ES ENTERA O SI ES ENTERA NO ES UN ENTERO NORMAL. EL HECHO QUE GOCE DE AUTOSIMILITUD SIGNIFICA QUE EL OBJETO FRACTAL NO DEPENDE DEL OBSERVADOR PARA SER EN SÍ, ES DECIR, SI TOMAMOS ALGUNOS TIPOS DE FRACTALES PODEMOS COMPROBAR QUE AL HACER UN AUMENTO DOBLE EL DIBUJO ES EXACTAMENTE IGUAL AL INICIAL, SI HACEMOS UN AUMENTO 1000 COMPROBAREMOS LA MISMA CARACTERÍSTICA, ASÍ PUES, SI HACEMOS UN AUMENTO N, EL DIBUJO RESULTA IGUAL LUEGO LAS PARTES SE PARECEN AL TODO.POR OTRA PARTE, SE RETOMA LA TEORÍA DE SITUACIONES DIDÁCTICAS, QUE FUE DESARROLLADA POR EL MATEMÁTICO Y EDUCADOR FRANCÉS GUY BROUSSEAU, LA CUAL SE CENTRA EN DISEÑAR Y ANALIZAR SITUACIONES DE APRENDIZAJE ESPECÍFICAS PARA FAVORECER LA CONSTRUCCIÓN DEL CONOCIMIENTO. ALGUNOS PUNTOS CLAVE QUE SE CONSIDERARON SON LA IDENTIFICACIÓN DEL OBJETO DE CONOCIMIENTO, ES DECIR ANTES DE DISEÑAR LA SITUACIÓN DIDÁCTICA, ES CRUCIAL IDENTIFICAR EL OBJETO DE CONOCIMIENTO QUE SE VA A ENSEÑAR, ESTO SE REFIERE AL CONTENIDO ESPECÍFICO QUE SE QUIERE QUE LOS ESTUDIANTES APRENDAN, DURANTE EL DISEÑO DE LA SITUACIÓN DIDÁCTICA SE IDENTIFICA EL ESCENARIO DE APRENDIZAJE DISEÑADO PARA PRESENTAR EL OBJETO DE CONOCIMIENTO DE MANERA ATRACTIVA Y COMPRENSIBLE,  EN ESTE CASO TEORÍA DE LÍMITES MATEMÁTICOS. PUEDE INCLUIR PROBLEMAS, ACTIVIDADES, RECURSOS Y DESAFÍOS RELACIONADOS CON EL TEMA.  AL TRABAJAR CON FRACTALES Y LIMITES TENDREMOS UNA SERIE DE REFLEXIONES QUE CONTAR COMO EXPERIENCIA EDUCATIVA.','SADOVSKY, P. (2005). LA TEORÍA DE SITUACIONES DIDÁCTICAS: UN MARCO PARA PENSAR Y ACTUAR LA ENSEÑANZA DE LA MATEMÁTICA. REFLEXIONES TEÓRICAS PARA LA EDUCACIÓN MATEMÁTICA, 5, 13-66. VALDÉS VÁSQUEZ, P. A. (2016). INTRODUCCIÓN A LA GEOMETRÍA FRACTAL.',NULL,NULL,16,2,2,16,'2023-12-19 09:15:04.000000',NULL),('ID-POSM008','EL IMPACTO DE LA INTELIGENCIA ARTIFICIAL EN EL APRENDIZAJE DE ALUMNOS DE BACHILLERATO','El presente trabajo muestra las opiniones de un grupo de estudiantes de la Escuela Nacional Preparatoria de la UNAM, sobre el uso de diferentes inteligencias artificiales, cuando se pidió como actividad que buscaran los principales indicadores financieros en México, situado en  el tema de indicadores financieros que se imparte en la asignatura de Matemáticas VI, área III.\r\nLos resultados sorprendieron a las investigadoras, porque aunque algunos alumnos ya utilizaban la IA para hacer sus tareas, la gran mayoría no las había usado, varios de ellos sólo conocían Chat GPT y algunos alumnos no estuvieron dispuestos a seguirlo usando, por pensar que no era correcto y eso los haría dependientes.\r\nTambién se les pidió una reflexión sobre el uso de las IA en la escuela y muchos coincidieron que aunque es de gran ayuda, ellos mismos están conscientes de que debe ser utilizada con cuidado, con responsabilidad y que no necesariamente los resultados que arroja la IA son válidos o correctos.\r\n','International Baccalaureate®. (2019). La inteligencia artificial en el aprendizaje, la enseñanza y la evaluación1, 3.	Universidad del Valle de México. (2019). Inteligencia artificial en la educación: retos usos y aplicaciones',NULL,NULL,16,2,2,433,'2024-01-10 19:51:08.000000',NULL),('ID-POSM009',' APRENDIZAJE INVERTIDO PARA CÁLCULO DIFERENCIAL: UNA EXPERIENCIA DIDÁCTICA.','En en proceso de enseñanza y aprendizaje tradicional centrado en el profesor, ha dado un giro en el que el alumno ahora debe ser un participante activo en su formación profesional, obligando a implementar nuevas metodologías didácticas, como es el caso del Aprendizaje Invertido a la asignatura de Cálculo Diferencial para alumnos de la carrera de Ingeniería Logística del Tecnológico de Estudios Superiores de Jilotepec. Antes de iniciar el curso, se aplicó un cuestionario de estilo de aprendizaje, lo que facilitó diseñar las actividades a los largo del curso, las que fueron apoyadas con uso de Internet, herramientas digitales y software matemático. El trabajo individual y por equipo fueron importantes para la realimentación entre los alumnos de los conceptos vistos en cada unidad y en la resolución de ejercicios y problemas de aplicación de la derivada, lo cual permitió a los estudiantes ubicar a la asignatura en su formación profesional. Es importante considerar que los conceptos no se aprenden, se construyen siendo el alumno el que adquiere el rol protagónico mientras que el profesor es su guía a lo largo del curso, Finalmente la flexibilidad del Aprendizaje Invertido permite utilizar diversas estrategias de evaluación enfocadas en el aprendizaje significativo.','Zuñiga , César (2021) Aprendizaje Invertido; Centro de Enseñanza y Aprendizaje en Tecnología Educativa, Universidad Rafael Landívar.',NULL,NULL,16,2,2,669,'2024-01-12 12:57:13.000000',NULL),('IP-POSM006','APLICACIÓN DE SERIES DE TIEMPO EN LA REALIZACIÓN DE PRONÓSTICOS UTILIZANDO RSTUDIO','Durante el año 2023, el colegio de profesores de la academia de Estadística Aplicada, dirigió sus trabajos de investigación académica hacia la elaboración de una propuesta de aplicación de una serie de tiempo para la elaboración de pronósticos a corto plazo, utilizando metodología de suavizamiento exponencial simple con Rstudio, dirigida a los estudiantes que cursan la unidad de aprendizaje de Estadística Aplicada del programa académico de Ingeniería en Transporte, que se imparte en la UPIICSA del IPN\r\nEl objetivo general es pronosticar para el 2023, el número de accidentes de tránsito terrestre en zonas urbanas y suburbanas en la alcaldía Iztacalco, a partir de una muestra compuesta por los datos históricos proporcionados por el Instituto Nacional de Estadística y Geografía (INEGI) desde 1997 hasta 2022\r\nEste articulo describe los pasos que los profesores realizaron para el diseño y desarrollo de la propuesta metodológica. Como primer punto se incluye una revisión teórica documental sobre Series de Tiempo, métodos cuantitativos para hacer pronósticos, así como las principales métricas para determinar su precisión. A continuación, para realizar el análisis estadístico y gráficos de la serie de tiempo, se propone trabajar los datos con Rstudio \r\n(entorno de desarrollo integrado) ya que es una herramienta que simplifica notablemente el manejo y la programación con el lenguaje R. Finalmente se presentan resultados, conclusiones y sugerencias para futuras líneas de investigación de interés. \r\nLa motivación y el interés de los estudiantes aumenta, cuando identifican las grandes ventajas que ofrece el uso de lenguaje de programación R con respecto al cálculo manual de los pronósticos, principalmente en la reducción del tiempo de análisis, aumentar su precisión, la obtención de gráficos de manera inmediata y con excelente calidad.\r\nPalabras clave. Pronósticos, Series de tiempo, Ingeniería en transporte, programación\r\n\r\n','CADENA LOZANO, J. B. Gestión del Pronóstico Estratégico: una herramienta de planificación en las empresas. 1. ed. Bogotá: Colegio de Estudios Superiores de Administración - CESA, 2016. 336 p.  Ortuzar, J ( 2012).  Modelos de Demanda de Transporte. Ediciones Universidad Catolica de Chile.',NULL,NULL,16,2,3,51,'2024-01-08 21:53:22.000000',NULL),('IP-POSM007','RELACIÓN DE LAS TAREAS DE ENSEÑANZA CON LAS ACTITUDES DE LOS ESTUDIANTES HACIA LAS MATEMÁTICAS','Relación de las Tareas de Enseñanza con las Actitudes de los Estudiantes hacia las Matemáticas\r\nCategoría: Investigación del proceso de enseñanza de las matemáticas.\r\nResumen\r\nLa investigación nace de la problemática de las actitudes hacia las matemáticas en el CECyTE 01 Tlaxcala y trata de conocer las actitudes de los estudiantes hacia “la evaluación de expresiones algébricas” que generan las tareas de enseñanza con enfoque constructivista, en comparación con las tareas de enseñanza con enfoque tradicionalista.\r\nExisten extensos estudios sobre la relación entre género, etnia, ramas de estudios universitarios, grados, uso de tecnología, desempeño, entre otras, con las actitudes hacia las matemáticas. Sin embargo, no se encontró investigación empírica que analice la relación de las tareas de enseñanza con las actitudes de los estudiantes hacia las matemáticas.\r\nLa metodología se ubica en un paradigma cuantitativo de tipo descriptivo y un diseño cuasiexperimental. En efecto, la muestra se conformó por 60 estudiantes de bachillerato de primer semestre del CECyTE 01.\r\nLas actitudes se midieron a través de una adaptación de la escala Actitudes hacia la estadística de Auzmendi (1992). Se realizaron varios análisis, entre ellos, análisis de consistencia interna del instrumento de medición de actitudes, pruebas de normalidad de muestras independientes, análisis de estadística descriptiva de las actitudes, pruebas para evaluar la significancia de las diferencias entre las actitudes de los dos grupos de estudio y análisis de correlación lineal de factores actitudinales.\r\nEl estudio permite afirmar que la actitud global de los estudiantes hacia “la evaluación de expresiones algebraicas” generadas con tareas de enseñanza constructivistas, es mayor y estadísticamente significativa que la actitud generada con tareas de enseñanza tradicionalista. Asimismo, los resultados permiten aseverar que las tareas de enseñanza constructivistas tienen mayor influencia positiva en la correlación de los factores actitudinales de Utilidad-Agrado y Motivación-Confianza, que las tareas de enseñanza tradicionalistas.\r\nRolando Castillo Filomeno','Auzmendi, Elena. (1992). Las actitudes hacia la Matemática-Estadística en las enseñanzas medias y universitarias. Características y medición. [Archivo PDF]. https://www.researchgate.net/publication/316665759_Las_actitudes_hacia_la_Matematica-Estadistica_en_las_ensenanzas_medias_y_universitarias_Caracteristicas_y_medicion/citation/download',NULL,NULL,16,2,3,825,'2024-01-09 12:41:36.000000',NULL),('IP-POSM008','DISEÑO DE UN RECURSO DIGITAL PARA ENSEÑAR CÁLCULO A PARTIR DE LAS PERCEPCIONES DEL ESTUDIANTADO','Se presenta un avance de investigación en donde a través de un diagnóstico de intervención se reconocen las emociones, percepciones y necesidades de estudiantes de nivel bachillerato y cómo estas inciden en el aprendizaje de las matemáticas. Se busca que, a partir de las dimensiones identificadas en la investigación, se logre construir un recurso digital, específicamente un Recurso Educativo Abierto (REA) que ayude al estudiantado a apreciar el aprendizaje de las matemáticas por medio de actividades que surjan de sus intereses, incluyendo en su elaboración y diseño recursos tecnológicos, modelación matemática y la metodología STEAM como elementos medulares para el aprendizaje de las matemáticas, particularmente en la asignatura de Cálculo diferencial.','García-Mejía, R. O., & García-Vera, E. (2020). Metodología STEAM y su uso en Matemáticas para estudiantes de bachillerato en tiempo de pandemia Covid-19. Dominio de Las Ciencias, 6(2), 163–180. https://doi.org/10.23857/dc.v6i3.1212 Gómez Chacón, I. (2002). Matemática emocional. Los afectos en el aprendizaje matemático. Moriña, A. (2016). Investigar con historias de vida.',NULL,NULL,16,2,3,839,'2024-01-11 21:10:25.000000',NULL),('IP-POSM009','EL PENSAMIENTO VARIACIONAL DEL DOCENTE Y SU INFLUENCIA EN EL PROCESO DE EVALUACIÓN DEL DESEMPEÑO','La evaluación como herramienta de la mejora continua requiere la habilidad de identificar las variables del proceso de enseñanza-aprendizaje y su interrelación. Las estrategias para la identificación de variables y su análisis pertenecen al campo de las matemáticas y son ampliamente utilizadas en los modelos de gestión de calidad. Por otra parte, considerando la Teoría Socioepistemológica, Cantoral, (2016), se establece una filiación entre el conocimiento matemático y las prácticas humanas, esta investigación considera el proceso de evaluación una práctica relevante en la docencia. \r\nEl estudio da respuesta a la interrogante: ¿Qué relación tiene el desarrollo del pensamiento variacional del docente en la implementación del proceso de evaluación del desempeño en el aula bajo el Modelo de Aprendizaje Basado en Competencias? A través de una metodología positivista, de alcance correlacional, de tipo cuantitativo y un diseño no experimental y transversal, se analizó la relación entre la manifestación del pensamiento variacional de los docentes y el proceso de evaluación del desempeño. Como estrategia de cambio se propone un Modelo Sistémico de Evaluación. Las evidencias obtenidas demuestran que los docentes con perfil profesional en el área de matemáticas comprenden mejor el proceso de evaluación de desempeño dentro del aula como los procesos de evaluación laboral. Adicionalmente, la estrategia implementada permitió a los docentes participantes mejorar la comprensión del proceso de evaluación.\r\nCon los resultados se confirma la poca efectividad de la capacitación docente específicamente en los procesos de evaluación del aprendizaje, (INEE, 2017 y 2018), se recomienda desarrollar destrezas complejas propias del pensamiento matemático para para mejorar los procesos de evaluación con base en evidencias. La presente investigación se une a la propuesta de Pastore y Andrade, (2019), para fortalecer en la identidad de los profesores el ser evaluadores del aprendizaje profesionales y éticos.','Cantoral, R. (2016). Teoría Socioepistemológica de la Matemática Educativa. Estudios sobre la construcción social del conocimiento. Gedisa. INEE (2017). La educación obligatoria en México. INEE. Pastore, S. & Andrade, H. (2019). Teacher assessment literacy: A three-dimensional model. Teaching and Teacher Education. 84. 10.1016/j.tate.2019.05.003. Disponible en https://www.researchgate.net/publication/333856284_Teacher_assessment_literacy_A_three-dimensional_model',NULL,NULL,16,2,5,684,'2024-01-15 10:38:37.000000',NULL),('POSM00115','PRUEBA 1 DE PONENCIA ORAL','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 16:56:13.000000',752),('POSM00215','PRUEBA 2 DE PONENCIA TALLER','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 17:25:56.000000',752),('POSM00315','PRUEBA 3 DE PONENCIA PONENCIA','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 17:49:35.000000',752),('POSM00415','PRUEBAS PDF POR TIPOGHASD','asdfasfj\r\n','dsdfsdf',NULL,NULL,15,2,1,488,'2023-06-21 02:04:38.000000',782),('POSM00615','ENRUTAMIENTO CON PT','Resumen de ponencia pt','Referencias de ponencia pt',NULL,NULL,15,2,2,531,'2023-06-28 11:35:27.000000',783),('POSM00715','SEGURUDAD CON LAS MATEMÁTICAS ','Prueba de actualización de trabajos','Seguridad información ',NULL,NULL,15,2,1,783,'2023-06-28 11:35:52.000000',NULL),('POSM00815','PRUEBA DE PONENCIA','Esta es una prueba para registrar una ponencia en el Congreso de Matemáticas','Herrera Cáceres, C. y Rosillo Peña, M. (2019). Confort y eficiencia energética en el diseño de edificaciones. Universidad del Valle.',NULL,NULL,15,2,2,784,'2023-06-28 11:42:08.000000',NULL),('POSM00915','PLATAFORMA LMS EN LA PL','Resumen. Por favor aporbar','Referencias de PL',NULL,NULL,15,2,2,531,'2023-06-28 11:45:14.000000',783),('POSM01015','TITULO DE LA PONENCIA DE MATEMÁTICAS','Resumen de la ponencia','Referencias',NULL,NULL,15,2,1,531,'2023-06-28 11:48:09.000000',784),('POSM01115','PRUEBA','prueba este es una prueba de tu modificación','prueba',NULL,NULL,15,2,1,783,'2023-06-28 11:53:29.000000',NULL),('POSM01315','LA EDUCACIÓN AUTONÓMA COMO SÍNDROME DE LAS NUEVAS GENERACIONES','La formación en el ámbito educativo a nivel superior se centra en jóvenes que pertenecen a la generación “Y” o a los famosos Millennials los cuales son nacidos entre 1981 y 2000, son considerados los que inventan, innovan, cambian paradigmas, disfrutan de la tecnología, los que desean aprender haciendo, son a los que les apasionan los desafíos, a los que se considera “nativos digitales”; se les atribuye la categoría de la primera generación global, la poseedora de una conexión inmediata con todo el mundo.','https://www.bing.com/search?q=LA+EDUCACI%C3%93N+AUTON%C3%93MA+COMO+S%C3%8DNDROME+DE+LAS+NUEVAS+GENERACIONE&cvid=bebec123d41d47fb93f208d7f44679d1&aqs=edge..69i57.405j0j9&FORM=ANAB01&PC=U531',NULL,NULL,15,2,2,242,'2023-06-28 12:08:24.000000',NULL),('POSM01415','PLATAFORMA VIRTUAL CON EJEMPLOS DE SERIES DE FURIER','En numerosos problemas de ingenierÌa aparecen funciones periÛdicas que\r\nse necesitan aproximar mediante sumas de las funciones trigonomÈtricas\r\nseno y coseno, lo que conduce a las series de Fourier.\r\nLas series de Fourier admiten m·s posibilidades de aplicaciÛn que las series\r\nde Taylor, ya que muchas funciones discontinuas se pueden desarrollar en\r\nserie de Fourier pero, por supuesto, no tienen representaciÛn en serie de\r\nTaylor. Recordemos que para que una funciÛn f (x) admita serie de Taylor\r\nen el punto x = a es condiciÛn necesaria que sea indeÖnidamente derivable\r\nen ese punto.\r\n','https://www.unioviedo.es/bayon/docen/AM-Tema-4.pdf',NULL,NULL,15,2,1,242,'2023-06-28 12:16:08.000000',NULL),('POSM01515','PRUEBA 3','Resumen 3','Referencias 3',NULL,NULL,15,2,2,531,'2023-06-28 12:55:53.000000',NULL),('PRSM00115','PROTOTIPO DE REDES','Resumen del prototipo modificado','Referencias del prototipo',NULL,NULL,15,4,3,531,'2023-06-28 11:36:50.000000',784),('PRSM00215','ROBOT QUE RESPONDE A CUASTIONAMIENTOS MATEMÁTICOS','Gracias por interesarse en nuestro contenido, sin embargo todo el contenido de este sitio web, incluyendo de manera enunciativa más no limitativa, textos, logotipos, contenido fotográfico, audio o video, son derechos reservados y propiedad de EMPRESAS EL DEBATE SA DE CV, protegidos por la Ley Federal del Derecho de Autor conforme a su artículo 17, 27 y los demás aplicables. Este contenido, al tratarse de derechos reservados, prohíbe todo tipo de distribución, publicación, edición o venta no autorizada, requiriendo licencia especial para cualquiera de las acciones mencionadas anteriormente, de manera enunciativa más no limitativa. Si desea adquirir licencia para reproducir de manera lícita el contenido propiedad de EMPRESAS EL DEBATE SA DE CV, contactar a Cristina Muñoz Grageda al teléfono 668 816 04 00 Ext. 68050, disponible de lunes a viernes en horarios de oficina, o al correo electrónico cristina.munoz@debate.com.mx. - Derechos Reservados © Empresas EL DEBATE SA de CV 2020','https://www.robotina.us/conectividad/Google-presenta-Minerva-la-Inteligencia-Artificial-que-resuelve-problemas-de-matematicas-20220703-0004.html',NULL,NULL,15,4,5,242,'2023-06-28 12:13:10.000000',354),('PRSM00315','CARTEL ','ysusus','usus',NULL,NULL,15,4,1,750,'2023-06-28 12:47:56.000000',NULL),('TASM00215','CDI CON TICS','Es de pureba','Zill',NULL,NULL,15,3,1,289,'2023-06-28 11:26:41.000000',NULL),('TASM00315','TALLER DE INSTRUMENTOS DE EVALUACIÓN','Resumen del taller','Referencias de la evaluación',NULL,NULL,15,3,4,531,'2023-06-28 11:44:12.000000',784),('TASM00415','AULA VIRTUAL DE MATEMATICAS','AULA VIRTUAL DE MATEMATICAS','AULA VIRTUAL DE MATEMATICAS',NULL,NULL,15,3,1,783,'2023-06-28 11:45:00.000000',NULL),('TASM00515','ENRUTAMIENTO ESTATICO CON CISCO','En asignaturas de redes de computadoras es fundamental el conocimiento y aplicación de sistemas numéricos, así como operaciones de cambio de base, esto hace necesario contar con los conocimientos y habilidades necesarias por parte de los alumnos que cursan estas asignaturas. Este documento tiene como objetivo utilizar los sistemas numéricos como herramienta de apoyo con la cual los alumnos desarrollarán una metodología y la aplicarán en la solución de problemas  de cálculo de redes y subredes y junto a la estrategia de Aprendizaje Basado en Problemas (ABP), los alumnos desarrollaran la competencia de configurar sistemas de asignación automática  de direcciones IP (DHCP) como parte de su formación  para automatizar procesos en la administración de redes de computadoras.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nSe desarrollará una metodología con la cual los alumnos tendrán la habilidad de automatizar procesos de configuración de redes de computadoras, además de conocer y aplicar operaciones con sistemas numéricos como son cambios de base, operaciones de conversión de base de decimal a binario y viceversa.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nLa metodología consiste en realizar una introducción a través de ejercicios didácticos con ejemplos ilustrativos de cambios de base decimal a binaria y binaria a decimal, posteriormente proponer a los alumnos ejercicios prácticos a través de la resolución de ejercicios de cálculo de redes y subredes y así desarrollen la habilidad descrita.   \\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nDe igual manera se utilizarán herramientas en línea que permitan a los alumnos comprobar que las operaciones de cálculo que realizan con base en los sistemas numéricos son correctas y con ello, llevar a cabo prácticas de configuración de un sistema de asignación automática de dicciones IP versión 4. ','Wendell Odo (2020).  CCNA 200-301 Official Cert Guide, Volume 1. Perspectives on IPv4 Subnetting (pp 268-274). Hoboken, NJ: Pearson Education, Inc.',NULL,NULL,15,3,2,354,'2023-06-28 11:46:40.000000',NULL),('TASM00615','TALLER DE MATEMATICAS ESPECIALIZADAS EN COHETES DE PROPULSIÓN CINÉTICO ','Ahora tratamos el caso en el que la masa de un objeto cambia. Analizamos el movimiento de un cohete, que cambia su velocidad (y, por ende, su momento) al expulsar los gases del combustible quemado, lo que hace que se acelere en la dirección opuesta a la velocidad del combustible expulsado (vea la Figura 9.32). Específicamente: Un cohete con todo el combustible en el espacio profundo tiene una masa total  m0\r\n  (esta masa incluye la masa inicial del combustible). En algún momento, el cohete tiene una velocidad  v⃗ \r\n  y masa m; esta masa es una combinación de la masa del cohete vacío y la masa del combustible restante no quemado que contiene. (Nos referimos a m como la \"masa instantánea\" y  v⃗ \r\n  como \"velocidad instantánea\"). El cohete acelera al quemar el combustible que lleva y expulsar los gases quemados de escape. Si la tasa de combustión del combustible es constante, y la velocidad a la que se expulsa el escape también es constante, ¿cuál es el cambio de velocidad del cohete como resultado de la quema de todo su combustible?','https://openstax.org/books/f%C3%ADsica-universitaria-volumen-1/pages/9-7-propulsion-de-cohetes',NULL,NULL,15,3,4,242,'2023-06-28 12:11:28.000000',NULL),('TASM00715','TALLER','modifier','usus',NULL,NULL,15,3,1,750,'2023-06-28 12:47:11.000000',NULL);
