INSERT INTO `ponencia_24012024_1124` VALUES ('AP-POSM001','EL MODELO DE OFERTA Y DEMANDA: UNA PROPUESTA DESDE LA PERSPECTIVA HETERODOXA','La Economía tiene una controversia: ¿Estado o Mercado? Dos campos de la disciplina ayudan a encontrar la respuesta. La visión ortodoxa asume al mercado como el mejor mecanismo de ajuste para encontrar una equitativa distribución de los recursos en una economía. En la mirada heterodoxa apela a una mayor intervención del Estado para regular la acción de los agentes en una economía de mercado. Para un estudiante, la discusión es irrelevante y abstracta. La propuesta es tomar un modelo para señalar los atributos de cada campo. En ese sentido, la ponencia tiene como objetivo mostrar las bondades del uso de las matemáticas para enseñar los dos campos que forman la disciplina de la Economía, a partir del Modelo de Oferta y Demanda (MOD). \r\nDesde los hechos, las Universidades pugnan por explicaciones menos fantasiosas y más reales, los involucrados en la enseñanza demandan más elementos heterodoxos y menos ortodoxos a partir de las crisis recientes (2008 y 2020).\r\nDesde el estado del arte, Lavoie (2011) propone tomar manuales ortodoxos (instrumentos convencionales) e introducir elementos heterodoxos para enseñar economía desde un punto de vista plural y empleando matemáticas (Lavoie, 2015; Lavoie y Seccareccia, 2022) para darle formalidad y entablar un diálogo entre ortodoxos y heterodoxos.\r\nLa metodología consiste en realizar una revisión documental de los principales autores de los dos campos, explicar el MOD con ayuda de elementos matemáticos desde las dos visiones y empleando el instrumento para generar política económica.\r\nLa conclusión principal es desarrollar el MOD desde una perspectiva matemátia heterodoxa, para mostrar al lector que la controversia de la ciencia económica puede compartirse desde la parsimonia a un público no contextualizado en Economía. Otro objetivo que busca la ponencia es impulsar una agenda de uso de matemáticas en modelos e ideas heterodoxas, insistiendo en la necesidad de pluralidad académica.\r\n','Lavoie, M. (2011). La enseñanza de economía post-keynesiana en un departamento ortodoxo. Lavoie, M. (2015). ¿Debería la economía heterodoxa ser enseñada en departamentos de economía, o existe algún espacio para la economía backwater? Lavoie, M. y M. Seccareccia (2022). La economía poskeynesiana, ¿un pensamiento heterodoxo desconocido?',NULL,NULL,16,2,5,801,'2023-12-02 16:59:25.000000',415),('AP-POSM017','RALLY MATEMÁTICO, UNA ACTIVIDAD LÚDICA Y COMPLEMENTARIA AL CURRÍCULO EN EL CCH VALLEJO.','¡Las matemáticas son aburridas!, expresión que suele mencionar el alumnado de cualquier nivel académico, ya que su aprendizaje suele ser memorístico o con la simple repetición y aplicación de fórmulas sin significado, por ello se buscó implementar actividades de carácter lúdico o experimental que contribuyeran al aprendizaje y que favorecieran el razonamiento lógico, la imaginación y creatividad en búsqueda del aprendizaje significativo.\r\nDe lo anterior se propuso realizar un Rally Matemático como una opción al aire libre que permitiera a los alumnos del Colegio de Ciencias y Humanidades plantel Vallejo utilizar diversas habilidades y destrezas para resolver los retos y juegos ubicados en diferentes estaciones favoreciendo aspectos cognitivos y sociales de los alumnos.\r\nEl Rally Matemático busco la participación por equipos de los estudiantes inscritos en cualquier semestre donde debían ejecutar adecuadamente una serie de 8 juegos matemáticos que tenían la intención de estimular la concentración, la memoria y el razonamiento, contribuyendo en la adquisición de conocimientos, pero sobre todo incrementar el gusto por las matemáticas.     En el presente trabajo se muestran los resultados de la aplicación del Rally Matemático en el CCH Vallejo y parte de las actividades desarrolladas.       ','Morera, M y Serrano, A. (2007). Rally… naturaleza, recreación y salud. Revista MHSalud, 1(4), 1-7.',NULL,NULL,16,2,5,55,'2024-01-13 01:05:55.000000',289),('AP-POSM019','LA IMPORTANCIA DE LA SIMULACIÓN Y MODELACIÓN MATEMÁTICA EN LA ENSEÑANZA DE LA FÍSICA EXPERIMENTAL','En este trabajo se presenta la aplicación de la simulación y modelación matemática para el diseño de actividades experimentales con estudiantes de bachillerato que cursan la asignatura de Física III en la Escuela Nacional Colegio de Ciencias y Humanidades (ENCCH). El problema se limita a estudiar la variación del momento de inercia con respecto a la distribución de masa de un sistema rotativo que desciende sobre un plano inclinado. La simulación y modelación se llevó a cabo con GeoGebra, mientras que para el trabajo experimental se implementaron las TIC, en particular, el uso de video en cámara lenta, así como el software video tracker para la toma, análisis e interpretación de datos experimentales. Esta propuesta de enseñanza permitirá a los alumnos desarrollar su autonomía intelectual en ambientes presenciales, virtuales e híbridos, ya que se utilizan materiales accesibles y de bajo costo, así como  softwares de uso libre como los mencionados anteriormente. \\r\\n\\r\\nAdemás, dicho trabajo puede contribuir a la actualización de los Programas de Estudio de la asignatura de Física III que se está llevando a cabo en el presente año en la ENCCH, así como proporcionar a los docentes recursos didácticos tecnológicos innovadores para mejorar los procesos de enseñanza y dar frente a la transformación digital educativa acelerada debida por eventualidades como la ocurrida por la contingencia sanitaria causada por el COVID-19.  \\r\\n','Aguirre. (2006). Actividades expérimentales de Física I. Mecánica. México: Trillas. ',NULL,NULL,16,2,5,390,'2024-01-18 11:52:43.000000',641),('AP-POSM020','DISEÑO DE SIMULADORES EN GEOGEBRA PARA LA ENSEÑANZA DE ALGUNOS CONCEPTOS FÍSICOS','En las últimas décadas, el avance tecnológico en el ámbito educativo ha proporcionado nuevas oportunidades para mejorar la enseñanza y el aprendizaje de la Física. En particular, el uso de simuladores en el aula ha permitido a los estudiantes explorar, conjeturar y comprender conceptos físicos de manera interactiva. Los simuladores se consideran modelos que representan la realidad de forma simplificada. Estos simuladores como objetos de aprendizaje permiten modelar situaciones problemáticas en entornos virtuales, llevando al estudiante a formular hipótesis, conjeturas, e interactuando con el simulador, la construcción de conceptos. \r\nEn este trabajo se presentan ejemplos de simuladores diseñados en GeoGebra para lograr algunos aprendizajes de la asignatura de Física 3, la cual se imparte como optativa en quinto semestre en el Colegio de Ciencias y Humanidades. Además, se analizarán las ventajas y las limitaciones de utilizar GeoGebra para el diseño de este tipo de recursos.','Rosales Guamán, A. V., Cuenca Cumbicos, K. M., Morocho Palacios, H. F., & Tapia Peralta, S. R. (2023). El uso de simuladores en línea para la enseñanza de la física: una herramienta educativa efectiva. Ciencia Latina Revista Científica Multidisciplinar, 7(3), 1488-1496',NULL,NULL,16,2,5,738,'2024-01-19 01:54:01.000000',148),('AP-POSM022','DISEÑO DE  HERRAMIENTA DE TROQUELADO PARA UNA TERMINAL ELECTRICA','Los procesos de troquelado utilizados en la industria metal – mecánica se clasifican en tres grupos, punzonado, doblado y embutido.  Actualmente en nuetro país esta industria  es muy importante, ya que dicho sector aporta el 3.0% del Producto Interno Bruto (PIB) total y el 17.2% del PIB Manufacturero.\\\\r\\\\nPor esta razón es de suma importancia tener una infraestructura para el diseño y manufactura de herramientas para procesar láminas metálicas (chapas).  En este trabajo presentamos el diseño  de un conjunto de herramientas para la fabricación de una terminal eléctrica, así como el cálculo de lasa fuerzas de doblez  y corte del material tomando en cuenta la estimación de la recuperación elástica de este, debido al proceso de doblez de la chapa. Se describe la metodología para establecer los cálculos necesarios para determinar la secuencia de dobleces necesarios para alcanzar las tolerancias en el proceso de corte y doblado.La parte se fabricará en lámina de latón 70-30, calibre # 22 y cuyas tolerancias son de ±  0.005 milésimos de pulgada y de ± 0.30’ de deviación angular.','Faies G. et.al (2009). “Optimization of springback in L-bendign process using a coupled Abaqus/Python algorithm”. Journal Adv. Manuf. Technol. Vol. 44 pp 61-67.  Farsi M, Arezoo B., (2009). “Development of a new method to determine bending sequence in progressive dies”. Journal Adv. Manuf. Technol. Vol. 43 pp 52-60.',NULL,NULL,16,2,5,4,'2024-01-19 11:04:12.000000',353),('AP-POSM024','PROTOTIPO MÓVIL PARA LA RECOLECCIÓN DE EXCREMENTO SÓLIDO CANINO ','El presente trabajo de investigación propone el diseño y construcción de un prototipo móvil que realice el barrido de un área específica en busca de excremento canino para su recolección. Para ello, se propone caracterizar el desecho a recolectar haciendo uso de dos o tres características importantes: presencia de gas metano, temperatura y/o color. Esta información será procesada en una red neuronal, que una vez sea entrenada para clasificar los elementos efectivamente, será implementada al prototipo para clasificar los objetos encontrados en el camino. Esto con la finalidad de facilitar el cuidado y mantenimiento de una casa con perros pequeños como mascotas.\r\nEste trabajo se dividio en 4 partes, La primera   suministra la información clave de los términos y procesos que se emplearon a lo largo del trabajo.\r\nLos siguientes pasos fueron el  Diseño Conceptual y  el Diseño de Detalle. En el primero  se analizaron los requerimientos generales del prototipo y los subsistemas necesarios para su correcto funcionamiento considerando las áreas funcionales de acuerdo con la metodología propuesta por Niegel Cross .  Se analizaron las posibles soluciones a cada una de las funciones requeridas, evalúando las alternativas.  En el Diseño de Detalle se desarrolla a profundidad las alternativas seleccionadas previamente, la selección de materiales y componentes, basados en propiedades fisicas y cálculos matemáticos, así como su correcta manufactura. Por último se realizó la validación de los datos a traves de pruebas en campo, mostrando  la integración de cada una de las áreas funcionales como un todo que trabaja en conjunto para llevar a cabo su función final.','A. Arenas, «Control de excrementos de perro en los espacios públicos municipales,» Universidad de Cordoba. Facultad de Veterinaria., 2014. [En línea]. Available: http://www.corvet.es/img/1rps_1439813577_a.pdf. IBM, «El modelo de redes neuronales,» 2007. [En línea]. Available: https://www.ibm.com/support/knowledgecenter/es/SS3RA7_sub/modeler_mainhelp_client_ddita/components/neuralnet/neuralnet_model.html.. ',NULL,NULL,16,2,5,4,'2024-01-19 12:30:04.000000',353),('AP-POSM027','ECUACIONES DIFERENCIALES DE MAXWELL EN EL DESARROLLO DE PROTIOTIPOS DE INGENIERÍA','Este artículo aborda la aplicación y relevancia de las ecuaciones diferenciales de Maxwell en el proceso de desarrollo de prototipos de ingeniería. Las ecuaciones de Maxwell son fundamentales en la descripción matemática de los fenómenos electromagnéticos, proporcionando un marco teórico esencial para el diseño y funcionamiento de dispositivos eléctricos y electrónicos.\r\nEn el cuerpo del trabajo se proporciona una visión integral de cómo las ecuaciones diferenciales de Maxwell son esenciales en la ingeniería contemporánea, ofreciendo valiosas perspectivas para estudiantes de licenciatura involucrados en proyectos de desarrollo de prototipos electromagnéticos.\r\n','Alexander, C., & Sadiku, M. (2017). Fundamentos de Circuitos Eléctricos (5ta ed.). McGrawHill',NULL,NULL,16,2,5,628,'2024-01-21 21:19:20.000000',289),('AP-POSM031','APRENDIZAJE BASADO EN PROBLEMAS: ENFOQUE EN EL ANÁLISIS ESTADÍSTICO EN PSICOLOGÍA','En la educación superior se debe fomentar la solución de problemas, dejando de lado la repetición acrítica. Esto es de mayor relevancia cuando se trata de cuestiones que incluyen las matemáticas, como en el uso de la estadística. En el caso de la carrera de Psicología, además de su aprendizaje sobre temas teóricos y conceptuales, hay que enfatizar su preparación en probabilidad y estadística, que es un dispositivo clave dentro del proceso de llevar a cabo intervenciones y determinar su efectividad . Esta carrera tiene problemas de reprobación, principalmente en el área metodológica, donde se entrena el análisis estadístico. Considerando que (Fink, 2003): (a) la tecnología amplía la variedad de contextos donde pueda darse un aprendizaje significativo, que el salón tradicional no permite y (b) tiene un efecto por hacer más activo al estudiante, aquí combinamos la situación didáctica en el aula, con la enseñanza virtual en una plataforma Moodle, en un entrenamiento en toma de decisiones estadísticas para la solución de problemas de investigación en Psicología. Como problema se asignó, uno por uno, seis artículos de investigación ya publicados para su análisis estratégico, centrando el enfoque en el análisis estadístico utilizado por el autor. Los participantes, un grupo de sexto semestre, de psicología, fueron entrenados en un curso virtual en la estrategia de análisis de textos (Santoyo, 2001) y se profundizó en las categorías relacionadas con la estadística. Después del curso los estudiantes fueron capaces de realizar análisis cada vez más completos, con una mejora en sus habilidades de análisis estadístico medidas mediante un examen. Asimismo, se logró que los estudiantes propusieran mejoras a los diseños de los artículos analizados. ','Fink, L. D. (2003). Creating significant learning experiences: An integrated approach to designing college courses. USA. John Wiley & Sons. Santoyo, C. (2001). Alternativas docentes. Vol. II. Aportaciones al estudio de la formación en habilidades metodológicas y profesionales en las ciencias del comportamiento. PAPIME, UNAM ',NULL,NULL,16,2,5,466,'2024-01-22 12:53:55.000000',573),('AP-POSM038','MODELOS MATEMÁTICOS EN UN SISTEMA DIGITAL PARA PERSONAS CON DISCAPACIDAD AUDITIVA','En el proyecto que se desarrolla en el Tecnológico de Estudios Superiores de Cuautitlán Izcalli utilizan herramientas como Blender y Kotlin para el reconocimiento del alfabeto en lenguaje de señas que representan patrones definidos.\r\n\r\nEl uso de técnicas en el Reconocimiento de Patrones y el análisis de la información en áreas como la medicina se agrupan bajo el nombre de procesamiento y/o análisis de señales biomédicas, esto se conoce comúnmente bajo el nombre de imagenología biomédica, que es el área de la ciencia que se encarga de extraer información de los seres vivos.\r\n\r\nPara el Reconocimiento de Patrones, se pueden identificar un conjunto de conocimientos y áreas que pueden ser multidisciplinarias, como lo puede ser la biología, la física, la misma medicina que se mencionó anteriormente, en el desarrollo de teorías, técnicas, métodos y el uso de dispositivos computacionales procesos de matemáticos y de ingeniería, que se relacionen con objetos físicos cuyo propósito es extraer o interpretar información que le permita establecer una relación en conjunto entre dichos objetos sobre los cuales se puede hacer una relación, comparación, clasificación o identificación para obtener un resultado y significado de dicha interpretación.\r\n\r\nLos objetos pueden ser fotos, escrituras, señales acústicas, algunas partes del cuerpo como la huella dactilar, el iris del ojo o en el presente caso la forma que presenta una mano para el lenguaje de señas como una forma de comunicación entre por lo menos dos personas donde una de ellas presente discapacidad auditiva.\r\n\r\nLa interpretación se hace mediante el uso de diferentes herramientas como YOLOv3, YOLOv3-tiny y MediaPipe librerías basadas en redes neuronales convolucionales, el uso de Blender que basado en los Algoritmos: Bresenham, DDA y ambas aplicaciones utilizadas en el presente proyecto para el desarrollo e interpretación de la forma y posición de la mano.','Gómez Maria del pilar, 2019, Rangayyan, 2015, Theis y Meyer Ruiz Shulcloper, J., (2013). Acerca del surgimiento del Reconocimiento de Patrones en Cuba. Revista Cubana de Ciencias Informáticas, 7(2), 169-192.-Bäse, 2010, ',NULL,NULL,16,2,5,210,'2024-01-23 18:37:33.000000',NULL),('CASM00215','HISTORIA DE LA CONCEPCIÓN DEL INFINITO EN MATEMÁTICAS','El concepto de infinidad ocupa un lugarimportante en la historia de las matemáticas, sucomprensión fue fundamental para construir y resolver problemas relacionados con el cálculo, geometría,aritmética y álgebra.\\r\\nEl término infinito se formó através de un largo periodo de tiempo, a consecuenciade preguntas e ideas de un determinado número de personajes.\\r\\nEste término hace referencia a que algo no eslimitado, que puede seguir sin tener alguna restricción.Este trabajo se centra en los personajes que aportaronconocimiento para que este concepto naciera, también delas principales preguntas que incentivaron su evolución','López. A. El infinito en la historia de la matemática. Ciencia ytecnología. Buenos Aires. 2005.Stewart. I. 2008.  Historia de las matemáticas. Inglaterra.Editorial crítica.',NULL,NULL,15,1,3,784,'2023-06-28 11:46:34.000000',NULL),('CASM00315','MEDIOS SICRONICOS DE ENERGÍA CUANTICA EN ESTADO SOLIDO','Después de presentar la hipótesis de los cuantos de luz que explicaba el efecto fotoeléctrico en 1905, Einstein demostró en 1906 que los resultados anteriores de Planck sobre la distribución de energía en la radiación electromagnética podrían derivarse utilizando dos supuestos. El primero, ya presente en su artículo de 1905, fue que la luz se compone de cuantos de luz; el segundo fue que los cuantos de luz son emitidos y absorbidos por cargas oscilantes dentro de la materia que vibran solo con ciertas energías cuantificadas. Esto significa que la luz es emitida por cargas oscilantes dentro de la materia, como podría esperarse de la teoría de Maxwell, pero las energías tanto de la luz emitida como de los osciladores están restringidas a ciertos valores permitidos, lo que contradice la teoría clásica. Los osciladores se comportaron como cargas unidas a resortes, oscilando de un lado a otro solo con ciertas frecuencias correspondientes a ciertas energías cuánticas.','https://culturacientifica.com/2020/03/24/solidos-cuanticos/',NULL,NULL,15,1,1,242,'2023-06-28 12:04:27.000000',354),('EN-CASM001','LAS MATEMÁTICAS EN EL ENTORNO DE LA PROGRAMACIÓN','\r\nLAS MATEMÁTICAS EN EL ENTORNO DE LA PROGRAMACIÓN\r\nSabemos que:\r\nLas matemáticas son la herramienta fundamental en la programación. Aunque, no todos los programadores necesitan ser expertos matemáticos, solo con tener los conceptos y habilidades básicas  de las matemáticas puede ser beneficioso en varios aspectos de la programación. Aquí hay algunas áreas donde las matemáticas son especialmente útiles en programación:\r\n1.	Algoritmos y estructuras de datos: La creación y optimización de algoritmos a menudo involucra conceptos matemáticos, como la teoría de grafos, álgebra y análisis de complejidad.\r\n2.	Geometría y gráficos: En el desarrollo de juegos, aplicaciones gráficas y diseño de interfaces de usuario, la geometría y las transformaciones matriciales son esenciales.\r\n3.	Criptografía: La seguridad en la programación, especialmente en el desarrollo de sistemas de cifrado y autenticación, se basa en conceptos matemáticos, como la teoría de números y la aritmética modular.\r\n4.	Procesamiento de señales y imágenes: En áreas como el procesamiento de señales de audio o imágenes, se utilizan conceptos matemáticos como la transformada de Fourier.\r\n5.	Inteligencia artificial y aprendizaje automático: Algoritmos de aprendizaje automático y técnicas de inteligencia artificial a menudo están respaldados por conceptos matemáticos, como álgebra lineal, cálculo y estadísticas.\r\n6.	Simulaciones y modelado: En campos como la simulación y modelado de fenómenos físicos, las ecuaciones matemáticas son esenciales.\r\n7.	Programación científica: En disciplinas científicas y de ingeniería, donde se desarrollan modelos matemáticos, la programación se utiliza para implementar y resolver esos modelos.\r\nAunque es posible programar sin un conocimiento profundo de matemáticas, tener una comprensión sólida de conceptos matemáticos puede facilitar la resolución de problemas complejos y permitir un enfoque más eficiente y elegante en el desarrollo de software. Además, en áreas específicas de la informática, como la investigación y el desarrollo de algoritmos avanzados, las matemáticas se vuelven esenciales.\r\nEnseñanza de las matemáticas a través de la programación \r\nAUTORES: \r\nIng. Guadalupe Hernández Gutiérrez\r\nCOAUTOR:\r\nIng. Rodolfo Lazos Gómez \r\n\r\n','NO APLICA',NULL,NULL,16,1,1,234,'2024-01-10 16:22:33.000000',NULL),('EN-POSM002','USO DE CAS EN LA ENSEÑANZA DE LAS MATEMÁTICAS CON APLICACIONES DE MODELADO.','Las matemáticas son la rama del conocimiento que tienen un papel central no solo en el desarrollo de las demás ciencias, sino también, en el desarrollo de la sociedad, la cultura, el progreso económico y tecnológico de un país. Bajo estos hechos, la enseñanza y uso de las mismas debe de empezar desde una temprana etapa en la formación de los estudiantes con el fin de que estos desarrollen capacidades de análisis y critica para su uso laboral, profesional y en la vida diaria. \r\nAsí, en este proyecto se hara uso del CAS en la enseñanza de las matemáticas con aplicaciones de modelado en nivel medio superior. El cual pretende no solo reforzar las habilidades matemáticas y de razonamiento lógico en esta etapa educativa , sino que ademas, permitirá al estudiante familiarizarse con software científico y de ingeniería para la resolución de problemas, tal como se aborda en la actualidad, esto con la intención de realizar un modelo matemático de un problema contemporáneo que los alumnos elegirán.\r\nEste proyecto integra las habilidades que de manera paralela se aprenden en esta etapa educativa, como lo son: comprensión lectora, análisis de textos, química y física, comunicación de resultados e interpretación de los mismos. Mostrando a los alumnos el alcance y aplicación de los conocimientos que adquiere. \r\nFinalmente haciendo uso de las técnicas de regresión lineal y métodos de optimización, en particular, mínimos cuadrados, el estudiante las aplicara en un problema de su elección, construira el modelo del mismo e interpretara sus resultados. \r\n','Gaisman, M. T. (2023). Innovación Educativa. Obtenido de El uso de la modelación en la enseñanza de las matemáticas: https://www.redalyc.org/pdf/1794/179414894008.pdf',NULL,NULL,16,2,1,24,'2023-12-06 12:43:19.000000',673),('EN-POSM003','El impacto del modelo ADDIE en la enseñanza de las matemáticas','Las matemáticas tienen varios desafíos para que los jóvenes aprendan de manera significativa, sin mencionar que la situación se complicó debido a la pandemia de Covid-19. Por esto, los docentes han tenido que adaptar y buscar estrategias para que los estudiantes alcancen los conocimientos propuestos en los Programas de Estudio, por ende, esta investigación tuvo el objetivo de diseñar materiales audiovisuales basados en el modelo ADDIE que combinan aspectos disciplinarios, pedagógicos y tecnológicos para promover el desarrollo de habilidades matemáticas. Para esto, se trabajó con una muestra por conveniencia no probabilística de 26 estudiantes que cursaban el segundo semestre en la Escuela Nacional Colegio de Ciencias y Humanidades, plantel Vallejo, logrando así que los jóvenes mejoraran significativamente en habilidades de dominio de procedimientos básicos, comprensión de lenguaje, razonamiento matemático y manejo de las herramientas tecnológicas, dado que es un arquetipo que conjuga lo práctico, lo teórico y lo tecnológico a partir de un enfoque pedagógico, siendo así una alternativa viable para reforzar y consolidar conocimientos conceptuales, procedimentales y actitudinales que impacten positivamente en el proceso de aprendizaje de las matemáticas. Sin embargo, es imperativo que los docentes continúen explorando y perfeccionando estrategias que se ajusten a los desafíos de un contexto cambiante.\\r\\n','Morales, B. (2022). Diseño instruccional según el modelo ADDIE en la formación inicial docente. Apertura, 14(1), 80-95. Recuperado de: https://doi.org/10.32870/ap.v14n1.2160',NULL,NULL,16,2,1,621,'2023-12-14 00:30:06.000000',714),('EN-POSM006','PROTOCOLO DE ENRUTAMIENTO INTERIOR OSPF QUE USA EL ALGORITMO DIJKSTRA','\r\nOSPF implementa el algoritmo de Dijkstra para calcular las rutas más cortas dentro de una red. Cada router OSPF mantiene una base de datos de enlaces y utiliza esta información para calcular la tabla de enrutamiento con las rutas más eficientes. La métrica utilizada en OSPF puede ser el costo, que puede basarse en la velocidad del enlace o en otras consideraciones.\r\n\r\nEn el contexto de OSPF, los routers intercambian información sobre los enlaces a través de paquetes de estado de enlace (LSA, Link State Advertisement), y luego utilizan el algoritmo de Dijkstra para construir el árbol SPF y determinar las rutas más cortas. Esto permite que los routers OSPF seleccionen las rutas óptimas para reenviar los paquetes en la red.\r\n\r\n\r\n\r\n\r\n\r\n','Kurose, J. F.,Ross, K. W. (2010).  Redes de computadoras un enfoque descendente. España: Addison Wesley ISBN: 978-84-7829-119-9',NULL,NULL,16,2,1,531,'2024-01-06 12:20:24.000000',148),('EN-POSM008','PRUEBA FINAL','Resumen final','APA',NULL,NULL,16,2,1,531,'2024-01-09 11:20:52.000000',440),('EN-POSM010','ELABORACIÓN DE UN LIBRO DIGITAL DEL TEMA DE DISTRIBUCIONES DE PROBABILIDAD','En este libro digital se abordan lo temas de distribuciones de probabilidad de una manera didáctica en donde se da cuenta del estudio de las distribuciones de probabilidad de las variables aleatorias discretas, así como de las variables aleatorias continuas; igualmente, se revisan las distribuciones especiales de probabilidad tanto para las primeras como para las segundas. Con el fin de facilitar al estudiante desarrollar habilidades en los procedimientos estadísticos se hace hincapié en los conceptos básicos y se incluyen múltiples ejercicios y preguntas de repaso, además de un completo formulario. Los alumnos podrán hojear el libro con sólo deslizar un dedo en la pantalla, los contenidos audiovisuales de este libro aportan ventajas a la hora de las explicaciones y de la comprensión de los conceptos. El libro digital no se limita a una digitalización de una versión en papel, este material además de la teoría en forma de preguntas, incluye videos de solución a problemas paso a paso, material multimedia de explicación de conceptos y calculadoras digitales para diferentes temas del libro. Al ser interactivos, se aprovecharán todas las ventajas de la red y sus aplicaciones. ','Devore, J. (2011) Probability and Statistics for Engineering and the Sciences. México. CENGAGE Learning. 8 edition.',NULL,NULL,16,2,1,573,'2024-01-16 11:55:47.000000',724),('EN-POSM012','LA RESOLUCIÓN DE PROBLEMAS Y EL PENSAMIENTO COMPUTACIONAL DE LOS PROFESORES DE MATEMÁTICAS','La ciencia informática ha experimentado un crecimiento notable en las últimas décadas, superando a otras disciplinas. Su influencia en nuestra vida diaria es cada vez más evidente, aunque a menudo no estamos conscientes de los avances en esta área. Dada esta expansión, la educación no puede permanecer ajena a estos cambios. Aunque no consideramos que la integración de la tecnología sea la única manera de mejorar el sistema educativo, sí la vemos como una alternativa viable para elevar la calidad de nuestra formación (Thohir et al., 2020). Los docentes pueden desempeñar un papel crucial como aliados para incorporar la tecnología en el aula, siempre y cuando estén dispuestos a aceptar el desafío de fortalecer tres aspectos fundamentales: conocimientos tecnológicos, pedagógicos y de contenido. Por ejemplo, un profesor de matemáticas puede utilizar la tecnología como una herramienta en su enseñanza, lo que puede llevar a tres posibles escenarios: una mejora en la enseñanza si se utiliza de manera efectiva y resulta significativa para los alumnos, una demora en el proceso debido al tiempo adicional necesario para diseñar e implementar actividades tecnológicas, y desventajas como distracciones de los alumnos o un enfoque excesivo en dominar la herramienta en lugar del contenido (Pattier & Reyero, 2022). Para desarrollar conocimientos tecnológicos, es esencial fomentar el pensamiento computacional (Mouza et al., 2017), que consiste en una red de habilidades informáticas utilizadas para resolver problemas en diversas disciplinas. Este tipo de pensamiento se inculca en los estudiantes desde la educación básica como parte de la cultura general, y no está reservado exclusivamente para los ingenieros informáticos. El objetivo de esta ponencia es analizar el pensamiento computacional de cuatro profesores de matemáticas de Toluca en la resolución de problemas. Los hallazgos apuntan a que el pesamiento computacional fortalece el pensamiento matemático de los docentes para resolver problemas.','Mouza, C., Yang, H., Pan, Y., Ozden, S. Y., & Pollock, L. (2017). Resetting educational technology coursework for. Pattier, D., & Reyero, D. (2022). Aportaciones desde la teoría de la educación a la investigación de ... y tecnología digital. Thohir, M. A., Jumadi, J., & Warsono, W. (2020). Technological pedagogical',NULL,NULL,16,2,1,832,'2024-01-10 10:06:02.000000',784),('EN-POSM015','USO DEL ENFOQUE STEAM PARA MODELAR CON GRÁFICAS DE LABORATORIO VIRTUAL: LABU4 ','El enfoque STEAM es cada vez más popular dentro de la didáctica y en particular la didáctica de las matemáticas, dónde una de las principales finalidades es transversalizar matemáticas, tecnología, y ciencias al desarrollar  proyectos y actividades significativas para el estudiantado. En la experiencia didáctica que presentamos se realizó el ciclo de modelación matemáticas al aplicar las herramientas de la aplicación Lab4U cuando estudiantes de bachillerato la activaron durante los juegos mecánicos de un parque de diversiones, teniendo como resultados datos y gráficas de variables físicas que se pueden analizar con la finalidad de obtener aprendizajes significativos, planteados de la realidad de forma multidisciplinaria y con uso de la tecnología. ','modelación, STEAM, gráficas, funciones, tecnología.',NULL,NULL,16,2,1,526,'2024-01-12 09:41:03.000000',673),('EN-POSM026','RELEVANCIA DEL DISEÑO INSTRUCCIONAL ELABORACIÓN DE CONTENIDOS EDUCATIVOS DIGITALES EN MATEMÁTICAS','En la época actual la educación mediada por la tecnología de la información y la comunicación (TIC) es una necesidad cotidiana en las instituciones educativas la elaboración de contenidos y objetos digitales, sin embargo, para lograr los objetivos de aprendizaje que se persiguen es necesario que los materiales educativos digitales sean elaborados con bases pedagógicas y didácticas que les den sentido y eficacia como objetos de aprendizaje. Es en esta parte donde se requiere que se utilice una metodología para su desarrollo llamada diseño educacional o instruccional.\r\nEn esta ponencia se describe de manera general el proceso de diseño instruccional y su importancia en la generación de materiales educativos digitales aplicado al desarrollo de un objeto digital de aprendizaje matemático para motivar a los estudiantes para que sigan aprendiendo.\r\n Palabras clave: diseño instruccional, objetos de aprendizaje, enseñanza, didáctica, TIC, matemáticas\r\n','Chew C.S., Wu W.C.V, Idris N., Loh E.F. & Chua Y.P. (2020). Enhancing summary  writing of ESL learners via a theory-based online tool: System development and evaluation, Journal of Educational Computing Research, 58 (2), pp. 398-432, 10.1177/0735633119837765',NULL,NULL,16,2,1,869,'2024-01-21 20:10:19.000000',784),('EN-POSM028','IMPORTANCIA DE LOS NÚMEROS COMPLEJOS EN ELECTROMAGNETISMO','En este artículo se considera la importancia de los números complejos en electromagnetismo y en la propia aplicación de desarrollos eléctricos y electrónicos, así como su potencial impacto en el desarrollo de la ingeniería actual.\r\nSe considera algo de la historia de los números complejos, su impacto actual en circuitos eléctricos y electrónicos como el triángulo de potencias o la impedancia en electrónica. Se respalda con algunas aplicaciones actuales en la ingeniería, específicamente en el área eléctrica y de las telecomunicaciones. Y se concluye con algunos datos de actualidad\r\n','Alexander, C., & Sadiku, M. (Año de publicación). Fundamentos de Circuitos Eléctricos (5ta ed.). Editorial.',NULL,NULL,16,2,5,628,'2024-01-21 21:27:22.000000',653),('EN-POSM033','PRUEBA EVALUACION RESUMEN','Prueba','Prueba',NULL,NULL,16,2,1,785,'2024-01-22 18:42:48.000000',798),('EN-TASM001','FRACTALES EN LA ENSEÑANZA DE LÍMITES CON ESTUDIANTES DE EDUCACIÓN MEDIA SUPERIOR','LA PALABRA “FRACTAL” PROVIENE DEL LATÍN FRACTUS, QUE SIGNIFICA “FRAGMENTADO”, APROPIADO PARA OBJETOS CUYA DIMENSIÓN ES FRACCIONARIA. EL TÉRMINO FUE ACUÑADO POR BENOÎT MANDELBROT EN SU LIBRO THE FRACTAL GEOMETRY OF NATURE. \\\\\\\\r\\\\\\\\nUN FRACTAL ES UN CONJUNTO MATEMÁTICO QUE PUEDE GOZAR DE AUTOSIMILITUD A CUALQUIER ESCALA, SU DIMENSIÓN NO ES ENTERA O SI ES ENTERA NO ES UN ENTERO NORMAL. EL HECHO QUE GOCE DE AUTOSIMILITUD SIGNIFICA QUE EL OBJETO FRACTAL NO DEPENDE DEL OBSERVADOR PARA SER EN SÍ, ES DECIR, SI TOMAMOS ALGUNOS TIPOS DE FRACTALES PODEMOS COMPROBAR QUE AL HACER UN AUMENTO DOBLE EL DIBUJO ES EXACTAMENTE IGUAL AL INICIAL, SI HACEMOS UN AUMENTO 1000 COMPROBAREMOS LA MISMA CARACTERÍSTICA, ASÍ PUES, SI HACEMOS UN AUMENTO N, EL DIBUJO RESULTA IGUAL LUEGO LAS PARTES SE PARECEN AL TODO.\\\\\\\\r\\\\\\\\nPOR OTRA PARTE, SE RETOMA LA TEORÍA DE SITUACIONES DIDÁCTICAS, QUE FUE DESARROLLADA POR EL MATEMÁTICO Y EDUCADOR FRANCÉS GUY BROUSSEAU, LA CUAL SE CENTRA EN DISEÑAR Y ANALIZAR SITUACIONES DE APRENDIZAJE ESPECÍFICAS PARA FAVORECER LA CONSTRUCCIÓN DEL CONOCIMIENTO. ALGUNOS PUNTOS CLAVE QUE SE CONSIDERARON SON LA IDENTIFICACIÓN DEL OBJETO DE CONOCIMIENTO, ES DECIR ANTES DE DISEÑAR LA SITUACIÓN DIDÁCTICA, ES CRUCIAL IDENTIFICAR EL OBJETO DE CONOCIMIENTO QUE SE VA A ENSEÑAR. ESTO SE REFIERE AL CONTENIDO ESPECÍFICO QUE SE QUIERE QUE LOS ESTUDIANTES APRENDAN, DURANTE EL DISEÑO DE LA SITUACIÓN DIDÁCTICA SE IDENTIFICA EL ESCENARIO DE APRENDIZAJE DISEÑADO PARA PRESENTAR EL OBJETO DE CONOCIMIENTO DE MANERA ATRACTIVA Y COMPRENSIBLE. PUEDE INCLUIR PROBLEMAS, ACTIVIDADES, RECURSOS Y DESAFÍOS RELACIONADOS CON EL TEMA.\\\\\\\\r\\\\\\\\nPOR OTRA PARTE, EL CONTRATO DIDÁCTICO HACE ALUSIÓN A QUE ES UN ACUERDO IMPLÍCITO ENTRE EL PROFESOR Y LOS ESTUDIANTES SOBRE CÓMO SE LLEVARÁ A CABO LA ENSEÑANZA Y EL APRENDIZAJE EN UNA SITUACIÓN ESPECÍFICA. ESTO INCLUYE LAS REGLAS, ROLES Y EXPECTATIVAS DE AMBAS PARTES.\\\\\\\\r\\\\\\\\n','SADOVSKY, P. (2005). LA TEORÍA DE SITUACIONES DIDÁCTICAS: UN MARCO PARA PENSAR Y ACTUAR LA ENSEÑANZA DE LA MATEMÁTICA. REFLEXIONES TEÓRICAS PARA LA EDUCACIÓN MATEMÁTICA, 5, 13-66. VALDÉS VÁSQUEZ, P. A. (2016). INTRODUCCIÓN A LA GEOMETRÍA FRACTAL.',NULL,NULL,16,3,1,822,'2023-12-18 15:12:23.000000',NULL),('ID-POSM004','La aplicación de la inteligencia artificial (IA)para potenciar el aprendizaje de las matemáticas','La Inteligencia Artificial (IA) ofrece múltiples beneficios en varios campos, incluyendo la educación. Por ello, este trabajo destaca el impacto de la IA en la enseñanza de la asignatura de Matemáticas II, por lo que el objetivo fue diseñar actividades de aprendizaje respaldadas por la IA que fomenten la autorreflexión y la metacognición en los estudiantes a través de una evaluación continua y oportuna. Es importante señalar que se utilizó un enfoque alternativo y metodologías activas que integraron aspectos disciplinares, pedagógicos y tecnológicos que se aplicó a una muestra por conveniencia a 26 estudiantes de primer año del turno vespertino en la Escuela Nacional Colegio de Ciencias y Humanidades, plantel Vallejo. Los resultados indican que la IA es un aliado valioso para personalizar el aprendizaje, adaptándolo a los estilos y tipos de aprendizaje individuales, ya que los jóvenes desarrollaron distintas habilidades matemáticas, que ayudaron en la resolución de problemas complejos y en una retroalimentación adaptativa, lo que promueve un aprendizaje sólido, significativo, motivador y centrado en el estudiante. En conclusión, esta propuesta aprovechó las ventajas y capacidades de la IA, no obstante, es crucial entender que no reemplaza la interacción humana y debe ser utilizada de manera informada y planificada.\\r\\n','Abeliuk, A., & Gutiérrez, C. (2021). Historia y evoluación de la inteligencia artificial. Revista Bits de Ciencia, (21), 14-21. Becerra, G. (2016). Los usos del constructivismo en las publicaciones científicas de Latinoamérica. Revista Mad, (35), 38-59. Biggs, J. (2006).  Calidad del aprendizaje universitario. España: Narcea.',NULL,NULL,16,2,2,621,'2023-12-14 00:38:56.000000',406),('ID-POSM005','REFLEXIONES DEL USO DE FRACTALES EN LA ENSEÑANZA DE LIMITES EN ESTUDIANTES NIVEL MEDIO SUPERIOR','LA PALABRA “FRACTAL” PROVIENE DEL LATÍN FRACTUS, QUE SIGNIFICA “FRAGMENTADO”, APROPIADO PARA OBJETOS CUYA DIMENSIÓN ES FRACCIONARIA. EL TÉRMINO FUE ACUÑADO POR BENOÎT MANDELBROT EN SU LIBRO THE FRACTAL GEOMETRY OF NATURE. UN FRACTAL ES UN CONJUNTO MATEMÁTICO QUE PUEDE GOZAR DE AUTOSIMILITUD A CUALQUIER ESCALA, SU DIMENSIÓN NO ES ENTERA O SI ES ENTERA NO ES UN ENTERO NORMAL. EL HECHO QUE GOCE DE AUTOSIMILITUD SIGNIFICA QUE EL OBJETO FRACTAL NO DEPENDE DEL OBSERVADOR PARA SER EN SÍ, ES DECIR, SI TOMAMOS ALGUNOS TIPOS DE FRACTALES PODEMOS COMPROBAR QUE AL HACER UN AUMENTO DOBLE EL DIBUJO ES EXACTAMENTE IGUAL AL INICIAL, SI HACEMOS UN AUMENTO 1000 COMPROBAREMOS LA MISMA CARACTERÍSTICA, ASÍ PUES, SI HACEMOS UN AUMENTO N, EL DIBUJO RESULTA IGUAL LUEGO LAS PARTES SE PARECEN AL TODO.POR OTRA PARTE, SE RETOMA LA TEORÍA DE SITUACIONES DIDÁCTICAS, QUE FUE DESARROLLADA POR EL MATEMÁTICO Y EDUCADOR FRANCÉS GUY BROUSSEAU, LA CUAL SE CENTRA EN DISEÑAR Y ANALIZAR SITUACIONES DE APRENDIZAJE ESPECÍFICAS PARA FAVORECER LA CONSTRUCCIÓN DEL CONOCIMIENTO. ALGUNOS PUNTOS CLAVE QUE SE CONSIDERARON SON LA IDENTIFICACIÓN DEL OBJETO DE CONOCIMIENTO, ES DECIR ANTES DE DISEÑAR LA SITUACIÓN DIDÁCTICA, ES CRUCIAL IDENTIFICAR EL OBJETO DE CONOCIMIENTO QUE SE VA A ENSEÑAR, ESTO SE REFIERE AL CONTENIDO ESPECÍFICO QUE SE QUIERE QUE LOS ESTUDIANTES APRENDAN, DURANTE EL DISEÑO DE LA SITUACIÓN DIDÁCTICA SE IDENTIFICA EL ESCENARIO DE APRENDIZAJE DISEÑADO PARA PRESENTAR EL OBJETO DE CONOCIMIENTO DE MANERA ATRACTIVA Y COMPRENSIBLE,  EN ESTE CASO TEORÍA DE LÍMITES MATEMÁTICOS. PUEDE INCLUIR PROBLEMAS, ACTIVIDADES, RECURSOS Y DESAFÍOS RELACIONADOS CON EL TEMA.  AL TRABAJAR CON FRACTALES Y LIMITES TENDREMOS UNA SERIE DE REFLEXIONES QUE CONTAR COMO EXPERIENCIA EDUCATIVA.','SADOVSKY, P. (2005). LA TEORÍA DE SITUACIONES DIDÁCTICAS: UN MARCO PARA PENSAR Y ACTUAR LA ENSEÑANZA DE LA MATEMÁTICA. REFLEXIONES TEÓRICAS PARA LA EDUCACIÓN MATEMÁTICA, 5, 13-66. VALDÉS VÁSQUEZ, P. A. (2016). INTRODUCCIÓN A LA GEOMETRÍA FRACTAL.',NULL,NULL,16,2,2,16,'2023-12-19 09:15:04.000000',362),('ID-POSM013','EL IMPACTO DE LA INTELIGENCIA ARTIFICIAL EN EL APRENDIZAJE DE ALUMNOS DE BACHILLERATO','El presente trabajo muestra las opiniones de un grupo de estudiantes de la Escuela Nacional Preparatoria de la UNAM, sobre el uso de diferentes inteligencias artificiales, cuando se pidió como actividad que buscaran los principales indicadores financieros en México, situado en  el tema de indicadores financieros que se imparte en la asignatura de Matemáticas VI, área III.\r\nLos resultados sorprendieron a las investigadoras, porque aunque algunos alumnos ya utilizaban la IA para hacer sus tareas, la gran mayoría no las había usado, varios de ellos sólo conocían Chat GPT y algunos alumnos no estuvieron dispuestos a seguirlo usando, por pensar que no era correcto y eso los haría dependientes.\r\nTambién se les pidió una reflexión sobre el uso de las IA en la escuela y muchos coincidieron que aunque es de gran ayuda, ellos mismos están conscientes de que debe ser utilizada con cuidado, con responsabilidad y que no necesariamente los resultados que arroja la IA son válidos o correctos.\r\n','International Baccalaureate®. (2019). La inteligencia artificial en el aprendizaje, la enseñanza y la evaluación1, 3.	Universidad del Valle de México. (2019). Inteligencia artificial en la educación: retos usos y aplicaciones',NULL,NULL,16,2,2,433,'2024-01-10 19:51:08.000000',686),('ID-POSM016',' APRENDIZAJE INVERTIDO PARA CÁLCULO DIFERENCIAL: UNA EXPERIENCIA DIDÁCTICA.','En en proceso de enseñanza y aprendizaje tradicional centrado en el profesor, ha dado un giro en el que el alumno ahora debe ser un participante activo en su formación profesional, obligando a implementar nuevas metodologías didácticas, como es el caso del Aprendizaje Invertido a la asignatura de Cálculo Diferencial para alumnos de la carrera de Ingeniería Logística del Tecnológico de Estudios Superiores de Jilotepec. Antes de iniciar el curso, se aplicó un cuestionario de estilo de aprendizaje, lo que facilitó diseñar las actividades a los largo del curso, las que fueron apoyadas con uso de Internet, herramientas digitales y software matemático. El trabajo individual y por equipo fueron importantes para la realimentación entre los alumnos de los conceptos vistos en cada unidad y en la resolución de ejercicios y problemas de aplicación de la derivada, lo cual permitió a los estudiantes ubicar a la asignatura en su formación profesional. Es importante considerar que los conceptos no se aprenden, se construyen siendo el alumno el que adquiere el rol protagónico mientras que el profesor es su guía a lo largo del curso, Finalmente la flexibilidad del Aprendizaje Invertido permite utilizar diversas estrategias de evaluación enfocadas en el aprendizaje significativo.','Zuñiga , César (2021) Aprendizaje Invertido; Centro de Enseñanza y Aprendizaje en Tecnología Educativa, Universidad Rafael Landívar.',NULL,NULL,16,2,2,669,'2024-01-12 12:57:13.000000',353),('ID-POSM021','IMPACTO DE LA EVALUACIÓN FORMATIVA EN ESTUDIANTES','Considerando que la evaluación formativa enfatiza el proceso de retroalimentación del aprendizaje, como un medio que proporciona información para modificar interacciones entre docentes, tecnología y estudiantes, mediante actividades de enseñanza y aprendizaje, un tema que aún no ha sido explorado con suficiente profundidad, se encuentra en saber cómo estudiantes de licenciatura utilizan pruebas (tests) formativas en línea y sus impactos en el aprendizaje. El objetivo se orienta al impacto, esto es, generar una estructura que permita clasificar y analizar cómo se aprovecha este tipo de recursos en clase y fuera de ella, y cómo esto se relaciona con estrategias de aprendizaje. Esta intención se encuentra en el entorno de un proyecto de innovación y mejora a la educación para la asignatura de Álgebra Lineal. Se emplea como marco teórico, la autorregulación del aprendizaje. Los autores generaron el diseño de la estructura que, posteriormente, fue validado por tres especialistas. En una etapa piloto, participaron 16 estudiantes que realizaron tests de temas de Álgebra Lineal según su programa de estudio. Los resultados muestran que los alumnos emplean los tests formativos para una variedad de propósitos, incluyendo la planificación de su aprendizaje y la profundización de su comprensión del contenido del curso. A partir de los resultados, se sugieren recomendaciones en cómo diseñar tests, y en proporcionar una adecuada retroalimentación.\\\\r\\\\n','Hattie, J. A. C., and Gan, M. (2011). “Instruction Based on Feedback,” in Handbook of Research on Learning and Instruction. Editors R. Mayer and P. Alexander New York: Routledge), 249–271.',NULL,NULL,16,2,2,587,'2024-01-19 08:23:24.000000',100),('ID-POSM030','CHATBOT CONVERSACIONAL PARA EVALUACIÓN FORMATIVA EN LA ASIGNATURA DE ANÁLISIS NUMÉRICO','La palabra chatbot surge de las raíces chat, que significa conversar, y bot (contracción de robot) que engloba una serie de algoritmos capaces de ejecutar acciones. En concreto, un chatbot es una aplicación de software que simula mantener una conversación con un usuario. Aunque el uso de los chatbots se ha popularizado en ambientes comerciales, sus potenciales incursiones en el ámbito educativo aún están siendo ampliamente estudiadas. Según su función (en entornos académicos), los chatbots se clasifican en dos: con y sin intencionalidad educativa. La finalidad de los chatbots sin intencionalidad educativa es responder preguntas frecuentes en procesos administrativos. Dentro de la rama de chatbots con fines educacionales se encuentran dos: aquellos con funciones de tutoría y los que fortalecen la ejercitación y práctica en adquisición de destrezas y competencias. El chatbot descrito en este proyecto pertenece a esta última sub-categoría ya que provee y evalúa problemas de Análisis Numérico personalizados de forma inmediata las 24 horas los 7 días de la semana. Al estar alojado en la aplicación de mensajería instantánea Telegram el chatbot disminuye obstáculos en el acceso a contenidos y se adapta a los diferentes estilos y horarios de estudio. Al estar dotado con potencialidades de evaluación, se espera que el chatbot constituya un recurso alternativo en el proceso de evaluación formativa del estudiantado. Además, al estar basado en microactividades, se espera que mejore la retención de conceptos y que diversifique los recursos de evaluación con fines de ajuste aplicados de forma masiva y recurrente.','Wang, J., Hwang, G.,  Chang, C.(2021). Directions of the 100 most cited chatbot-related human behavior research: A review of academic  publications. Computers and Education: Artificial Intelligence, 2, 1–12. https://doi.org/10.1016/j.caeai.2021.100023, Shail, M. S. (2019). Using micro-learning on mobile applications to increase knowledge retention and work performance: A review of literature. Cureus, 11(8). https://doi.org/10.7759/cureus.5307',NULL,NULL,16,2,2,864,'2024-01-22 09:36:28.000000',406),('ID-POSM034','PROCESOS COGNITIVOS PROMOVIDOS EN LIBROS DE TEXTO DE SEGUNDO GRADO DE SECUNDARIA: FUNCIONES LINEALES','Se identifican los procesos cognitivos que se promueven en dos libros de matemáticas, autorizados por la SEP para segundo grado de secundaria en México, durante el ciclo escolar 2022-2023. Se analizan tareas asociadas con funciones lineales, porque esta idea permea todas las ramas matemáticas, desde nivel básico hasta el superior. Los libros de texto son la herramienta principal con la que cuentan los docentes para orientar el proceso de aprendizaje de los estudiantes y, por ello, influyen en la práctica de las aulas y sobre las características del conocimiento que los estudiantes construyen. Se analizan los contenidos de segundo grado ya que existen diversas deficiencias sobre el tema en estudiantes de tercer grado. El fundamento teórico del trabajo incluye la taxonomía de procesos cognitivos de Anderson el al. (2001) y el modelo de resolución de problemas. El marco también considera las diferentes perspectivas desde las cuales se puede analizar el contenido de un libro de texto (Stylianides, 2009). La metodología incluye un análisis cualitativo de contenido (Kuckartz y Rädiker, 2023) desde un punto de vista matemático. La unidad de análisis son las tareas. El análisis de la información incluyó un proceso de segmentación de las tareas, la identificación del contenido explícito y el subyacente. Las herramientas de análisis incluyeron el conteo, nubes de palabras y redes gráficas que muestran un “flujo” de procesos cognitivos. Entre los principales resultados se destaca que la mayor parte de las tareas son algorítmicas, e involucran los procesos cognitivos de recordar e implementar tanto definiciones como algoritmos. Solo en contados casos, las tareas proporcionan a los estudiantes oportunidades para comunicar resultados, expresar ideas o bien explicar la ruta que siguió para resolver el problema que se le plantea. Se detectó además una falta de uniformidad y consistencia en la terminología matemática.','Anderson, L. W., Krathwohl, D. R., Airasain, P. W., Cruikshank, K. A., Mayer, R. E., Pintrich, P. R., Raths, J. & Wittrock, M. C. (2001). A Taxonomy for Learning, Teaching, and Assessing A Revision of Bloom \'s Taxonomy of Educational Objectives. Pearson Education.',NULL,NULL,16,2,2,857,'2024-01-22 19:59:09.000000',NULL),('ID-POSM037','REVISIÓN BIBLIOGRÁFICA EN BASES DE DATOS CIENTÍFICAS COMPARANDO DATOS ESTADÍSTICOS','En este trabajo se hace la búsqueda de información en distintas plataformas de búsqueda de textos científicos para realizar y observar el volumen de información existente sobre un tema en específico que se desea plantear para la elaboración previa de la pregunta investigación abordada. Por tal motivo esta actividad pretende registrar la documentación obtenida de bases de datos de información científica y recursos digitales para la revisión de literatura que le permite al estudiante ir comprendiendo los elementos necesarios para realizar un reporte de investigación experimental. \r\nPara el desarrollo de esta actividad se emplearon diferentes tipos de bases de datos que contienen información científica y buscadores con recursos digitales tales como: Google, Google Académico, Science Direct, Mendeley y Microsoft Académico. Se utilizó una revisión sistemática de los recursos mencionados anteriormente como técnica exploratoria y analítica para realizar una revisión de la literatura, con el objetivo de hacer una comparación del número de textos encontrados en cada base de datos. La acción de revisar según el diccionario de la RAE es observar con atención y cuidado algo en específico o someter algo a un examen para corregirlo o repararlo (Real Academia Española, 2007).\r\nLa Búsqueda se puede realizar por concepto de lo que se quiere obtener de información o mediante el uso de palabras clave, como a continuación se muestrea en un ejemplo.\r\nEjemplo de Búsqueda:\r\n•	General: Photoacoustic signals\r\n•	Definida: Photoacoustic signal analysis\r\n•	Focalizada: Systemic design of a mathematical model for the analysis of photoacoustic signals\r\nSe hizo un ANOVA elaborada con el software STATGRAPHICS en dónde se muestran los valores obtenidos comparando las muestras de los buscadores por lo que con este análisis se busca observar si las medias de los buscadores tienen o no una diferencia estadísticamente significativa.','Real Academia Española. (2007). Disquisición. En Diccionario de la lengua española (22.a ed.). Recuperado de http://buscon.rae.es/draeI/SrvltConsulta?TIPO_BUS=3&LEMA=disquisici%F3n',NULL,NULL,16,2,2,893,'2024-01-23 14:19:01.000000',NULL),('IP-POSM007','APLICACIÓN DE SERIES DE TIEMPO EN LA REALIZACIÓN DE PRONÓSTICOS UTILIZANDO RSTUDIO','Durante el año 2023, el colegio de profesores de la academia de Estadística Aplicada, dirigió sus trabajos de investigación académica hacia la elaboración de una propuesta de aplicación de una serie de tiempo para la elaboración de pronósticos a corto plazo, utilizando metodología de suavizamiento exponencial simple con Rstudio, dirigida a los estudiantes que cursan la unidad de aprendizaje de Estadística Aplicada del programa académico de Ingeniería en Transporte, que se imparte en la UPIICSA del IPN\r\nEl objetivo general es pronosticar para el 2023, el número de accidentes de tránsito terrestre en zonas urbanas y suburbanas en la alcaldía Iztacalco, a partir de una muestra compuesta por los datos históricos proporcionados por el Instituto Nacional de Estadística y Geografía (INEGI) desde 1997 hasta 2022\r\nEste articulo describe los pasos que los profesores realizaron para el diseño y desarrollo de la propuesta metodológica. Como primer punto se incluye una revisión teórica documental sobre Series de Tiempo, métodos cuantitativos para hacer pronósticos, así como las principales métricas para determinar su precisión. A continuación, para realizar el análisis estadístico y gráficos de la serie de tiempo, se propone trabajar los datos con Rstudio \r\n(entorno de desarrollo integrado) ya que es una herramienta que simplifica notablemente el manejo y la programación con el lenguaje R. Finalmente se presentan resultados, conclusiones y sugerencias para futuras líneas de investigación de interés. \r\nLa motivación y el interés de los estudiantes aumenta, cuando identifican las grandes ventajas que ofrece el uso de lenguaje de programación R con respecto al cálculo manual de los pronósticos, principalmente en la reducción del tiempo de análisis, aumentar su precisión, la obtención de gráficos de manera inmediata y con excelente calidad.\r\nPalabras clave. Pronósticos, Series de tiempo, Ingeniería en transporte, programación\r\n\r\n','CADENA LOZANO, J. B. Gestión del Pronóstico Estratégico: una herramienta de planificación en las empresas. 1. ed. Bogotá: Colegio de Estudios Superiores de Administración - CESA, 2016. 336 p.  Ortuzar, J ( 2012).  Modelos de Demanda de Transporte. Ediciones Universidad Catolica de Chile.',NULL,NULL,16,2,3,51,'2024-01-08 21:53:22.000000',603),('IP-POSM009','RELACIÓN DE LAS TAREAS DE ENSEÑANZA CON LAS ACTITUDES DE LOS ESTUDIANTES HACIA LAS MATEMÁTICAS','Relación de las Tareas de Enseñanza con las Actitudes de los Estudiantes hacia las Matemáticas\r\nCategoría: Investigación del proceso de enseñanza de las matemáticas.\r\nResumen\r\nLa investigación nace de la problemática de las actitudes hacia las matemáticas en el CECyTE 01 Tlaxcala y trata de conocer las actitudes de los estudiantes hacia “la evaluación de expresiones algébricas” que generan las tareas de enseñanza con enfoque constructivista, en comparación con las tareas de enseñanza con enfoque tradicionalista.\r\nExisten extensos estudios sobre la relación entre género, etnia, ramas de estudios universitarios, grados, uso de tecnología, desempeño, entre otras, con las actitudes hacia las matemáticas. Sin embargo, no se encontró investigación empírica que analice la relación de las tareas de enseñanza con las actitudes de los estudiantes hacia las matemáticas.\r\nLa metodología se ubica en un paradigma cuantitativo de tipo descriptivo y un diseño cuasiexperimental. En efecto, la muestra se conformó por 60 estudiantes de bachillerato de primer semestre del CECyTE 01.\r\nLas actitudes se midieron a través de una adaptación de la escala Actitudes hacia la estadística de Auzmendi (1992). Se realizaron varios análisis, entre ellos, análisis de consistencia interna del instrumento de medición de actitudes, pruebas de normalidad de muestras independientes, análisis de estadística descriptiva de las actitudes, pruebas para evaluar la significancia de las diferencias entre las actitudes de los dos grupos de estudio y análisis de correlación lineal de factores actitudinales.\r\nEl estudio permite afirmar que la actitud global de los estudiantes hacia “la evaluación de expresiones algebraicas” generadas con tareas de enseñanza constructivistas, es mayor y estadísticamente significativa que la actitud generada con tareas de enseñanza tradicionalista. Asimismo, los resultados permiten aseverar que las tareas de enseñanza constructivistas tienen mayor influencia positiva en la correlación de los factores actitudinales de Utilidad-Agrado y Motivación-Confianza, que las tareas de enseñanza tradicionalistas.\r\nRolando Castillo Filomeno','Auzmendi, Elena. (1992). Las actitudes hacia la Matemática-Estadística en las enseñanzas medias y universitarias. Características y medición. [Archivo PDF]. https://www.researchgate.net/publication/316665759_Las_actitudes_hacia_la_Matematica-Estadistica_en_las_ensenanzas_medias_y_universitarias_Caracteristicas_y_medicion/citation/download',NULL,NULL,16,2,3,825,'2024-01-09 12:41:36.000000',100),('IP-POSM014','DISEÑO DE UN RECURSO DIGITAL PARA ENSEÑAR CÁLCULO A PARTIR DE LAS PERCEPCIONES DEL ESTUDIANTADO','Se presenta un avance de investigación en donde a través de un diagnóstico de intervención se reconocen las emociones, percepciones y necesidades de estudiantes de nivel bachillerato y cómo estas inciden en el aprendizaje de las matemáticas. Se busca que, a partir de las dimensiones identificadas en la investigación, se logre construir un recurso digital, específicamente un Recurso Educativo Abierto (REA) que ayude al estudiantado a apreciar el aprendizaje de las matemáticas por medio de actividades que surjan de sus intereses, incluyendo en su elaboración y diseño recursos tecnológicos, modelación matemática y la metodología STEAM como elementos medulares para el aprendizaje de las matemáticas, particularmente en la asignatura de Cálculo diferencial.','García-Mejía, R. O., & García-Vera, E. (2020). Metodología STEAM y su uso en Matemáticas para estudiantes de bachillerato en tiempo de pandemia Covid-19. Dominio de Las Ciencias, 6(2), 163–180. https://doi.org/10.23857/dc.v6i3.1212 Gómez Chacón, I. (2002). Matemática emocional. Los afectos en el aprendizaje matemático. Moriña, A. (2016). Investigar con historias de vida.',NULL,NULL,16,2,3,839,'2024-01-11 21:10:25.000000',289),('IP-POSM018','EL PENSAMIENTO VARIACIONAL DEL DOCENTE Y SU INFLUENCIA EN EL PROCESO DE EVALUACIÓN DEL DESEMPEÑO','La evaluación como herramienta de la mejora continua requiere la habilidad de identificar las variables del proceso de enseñanza-aprendizaje y su interrelación. Las estrategias para la identificación de variables y su análisis pertenecen al campo de las matemáticas y son ampliamente utilizadas en los modelos de gestión de calidad. Por otra parte, considerando la Teoría Socioepistemológica, Cantoral, (2016), se establece una filiación entre el conocimiento matemático y las prácticas humanas, esta investigación considera el proceso de evaluación una práctica relevante en la docencia. \r\nEl estudio da respuesta a la interrogante: ¿Qué relación tiene el desarrollo del pensamiento variacional del docente en la implementación del proceso de evaluación del desempeño en el aula bajo el Modelo de Aprendizaje Basado en Competencias? A través de una metodología positivista, de alcance correlacional, de tipo cuantitativo y un diseño no experimental y transversal, se analizó la relación entre la manifestación del pensamiento variacional de los docentes y el proceso de evaluación del desempeño. Como estrategia de cambio se propone un Modelo Sistémico de Evaluación. Las evidencias obtenidas demuestran que los docentes con perfil profesional en el área de matemáticas comprenden mejor el proceso de evaluación de desempeño dentro del aula como los procesos de evaluación laboral. Adicionalmente, la estrategia implementada permitió a los docentes participantes mejorar la comprensión del proceso de evaluación.\r\nCon los resultados se confirma la poca efectividad de la capacitación docente específicamente en los procesos de evaluación del aprendizaje, (INEE, 2017 y 2018), se recomienda desarrollar destrezas complejas propias del pensamiento matemático para para mejorar los procesos de evaluación con base en evidencias. La presente investigación se une a la propuesta de Pastore y Andrade, (2019), para fortalecer en la identidad de los profesores el ser evaluadores del aprendizaje profesionales y éticos.','Cantoral, R. (2016). Teoría Socioepistemológica de la Matemática Educativa. Estudios sobre la construcción social del conocimiento. Gedisa. INEE (2017). La educación obligatoria en México. INEE. Pastore, S. & Andrade, H. (2019). Teacher assessment literacy: A three-dimensional model. Teaching and Teacher Education. 84. 10.1016/j.tate.2019.05.003. Disponible en https://www.researchgate.net/publication/333856284_Teacher_assessment_literacy_A_three-dimensional_model',NULL,NULL,16,2,5,684,'2024-01-15 10:38:37.000000',350),('IP-POSM025','REFLEXIÓN Y CONTINGENCIA: DINAMIZANDO EL CONOCIMIENTO EN LA ENSEÑANZA DE LA FUNCIÓN CUADRÁTICA ','Este estudio examina la interacción entre la contingencia y la reflexión en la práctica docente y cómo estas dinámicas contribuyen al conocimiento del profesor de matemáticas. A través del análisis detallado de videograbaciones de las clases de dos profesores del CCH Azcapotzalco enseñando la función cuadrática, se destaca que las situaciones de contingencia —eventos imprevistos en el aula— son fundamentales para la enseñanza efectiva de las matemáticas, ofreciendo oportunidades singulares para el aprendizaje y la adaptación docente. \r\n\r\nEl artículo subraya la importancia de la reflexión en dos momentos esenciales: durante la acción y después de ella definidos en Schön (1983). Se demuestra que la reflexión durante la acción permite a los docentes adaptarse en tiempo real a las contingencias del aula, mientras que la reflexión después de la acción fomenta un análisis profundo de la práctica docente, llevando a una mejora continua y una planificación más efectiva. \r\n\r\nLos hallazgos resaltan que enfrentar y reflexionar sobre las contingencias enriquece el conocimiento del profesor, especialmente en las dimensiones de Fundamentación y Conexión componentes del Cuarteto del Conocimiento (KQ) de Rowland et. al. (2005). Este proceso no solo mejora la comprensión y la adaptabilidad a las necesidades del estudiante, sino que también fortalece la práctica docente en general. ','Schön, D. A. (1983). The reflective practitioner: How profesionals think in action. Basic Books.   Rowland, T., Huckstep, P., & Thwaites, A. (2005). Elementary Teachers’ Mathematics Subject Knowledge: The Knowledge Quartet and the Case of Naomi. Journal of Mathematics Teacher Education, 8(3), 255–281. https://doi.org/10.1007/s10857-005-0853-5 ',NULL,NULL,16,2,3,567,'2024-01-20 18:01:48.000000',100),('IP-POSM029','OMISIONES Y ERRORES DE ESTUDIANTES DE BACHILLERATO CUANDO CONSTRUYEN HISTROGRAMAS','Se presenta un estudio de caso sobre una exploración de omisiones y errores que los estudiantes de quinto semestre de bachillerato (17-18 años) cometen cuando construyen histogramas. Este tipo de gráficos, en general todos, son importantes porque a través de ellos se presenta la información resumida y se pueden observar tendencias descritas por los datos. Se solicitó a los estudiantes que construyeran el histograma (con sus respectivos procedimientos en tablas de frecuencias) a partir de un conjunto de datos dados, se observó que omiten uno o varios elementos que componen a un gráfico tales como el título, las etiquetas de los ejes y comenten errores como escribir mal las escalas en los ejes. Esto indica que se debe poner más énfasis en la enseñanza de la construcción de gráficos, en particular de histogramas, para que se pueda hacer una correcta interpretación de ellos, lo que permitiría una mirada crítica sobre los datos que se nos presentan en los diversos medios de comunicación, informes laborales o escolares.','Álvarez, I., Guerrero, Y. & Torres, Y. (2020). Taxonomía de errores y dificultades en la construcción e interpretación de tablas de frecuencias. Zetetiké, 28. 1-22. DOI: 10.20396/zet.v28i0.8656553',NULL,NULL,16,2,3,700,'2024-01-21 23:14:16.000000',325),('IP-POSM032','DIFICULTADES DE COMPRENSIÓN DE LA SUMA DE FRACCIONES EN ALUMNOS DE BACHILLERATO','Se identifican las dificultades de comprensión de la suma de fracciones en alumnos de un bachillerato público, ubicado en una zona semiurbana del estado de Hidalgo, México. La revisión de la literatura permitió identificar que la mayoría de las investigaciones se han realizado con estudiantes de primaria, por lo que hace falta analizar las dificultades que persisten en estudiantes de bachillerato. Las principales dificultades identificadas son que los estudiantes transfieren, de manera incorrecta, las propiedades de las operaciones con números enteros a las fracciones, lo que es evidencia de una conceptualización errónea o incompleta de la fracción (Lamon, 2020). El referente teórico del estudio son las diferentes interpretaciones de una fracción propuestas por Lamon (2020) y Lesh (1976). Se eligieron y adaptaron nueve problemas verbales que involucran suma de fracciones, retomados de artículos de investigación y de páginas de internet. Los problemas incluyeron fracciones propias, impropias y mixtas. Los participantes de la investigación fueron 10 estudiantes voluntarios (cinco hombres y cinco mujeres) de tercer semestre de bachillerato, quienes resolvieron los problemas en una sesión de una hora, durante el semestre julio-diciembre 2023, y a quienes se les otorgó un punto extra por su participación. Las fuentes de recolección de la información fueron las producciones escritas de los participantes, a partir de las cuales se identificaron los errores que cometieron al sumar fracciones. También se trató de establecer cuáles son las fuentes de tales errores, para de ahí deducir las posibles dificultades de comprensión. Entre los principales resultados se destaca que los errores más comunes que cometen los participantes, al sumar fracciones son, la adición de los denominadores en sumas con diferente denominador, así como el uso parcial del algoritmo estándar en combinación con otros procedimientos, lo cual es indicador de una falta de comprensión de la fracción como un número.\r\n','Lamon, S. J. (2020). Teaching fractions and ratios for understanding. (4a. ed.). Routledge Taylor & Francis Group. Valdemoros, M. & Ruiz, E. (2008). El caso de Lucina para el estudio de las fracciones en la escuela de adultos. Revista Latinoamericana de Investigación en Matemática Educativa, 11(1), 127-156.',NULL,NULL,16,2,3,851,'2024-01-22 16:41:38.000000',NULL),('IP-POSM035','LA ALFABETIZACIÓN MATEMÁTICA DE LOS FUTUROS DOCENTES, UNA PROPUESTA PARA IMPLEMENTAR P.E. 2022 ','En la Escuela Normal No. 2 de Nezahualcóyotl está en marcha una investigación sobre la Alfabetización Matemática, misma que ha generado una serie de conocimientos y propuestas para su implementación con los alumnos que cursan los Planes de Estudio (PE) 2022 en la Licenciatura en Enseñanza y Aprendizaje de las Matemáticas (LEAM). Entre estas está la implementación de un Taller donde se ejemplifique como se puede atender. De igual modo se presenta el concepto que maneja, tanto la Organización para la Cooperación y el Desarrollo Económico (OCDE) como algunos autores, a su vez se consideran datos sobre los resultados obtenidos en la prueba del Programa Para la Evaluación Internacional de los Estudiantes (PISA) desde el 2000 hasta la fecha, los cuales nos refieren la necesidad de abordar el tema con los futuros docentes, de manera inicial porque tendrán que afrontar esa evaluación, la Nueva Escuela Mexicana (NEM), que pone a la comunidad al centro y se demanda una contextualización del aprendizaje que se imparte en educación básica, la investigación sigue su curso, brindando condiciones para poder tomar información derivada de ésta, para ir diseñando actividades que contribuyan a una implementación de los cursos que están por realizarse. Del mismo modo apoyar a los docentes en formación del plan 2018 de la Licenciatura en Enseñanza y Aprendizaje de las Matemáticas en Educación Secundaria (LEAMES), a contar con elementos que les permitan tomar el contexto como base para el desarrollo de planteamientos matemáticos en su labor frente a grupos, también se incluirán a los docentes en formación de la Licenciatura en Educación Primaria, planes 2018 y 2022, quienes también implementan, desde sus prácticas profesionales, los planes de estudio de la NEM. Cabe destacar que el taller ha de contribuir al desarrollo de una alfabetización matemática de los futuros docentes de manera efectiva.','Ángel Alsina, Marcos teóricos de PISA 2003,. Ramón Pajares, Angel Sanz, Luis Rico, El proyecto PISA 2000, Mg. Cesar Hilton Aguilar Ramos, DGESUM. Planes y programas de estudio 2022. DOF:19/08/2022. Acuerdo número 14/08/22, Ley General de Educación DGESUM. Planes y programas de estudio 2022',NULL,NULL,16,2,3,826,'2024-01-23 11:24:27.000000',NULL),('IP-POSM036','ANÁLISIS DE ERRORES EN LA RESOLUCIÓN DE ECUACIONES DIFERENCIALES DE 1° Y 2° ORDEN','Objetivos: Analizar las resoluciones desarrolladas y los errores cometidos por los estudiantes en los ejercicios correspondientes a ecuaciones diferenciales ordinarias de 1° y 2° orden, de la asignatura Matemática de las carreras de Farmacia y Bioquímica de la Facultad de Farmacia y Bioquímica de la Universidad de Buenos Aires.\r\nSustento teórico: Se identifican un conjunto de obstáculos en el aprendizaje de las ecuaciones diferenciales ordinarias que problematizan la comprensión y el aprendizaje de este nuevo saber (García Romero, Arcia Oliveros y otros, 2021). Estos obstáculos pueden ser analizados desde los terrenos epistemológico, didáctico y psicológico (Túregano, 1998). En el plano didáctico, por ejemplo, se asocian tales dificultades con el enfoque algebraico y reduccionista de la enseñanza del cálculo (Milevicich, 2008). Entre los obstáculos epistemológicos que deben atravesar los alumnos, se puede identificar, dualidad del lenguaje utilizado. Mena, Montoya y otros (2007) indican que los obstáculos epistemológicos suelen tener raíces profundas en la propia matemática, y se caracterizan por la persistencia con la cual reaparecen en diversas situaciones y lo determinante que son para el logro del aprendizaje matemático. \r\nMetodología: Se realizó un análisis cualitativo de exámenes parciales y recuperatorios durante los segundos cuatrimestres de las cursadas de 2019, 2022 y 2023. Se analizaron las resoluciones de aquellos ejercicios que involucraban ecuaciones de 1° orden y 2° orden, diferenciándolos y categorizando los tipos de errores. \r\nResultados y conclusiones: Pudimos observar que los estudiantes: 1) Cometieron distintos tipos de errores: algebraicos, mal planteo de las soluciones (homogénea, particular y general), cálculo de la integral, método de resolución que aplican, despeje, entre otros. 2) En el año 2022 presentaron mayores dificultades que en los otros 2 años. \r\nEstas conclusiones se constituyen en elementos imprescindibles para repensar y reformular actividades vinculadas a la enseñanza de las ecuaciones diferenciales ordinarias.\r\n\r\nPalabras clave: Cualitativo, didáctica, ecuaciones, epistemología, obstáculos,universidad\r\n','•	García Romero, T.; Arcia Oliveros, E.; Meza Pallares, D. Pertuz Rincón, J. (2021). Obstáculos epistemológicos en la resolución de problemas de libros de textos de ecuaciones diferenciales ordinarias. Revista Boletín R E D I P E  1 0 (9), 4 3 0 - 4 5 8. ',NULL,NULL,16,2,3,875,'2024-01-23 13:38:23.000000',NULL),('POSM00115','PRUEBA 1 DE PONENCIA ORAL','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor .',NULL,NULL,15,2,3,750,'2023-06-13 16:56:13.000000',752),('POSM00215','PRUEBA 2 DE PONENCIA TALLER','Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lo