L,NULL,15,2,1,488,'2023-06-21 02:04:38.000000',782),('POSM00615','ENRUTAMIENTO CON PT','Resumen de ponencia pt','Referencias de ponencia pt',NULL,NULL,15,2,2,531,'2023-06-28 11:35:27.000000',783),('POSM00715','SEGURUDAD CON LAS MATEMÁTICAS ','Prueba de actualización de trabajos','Seguridad información ',NULL,NULL,15,2,1,783,'2023-06-28 11:35:52.000000',NULL),('POSM00815','PRUEBA DE PONENCIA','Esta es una prueba para registrar una ponencia en el Congreso de Matemáticas','Herrera Cáceres, C. y Rosillo Peña, M. (2019). Confort y eficiencia energética en el diseño de edificaciones. Universidad del Valle.',NULL,NULL,15,2,2,784,'2023-06-28 11:42:08.000000',NULL),('POSM00915','PLATAFORMA LMS EN LA PL','Resumen. Por favor aporbar','Referencias de PL',NULL,NULL,15,2,2,531,'2023-06-28 11:45:14.000000',783),('POSM01015','TITULO DE LA PONENCIA DE MATEMÁTICAS','Resumen de la ponencia','Referencias',NULL,NULL,15,2,1,531,'2023-06-28 11:48:09.000000',784),('POSM01115','PRUEBA','prueba este es una prueba de tu modificación','prueba',NULL,NULL,15,2,1,783,'2023-06-28 11:53:29.000000',NULL),('POSM01315','LA EDUCACIÓN AUTONÓMA COMO SÍNDROME DE LAS NUEVAS GENERACIONES','La formación en el ámbito educativo a nivel superior se centra en jóvenes que pertenecen a la generación “Y” o a los famosos Millennials los cuales son nacidos entre 1981 y 2000, son considerados los que inventan, innovan, cambian paradigmas, disfrutan de la tecnología, los que desean aprender haciendo, son a los que les apasionan los desafíos, a los que se considera “nativos digitales”; se les atribuye la categoría de la primera generación global, la poseedora de una conexión inmediata con todo el mundo.','https://www.bing.com/search?q=LA+EDUCACI%C3%93N+AUTON%C3%93MA+COMO+S%C3%8DNDROME+DE+LAS+NUEVAS+GENERACIONE&cvid=bebec123d41d47fb93f208d7f44679d1&aqs=edge..69i57.405j0j9&FORM=ANAB01&PC=U531',NULL,NULL,15,2,2,242,'2023-06-28 12:08:24.000000',NULL),('POSM01415','PLATAFORMA VIRTUAL CON EJEMPLOS DE SERIES DE FURIER','En numerosos problemas de ingenierÌa aparecen funciones periÛdicas que\r\nse necesitan aproximar mediante sumas de las funciones trigonomÈtricas\r\nseno y coseno, lo que conduce a las series de Fourier.\r\nLas series de Fourier admiten m·s posibilidades de aplicaciÛn que las series\r\nde Taylor, ya que muchas funciones discontinuas se pueden desarrollar en\r\nserie de Fourier pero, por supuesto, no tienen representaciÛn en serie de\r\nTaylor. Recordemos que para que una funciÛn f (x) admita serie de Taylor\r\nen el punto x = a es condiciÛn necesaria que sea indeÖnidamente derivable\r\nen ese punto.\r\n','https://www.unioviedo.es/bayon/docen/AM-Tema-4.pdf',NULL,NULL,15,2,1,242,'2023-06-28 12:16:08.000000',NULL),('POSM01515','PRUEBA 3','Resumen 3','Referencias 3',NULL,NULL,15,2,2,531,'2023-06-28 12:55:53.000000',NULL),('PRSM00115','PROTOTIPO DE REDES','Resumen del prototipo modificado','Referencias del prototipo',NULL,NULL,15,4,3,531,'2023-06-28 11:36:50.000000',784),('PRSM00215','ROBOT QUE RESPONDE A CUASTIONAMIENTOS MATEMÁTICOS','Gracias por interesarse en nuestro contenido, sin embargo todo el contenido de este sitio web, incluyendo de manera enunciativa más no limitativa, textos, logotipos, contenido fotográfico, audio o video, son derechos reservados y propiedad de EMPRESAS EL DEBATE SA DE CV, protegidos por la Ley Federal del Derecho de Autor conforme a su artículo 17, 27 y los demás aplicables. Este contenido, al tratarse de derechos reservados, prohíbe todo tipo de distribución, publicación, edición o venta no autorizada, requiriendo licencia especial para cualquiera de las acciones mencionadas anteriormente, de manera enunciativa más no limitativa. Si desea adquirir licencia para reproducir de manera lícita el contenido propiedad de EMPRESAS EL DEBATE SA DE CV, contactar a Cristina Muñoz Grageda al teléfono 668 816 04 00 Ext. 68050, disponible de lunes a viernes en horarios de oficina, o al correo electrónico cristina.munoz@debate.com.mx. - Derechos Reservados © Empresas EL DEBATE SA de CV 2020','https://www.robotina.us/conectividad/Google-presenta-Minerva-la-Inteligencia-Artificial-que-resuelve-problemas-de-matematicas-20220703-0004.html',NULL,NULL,15,4,5,242,'2023-06-28 12:13:10.000000',354),('PRSM00315','CARTEL ','ysusus','usus',NULL,NULL,15,4,1,750,'2023-06-28 12:47:56.000000',NULL),('TASM00215','CDI CON TICS','Es de pureba','Zill',NULL,NULL,15,3,1,289,'2023-06-28 11:26:41.000000',NULL),('TASM00315','TALLER DE INSTRUMENTOS DE EVALUACIÓN','Resumen del taller','Referencias de la evaluación',NULL,NULL,15,3,4,531,'2023-06-28 11:44:12.000000',784),('TASM00415','AULA VIRTUAL DE MATEMATICAS','AULA VIRTUAL DE MATEMATICAS','AULA VIRTUAL DE MATEMATICAS',NULL,NULL,15,3,1,783,'2023-06-28 11:45:00.000000',NULL),('TASM00515','ENRUTAMIENTO ESTATICO CON CISCO','En asignaturas de redes de computadoras es fundamental el conocimiento y aplicación de sistemas numéricos, así como operaciones de cambio de base, esto hace necesario contar con los conocimientos y habilidades necesarias por parte de los alumnos que cursan estas asignaturas. Este documento tiene como objetivo utilizar los sistemas numéricos como herramienta de apoyo con la cual los alumnos desarrollarán una metodología y la aplicarán en la solución de problemas  de cálculo de redes y subredes y junto a la estrategia de Aprendizaje Basado en Problemas (ABP), los alumnos desarrollaran la competencia de configurar sistemas de asignación automática  de direcciones IP (DHCP) como parte de su formación  para automatizar procesos en la administración de redes de computadoras.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nSe desarrollará una metodología con la cual los alumnos tendrán la habilidad de automatizar procesos de configuración de redes de computadoras, además de conocer y aplicar operaciones con sistemas numéricos como son cambios de base, operaciones de conversión de base de decimal a binario y viceversa.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nLa metodología consiste en realizar una introducción a través de ejercicios didácticos con ejemplos ilustrativos de cambios de base decimal a binaria y binaria a decimal, posteriormente proponer a los alumnos ejercicios prácticos a través de la resolución de ejercicios de cálculo de redes y subredes y así desarrollen la habilidad descrita.   \\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nDe igual manera se utilizarán herramientas en línea que permitan a los alumnos comprobar que las operaciones de cálculo que realizan con base en los sistemas numéricos son correctas y con ello, llevar a cabo prácticas de configuración de un sistema de asignación automática de dicciones IP versión 4. ','Wendell Odo (2020).  CCNA 200-301 Official Cert Guide, Volume 1. Perspectives on IPv4 Subnetting (pp 268-274). Hoboken, NJ: Pearson Education, Inc.',NULL,NULL,15,3,2,354,'2023-06-28 11:46:40.000000',NULL),('TASM00615','TALLER DE MATEMATICAS ESPECIALIZADAS EN COHETES DE PROPULSIÓN CINÉTICO ','Ahora tratamos el caso en el que la masa de un objeto cambia. Analizamos el movimiento de un cohete, que cambia su velocidad (y, por ende, su momento) al expulsar los gases del combustible quemado, lo que hace que se acelere en la dirección opuesta a la velocidad del combustible expulsado (vea la Figura 9.32). Específicamente: Un cohete con todo el combustible en el espacio profundo tiene una masa total  m0\r\n  (esta masa incluye la masa inicial del combustible). En algún momento, el cohete tiene una velocidad  v⃗ \r\n  y masa m; esta masa es una combinación de la masa del cohete vacío y la masa del combustible restante no quemado que contiene. (Nos referimos a m como la \"masa instantánea\" y  v⃗ \r\n  como \"velocidad instantánea\"). El cohete acelera al quemar el combustible que lleva y expulsar los gases quemados de escape. Si la tasa de combustión del combustible es constante, y la velocidad a la que se expulsa el escape también es constante, ¿cuál es el cambio de velocidad del cohete como resultado de la quema de todo su combustible?','https://openstax.org/books/f%C3%ADsica-universitaria-volumen-1/pages/9-7-propulsion-de-cohetes',NULL,NULL,15,3,4,242,'2023-06-28 12:11:28.000000',NULL),('TASM00715','TALLER','modifier','usus',NULL,NULL,15,3,1,750,'2023-06-28 12:47:11.000000',NULL);
