os lineamientos pertinentes ...Saludos.... Comité Evaluador '),('531EN-POSM00265aeb8e94f747','RESUMEN','2024-02-22 12:24:44.000000','A','1) Es conveniente que describa los acronimos por lo menos la primera vez que aparecen en el resumen \r\naun cuando la mayoria de la comunidad este enterada del significado se recomienda realizar la mencionada descripción\r\n\r\n\r\n2) Revisar la referencia de acuerdo al formato APA.\r\n'),('531EN-POSM00365aeb91128abc','RESUMEN','2024-01-30 11:40:25.000000','A','Esperamos su extenso con gran interés, gracias.'),('531EN-POSM00665999b389eabc','RESUMEN','2024-01-06 16:02:17.000000','R','Corregir APA'),('531EN-POSM0066599cec653d6b','RESUMEN','2024-01-06 16:06:39.000000','A',''),('531EN-POSM006659c5054a459b','EXTENSO','2024-01-08 13:43:16.000000','',NULL),('531EN-POSM00665aeb99b8c0fb','EXTENSO','2024-01-22 12:53:15.000000',NULL,NULL),('531EN-POSM007659d80def1cdb','RESUMEN','2024-01-09 11:24:11.000000','A',''),('531EN-POSM007659d81aa9bd2b','EXTENSO','2024-01-09 11:37:30.000000','R',''),('531EN-POSM007659d854ce8d1e','EXTENSO','2024-01-09 11:48:27.000000','R','Debe de corregir el trabajo'),('531EN-POSM007659d8735239ae','EXTENSO','2024-01-09 11:52:04.000000','R','MAl'),('531EN-POSM007659d885835e72','EXTENSO','2024-01-09 11:56:30.000000','R','Error'),('531EN-POSM007659da191e5e96','EXTENSO REVISION FINAL','2024-01-09 13:42:57.000000','F',''),('531EN-POSM00865aec03b0c43b','EXTENSO REVISION FINAL','2024-01-22 13:21:31.000000',NULL,NULL),('531EN-POSM01065aeba42ac45b','RESUMEN','2024-02-01 10:50:42.000000','A','Cambiar el inicio del resumen por:\r\nEn esta ponencia se muestra el uso de un libro digital para abordar los temas de distribuciones de... (en lugar de en este libro digital)'),('531EN-POSM01265af24b86e3d0','RESUMEN','2024-01-22 20:30:16.000000',NULL,NULL),('531EN-POSM01265d3ffe07fc20','RESUMEN','2024-02-19 20:12:43.000000','A',''),('531EN-POSM01565aebb1d78c94','RESUMEN','2024-01-22 12:59:41.000000',NULL,NULL),('531EN-POSM01565d3c73163108','RESUMEN','2024-02-19 15:26:32.000000','A',''),('531EN-POSM01565d3c7b962a7e','RESUMEN','2024-02-22 12:27:08.000000','R','1) Es conveniente que describa los acronimos por lo menos la primera vez que aparecen en el resumen \r\naun cuando la mayoria de la comunidad este enterada del significado se recomienda realizar la mencionada descripción\r\n\r\n2) otra observación es que no esta poniendo referencia alguna y lo que aparece en el apartado de REFERENCIAS son palabras CLAVE\r\n\r\n3) Incluir alguna referencia de acuerdo al formato APA.\r\n'),('531EN-POSM02665af24cd129f4','RESUMEN','2024-01-22 20:30:37.000000',NULL,NULL),('531EN-POSM02665d3ffab14199','RESUMEN','2024-02-19 19:26:03.000000',NULL,NULL),('531EN-POSM02665d505d3e5b19','RESUMEN','2024-02-20 14:04:35.000000',NULL,NULL),('531EN-POSM02665d5f87e7774c','RESUMEN','2024-02-21 23:34:13.000000','A','Dentro del resumen, no se abordar los elementos requeridos de forma clara, modifíquelos:\r\nEl objetivo asumo que es desarrollar materiales educativos digitales.\r\nEl sustento teórico o antecedentes: Es que los materiales sean elaborados con bases pedagógicas y didácticas.\r\nHace falta describir una metodología o desarrollo (si empleara un software determinado, aplicando algún proceso, o método matemático, etc.) \r\nNo se mencionan resultados y/o conclusiones específicas, aunque indica que empleará el aprendizaje matemático, con la intensión de motivar a los estudiantes.'),('531EN-POSM02865aebd960bd72','RESUMEN','2024-01-30 17:11:51.000000','A','El trabajo tiene méritos para ser aprobado y presentado por las aplicaciones en electromagnetismo y en Ingeniería.'),('531EN-POSM03365b97965800cd','RESUMEN','2024-01-30 16:34:13.000000',NULL,NULL),('531EN-POSM04565b7edc7a743b','RESUMEN','2024-01-29 17:26:20.000000','A','En el segundo renglón dide: que se presentan los libros. De decir: que presentan los libros.  o que se presentan en los libros. Corregir en el extenso.'),('531EN-POSM04765b7ef0d09fff','RESUMEN','2024-01-30 17:29:26.000000','A','El trabajo analiza problemas de cálculo de matrices inversas y se compara con el software Python utilizando algoritmos como el de Euler y Runge-Kutta.  Reduce el costo computacional al aumentar el tamaño de las matrices que se consideran. '),('531EN-POSM04965b7ef73e171c','RESUMEN','2024-01-31 15:23:50.000000','A','Hay considerar que el desarrollo tecnológico en la industria de nuestro país requiere de una formación integral que incluya entre otras la la resolución de problemas algebraicos y de Ingeniería. Es importante mencionar cuáles son los conceptos de álgebra lineal incluidos en los diseños y producción de las secuencias didácticas. Describir con mayor claridad el problema contextualizado que se menciona. '),('531EN-POSM05565b7f163a3501','RESUMEN','2024-01-29 12:41:39.000000',NULL,NULL),('531EN-POSM05665b7f17cb1872','RESUMEN','2024-01-29 19:52:58.000000','A','De acuerdo a la revisión realizada a su ponencia titulada:  ALGORITMO GENÉTICO APLICADO MOVILIDAD HUMANA, es aceptada mantiene los elementos indicados en la convocatoria, y le sugiero continuar con las indicaciones en la convocatoria del congreso para la entrega del extenso.. Gracias.'),('531EN-POSM05765b7f1aa1ee44','RESUMEN','2024-01-29 12:42:50.000000',NULL,NULL),('531EN-POSM05865b7f21ac35a6','RESUMEN','2024-01-29 19:42:29.000000','R','¿Cuáles son los elementos que debe tener un resumen para ponencia oral?\r\n1.	Título (Máximo 15 palabras)\r\nConsiderar incluir en el título la palabra “algebraicos” (problemas algebraicos), sólo si fuera el caso y partiendo de la pregunta de investigación donde se menciona “pensamiento algebraico”.\r\n2.	Categoría.\r\nIndicar (EN) al final de la categoría\r\n3.	Contenido\r\nMencionar resultados o conclusiones.\r\n4.	Bibliografía y cibergrafía en estilo APA (American Psychological Association).\r\nRevisar estilo APA en referencia de dónde usar la letra cursiva.\r\n\r\n'),('531EN-POSM06265b7f2c5cd3c6','RESUMEN','2024-01-29 21:06:12.000000','A','Poner explícitamente el objetivo del trabajo.\r\nEn la primera línea menciona “diferentes desarrollos”; especificar a qué tipos de “desarrollos” se refiere. Además se menciona “en la mayoría de los libros de texto”. Indicar de qué nivel educativo se habla.\r\nEn la segunda línea dice “acostumbran” debe decir “acostumbran a”. \r\nEn la cuarta línea, quitar comillas a la palabra “ancho”.\r\nQuitar la bibliografía empleada del texto del contenido.\r\nPara el trabajo en extenso se debe apegar a la “guía para autores”.\r\n'),('531EN-POSM06365b7f3192010c','RESUMEN','2024-01-29 12:48:57.000000',NULL,NULL),('531EN-POSM06365b7f33fb4776','RESUMEN','2024-02-02 12:12:49.000000','R','El trabajo propuesto, es muy interesante, sin embargo, se le solicita definir el objetivo y la metodología, así como ampliar las conclusiones. '),('531EN-POSM07265b7f588495fb','RESUMEN','2024-02-07 19:42:39.000000','A',''),('531EN-POSM07365b7f5afddc40','RESUMEN','2024-02-22 18:23:49.000000','A',''),('531EN-POSM07565b7f5fee1e9e','RESUMEN','2024-01-31 17:24:48.000000','R',''),('531EN-POSM08065b7f748322d5','RESUMEN','2024-01-29 16:34:29.000000','A','El resumen está bien elaborado y se entiende el objetivo y se muestran los resultados.'),('531EN-POSM08165b7f76f4a83b','RESUMEN','2024-02-15 15:20:45.000000','A','Saludos cordiales, su resumen cumple con los requerimientos establecidos, solo hay que realizar algunas modificaciones muy sencillas, le recomiendo no usar mayúsculas a lo largo del texto, solo si se justifica. Noté que quiso usar código para su texto, pero no funciono, aparecen estas etiquetas (\\r\\n), retírelas y revise que en extenso no cometa el mismo error, su bibliografía no cumple con el formato APA versión 6.  '),('531EN-POSM08265b7f7a1bc510','RESUMEN','2024-02-22 13:36:36.000000','R','Se sugiere reestructurar este resumen haciendo mayor énfasis en las TIC empleadas y su uso en la experiencia didáctica para justificar la categoría en la que se inscribió este trabajo; de otra manera, se sugiere solicitar el cambio de categoría a Experiencia e innovación didáctica en la enseñanza de las matemáticas (ID) enviando un correo al Comité Organizador (16congresomatematicas@cuautitlan.unam.mx).'),('531EN-POSM08765b7f85a236a5','RESUMEN','2024-01-29 16:40:43.000000','A','Corregir el título original: que no está completa la palabra Matemática.'),('531EN-POSM08865b7f877ecbed','RESUMEN','2024-02-07 19:52:17.000000','R','Enriquecer con fundamentos teóricos el uso del WhatsApp dentro de la enseñanza superior aplicada matemáticas.'),('531EN-POSM08965c2a192b0d2b','RESUMEN','2024-02-06 15:22:46.000000','A',''),('531EN-POSM09265c2a1f3961c9','RESUMEN','2024-02-13 19:00:46.000000','R','Observaciones: El resumen no tiene bien planteado el objetivo. Hay inconsistencias \r\nCuidar la redacción y ortografía.\r\n  Se recomienda corregir y subirlo de nuevo.'),('531EN-POSM09365c2a2065f216','RESUMEN','2024-02-07 12:02:54.000000','A','Revisar estilo APA en referencias '),('531EN-POSM09665c2a25e899a0','RESUMEN','2024-02-08 13:19:14.000000','A','El titulo de la ponencia es MINIMIZACIÓN DE FUNCIONES DE VARIAS VIABLES EN EL MÉTODO DE REGRESIÓN LINEAL USANDO MAPLE.                                                                                                              \r\n                                                                                                                                                                    \r\n Por el contenido del resumen creo que se debería agregar VARIABLES en vez de VIABLES quedando como:                                                                                                                                                                                                  MINIMIZACIÓN DE FUNCIONES DE VARIAS VARIABLES EN EL MÉTODO DE REGRESIÓN LINEAL USANDO MAPLE.'),('531EN-POSM09765c2a26f83757','RESUMEN','2024-02-06 15:19:43.000000',NULL,NULL),('531EN-POSM10165c2a2b29dffc','RESUMEN','2024-02-08 14:46:07.000000','A',''),('531EN-POSM10265c2a2c60359d','RESUMEN','2024-02-07 14:03:26.000000','A','La cita debe de ir referenciada dentro del texto.'),('531EN-POSM10465cd09b286c57','RESUMEN','2024-02-14 14:07:18.000000','A',''),('531EN-POSM10565cd09c49d258','RESUMEN','2024-02-14 12:43:16.000000',NULL,NULL),('531EN-POSM10565ce22a6d2f22','RESUMEN','2024-02-15 14:30:07.000000','A','Se acepta con la salvedad de que se incluyan aportaciones inéditas de investigación científica relacionada con el aprendizaje, enseñanza y aplicación de las matemáticas, presentando los resultados obtenidos al momento con el debido sustento.  En caso contrario, considere cambiar a la categoría experiencia e innovación didáctica, donde se incluirán experiencias vividas en el entorno educativo en donde se desempeña, e incluir la implementación o modificación de estrategias didácticas bajo\r\nun sustento pedagógico que permita propiciar el aprendizaje en el alumno. \r\n\r\n\r\n'),('531EN-TASM00165c3b98c8cad6','RESUMEN','2024-02-20 22:42:09.000000','A','Solicitamos:\r\n1.    Cuál es su necesidad de requerimientos de software.\r\n2.    Nombres completos y  participantes como ponentes.\r\n3.    El horario de impartirción.\r\n4.    PRESENCIAL o VIRTUAL.\r\n5.    VIRTUAL se le creará y enviará una URL a través de la cual Ud. podrá dar su taller, tecnología a utilizar. Zoom, Meet, etc.\r\n6.    PRESENCIAl indicaremos lugar,  hora.,\r\n7.    Se pide  prueba de comunicación para el día y hora que nos indique. (Solo confirme por favor). \r\n5532067647 / email: 74valsan@gmail.com\r\n'),('531EN-TASM00465c3b9b66e12e','RESUMEN','2024-02-20 22:45:42.000000','A','Solicitamos:\r\n1.    Cuál es su necesidad de requerimientos de software.\r\n2.    Nombres completos y  participantes como ponentes.\r\n3.    El horario de impartición.\r\n4.    PRESENCIAL o VIRTUAL.\r\n5.    VIRTUAL se le creará y enviará una URL a través de la cual Ud. podrá dar su taller, tecnología a utilizar. Zoom, Meet, etc.\r\n6.    PRESENCIAl indicaremos lugar,  hora.,\r\n7.    Se pide  p