-01-23 21:41:07.000000','A',''),('531ID-POSM00565aeb960c93cc','RESUMEN','2024-01-22 20:57:41.000000','R','1. El resumen debe de estar ecrito en altas y bajas (mayusculas y minusculas). Ver guia para autores y plantilla para extensos.\r\n2. En el renglón 8 dice: TODO.POR. Debe decir: TODO. POR'),('531ID-POSM01365aebac65a8f8','RESUMEN','2024-01-29 17:17:35.000000','A','Revisar la bibliografía cuando se incorpore en el extenso.'),('531ID-POSM01665aebb3f48113','RESUMEN','2024-02-08 11:12:19.000000','A',''),('531ID-POSM02165aebc5fd1e3a','RESUMEN','2024-02-02 14:19:19.000000','A','El título es muy general, se solicita que se adecue para estar en concordancia con el resumen. La asignatura de álgebra lineal es muy robusta y el temario de cada institución depende de varios factores entre ellos la extensión, profundidad y número de horas por lo que es necesario especificar cuáles son los temas incluidos en el estudio. Además, se pide caracterizar con precisión la estructura generada a la cual aluden los autores al redactar el objetivo.'),('531ID-POSM03065aebdd415e20','RESUMEN','2024-01-23 21:43:29.000000','A',''),('531ID-POSM03465b7eb3e18428','RESUMEN','2024-01-31 15:56:35.000000','A','El trabajo es aceptado, pero será condicionado para su presentación bajo las siguientes aspectos: 1. Que cumpla con los lineamientos del congreso.  2. Que las referencias sean de acuerdo al formato APA, tanto en el contenido del trabajo como en las referencias bibliográficas, como lo pide el congreso.'),('531ID-POSM03765b7ebd3d5146','RESUMEN','2024-01-31 17:48:29.000000','R','El resumen enviado está bien elaborado, pero no se alinea adecuadamente con la línea temática de experiencia e innovación didáctica en matemáticas, que es el enfoque principal elegido por el auto(res).\r\nSe reconoce el valor de la investigación y el trabajo realizado para explorar la disponibilidad de información científica sobre un tema específico y la utilización de diferentes bases de datos y recursos digitales para la revisión de literatura, pero  nocorresponde con la enseñanza y el aprendizaje de las matemáticas.\r\n'),('531ID-POSM03965b7ec9fca7c3','RESUMEN','2024-02-01 17:57:10.000000','A','En el renglón 9, menciona \"Problema\" con mayúsculas, se debe corregir. En el renglón 12 dice \"...las principales estrategias...2 sugiero diga herramientas. Dice que se resolvieron \"tareas\", ¿debe decir \"tareas\" o \"problemas\"?. Se sugiere mejorar la redacción para ordenar las acciones llevadas a cabo y la forma (individual o colaborativa) en la que se llevó a cabo la investigación. ¿Cómo se clasificaron las estrategias? y ¿cuáles identificaron? (al inicio del resumen dice eso), ¿resolvieron con Geogebra los problemas?'),('531ID-POSM04065b7ecc31961f','RESUMEN','2024-01-29 16:44:31.000000','A','El resumen no dice a dónde se llegó ni cómo se aplicó de manera resumida la metodología.'),('531ID-POSM04365b7ed2774b9b','RESUMEN','2024-01-29 12:23:35.000000',NULL,NULL),('531ID-POSM04465b7ed4e78b15','RESUMEN','2024-01-29 17:36:55.000000','A','En el terecr renglon dice: tecnlógicas. Debe decir. tecnlógías. Corregir en el extenso.'),('531ID-POSM05065b7effa77635','RESUMEN','2024-01-31 17:56:17.000000','R','El tema es relevante y pertinente. Sin embargo, no define con claridad el encuadre teórico que guía su investigación, ni los métodos específicos que tienen previsto emplear. Este aspecto es crucial para fundamentar adecuadamente las conclusiones que se plantean en el trabajo y garantizar la validez y la rigurosidad de los resultados obtenidos.\r\nEs importante que revisen y aclaren estos aspectos en su trabajo antes de enviar la versión final. \r\n'),('531ID-POSM07165b7f55ba925d','RESUMEN','2024-02-02 12:18:45.000000','A',''),('531ID-POSM07665b998d78da80','RESUMEN','2024-02-01 16:46:27.000000','A','El trabajo se encuentra anclado a la categoría denominada: EXPERIENCIA E INNOVACIÓN DIDÁCTICA EN LA ENSEÑANZA DE LAS MATEMATICAS, lo cual da cuenta de la relevancia que tiene el compartirlo con los asistentes al evento. Las referencias son relevantes y acordes a lo que se plantea en la ponencia. Se plantea el objetivo y la muestra en la que se desarrollan las actividades. El tema es relevante por el tema que se aborda.'),('531ID-POSM07765b7f6d26b4f4','RESUMEN','2024-02-20 12:14:47.000000','A','El resumen contiene citas bibliográficas y no deben de ir.'),('531ID-POSM09065c2a1c21a223','RESUMEN','2024-02-22 13:41:31.000000','R','Se sugiere reescribir el resumen haciendo énfasis en cuál es el objetivo del trabajo, cuál es su sustento teórico o antecedentes, describir mejor la metodología o el desarrollo del trabajo, y qué resultados o conclusiones se obtuvieron, para poder decidir si el trabajo se mantiene en la categoría en que se inscribió o se solicita el cambio de categoría de la ponencia a Aplicación y/o vinculación de las matemáticas con otras disciplinas (AP).'),('531ID-TASM00265c3b9988eab1','RESUMEN','2024-02-20 23:01:38.000000','A','Solicitamos:\r\n1.    Cuál es su necesidad de requerimientos de software.\r\n2.    Nombres completos y  participantes como ponentes.\r\n3.    El horario de impartición.\r\n4.    PRESENCIAL o VIRTUAL.\r\n5.    VIRTUAL se le creará y enviará una URL a través de la cual Ud. podrá dar su taller, tecnología a utilizar. Zoom, Meet, etc.\r\n6.    PRESENCIAl indicaremos lugar,  hora.,\r\n7.    Se pide  prueba de comunicación para el día y hora que nos indique. (Solo confirme por favor). \r\n5532067647 / email: 74valsan@gmail.com\r\n'),('531ID-TASM00365c3b9ab61e80','RESUMEN','2024-02-20 23:03:43.000000','A','Solicitamos:\r\n1.    Cuál es su necesidad de requerimientos de software.\r\n2.    Nombres completos y  participantes como ponentes.\r\n3.    El horario de impartición.\r\n4.    PRESENCIAL o VIRTUAL.\r\n5.    VIRTUAL se le creará y enviará una URL a través de la cual Ud. podrá dar su taller, tecnología a utilizar. Zoom, Meet, etc.\r\n6.    PRESENCIAl indicaremos lugar,  hora.,\r\n7.    Se pide  prueba de comunicación para el día y hora que nos indique. (Solo confirme por favor). \r\n5532067647 / email: 74valsan@gmail.com\r\n'),('531IP-POSM00765aeb9d8694a2','RESUMEN','2024-01-24 22:31:40.000000','A',''),('531IP-POSM00965aeba2a79760','RESUMEN','2024-01-22 12:55:38.000000',NULL,NULL),('531IP-POSM00965b7ef67202d4','RESUMEN','2024-01-29 12:47:28.000000','A','Propone reportar una investigación con una temática de interés para profesores de matemática e investigadores en matemática educativa.'),('531IP-POSM01465aebaeba5b64','RESUMEN','2024-01-26 14:07:36.000000','A',''),('531IP-POSM01865aebba9d22d1','RESUMEN','2024-02-22 12:54:09.000000','A','Se recomienda pedir el cambio de categoría de la ponencia a Evaluación del aprendizaje en la enseñanza de las matemáticas en la nueva normalidad (EA) enviando un correo al Comité Organizador (16congresomatematicas@cuautitlan.unam.mx). Se considera que hay algunos detalles en la redacción del resumen que se espera que se corrijan en la presentación del trabajo en extenso.'),('531IP-POSM02565aebcd93d18b','RESUMEN','2024-01-22 13:07:05.000000',NULL,NULL),('531IP-POSM02565b7efc5eb5d1','RESUMEN','2024-02-13 19:34:12.000000','A','No hay observaciones'),('531IP-POSM02965aebdb530640','RESUMEN','2024-02-20 12:12:53.000000','R','Se sugiere cambiar la ponencia a la categoría de “Experiencia en aula”\r\nSi bien esta detectado el problema en la construcción de histogramas por parte de los alumnos, en el resumen no se observa una propuesta de mejora en el proceso de enseñanza aprendizaje para tratar de eliminar las omisiones que presentan los estudiantes. \r\nQue metodología se implementaría y cuales serian los resultados esperados.\r\nSe sugiere eliminar “en general todos,”\r\n'),('531IP-POSM03265b7eb2042ed5','RESUMEN','2024-01-31 16:05:14.000000','A','Se acepta para ser presentado en el congreso pero condicionado a que en el extenso cumpla con las siguientes condiciones: 1, que el extenso cumpla con los lineamientos que se piden para el congreso.  2. que las referencias en el contenido del extenso y reportadas al final del trabajo, cumplan con el estilo APA, como lo pide el congreso.'),('531IP-POSM03565b7eb6d94438','RESUMEN','2024-02-22 17:43:23.000000','A',''),('531IP-POSM03665b7ebba0fd22','RESUMEN','2024-01-30 17:37:11.000000','A','En este trabajo se analizan los errores cometidos por los estudiantes de las carreras de Farmacia y Bioquímica en la solución de Ecuaciones Diferenciales Ordinarias de 1o. y 2o. orden con el fin de reformular las actividades vinculadas a la enseñanza de las ecuaciones diferenciales ordinarias.'),('531IP-POSM04265b7ed084609d','RESUMEN','2024-01-31 08:41:06.000000','A',''),('531IP-POSM04665b7ede3b3657','RESUMEN','2024-01-29 12:54:50.000000','A','Interesante propuesta de recorrido histórico del origen de las matrices y determinantes y aplicaciones.\r\nRevisar ortografía, ya que faltan algunas tildes. Reemplazar “inca pie” por “hincapié”.\r\n'),('531IP-POSM04865b7ef297be29','RESUMEN','2024-01-29 20:01:57.000000','A','De acuerdo a la revisión del resumen de la ponencia titulada: INVESTIGACIÓN DEL PROCESO DE LA ENSEÑANZA DE LAS MATEMATICAS, es aprobado se sugiere de acuerdo contemplar la importancia del pensamiento critico para el aprendizaje de las matemáticas en este caso del calculo mental, además en este proceso de construcción se puede mejorar el titulo iniciando el titulo por el tema central calculo mental '),('531IP-POSM06465b7f393d2e0d','RESUMEN','2024-01-29 14:37:55.000000','A','Se sugiere modificar la redacción de los primeros párrafos en el   resumen (no incluir  las referencias bibliográficas).Se sugiere revisar el formato APA para citar la bibliografía(revisar los ejemplos que se dan en la presentación del extenso).'),('531IP-POSM06565b7f3ae15a1c','RESUMEN','2024-02-05 10:50:10.000000','A','Clarificar la idea y en su caso corregir en la primera línea \"Esta ponencia esta {destina} a compartir\". Tomar en cuenta que al estar en la categoría de investigación,  deberá cumplir en el extenso con todos los requisitos de la misma.'),('531IP-POSM06565c2a3731528d','RESUMEN','2024-02-06 15:42:05.000000','A','Se recomienda ampliar la información de \"se implementó un cuestionario de conocimientos \" , mencionar la validación del cuestionario .Se recomienda además revisar el apartado de cómo se piden presentar las palabras claves.'),('531IP-POSM07065b7f531de234','RESUMEN','2024-01-30 16:22:36.000000','R','El título debe ser más específico. Ya que se trata de un trabajo con estudiantes sólo de tercer grado y con un cierto tipo de problemas. En las referencias no aparece la de Alarcón. Es necesario especificar en el material de cuántos años se consideró. En muy importante incluir la pregunta de investigación. Sería muy útil explicar cómo los estudiantes interactuaron con el software GeoGebra. Y '),('531IP-POSM07465b7f5cec9a22','RESUMEN','2024-01-29 13:09:54.000000','A','La propuesta realizada es de interés para los profesores de matemáticas y se encuentra adecuadamente enmarcada. '),('531IP-POSM08365b7f7c09387a','RESUMEN','2024-02-03 09:33:10.000000','A','Al final del resumen, mencionan que “…desde la corriente conductual de la neurociencia se brinda un inicio y evolución del educando…” no es claro a lo que se refiere con “Inicio del educando”. Y con “evolución” a qué aspecto del educando hace referencia, sugiero especifique con qué se llevó a cabo la investigación, dice “estrategias” pero no menciona algún ejemplo. La población inscrita en 1o no es necesario incluirla, en el resumen basta con la muestra. '),('531IP-POSM09865c2a27e5ecdb','RESUMEN','2024-02-22 23:38:46.000000','A','El trabajo mostrado presenta una buena aportación en esta área de investigación. Se sugiere que se mejore la redacción en donde se menciona el planteamiento de las dos hipótesis, no es claro cuales son.  Se sugiere también incluir los objetos matemáticos o temas a los que fueron enfocados los materiales didácticos, de forma general se menciona \"en Matemáticas\".'),('531POSM00915649c76c21793c','RESUMEN','2023-06-28 12:07:48.000000','A',''),('531PRSM00115649c77525e0d1','RESUMEN','2023-06-28 12:10:01.000000','A','Trabajo completo; cumple con lo reuqerido'),('55AP-POSM01765c83f711687d','EXTENSO REVISION FINAL','2024-02-23 16:07:22.000000','A',''),('55AP-POSM06065cd5e69808ac','RESUMEN','2024-02-19 14:54:18.000000','A','Se recomienda en el extenso destacar la enseñanza y/o aplicación de las matemáticas de manera puntual. Es necesario manejar los conceptos matemáticos y/o estrategias didácticas en donde se destaquen los aprendizajes relacionados con el área seleccionada. '),('587ID-POSM02165d8f3a4e1498','EXTENSO','2024-02-23 13:36:04.000000','',NULL),('621EN-POSM00365cd692a59de6','EXTENSO','2024-02-22 14:01:01.000000','R',''),('621ID-POSM00465cd6957b345a','EXTENSO','2024-02-19 21:07:18.000000','R',''),('628AP-POSM02765d1930a46687','EXTENSO','2024-02-20 12:28:25.000000','R','El trabajo extenso es de máximo 8 cuartillas.\r\nCentrarse en las ecuaciones diferenciales de Maxwell.\r\nAlgunas ecuaciones si tiene el punto final después del número de la ecuación y otras no realizarlo como se sugiere en la guía de extensos del congreso.\r\nUsar Desarrollo. Y quitar Metodología en la línea 278.\r\n'),('628AP-POSM02765d505cfaeb41','EXTENSO REVISION FINAL','2024-02-25 10:59:01.000000','A',''),('628EN-POSM02865c81fc7d4c34','EXTENSO REVISION FINAL','2024-02-25 11:07:25.000000','A',''),('669ID-POSM01665db08e2c1d52','EXTENSO','2024-02-25 03:31:14.000000','',NULL),('685ID-POSM05065bae413af981','RESUMEN','2024-02-16 17:12:51.000000','A',''),('686AP-POSM09165d6504e25e02','RESUMEN','2024-02-21 20:17:04.000000','A',''),('731EN-POSM07565bc4eded179b','RESUMEN','2024-02-16 17:09:49.000000','R','En la primera revisión se le indicó lo siguiente: (1) contar con referencias actualizadas, (2) mejorar la estructura, ya que la coherencia dificulta la comprensión, (3) definir la propuesta con base en el marco. Aún no se observan las mejoras solicitadas.'),('731EN-POSM07565d1927f2635a','RESUMEN','2024-02-18 13:54:02.000000','A','Se observa el esfuerzo por mejorar la ponencia; sin embargo, aún requiere refinarse,  para lograr una presentación más consistente y congruente de las ideas.\r\nAdicionalmente, falta la inclusión de la bibliografía actualizada que respalde la ponencia. revisen Además, la estructura y redacción, consultando bibliografía especializada sobre cómo elaborar este tipo de presentaciones.\r\nSe acepta el resumen, sin embargo, estos puntos se revisarán en la ponencia.'),('738AP-POSM02065bdd2582b307','RESUMEN','2024-02-07 20:56:15.000000','R','La ponencia presenta la siguiente clave AP-POSM020 y sin embargo esta registrada con la Categoría\r\nENSEÑANZA DE LAS MATEMÁTICAS CON LAS TIC EN LA NUEVA NORMALIDAD   favor de revisar '),('750POSM001156488f437ea96d','RESUMEN','2023-06-13 16:58:45.000000','R','Estos comentarios son visibles.'),('750POSM001156488f4c234b5b','RESUMEN','2023-06-13 17:00:06.000000','A','Muy bien.'),('750POSM001156488f50f91c2a','EXTENSO','2023-06-13 17:04:49.000000','R','Muy mal, corrigelo.'),('750POSM001156488f65a5d108','EXTENSO','2023-06-13 17:06:24.000000','R','Nla'),('750POSM001156488f67fc1015','EXTENSO REVISION FINAL','2023-06-13 17:19:57.000000','A','zzz'),('750POSM002156488fb946d361','RESUMEN','2023-06-13 17:30:21.000000','A',''),('750POSM002156488fc1ad1314','EXTENSO REVISION FINAL','2023-06-13 17:31:32.000000','FR','zzzzzzzz'),('750POSM002156488fc6193c94','EXTENSO REVISION FINAL','2023-06-13 17:40:22.000000','FR',''),('750POSM002156488fe8255c4b','EXTENSO REVISION FINAL','2023-06-13 17:40:50.000000',NULL,NULL),('750POSM00315648900a79424e','RESUMEN','2023-06-13 17:50:12.000000','A',''),('750POSM00315648900bef39b3','EXTENSO REVISION FINAL','2023-06-13 17:50:40.000000','F',''),('750PRSM001156488fb55b9ec2','RESUMEN','2023-06-13 17:27:49.000000','R','Faltan coautores para esta ponencia.'),('785AP-CASM00265cd38c72bee8','RESUMEN','2024-02-15 09:33:29.000000','A','Hola estimado Congresista..  Lo saludo con gusto y le comento que su trabajo ha sido aprobado  favor de continuar con los lineamientos del congreso.....Seguimos en contacto...… Comité evaluador  '),('785AP-POSM02065cd37fc5f4a3','RESUMEN','2024-02-17 21:36:27.000000','R','el trabajo se encuentra registrado en la categoría:  Enseñanza de las matemáticas con las TIC en la nueva normalidad (EN). en la nomenclatura no corresponde la clave es AP-POSM020 que representa la categoría: Aplicación y/o vinculación de las matemáticas con otras disciplinas (AP). se recomienda verificar lo anterior. '),('785AP-POSM03865cd3806a46dc','RESUMEN','2024-02-17 21:23:40.000000','R','revisar redacción en:  computacionales procesos de matemáticos y de ingeniería                                                                              debería ser: computacionales procesos matemáticos y de ingeniería'),('785AP-POSM09465cd3810d9510','RESUMEN','2024-02-17 21:41:42.000000','A',''),('785EN-CASM00165cd38bd8d9a6','RESUMEN','2024-02-15 09:34:11.000000','A','Hola estimado Congresista..  Lo saludo con gusto y le comento que su trabajo ha sido aprobado  favor de continuar con los lineamientos del congreso.....Seguimos en contacto...… Comité evaluador '),('785EN-POSM03365af0bbbe6bf5','RESUMEN','2024-01-22 18:44:16.000000','R','Mal'),('785EN-POSM03365b1d4e71ad37','RESUMEN','2024-01-24 21:27:12.000000','A','aprobado'),('785EN-POSM03365c988139b83f','RESUMEN','2024-02-11 20:53:53.000000','A','bien'),('785EN-POSM05565cd38dbb4318','RESUMEN','2024-02-15 09:43:41.000000','A','Hola estimado Congresista..  Lo saludo con gusto y le comento que su trabajo ha sido aprobado  favor de continuar con los lineamientos del congreso.....Seguimos en contacto...… Comité evaluador '),('785EN-POSM09765cd38ebce96d','RESUMEN','2024-02-15 09:43:57.000000','A','Hola estimado Congresista..  Lo saludo con gusto y le comento que su trabajo ha sido aprobado  favor de continuar con los lineamientos del congreso.....Seguimos en contacto...… Comité evaluador '),('801AP-POSM00165d5336370128','EXTENSO','2024-02-20 17:18:59.000000','',NULL),('813EN-POSM08265dbe4ed79cc2','RESUMEN','2024-02-25 19:10:05.000000',NULL,NULL),('825IP-POSM00965c3fcc3881f5','EXTENSO','2024-02-07 18:23:32.000000','R','Debe revisarse detalladamente el formato de APA de las Referencias bibliográficas y corregirse. Por ejemplo: En algunas publicaciones figuran los nombres de los autores y no las iniciales de los mismos; no se han utilizado adecuadamente las itálicas en algunas publicaciones, falta la editorial del libro de Auzmendi.'),('825IP-POSM00965c7d4d9e0154','EXTENSO','2024-02-10 13:56:09.000000','',NULL),('830EN-POSM08865d425927139d','RESUMEN','2024-02-22 09:34:22.000000','A',''),('832EN-POSM01265d4d8b7652b2','EXTENSO','2024-02-20 10:52:07.000000','',NULL),('839IP-POSM01465cd15f66f615','EXTENSO REVISION FINAL','2024-02-22 11:00:36.000000','A',''),('843ID-POSM04065c2e54ed25fb','EXTENSO','2024-02-06 20:05:02.000000','',NULL),('845AP-POSM09965d2af20aac7e','EXTENSO','2024-02-21 12:38:23.000000','R',''),('845AP-POSM09965d82e0b83428','EXTENSO','2024-02-22 23:32:59.000000','',NULL),('847IP-POSM07465d992452a9c1','EXTENSO REVISION FINAL','2024-02-26 11:40:31.000000','F',''),('849IP-POSM07065c116b8c2184','RESUMEN','2024-02-19 16:22:18.000000','A','Es importante precisar que la modalidad de telesecundaria está directamente relacionada con la Nueva Escuela Mexicana y en consecuencia no se limita sólo a la resolución de problemas (se recomienda adecuar la redacción). \"El diseño de una solución\" ¿ cómo lo logran los estudiantes? (es necesario aclarar este punto). Al final del resumen afirma: \"... respecto a la resolución de problemas en el aula escolar, lo cual permite mejorar el ...\" Identificar resultados no necesariamente permite una mejora (necesita explicar).'),('857ID-POSM03465d6cbfa756c3','EXTENSO','2024-02-21 22:22:18.000000','',NULL),('864ID-POSM03065d517afb5aa1','EXTENSO','2024-02-22 18:59:19.000000','R',''),('865IP-POSM04265d78f4a389a7','EXTENSO','2024-02-26 12:36:23.000000','R','Revisar la redacción del documento. Revisar algunas palabras están separadas por dos o mas espacios, algunas palabras sin acentos'),('888IP-POSM06465d95b52885c7','EXTENSO','2024-02-23 20:58:26.000000','',NULL),('890ID-POSM07665d2b658bc81d','EXTENSO','2024-02-20 09:32:42.000000','R','En general, el documento se plantea de forma adecuada y concreta en relación con lo que se plantea y se usa el formato solicitado. Se sugiere revisar nuevamente todo el escrito para corregir algunos detalles de acentuación de algunos verbos en pasado, eliminar los espacios en blanco, entre otros. Verificar si la palabra solo lleva acento o no. Las referencias también tienen algunos detalles respecto al uso de APA, se sugiere atenderlos. Es importante revisar lo correspondiente al formato en relación con las figuras (el color y tamaño del texto). Se sugiere en la medida que sea posible, agregar evidencia de las estrategias generadas por los estudiantes y que se describen en el apartado del análisis.'),('893ID-POSM03765d6b4b2974a8','RESUMEN','2024-02-26 07:53:17.000000','A',''),('899IP-POSM04865d69802b3ff4','EXTENSO','2024-02-21 18:40:34.000000','',NULL),('914EN-POSM05565d2f15af3c44','EXTENSO REVISION FINAL','2024-02-25 11:06:21.000000','A',''),('918AP-POSM06865dcdf1f1450f','EXTENSO','2024-02-26 12:57:35.000000','',NULL),('954AP-POSM10665dce7e9d674e','RESUMEN','2024-02-26 13:35:05.000000',NULL,NULL);
